(1, '        Affordable           fitness classes           just near you', '      If several languages coalesce, the grammar of the resulting language is more simple and regular than that of the individual languages. The new common language will be more simple and regular than the existing European languages. It will be as simple as Occidental; in fact, it will be Occidental. To an English person, it will seem like simplified English, as a skeptical Cambridge friend of mine told me what Occidental is.\n\nThe European languages are members of the same family. Their separate existence is a myth. For science, music, sport, etc, Europe uses the same vocabulary. The languages only differ in their grammar, their pronunciation and their most common words. To achieve this, it would be necessary to have uniform grammar, pronunciation and more common words. If several languages coalesce, the grammar of the resulting.', 'fdgh', 'fdgdfg', 'Keep Your Strenght', 'bhnv', 'https://www.ikaweightlifter.com/media/Slide1.png', 'bvn', 'Innovative Training Model', 'vbn', 'https://www.ikaweightlifter.com/media/Slide2.png', 'vbn', 'Your Team', 'vbnvb', 'https://www.ikaweightlifter.com/media/Slide3.png', 'vbn', 'Our Innovative Training Program ', 'Clean Showers', 'This element is an Icon/Image box and can be changed with simple mouse clicks.', 'icomoon-icon-pencil-4', '', '', 'icomoon-icon-quill', '', '', 'icomoon-icon-clock-3', '', '', 'icomoon-icon-pen', '', '', 'icomoon-icon-pencil-4', '', '', 'icomoon-icon-quill');
