(1, '', 'როგორ პასუხობს ე.წ. აფხაზეთის საგარეო უწყება \"ოთხოზორია-ტატუნაშვილის სიას\"', 'ოკუპირებული აფხაზეთის დე ფაქტო საგარეო უწყება „ოთხოზორია-ტატუნაშვილის სიაში“ 33 პირის შეყვანის ფაქტს გამოეხმაურა. „არსებული გარემოებების გათვალისწინებით, აფხაზეთის რესპუბლიკის საგარეო საქმეთა სამინისტრო სერიოზულ შეშფოთებას გამოთქვამს საქართველოს მთავრობის, კერძოდ, პრემიერ-მინისტრ მამუკა ბახტაძეს უკიდურესად დესტრუქტიული ქმედებებით, რომელსაც პროვოკაციული ხასიათი აქვს და შეუძლია სრულად გამოუთხაროს ძირი ჟენევის საერთაშორისო დისკუსიებს“, - ნათქვამია განცხადებაში. \nდე ფაქტო საგარეო უწყებაში ასევე აღნიშნავენ, რომ „საქართველოს პრემიერ-მინისტრის განცხადება კიდევ ერთხელ ცხადყოფს, რომ საქართველოს ხელმძღვანელობის პოლიტიკა აფხაზეთთან და მის მოქალაქეებთან მიმართებაში აგრესიული ხასიათისაა“.\n„ქართულმა მხარემ ყოველგვარი ობიექტური საფუძველის გარეშე ბრალი წაუყენა აფხაზეთისა და სამხრეთ ოსეთის მოქალაქეებს ადამიანის უფლებების დარღვევაში და ისინი ‘შავ სიაში“ შეიყვანა, რაც საერთაშორისო დონეზე პერსონალური სანქციების დაწესებას ითვალისწინებს“, - ნათქვამია განცხადებაში. \nდე ფაქტო საგარეო უწყებაში ხაზგასმით აღნიშნეს, რომ პასუხისმგებლობა ჟენევის დისკუსიების შესაძლო ჩაშლაზე პირადად პრემიერ-მინისტრ მამუკა ბახტაძეს დაეკისრება. \n„ოთხოზორია-ტატუნაშვილის სია“ პარლამენტში უკვე შევიდა. სია, რომელიც საქართველოს მთავრობამ გუშინდელ სხდომაზე დაამტკიცა, საკანონმდებლო ორგანოს უკვე გადაეგზავნა. \nოთხოზორია-ტატუნაშვილის 33-პირიან სიაში შემდეგი ადამიანები არიან შეყვანილი: 1. დავით ჯემალის ძე გურწიევი; 2. ალიკ ფიროდის ძე ტაბოევი; 3. რაშიდ კანჯიოღლი; 4. სლავის სვიატოსლავის ძე ბადია; 5. რაულ მახტის ძე კორტავა; 6. ზაურ ანდროს ძე ჭითანავა; 7. ციბრონა (ეკა) ახალაია; 8. ოთარ ტურნანბა; 9. ალიკა წაბრია; 10. რუსლან დომენტის ძე ჯოპუა; 11. როზა ჯოჯოს ასული მირცხულავა; 12. დიმიტრ არშბა; 13. ვლადიმერ გუნია; 14. ალხაზ მირცხულავა; 15. გია ტუჟბა; 16. გენრიხ გენრიხის ძე ჭანბა; 17. ვლადიმერ გრიგოლის ძე ანუა; 18. ზაურ ცეცხლაძე იგივე მიხეილ თარბა; 19. გენადი ბაგრატის ძე აშხაცავა; 20. გელა ალეკოს ძე ვანაჩა; 21. ოთარ ფალავანძია; 22. ოლეგ პაპასკირი; 23. აფრიკან ბგანბა; 24. ვახტანგ უბირია; 25. ვლადიმერ ემინის ძე ნაჩაჩ-ოღლი; 26. შურიკ (ალექსანდრე) კოკოსკერია; 27. ლევ სარდინოის ძე ბიჩენოვი; 28. გია თუაევი; 29. ფისო ივანეს ძე ვაზაგოვი; 30. თამაზ ოთარის ძე ბესტაევი; 31. რამჩიკ ედიკას ძე ფუხაევი; 32. არკადი ოთარის ძე ძერანოვი; 33. ზურაბ თენგიზის ძე დუდაევი. აღნიშნული პირები ოკუპირებულ ტერიტორიებზე საქართველოს მოქალაქეთა მკვლელობაში, გატაცებაში, წამებასა და არაჰუმანურ მოპყრობაში, ჯანმრთელობის მძიმე დაზიანებაში, აგრეთვე ამ დანაშაულთა დაფარვაში არიან ბრალდებულები და მსჯავრდებულები.', 'conflicts', '2018-09-12 12:47:50.531466', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/politika/afxazeti_2018-06-27_TretMK5N8I.jpg', '2018-06-27 11:08:00', '[\'აფხაზეთი\', \'ოთხოზორია-ტატუნაშვილის სია\']', 0, '', 0, '', 1192, '', ''),
(3, '', 'უეს მითჩელი - აშშ საქართველოსა და უკრაინაში შეიარაღების მიწოდებას ზრდის', 'აშშ საქართველოსა და უკრაინაში შეიარაღების მიწოდებას ზრდის, რაც განპირობებულია იმით, რომ მათ რუსეთის წინააღმდეგობის გაწევა შეძლონ, - ამის შესახებ ევროპისა და ევრაზიის საკითხებში ამერიკის სახელმწიფო მდივნის თანაშემწემ უეს მითჩელმა ამერიკის სენატის საგარეო ურთიერთობათა კომიტეტში გამართულ მოსმენაზე განაცხადა.\n„ჩვენ ვუწევთ სამხედრო დახმარებას საქართველოსა და უკრაინას, რომლებსაც რუსეთი ცოტა ხნის წინ სამხედრო ძალების გამოყენებით ემუქრებოდა. ვუზრდით სამხედრო საშუალებებს, რომლებიც აუცილებელია თავდაცვისთვის. მოვხსენით წინა ადმინისტრაციის მიერ დაწესებული აკრძალვები მათთვის სამხედრო დახმარებასთან დაკავშირებით და ორივე სახელმწიფოს ვეხმარებით თავდაცვითი შესაძლებლობების გაუმჯობესებაში“, - განაცხადა მითჩელმა.\nმისივე თქმით, ამავდროულად, აშშ ცდილობს მიაღწიოს, რომ უკრაინამ განაგრძოს რეფორმები. „ჩვენ, ასევე, ვმუშაობთ საქართველოსთან პოლიტიკური, სამხედრო და ეკონომიკური ურთიერთქმედებების გაფართოებაზე“, - განაცხადა სახელმწიფო მდივნის თანაშემწემ.', 'samkhedro', '2018-09-12 13:05:29.222546', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/politika/mitcheli_2018-06-27_oDKcTOlGBH3hS.jpg', '2018-06-27 11:32:00', '[\'შეიარაღება\']', 20, '', 0, '', 980, '', ''),
(4, '', 'ავარია აგარაში - გარდაცვლილია თავდაცვის სამინისტროს ორი თანამშრომელი, მესამე კი დაშავებულია', 'თბილისი-სენაკი-ლესელიძის საავტომობილო მაგისტრალის აგარის მონაკვეთზე მომხდარი ავტოსაგზაო შემთხვევის შედეგად ორი ადამიანი დაიღუპა, ერთმა კი სხეულის სხვადასხვა დაზიანება მიიღო.\nგარდაცვლილები თავდაცვის სამინისტროს გენერალური შტაბის თანამშრომლები არიან.\nამავე უწყების თანამშრომელია მესამე პირიც, რომელიც სასწრაფო-დახმარების ბრიგადის მიერ გორში, სამედიცინო ცენტრ „გორმედშია“ გადაყვანილი. ის რეანიმაციულ განყოფილებაშია მოთავსებული.\nიხილეთ ვიდეო: ავარია აგარაში: ორი სამხედრო მოსამსახურე დაიღუპა, მესამე კი დაშავებულია', 'semtxveva', '2018-09-12 13:05:34.874884', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sxvadasxva/klinika_2018-06-27_WtTr21sMfrHRImX.jpg', '2018-06-27 11:32:00', '', 5, '', 0, '', 973, '', ''),
(5, '', '\"თეგეტა მოტორსი\" მომხმარებლებს ჰიბრიდული ავტომობილების სრულ სერვისს სთავაზობს', '\"თეგეტა მოტორსი\" მომხმარებლებს ჰიბრიდული ავტომობილების სრულ სერვისს სთავაზობს. როგორც “ინტერპრესნიუსს“ კომპანიიდან აცნობეს, კომპანიამ გადაწყვიტა ჰიბრიდული ავტომობილების სერვისისთვის ცალკე უბანი გამოეყო, ასევე გაზარდა სათადარიგო ნაწილების და სხვა საჭირო აქსესუარების ასორტიმენტი.\n\"თეგეტა\" ჰიბრიდული ავტომობილების სერვისის ახალ მიმართულებას წარმოადგენს. ბაზარზე გაზრდილი მოთხოვნიდან გამომდინარე კომპანიამ გადაწყვიტა ჰიბრიდული ავტომობილების სერვისისთვის ცალკე უბანი გამოეყო, ასევე გაზარდა სათადარიგო ნაწილების და სხვა საჭირო აქსესუარების ასორტიმენტი. მიმდინარე თვეს შეგიძლიათ ისარგებლოთ სპეციალური აქციით, რომლის ფარგლებში ჰიბრიდული ავტომობილებისთვის განკუთვნილი პროდუქციის ან მომსახურების შეძენისას მომხმარებელი ისარგებლებს ჰიბრიდული სისტემის ელექტრო დიაგნოსტირების უფასო სერვისით, აქცია მოქმედებს 30 ივნისის ჩათვლით.\n\"თეგეტას\" ჰიბრიდული ავტომობილების მომსახურების უბანზე ნებისმიერი მარკის ჰიბრიდული ავტომობილის სრული სერვისია შესაძლებელი. კერძოდ, აღნიშნულ განყოფილებაში თქვენ შეგიძლიათ ისარგებლოთ შემდეგი სპეციალიზირებული სერვისებით: ცენტრალური სისტემის ელექტრო დიაგნოსტირება, აკუმულატორის მოხსნა/დაყენება, აკუმულატორის გაგრილების ვენტილატორის გაწმენდა, აკუმულატორის კლემების გაწმენდა და ინვენტორის მოხსნა/დაყენება. \"თეგეტას\" ჰიბრიდული ავტომობილების მომსახურების უბანზე დაგხვდებათ უახლესი სპეციალიზირებული მანქანა/დანადგარები და მაღალკვალიფიციური კადრები“, - ნათქვამია კომპანიის ინფორმაციაში.\n“თეგეტა“ მომხმარებელს წინასწარი ჩაწერის სერვისს სთავაზობს, რომლის საშუალებითაც შესაძლებელია მოქალაქემ დაჯავშნოს ვიზიტი სწრაფი სერვისის ან სერვისების მისაღებად.\n„რეზერვაციის პროცედურა მარტივია, რამდენიმე წუთში თქვენ შეძლებთ ჩაეწეროთ თქვენთვის მისაღებ დროს და სწრაფად მიიღოთ სასურველი მომსახურება. აღნიშნული სერვისით სარგებლობა შესაძლებელია როგორც ონლაინ www.reservation.tegetamotors.ge, ასევე “თეგეტას“ ცხელი ხაზის მეშვეობით (032) 226 44 44“, - ნათქვამია კომპანიის ინფორმაციაში.\nცნობისთვის, “თეგეტა მოტორსი“ 1995 წლიდან მოღვაწეობს ქართულ ბაზარზე, ჰოლდინგი აერთიანებს 7 შვილობილ კომპანიას და 23 წელია მუდმივად ინარჩუნებს ავტოინდუსტრიაში ლიდერის პოზიციას. კომპანია ემსახურება 250 000-მდე რეგისტრირებულ საცალო და 20 000-მდე კორპორატიულ მომხმარებელს. „თეგეტას“ ფილიალებში შეგიძლიათ შეიძინოთ მსოფლიოში წამყვანი 300-მდე ბრენდის უმაღლესი ხარისხის პროდუქცია, როგორებიც გახლავთ: Bridgestone, Michelin, Varta, Shell, Motul, Hengst, ZF Parts, Lemforder, Sachs, Philips, Bosch, Febi, Federal Mogul და სხვა. სასურველი პროდუქცია შეგიძლიათ შეარჩიოთ თეგეტას ონლაინ კატალოგში: shop.tegetamotors.ge.\n ', 'sazogadoeba', '2018-09-12 13:05:42.035784', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/reklama/tegeta_2018-06-27_sD7VPTWISUY.jpg', '2018-06-27 11:34:00', '[\'თეგეტა მოტორსი\']', 0, '', 0, '', 973, '', ''),
(6, '', 'მაიკ პენსი - თუ აშშ-ში ლეგალურად ჩამოსვლა არ შეგიძლიათ, მაშინ საერთოდ არ ჩამოხვიდეთ', 'თუ აშშ-ში ლეგალურად ჩამოსვლა არ შეგიძლიათ, მაშინ საერთოდ არ ჩამოხვიდეთ, - ამის შესახებ აშშ-ს ვიცე-პრეზიდენტმა მაიკ პენსმა ბრაზილიის პრეზიდენტთან მიშელ ტემერთან გამართულ ერთობლივ პრესკონფერენციაზე განაცხადა. \n„მინდა მკაფიოდ განვაცხადო. კაცობრიობის ისტორიაში აშშ მიგრანტებისთვის ყველაზე კეთილმოსურნე სახლი იყო. ჩვენ ვამაყობთ ამ მემკვიდრეობით. მაგრამ ჩვენ ასევე ვამაყობთ იმით, რომ კანონმორჩილი ერი ვართ, რომლის საერთაშორისო საზღვრებს პატივს სცემენ“, - განაცხადა აშშ-ს ვიცე-პრეზიდენტმა. \nმაიკ პენსმა მიგრანტებს ასევე მოუწოდა, რისკის ქვეშ არ დააყენონ თავიანთი და თავიანთი შვილების სიცოცხლე აშშ-ში არალეგალურად ჩასვლის მცდელობით.\n„რისკის ქვეშ ნუ დააყენებთ თქვენს და თქვენი ბავშვების სიცოცხლეს, როდესაც აშშ-ში შემოსვლას ცდილობთ იმ გზით, რომელზეც ბატონობენ ნარკოკონტრაბანდისტები და ადამიანებით მოვაჭრეები. თუ აშშ-ში ლეგალურად არ შეგიძლიათ ჩამოხვიდეთ, მაშინ საერთოდ არ ჩამოხვიდეთ“, - აღნიშნა მაიკ პენსმა. ', 'msoplio', '2018-09-12 13:05:47.949058', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/politika/pensimaik9_2018-05-22_85FBnmfVLCr.jpg', '2018-06-27 11:36:00', '[\'მიგრანტი\']', 8, '', 0, '', 973, '', ''),
(7, '', '\"კონდიცირების და გამათბობლების მილების დემონტაჟი უნდა მოხდეს\" - ვის მიმართავს მერი?', 'თბილისის მერი კახა კალაძე რეაბილიტირებულ ძველ თბილისში მცხოვრებ მოსახლეობას გონივრულ ვადას აძლევს, რომ თვითნებურად მოწყობილი საყოფაცხოვრებო ინფასტრუქტურის დემონტაჟი მოახდინონ.\nროგორც კალაძემ აღნიშნა, რეაბილიტირებულ აღმაშენებლის გამზირზე მოსახლეობას კონდიცირების სისტემები აქვს მოწყობილი, გაყვანილი აქვთ გათბობის მილები, რაც დაუშვებელია.\nკალაძემ ზედამხედველობის სამსახურს საკითხის გასაკონტროლებლად მონიტორინგის განხორციელება დაავალა.\n“თქვენ იცით, რომ 2016 წელს თბილისის მუნიციპალიტეტის დაფინანსებით განხორციელდა ახალი აღმაშენებლის გამზირის სრული რეაბილიტაცია, სადაც დაახლოებით 30 მილიონი ლარი დაიხარჯა. მერიის ინიციატივით ხორციელდება ასევე გუდიაშვილისა და ორბელიანის მოედნების სრული რეაბილიტაცია-აღდგენა, პროექტების ღირებულება 110 მილიონი ლარია. ამ სარეაბილიტაციო სამუშაოების მიზანი არის, რომ ქალაქს ისტორიული იერსახე აღუდგეს და შეუნარჩუნდეს. ძალიან სამწუხარო და შემაშფოთებელია ის ფაქტი, რომ ჩვენი ქალაქის რეაბილიტირებულ ადგილებში ბოლო პერიოდში ძალიან გახშირდა იერსახის და ფასადების დაზიანება კონდენციონერებით, გამათბობლებით და სხვა საყოფაცხოვრებო საჭიროებით.\nვიმეორებ, 30 მილიონი ლარი დაიხარჯა აღმაშენებლის გამზირის სარეაბილიტაციო სამუშაოებისთვის. ჩვენ თვითონ ვაზიანებთ იმას, რასაც ვაკეთებთ. ასეთი ფაქტები არის უამრავი და ძალიან სამწუხაროა. სკვერებში არის ვანდალიზმის ფაქტები, რაც ძალიან მძიმეა. ეს ყველაფერი იმისთვის კთდება, რომ მოვუაროთ, აღვადგინოთ და შევინარჩუნოთ და შემდეგ ისევ ჩვენ თვითონ ვაზიანებთ, რაც ნამდვილად სამწუხაროა“, - განაცხადა კახა კალაძემ და მთავრობის სხდომაზე ვანდალიზმის ფაქტების ამსახველი ფოტომასალა წარადგინა.\n\n\n\nკალაძის თქმით, მომდევნო წლებში ქალაქის რეაბილიტაციისთვის კიდევ 500 მლნ ლარი დაიხარჯება.\n“მესმის, რომ საყოფაცხოვრებო პირობებისთვის საჭიროა სხვადასხვა ინფრასტრუქტურის მოწყობა, მაგრამ არ უნდა მოხდეს ფასადების დაზიანების ხარჯზე. კატეგორიულად მიუღებელია ეს მიდგომები და დამოკიდებულება. მეპატრონეები თვითონ უნდა იყვნენ პირველი, ვინც დაიცავს იმ შენობა-ნაგებობებს და არავის არ უნდა მისცეს მისი დაზიანების შესაძლებლობა. ჩვენ ვაპირებთ ძველი თბილისის რეაბილიტაციის გაგრძელებას. 110 მლნ ლარი იხარჯება ორ კონკრეტულ პროექტზე, თუმცა მომდევნო წლების განმავლობაში 500 მლნ ლარის დახარჯვას ვაპირებთ, რომ ის სიმდრიდრე, რაც ამ ქალაქს გააჩნია, შევინარჩუნოთ და უფრო მეწესრიგებულ-გალამაზებული გადავცეთ ჩვენს შვილებს და მომავალ თაობებს. მაგრამ რეაბილიტაციის შემდეგ ამ ყველაფერს სჭირდება მოვლა-პატრონობა და ამ ყველაფერში მოსახლეობის ჩართულობა არის ძალიან მნიშვნელოვანი“, - აღნიშნა თბილისის მერმა.\n\nკახა კალაძე იმედოვნებს, რომ გაფრთხილება საკმარისი იქნება და უფრო მკაცრი ზომების მიღება არ გახდება საჭირო.\n“მინდა დავავალო თბილისის მერიის ზედამხედველობის სამსახურს, რომ დააფიქსიროს თითოეული მსგავსი ფაქტი, რაზეც ახლა ვსაუბრობდი. მესაკუთრეებს მივცეთ გონივრული ვადა, რომ თვითნებურად მოწყობილი ინფრასტრუქტურის დემონტაჟი განახორციელონ. იმ დაზიანებებს, რაც ფასადებზე არის, ჩვენი ხარჯებით აღვადგენთ, უბრალოდ, კონდიცირების და გამათბობლების მილების დემონტაჟი უნდა მოხდეს. მე იმედი მაქვს, რომ ჩვენ მიერ დადგენილ ვადაში მოხდება დემონტაჟი და არ მოგვიწევს სხვა უფრო მკაცრი ზომების მიღება“, - აღნიშნა კახა კალაძემ.\nიხილეთ ვიდეო: \"მივცეთ გონივრული ვადა, კონდიცირებისა და გამათბობლების მილების დემონტაჟი განახორციელონ\" - კალაძე ძველი თბილისის მოსახლეობას მიმართავს', 'sazogadoeba', '2018-09-12 13:05:54.913465', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sazogadoeba/kaladze4954_2018-06-27_lJzgHf5BxQ.jpg', '2018-06-27 11:59:00', '[\'რეაბილიტაცია\', \'კახა კალაძე\', \'ძველი თბილისი\']', 25, '', 0, '', 973, '', ''),
(8, '', 'მანქანა, რომლითაც თავდაცვის სამინისტროს თანამშრომლები მოძრაობდნენ, თურქული ნომრით მოძრავ ტრაილერს შეეჯახა - რას ჰყვებიან ახლობლები', 'აგარასთან მომხდარი ავტოსაგზაო შემთხვევის შედეგად დაშავებული, თავდაცვის სამინისტროს გენერალური შტაბის თანამშრომლის ჯანმრთელობის მდგომარეობა სტაბილურად მძიმეა.\nროგორც „ინტერპრესნიუსს“ გორში მდებარე სამედიცინო ცენტრ “გორმედის” კლინიკურმა დირექტორმა, დავით ყაზაიშვილმა განუცხადა, პაციენტს მრავლობითი დაზიანებები აღენიშნება. უფრო კონკრეტულად, თავის ტვინის დაჟეჟილობა, სახის ძვლების დაზიანება ცხვირის არეში, ასევე იდაყვის ძვლის ტრავმა, თუმცა, ყაზაიშვილის განცხადებით, მისი სასიცოცხლო პარამეტრები შენარჩუნებულია და მდგომარეობა სტაბილურად მძიმეა.\nაღნიშნული პირი 36 წლისაა და თავდაცვის სამინისტროს ერთ-ერთი დანაყოფის თანამშრომელია.\nთბილისი-სენაკი-ლესელიძის საავტომობილო მაგისტრალის აგარის მონაკვეთზე ავტოსაგზაო შემთხვევა დღეს მოხდა. დაიღუპა თავდაცვის სამინისტროს ორი თანამშრომელი, ერთი კი დაშავდა.\nგარდაცვლილების ახლობლების ინფორმაციით, ავტომანქანა, რომლითაც თავდაცვის სამინისტროს წარმომადგენლები მოძრაობდნენ, ტრაილერს შეეჯახა, რომელსაც თურქეთის მოქალაქე მართავდა.\nახლობლების ინფორმაციით, ისინი დასავლეთ საქართველოდან, დაკრძალვიდან ბრუნდებოდნენ.\nიხილეთ ვიდეო: ახლობლების ინფორმაციით, ავტომანქანა, რომლითაც თავდაცვის სამინისტროს თანამშრომლები მოძრაობდნენ, თურქული ნომრით მოძრავ ტრაილერს შეეჯახა', 'semtxveva', '2018-09-12 13:05:55.777137', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sxvadasxva/gormedi_2018-06-27_XN0YaFFdoEOPNTv.jpg', '2018-06-27 12:19:00', '[\'ავარია აგარაში\']', 10, '', 0, '', 973, '', ''),
(9, '', 'ექიმის კომენტარი ირაკლი ნოზაძის ჯანმრთელობის მდგომარეობის შესახებ', 'პაციენტის მდგომარეობა აბსოლუტურად სტაბილურია, მოხსნილია მართვითი სუნთქვის აპარატიდან, - ამის შესახებ \"ღუდუშაურის კლინიკის\" გენერალური დირექტორის მოადგილემ, მარინა გელანტიამ მომღერალ ირაკლი ნოზაძის ჯანმრთელობის მდგომარეობის შესახებ საუბრისას განაცხადა.\n\"მე მესმის საზოგადოების ინტერესი პაციენტის ჯანმრთელობის მდგომარეობას თან დაკავშირებით. შემიძლია დაბეჯითებით გითხრათ, რომ ამ დროისთვის პაციენტის მდგომარეობა აბსოლუტურად სტაბილურია, მოხსნილია მართვითი სუნთქვის აპარატიდან, ადეკვატური და კონტაქტურია. მიმდინარეობს ინტენსიური მონიტორინგი რეანიმაციულ განყოფილებაში\", - განაცხადა მარინა გელანტიამ.\nექიმის თქმით, ჯერჯერობით პაციენტის დაკითხვის საჭიროებას ვერ ხედავს, თუმცა აცხადებს, რომ ეს საკითხი მისი გადასაწყვეტი არაა.\n\"ეს ჩემი გადასაწყვეტი არ არის. ზოგადად, ამ წუთისთვის მისი მდგომარეობა საყურადღებოა. ჯერ რეანიმაციულ განყოფილებაშია და არამგონია, მისი დაკითხვა საჭიროებას წარმოადგენდეს. ოჯახის წევრების შეშვების ვალდებულება გვაქვს, სხვა არავინ შესულა\", - განაცხადა გელანტიამ.\n„ქუჩის ბიჭების“ სოლისტი ირაკლი ნოზაძე წერეთლის გამზირზე ორი დღის წინ დაჭრეს. მას ღუდუშაურის კლინიკაში ოპერაცია ჩაუტარდა.\nშინაგან საქმეთა სამინისტრომ მომღერლის დაჭრის ფაქტზე გუშინ ორი გოგო დაკაავა. ბრალდებულები მოსკოვის გამზირზე მდებარე ერთ-ერთ საერთო საერთო საცხოვრებელში დააკავეს. მომხდარზე გამოძიება სსკ-ს 19-108-ე მუხლით და 376-ე მუხლით მიმდინარეობს.', 'sazogadoeba', '2018-09-12 13:05:56.535877', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sazogadoeba/gelantia_2018-06-27_OLSqtJkfRj2.jpg', '2018-06-27 12:23:00', '[\'ირაკლი ნოზაძის დაჭრა\']', 1, '', 0, '', 973, '', ''),
(10, '', 'ვინ არის გიორგი ქობულია, რომელმაც შესაძლოა ეკონომიკის მინისტრის პოსტი დაიკავოს', 'ეკონომიკის მინისტრის პოსტზე გიორგი ქობულიას კანდიდატურა განიხილება. ამის შესახებ ინფორმაციას BMG ავრცელებს. „ქობულია თბილისის სამედიცინო უნივერსიტეტის და ამერიკული ემორის კურსდამთავრებულია. 2001 წლიდან დღემდე მსოფლიოში უმსხვილესი საკონსულტაციო კომპანია „მაქკინზის“ (McKinsey) გუნდის წევრია და დღეს უფროსი პარტნიორის რანგშია McKinsey-ის მოსკოვის ოფისში, სადაც საერთაშორისო მასშტაბით სხვადასხვა კომპანიას უწევს კონსულტირებას: ნავთობპროდუქტების, ბუნებრივი აირის, მეტალურგიული სექტორის და ასევე წიაღისეულის მომპოვებელ-გადამმუშავებელ კომპანიებს, რაც მოიცავს მათ ორგანიზაციულ ტრანსფორმაციას, სტრატეგიის შემუშავებას, შესყიდვების მწყობრი სისტემის დანერგვას და მრავალ სხვა მიმართულებას. \nვიდრე McKinsey-ის შეუერთდებოდა, ქობულია საქართველოს კარდიოლოგიის ინსტიტუტის კარდიოლოგი იყო. იგი ასევე უმსხვილესი ამერიკული ფარმაცევტული კომპანია Merck, Sharp & Dohme-ის მეცნიერ-თანამშრომელიც იყო“, - წერს Busness Media Georgia. \nროგორც ცნობილია, ახალდანიშნული პრემიერ-მინისტრი პარლამენტისთვის მთავრობის ახალი შემადგენლობის წარდგენას უახლოეს კვირებში გეგმავს. ', 'politika', '2018-09-12 13:05:57.497532', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/politika/qobulia_2018-06-27_cateuPnmGssuwv.jpg', '2018-06-27 12:40:00', '[\'გიორგი ქობულია\']', 36, '', 0, '', 973, '', ''),
(11, '', 'აგარასთან მომხდარ ავარიაში დაღუპულები, 4 დღის წინ ავარიაში გარდაცვლილი და-ძმის პანაშვიდიდან ბრუნდებოდნენ', 'თბილისი-სენაკი-ლესელიძის საავტომობილო მაგისტრალის აგარის მონაკვეთზე ავტოსაგზაო შემთხვევას ორი ადამიანი ემსხვერპლა. დაღუპულები თავდაცვის სამინისტროს თანამშრომლები არიან, კიდევ ერთი მგზავრი კი მძიმედ დაშავდა.\nAMBEBI.GE-ს ინფორმაციით, ავარიის შედეგად დაიღუპნენ გაბრიელ გვარჯალაძე და გიგო გარაყანიძე. ორივე მათგანი 45 წლამდე ასაკისაა.\nთავდაცვის სამინისტროს თანამშრომლები თბილისში მუშაობდნენ და შემთხვევის დროს ოზურგეთის მუნიციპალიტეტის სოფელ გომიდან ბრუნდებოდნენ, სადაც ავარიის წინა დღეს, მეზობლების პანაშვიდზე ჩავიდნენ. გვარჯალაძე და გარაყანიძე სოფელში და-ძმა მახარაძეების პანაშვიდზე იყვნენ ჩასულები, რომლებიც ოთხი დღის წინ - 23 ივნისს ზესტაფონში მომხდარ ავარიას ემსხვერპლნენ. ლალი და თემურ მახარაძეები მსუბუქი მარკის ავტომობილში ისხდნენ კიდევ ორ ადამიანთან ერთად, მანქანა გზიდან გადავიდა და ამობრუნდა.\nროგორც AMBEBI.GE-სთან საუბარში გომის ერთ-ერთი მკვიდრი ამბობს, \"სოფელში წარმოუდგენელი ტრაგედია ტრიალებს - ერთ კვირაში ოთხი თანასოფლელი ავარიით დაიღუპა\".\nრაც შეეხება აგარასთან მომხდარ ავარიას, გარდაცვლილების ახლობლების ინფორმაციით, ავტომანქანა, რომლითაც თავდაცვის სამინისტროს წარმომადგენლები მოძრაობდნენ, ტრაილერს შეეჯახა, რომელსაც თურქეთის მოქალაქე მართავდა.', 'semtxveva', '2018-09-12 13:05:58.293273', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sazogadoeba/dagupulebiagaraavaria_2018-06-27_SNQWMV5zGSHDd.jpg', '2018-06-27 12:40:00', '[\'ავარია აგარასთან\']', 20, '', 0, '', 973, '', ''),
(12, '', 'გარემოს ეროვნული სააგენტო მოსახლეობას მოსალოდნელი მაღალი ტემპერატურის შესახებ აფრთხილებს', 'გარემოს დაცვისა და სოფლის მეურნეობის სამინისტროს გარემოს ეროვნული სააგენტო მოსახლეობას მოსალოდნელი მაღალი ტემპერატურის შესახებ აფრთხილებს. გარემოს ეროვნული სააგენტოს ინფორმაციით, 28 ივნისიდან საქართველოში მოსალოდნელია ჰაერის ტემპერატურის მნიშვნელოვანი მატება. კერძოდ, 28 ივნისს დასავლეთ საქართველოში ჰაერის მაქსიმალურმა ტემპერატურამ შესაძლოა +39, +41 გრადუსს მიაღწიოს.\nაღმოსავლეთ საქართველოში 28 ივნისიდან 3 ივლისამდე ჰაერის მაქსიმალური ტემპერატურა - +36, +41 გრადუსია მოსალოდნელი. თბილისში ჰაერის ტემპერატურა +37, +39 გრადუსი დაფიქსირდება.', 'sazogadoeba', '2018-09-12 13:05:59.143712', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sxvadasxva/sicxe_mze_amindi_2018-06-27_OVHGbcQyZruV.jpg', '2018-06-27 12:46:00', '[\'სიცხე\']', 1, '', 0, '', 973, '', ''),
(13, '', '\"ბილეთი საიტზე გადავამოწმე და იმის მერე არაფერი მახსოვს...\" - რას ყვება იღბლიანი თბილისელი ქალი, რომელმაც ლატარიაში 80 000 მოიგო', '\"თუ არ ითამაშებთ, ვერც მოიგებთ. ამიტომ, ითამაშეთ, რადგან მოგება შეუძლია ყველას!’’\nთინათინ აზალაძე საქართველოს ეროვნული ლატარიის ყველაზე იღბლიანი გამარჯვებულია. მან ტირაჟიანი \"ლოტო 6/36-ის\" ბილეთი საყვარელი ადამიანების დაბადების დღეების რიცხვებით შეავსო. ლოტოს გამარჯვებული თინათინ აზალაძე გვესაუბრება.\n \n- თინათინ, თქვენ ამ დროისთვის საქართველოს ეროვნული ლატარიის ყველაზე მსხვილი გამარჯვებული ბრძანდებით, ხშირად თამაშობდით ლატარიას?\n- ლატარიას ხშირად ვთამაშობ, განსაკუთრებით - სამშაბათობით. მინიმუმ ორ დაფას ვავსებ ხოლმე.\n \n- თქვენი აზრით, რამ განაპირობა თქვენი მოგება, იღბალმა თუ შემთხვევითობამ? \n- ცხადია, იღბალმა, ბედნიერმა შემთხვევითობამ. უფრო მეტად კი - ღვთის წყალობამ.\n \n- გჯეროდათ ასე შემთხვევით შეიძლებოდა ამხელა თანხის მოგება?\n- მოგების ყოველთვის მჯერა, როდესაც ლატარიის ჯიხურთან მივდივარ. ბევრად უფრო ამბიციურ მოგებაზეც მიფიქრია.\n\n- რა ემოცია დაგეუფლათ თქვენ და თქვენს ოჯახს, როდესაც ლოტოტრონმა თქვენს მიერ ბილეთში შემოხაზული ციფრები გამოავლინა?\n- გათამაშება პირდაპირ ეთერში არ გვინახავს, ბილეთი საიტზე დაახლოებით 11 საათზე გადავამოწმეთ და იმის მერე არ გვახსოვს არაფერი. ძალიან დიდი ხანი ვიყავით ეიფორიაში, მაგარი განცდაა!\n \n- რას მოახმარეთ მოგებული თანხა და რა შეიცვალა თქვენს ცხოვრებაში?\n- მცირე ხნის წინ მე და ჩემმა მეუღლემ ბინა შევიძინეთ, ამ ბინის კრედიტი „ჩავაქრეთ“ და რემონტის ფულიც დაგვრჩა.\n \n- კიდევ აგრძელებთ ლატარიის თამაშს? \n- ცხადია, რატომ არ უნდა გავაგრძელო?!\n \n- რას ურჩევდით ლატარიის მოთამაშეებს? \n- თუ არ ითამაშებთ, ვერც მოიგებთ. ამიტომ, ითამაშეთ, რადგან მოგება შეუძლია ყველას!\n ', 'mnishvnelovai-informacia', '2018-09-12 13:06:00.039907', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sazogadoeba/azaladzelataria_2018-06-27_rtJ0BC25L7nUI.jpg', '2018-06-27 13:05:00', '[\'ლატარიის კომპანია\', \'თინათინ აზალაძე\']', 9, '', 0, '', 973, '', ''),
(14, '', '\"ხორავას ქუჩაზე მოზარდების მკვლელობის საქმეზე რამდენიმე ახალი დაკავებული გვყავს და როგორც ჩანს, ეს დაკავებები გაგრძელდება\"', 'გამოყოფილი საქმის ფარგლებში, რამდენიმე ახალი დაკავებული გვყავს და როგორც ჩანს, ეს დაკავებები გაგრძელდება, - ამის შესახებ შინაგან საქმეთა მინისტრმა გიორგი გახარიამ ხორავას ქუჩაზე მომხდარ მკვლელობასთან დაკავშირებით შექმნილი საპარლამენტო კომისიის სხდომებზე გამოვლენილი გარემოებების შესახებ ჟურნალისტების კითხვის საპასუხოდ განაცხადა.\nგახარიას თქმით, შეფასებებს ის კომისიის საქმიანობის დასრულების შემდეგ გააკეთებს.\n„ხორავას ქუჩაზე მომხდარ ტრაგედიასთან მიმართებაში შექმნილია საპარლამენტო კომისია. საპარლამენტო კომისიამ მუშაობა ახლახან დაიწყო და გრძელდება. მე იმის შემდეგ გავაკეთებ კომენტარს ხორავას ქუჩის მკვლელობასთან დაკავშირებით, როდესაც კომისიის წევრები მუშაობას დაასრულებენ. ამ ეტაპზე, არანაირი შედეგი არ დაუდია კომისიას, რადგან მისი მუშაობის ვადა არის სამი თვე და სულ რაღაც სამი დღეა მუშაობს. ეს თემა დავხუროთ ახლა. გამოყოფილია ცალკე საქმე, რომელიც 27 დეკემბერს გამოიყო. ამ საქმის ფარგლებში, სიტუაციის, მოვლენების განვითარების არც ერთ შემთხვევას, არც ერთ ვარიანტს არ გამოვრიცხავთ. როგორც იცით, ახალ, გამოყოფილი საქმის ფარგლებში, რამდენიმე ახალი დაკავებული გვყავს და როგორც ჩანს, ეს დაკავებები გაგრძელდება“, - განაცხადა გიორგი გახარიამ.', 'samartali', '2018-09-12 13:06:00.921770', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/politika/gaxaria3.jpg', '2018-06-27 13:28:00', '[\'მკვლელობა ხორავას ქუჩაზე\']', 6, '', 0, '', 973, '', ''),
(15, '', 'იაპონელი პრინცესა სიყვარულის გამო სამეფო სტატუსს თმობს', 'ბოლო 2 წლის განმავლობაში უკვე მეორე იაპონელმა პრინცესამ თქვა უარი სამეფო სტატუსზე სიყვარულის გამო. CNN-ის ინფორმაციით, პრინცესა აიაკომ გადაწყვიტა, არასამეფო სისხლის მქონე ადამიანზე დაქორწინდეს.\nიაპონიის იმპერატორის სასახლემ გაავრცელა ინფორმაცია, რომ გარდაცვლილი პრინცის ტაკამოდოს ქალიშვილი 32 წლის კეი მორიაზე ქორწინდება, რომელიც საზღვაო გადაზიდვების კომპანიაში მუშაობს.\nპრინცესამ და კეიმ ერთმანეთი 1 წლის წინ გაიცნეს. მათი ნიშნობა 12 აგვისტოს შედგება, 29 ოქტომბერს კი დაქორწინდებიან.\nიაპონიის სამეფო წესების მიხედვით, პრინცესა ვალდებულია, მორიაზე დაქორწინების შემთხვევაში ოჯახი დატოვოს. თუმცა, ის მიიღებს თანხას, დაახლოებით 1 მლნ დოლარის ოდენობით.', 'msoplio', '2018-09-12 13:06:01.674841', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sxvadasxva/ayako_2018-06-27_ydH0IuNf8a0wsB.jpg', '2018-06-27 13:30:00', '[\'იაპონიის პრინცესა\']', 2, '', 0, '', 973, '', ''),
(16, '', 'ფინანსთა მინისტრობის ერთ-ერთ კანდიდატად ირაკლი მანაგაძე განიხილება', 'ფინანსთა მინისტრის პოსტზე ერთ-ერთ კანდიდატად მსოფლიო ბანკის კონსულტანტი და „ლიბერთი ბანკის“ სამეთვალყურეო საბჭოს წევრი ირაკლი მანაგაძე განიხილება. არაოფიციალური ინფორმაციით, მანაგაძესთან კონსულტაციები მიმდინარეობს, თუმცა გადაწყვეტილება ჯერჯერობით მიღებული არ არის.\nრაც შეეხება მის სამუშაო გამოცდილებას, მანაგაძე, 1998–2005 წლებში სებ-ის პრეზიდენტი იყო. მანამდე, 1991 წელს საქართველოს საგარეო საქმეთა სამინისტროში ატაშეს თანამდებობაზე მუშაობდა; 1993 წელს საქმიანობა გააგრძელა საქართველოს საგარეო ეკონომიკური ურთიერთობების სახელმწიფო კომიტეტში მთავარ სპეციალისტად; 1993-1994 წლებში საქართველოს რესპუბლიკის მინისტრთა კაბინეტის ეკონომიკის განყოფილების წამყვანი სახელმწიფო მრჩევლისა და სამდივნოს უფროსის თანამდებობას იკავებდა; 1994 წელს მუშაობდა საქართველოს მინისტრთა კაბინეტის საერთაშორისო საფინანსო და ეკონომიკურ ორგანიზაციებთან თანამშრომლობის სამთავრობო კომისიის სამდივნოში - ჯერ სახელმწიფო მრჩევლად, შემდეგ კი წამყვან სახელმწიფო მრჩევლად. განაგრძეთ კითხვა', 'politika', '2018-09-12 13:06:02.405157', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/politika/iraklimanagadze_2018-06-27_yH80VPG6q9.jpg', '2018-06-27 13:55:00', '[\'ირაკლი მანაგაძე\']', 6, '', 0, '', 973, '', ''),
(17, '', 'რევოლუციური მიდგომა სამედიცინო მომსახურებასა და განათლებაში - BTU-ს სტუდენტმა ინოვაციური პროდუქტი DigitalMed შექმნა', 'პროგრამა, რომელიც ქართულ ენაზე გესაუბრება და შესაძლებლობა აქვს გადაამუშაოს და გააანალიზოს მიღებული ინფორმაცია, შედეგად კი დასვას პირველადი დაიგნოზი, გაუწიოს პაციენტს შესაბამის ექიმთან ვიზიტის კონსულტაცია, უზრუნველყოს შემდგომი კვლევების ჩამონათვალით - ეს გეგა თათულიშვილის პროექტია. 19 წლის გეგამ, რომელიც ბიზნესისა და ტექნოლოგიების უნივერსიტეტის პირველი კურსის სტუდენტია, მედიცინაში ხელოვნური ინტელექტის დანერგვის რევოლუციური ფორმატი შეიმუშავა.\n”სპეციალური ალგორითმით შექმნილი პროდუქტი სრულიად განსხვავებული და ახალი მიდგომით ანაცვლებს დიაგნოსტიკის, ექიმთან კონსულტაციის პროცედურებს, სამედიცინო განათლების მიღების შესაძლებლობებსა და სხვა პროცესებს. უნიკალური პროდუქტი - ხელოვნური ინტელექტი მედიცინაში, თვითგანვითარებადია, მუშაობს მეგამონაცემთა ანალიზზე, დაფუძნებულია ხელოვნურ ნეირონული ქსელზე და იყენებს ნეიროლინგვისტურ პროგრამირებას. პროდუქტი შესაძლებელია გამოყენებულ იქნას საგანმანათლებლო დანიშნულებითაც, რადგან ის აერთიანებს სამედიცინო სფეროში დაგროვილ ცოდნასა და უახლეს კვლევებს/მიღწევებს, მუდმივად განახლებადია და უალტერნატივოა სხვა საგანმანათლებლო პორტალებთან შედარებით,” - განმარტავს გეგა თათულიშვილი.\nDigitalMed-ის განვითარების პროცესი მოიაზრებს სხვადასხვა ქვეყნის სამედიცინო ჩანაწერების გაერთიანებასა და ანალიტიკას, ქლაუდ სისტემაზე დაფუძნებული ხელოვნური ინტელექტის მეგამონაცემთა ბაზის შექმნას.\n”ყოველთვის მაინტერესებდა მედიცინა. სურვილი მქონდა და ვცდილობდი, გამომეგონებინა ისეთი რაღაც, რაც ძალიან დაეხმარებოდა მოსახლეობას და განავითარებდა მედიცინას. შედეგას კი სწორედ ეს პროდუქტი მივიღე. ის არის პირველი ქართული ხელოვნური ინტელექტი მედიცინაში. DigitalMed-ზე მუშაობა რამდენიმე თვის წინ დავიწყე. პროგრამა იყენებს სპეციალურად შექმნილ, უნიკალურ ალგორითმებს, რომლის ანალოგი მსოფლიოს მაშტაბით არ არსებობს. პროდუქტს განვითარების დიდი პერსპექტივა აქვს და მისი დამუშავება ბიზნესისა და ტექნოლოგიების უნივერსიტეტის ბაზაზე მოხდება,” - დაამატა გეგა თათულიშვილმა.\nDigitalMed გატესტილია მრავალჯერ და მზადაა გამოსაყენებლად. მისი შემქმნელი აპირებს, რომ ითანამშრომლოს კლინიკებთან და არამხოლოდ საქართველოს მასშტაბით. გეგას სურვილია, რომ ის ყველა ადამიანისთვის ხელმისაწვდომი იყოს. სამომავლოდ კი DigitalMed-ს ახალი ფუნქციებიც დაემატება.', 'sazogadoeba', '2018-09-12 13:06:13.315419', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/reklama/digital_2018-06-27_RlzCEFfLDtVU.jpg', '2018-06-27 14:17:00', '', 1, '', 0, '', 973, '', ''),
(18, '', 'არიან თუ არა გარდაცვლილები \"ოთხოზორია-ტატუნაშვილის სიაში\"? - უმცირესობისა და უმრავლესობის კომენტარები', 'ეს სია გაფართოვდება, დაიხვეწება და მასში ყველა ჯალათი აუცილებლად მოხვდება, - ამის შესახებ „ოთხოზორია-ტატუნაშვილის სიასთან“ დაკავშირებით პრემიერ-მინისტრმა მამუკა ბახტაძემ განაცხადა. მისი თქმით, სიაში შეყვანილ ყველა ადამიანს ბრალი ედება უმძიმეს დანაშაულებებში.\n„სიაში არის 33 ადამიანი და ყველა მათგანს ბრალი ედება უმძიმეს დანაშაულებებში საქართველოს მოქალაქეების წინააღმდეგ. ეს არის სია, რომელიც აუცილებლად გაფართოვდება. სამართალდამცველი ორგანოები 24 საათი მუშაობენ ამ თემაზე. არა მარტო უშუალო შემსრულებლები, არამედ ამ სიაში მოხვდებიან ის ადამიანებიც, რომლებიც დამნაშავეებს ხელი დააფარეს. ეს არის პირველი ნაბიჯი, რომელიც ქართულმა სახელმწიფომ გადადგა ამ მიმართულებით. ეს სია გაფართოვდება, დაიხვეწება და მასში ყველა ჯალათი აუცილებლად მოხვდება“, - განაცხადა ბახტაძემ.\nროგორც ვიცე-სპიკერმა, „ევროპული საქართველოს“ წევრმა სერგი კაპანაძემ განაცხადა, მთავრობის მიერ შედგენილი “ოთხოზორია-ტატუნაშვილის“ სიაში შეყვანილი რამდენიმე ადამიანი გარდაცვლილია, რაც სიის მიმართ ხელისუფლების არასერიოზულ დამოკიდებულებაზე მეტყველებს.\nიქნებ მასწავლოთ, როგორ უნდა ავუაროთ გვერდი იმ ფაქტს, რომ მთავრობის მიერ შედგენილ “ოთხოზორია - ტატუნაშვილის სიაში“ დიდი ხნის წინ გარდაცვლილი პირები აღმოჩნდნენ - იქნებ გამაგებინოთ, როგორ შეიძლება გარდაცვლილ ადამიანებზე რაიმე სახის სანქციები განხორციელდეს, - აღნიშნული განცხადებით პარლამენტის პლენარულ სხდომაზე უმრავლესობის წარმომადგენლებს ოპოზიციონერმა დეპუტატმა ირმა ნადირაშვილმა მიმართა.\nნადირაშვილის შეფასებით, უწყება, რომელიც სიის შედგენაზე იყო პასუხისმგებელი, პასუხისმგებლობას გულგრილად მიუდგა, ის პარლამენტში უნდა მივიდეს და ახსნას, რატომ არ მოხვდნენ სიაში რუსეთის ფედერაციის მოქალაქეები და როგორ მოხვდნენ გარდაცვლილი პირები.\n“ოთხოზირია-ტატუნაშვილის სიის“ იდეა თავიდანვე პრევენციული იყო. ეს იყო შესაძლებლობა იმისა, შეგვექმნა ეფექტური მექანიზმი ოკუპაციის ხაზის გასწვრივ რუსეთის და საოკუპაციო რეჟიმის თავხედური ქმედებების შესაჩერებლად - ისეთი ქმედებების შესაჩერებლად, რომელსაც ჩვენი მოქალაქეების სიცოცხლე ემსხვერპლა. იმ ჩამონათვალით და იმ სახელებითა და გვარებით, რომლითაც სია მთავრობამ შემოგვთავაზა, პრევენციულობის არსი დაიკარგა. ხელისუფლების მიერ “ოთხოზორია-ტატუნაშვილის სიაში“ რუსეთის ფედერაციის არც ერთი მოქალაქე შეყვანილი არ არის - კერძოდ, „ფე-ეს-ბეს“ ადგილზე არსებული “გრუს“ და ზოგადად, საოკუპაციო რეჟიმის წარმომადგენლები. მე არ ვსაუბრობ ამ სიაში რუსი პოლიტიკოსების შეყვანაზე. ეს საქართველოს პარლამენტის მიერ მიღებული რეზოლუციის ჩარჩოებს სცილდება. ვსაუბრობ სიაში რუსეთის იმ მოქალაქეების შეყვანაზე, რომლებიც საქართველოს ოკუპირებულ ტერიტორიებზე ეფექტურ კონტროლს ახორციელებენ და ხშირ შემთხვევაში, ან თვითონ არიან დანაშაულის ჩამდენი ან ხელს აფარებენ დანაშაულის ჩამდენ პირებს. სწორედ ამ ადამიანების შეყვანა იქნებოდა ეფექტური “ოთხოზორია-ტატუნაშვილის“ სიაში“, - განაცხადა ნადირაშვილმა პარლამენტის პლენარულ სხდომაზე.\nთუ დადასტურდება, რომ „ოთხოზორია-ტატუნაშვილის სიაში“ მყოფი რამდენიმე ადამიანი ცოცხალი არ არის, ეს იქნება ძალიან დიდი მინუსი და არაკომპეტენტურობა სიის შემდგენლის, - ამის შესახებ დღეს გამართულ პრესკონფერენციაზე შერიგებისა და სამოქალაქო თანასწორობის საკითხებში ყოფილმა სახელმწიფო მინისტრმა პაატა ზაქარეიშვილმა განაცხადა. მისი თქმით, ყველა ელოდება ამ სიის გამოქვეყნებას.\n\"მისი კრიტიკა შეიძლება და აუცილებელიცაა. კარგია რომ სია გამოქვეყნდა. სიაში არის აფხაზური და ოსური გვარები, მაგრამ არ მინახავს რუსული გვარები, თუმცა შესაძლოა, იყოს აფხაზი ან ოსი, რომელსაც რუსეთის მოქალაქეობა აქვს. თუ ამ სიაში არიან დაღუპულები, ძალიან ცუდი ნიშანი იქნება. თუ დადასტურდება, რომ სიაში მყოფი რამდენიმე ადამიანი ცოცხალი არ არის, ეს იქნება ძალიან დიდი მინუსი და არაკომპეტენტურობა სიის შემდგენელის\", - განაცხადა პაატა ზაქარეიშვილმა.\nმისივე თქმით, ეს სია არის პრევენციული და ყველა მიხვდება, რომ მათ არ გაუვათ ასეთი ამაზრზენი და უტიფარი მკვლელობები.\n\"მე ეჭვი მეპარება, რომ სიაში მყოფი ადამიანების უმრავლესობა მოხვდეს უცხოეთში, რადგან ეცოდინებათ, რომ მათზე ინტერპოლი ახორციელებს ძებნას. რუსეთში კი არ დააპატიმრებენ და ამაზე ორი აზრი არ არსებობს. თავის დროზე, „ნაციონალური მოძრაობის“ დროს, როდესაც ათობით ადამიანი იღუპებოდა, ასეთი სია, რომ შექმნილიყო, ოთხოზორიაც, ბაშარულიც და ტატუნაშვილიც ცოცხალი იქნებოდა. ეს სია არის პრევენციული სია და ყველა მიხვდება, რომ მათ არ გაუვათ ასეთი ამაზრზენი და უტიფარი მკვლელობები. ამ სიის ძალა არის პრევენციაში\", - განაცხადა ზაქარეიშვილმა.\nყოფილი სახელმწიფო მინისტრი სიის შესაძლო მინუსებზეც საუბრობს.\n\"სიას მინუსიც აქვს. დავუშვათ სიის რომელიმე წევრი ინტერპოლმა დააკავა. თუ ვერ დავამტკიცეთ, რომ ეს ადამიანი არის მკვლელი და თუ გათავისუფლდა, მაშინ მიიღებს პირველ სერიოზულ დარტყმას ეს სია. ამ შემთხვევაში აღმოჩნდება, რომ სია არის ხელოვნურად შექმნილი და პოლიტიკურად ანგაჟირებული\", - განაცხადა ზაქარეიშვილმა.\n„ევროპული საქართველოს“ მიერ გავრცელებულ ინფორმაციას საპარლამენტო უმრავლესობის ლიდერმა არჩილ თალაკვაძემ ასე უპასუხა: \"ეს ის ოპოზიციაა, რომელიც 33 ადამიანისგან შემდგარ სიაში მხოლოდ ორს ხედავს და 31 ადამიანს ვერა - ეს აჩვენებს, თუ რაზე არიან ეს ადამიანები ორიენტირებული\".\nთალაკვაძის განმარტებით, საქართველოს მთავრობას სიაში შეყვანილი პირების გარდაცვალებასთან დაკავშირებით ოფიციალური ცნობები არ მიუღია.\n„ჩვენი მხრიდან ცალმხრივად იმის ჩათვლა, რომ ეს ადამიანები გარდაცვლილები არიან, იურიდიულად სწორი არ არის,\" - განაცხადა არჩილ თალაკვაძემ.\nრაც შეეხება აღნიშნულ სიას ზოგადად, საპარლამენტო უმრავლესობის ლიდერმა ხაზი გაუსვა, რომ „ოთხოზორია-ტატუნაშვილის“ სიას არავითარი კავშირი არ აქვს აფხაზეთსა და ცხინვალში მცხოვრებ საზოგადოებასთან, ოჯახებთან და იმ ურთიერთობებთან, რომელიც ქართველებს აფხაზ და ოს ძმებთან აქვს.\n\"საკითხის ინტერპრეტაცია არასწორია და უსარგებლო მცდელობაა. ჩვენ სამშვიდობო ინიციატივებს გავაგრძელებთ. რაც შეეხება კრიმინალებსა და დანაშაულის ჩამდენ პირებს, ისინი მართლმსაჯულების წინაშე წარსდგებიან. სია დახურული არ არის, მასში, შესაძლოა, ცვლილებები შევიდეს - შესაძლოა, სხვა გვარებიც დაემატოს მას შემდეგ, რაც ტატუნაშვილის მკვლელობაში მონაწილე სხვა პირებს ბრალი წარედგინებათ. ჩვენთვის პრინციპული იყო როგორც ოთხოზორიას, ასევე ტატუნაშვილის მკვლელობაში მსჯავრდებული, ბრალდებული და შესაძლო მონაწილე პირები ყოფილიყვნენ სიაში შეყვანილი და ასეცაა გაკეთებული. თუ აფხაზეთიდან ან ცხინვალიდან სერიოზულ მონაცემებს მივიღებთ, სიის ცვლილებას სერიოზულად განვიხილავთ“, - აღნიშნა თალაკვაძემ.\nროგორც ცნობილია, მთავრობამ გუშინდელ სხდომაზე „ოთხოზორია-ტატუნაშვილის სია“ დაამტკიცა, რომელშიც 33 პირისგან შედგება.', 'politika', '2018-09-12 13:06:15.493840', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/politika/otxozoriatatunashvili_sia_2018-06-27_V4YDHtWjehaetZ.jpg', '2018-06-27 14:10:00', '[\'ოთხოზორია-ტატუნაშვილის სია\']', 7, '', 0, '', 973, '', ''),
(19, '', '\"ტრაგედია ტრიალებს ჩვენს სოფელში, ოთხი მკვდარი გვყავს...\" - რას ყვება ავარიაში გარდაცვლილების შესახებ მეზობელი', 'თბილისი-სენაკი-ლესელიძის საავტომობილო მაგისტრალის აგარის მონაკვეთზე ავტოსაგზაო შემთხვევას ორი ადამიანი ემსხვერპლა. დაღუპულები თავდაცვის სამინისტროს თანამშრომლები არიან, კიდევ ერთი მგზავრი კი მძიმედ დაშავდა.\nAMBEBI.GE-ს ინფორმაციით, ავარიის შედეგად დაიღუპნენ გაბრიელ გვარჯალაძე და გიგო გარაყანიძე.\nთავდაცვის სამინისტროს თანამშრომლები თბილისში მუშაობდნენ და შემთხვევის დროს ოზურგეთის მუნიციპალიტეტის სოფელ გომიდან ბრუნდებოდნენ, სადაც ავარიის წინა დღეს, მეზობლების პანაშვიდზე ჩავიდნენ. გვარჯალაძე და გარაყანიძე სოფელში და-ძმა მახარაძეების პანაშვიდზე იყვნენ ჩასულები, რომლებიც ოთხი დღის წინ - 23 ივნისს ზესტაფონში მომხდარ ავარიას ემსხვერპლნენ.\nAMBEBI.GE შემთხვევის შესახებ და გარდაცვლილებზე სასაუბროდ მათ მეზობელს, მარიკა ყაზარაშვილს ესაუბრა:\n- ტრაგედია ტრიალებს ჩვენს სოფელში, ოთხი მკვდარი გვყავს. გაბრიელ გვარჯალაძე და გიგო გარაყანიძე ღობის მეზობლები არიან, ისინი რამდენიმე დღის წინ, ავარიაში დაღუპული და-ძმა მახარაძეების პანაშვიდზე სამსახურის მერე წამოვიდნენ, სამძიმარზე მისვლის შემდეგ, სახლებში გაიარეს და თბილისში ბრუნდებოდნენ დილით. სწორედ ამ დროს მოხდა ავარია და ორივე დაიღუპა.\n- ამბობენ, რომ მათთან ერთად კიდევ ერთი ადამიანი იჯდა მანქანაში?\n- გიგო გარაყანიძის შვილი, ირაკლი იჯდა მანქანაში, ის გადარჩა და ჯანმრთელია. კიდევ მეოთხე ადამიანიც იყო მანქანაში, ანუ მძღოლი და ის გორის ჰოსპიტალში წევს.\n- რა ასაკის იყვნენ გარდაცვლილები და რა პოზიცია ეკავათ თავდაცვის სამინისტროში?\n- გიგო 52 წლის იყო, გაბრიელი 44 წლის. ორივე სამხედრო მოსამსახურე იყო. გიგო მძღოლი იყო თავდაცვის სამინისტროში. გაბრიელი ერაყის მისიაშიც მსახურობდა რამდენჯერმე, ასევე თავდაცვის სამინისტროს ეკლესიის სტიქაროსანი იყო და ტაძრის წინამძღვარს დაატარებდა.\n- შვილები ორივეს დარჩა?\n- კი, ორივეს დარჩა შვილები. გაბრიელის მეუღლე ერთ-ერთი მაღაზიის მენეჯერია, ქალიშვილი დარჩა 8 წლის ნია. რაც შეეხება გიგოს, მას ჩვენი სოფლელი გოგო ჰყავს ცოლად, ორი შვილი დარჩა - 19 წლის თამუნა და 22 წლის ირაკლი. გაბრიელს და გიგოსაც ახლა მოასვენებენ სოფელში. ხვალ და-ძმას თემური და ლანა მახარაძეებს დავასაფლავებთ, მერე გაბრიელს და გიგოს. ასეთი ტრაგედია ამ სოფელს არ ახსოვს...\n- თემურის და ლანას ჰყავდათ ოჯახები?\n- კი, თემური ელიავას ბაზრობაზე მუშაობდა, ლანო ლაგოდეხში იყო გათხოვილი. ორივე და-ძმას ორ-ორი ბიჭი დარჩა.\n ', 'semtxveva', '2018-09-12 13:06:16.336540', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sazogadoeba/avariashiagupulebi_2018-06-27_CEbx18btspT6fd.jpg', '2018-06-27 13:57:00', '[\'ავარია აგარასთან\']', 7, '', 0, '', 973, '', ''),
(20, '', 'ფოტომ, რომელზეც მესის შეკავებას 4 ნიგერიელი ცდილობს, არგენტინის ფანებიც კი მოატყუა', 'ფოტო, რომელზეც ასახულია როგორ აკავებს არგენტინელ ფეხბურთელს ლიონელ მესის ნიგერიის ნაკრების 4 წევრი, სრულიად “ფეისბუქი“ მოიცვა და მესი კიდევ ერთხელ აღიარეს ფეხბურთის \"მესიად\", რომელსაც ვერავინ და ვერაფერი აკავებს.\nთუმცა, ფოტო, რომელმაც არგენტინელი ფეხბურთელის ჭეშმარიტი ფანებიც კი მოატყუა, მონტაჟი აღმოჩნდა. ფოტო სოციალურ ქსელში არგენტინა - ნიგერიის ნაკრებების თამაშის შემდეგ გავრცელდა.\nსოციალური ქსელების მომხმარებლები აზიარებენ რეალურ ფოტოსაც, სადაც მესი ორ მოწინააღმდეგეს იგერიებს.\n\nარგენტინამ ძალიან დაძაბულ მატჩში 2:1 დაამარცხა ნიგერია და მერვედფინალში საფრანგეთს შეხვდება.\nბანეგას შესანიშნავი პასის შემდეგ ლიონელ მესიმ ანგარიში გახსნა, თუმცა ნიგერიამ ანგარიში პენალტით გაათანაბრა. გამარჯვების გოლი კი მარკოს როხომ გაიტანა.\n\n ', 'mozaika', '2018-09-12 13:06:17.117682', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sxvadasxva/photoshop_2018-06-27_4TOXHBtL5Y3I.jpg', '2018-06-27 15:01:00', '[\'ფოტომონტაჟი\', \'არგენტინა\', \'ლიონელ მესი\']', 9, '', 0, '', 973, '', ''),
(21, '', 'თბილისის მერია ავტოპარკის ტექდათვალიერებას იწყებს', 'დედაქალაქის მერია ავტოპარკის ტექდათვალიერებას იწყებს. ამის შესახებ თბილისის მერმა კახა კალაძემ დედაქალაქის მთავრობის სხდომაზე განაცხადა. \"დედაქალაქში ერთ-ერთი უმნიშვნელოვანესი და სასწრაფოდ მოსაგვარებელი საკითხი ჰაერის დაბინძურების პრობლემაა. ჩვენ არაერთხელ გვისაუბრია არსებულ ეკოლოგიურ მდგომარეობაზე, თუ რა მდგომარეობაა ჰაერის დაბინძურების თვალსაზრისით და შემიძლია გითხრათ, რომ ამ გამოწვევების თვალსაზრისით მუნიციპალიტეტს მკვეთრი გადაწყვეტილებების მიღება მოუწევს მომდევნო თვეების და წლების განმავლობაში როგორც სატრანსპორტო პოლიტიკის, ასევე გარემოს დაცვის მიმართულებით. ძალიან დიდი იმედი მაქვს, რომ საზოგადოების მხრიდან იქნება დიდი მხარდაჭერა, თანადგომა, რადგან მერიას მოუწევს არაპოპულარული ნაბიჯების გადადგმა ამ მიმართულებით, თუმცა ეს სასიცოცხლოდ მნიშვნელოვანი იქნება ჩვენი, ჩვენი შვილების და მომავალი თაობების კეთილდღეობისათვის, რომ ის არსებული რეალობა რაც ჰაერის დაბინძურების კუთხით გვაქვს, იყოს მოგვარებული“, - განაცხადა კალაძემ. \nთბილისის მერის თქმით, 1-ელი ივლისიდან სავალდებულო ხდება სახელმწიფო ავტოპარკისა და იურიდიული პირების საკუთრებაში არსებული ავტოსატრანსპორტო საშუალებების ტექდათვალიერება. განაგრძეთ კითხვა', 'politika', '2018-09-12 13:06:22.989830', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sxvadasxva/meriatbilisis958943.jpg', '2018-06-27 15:07:00', '[\'მერია\', \'ავტოპარკი\']', 11, '', 0, '', 973, '', ''),
(22, '', 'ქვეყნები, საიდანაც ქართველებს ყველაზე ხშირად ადეპორტებენ', 'ინფორმაციის თავისუფლების განვითარების ინსტიტუტი საქართველოს მოქალაქეების დეპორტაციის შემთხვევების შესახებ აქვეყნებს ინფორმაციას. ორგანიზაციის ცნობით, 2015-2017 წლებში საქართველოს მოქალაქეების დეპორტაციის ჯამში, 11 428 შემთხვევა დაფიქსირდა. \nკერძოდ, 2015 წელს - 3 688 საქართველოს მოქალაქე; 2016 წელს - 3 601; 2017 წელს კი - 4 126 მოქალაქის დეპორტაცია განხორციელდა. რაც შეეხება ქვეყნებს, საიდანაც დეპორტაციის შემთხვევები ყველაზე ხშირია ჩამონათვალში ლიდერობს თურქეთი. ასევე ამ ქვეყნებს შორისაა: გერმანია, ისრაელი და რუსეთი. იხილეთ ინფოგრაფიკა', 'ekonomika', '2018-09-12 13:06:23.770089', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sazogadoeba/deporti_2018-06-27_1Q2ULQZCMZ.jpg', '2018-06-27 15:30:00', '[\'დეპორტაცია\']', 0, '', 0, '', 973, '', ''),
(23, '', 'ნოდიკო ტატიშვილის და სალომე ბაკურაძის დუეტი წლის სიმღერა გახდა - ვინ გახდნენ \"ოქროს ტალღა 2018\"-ის გამარჯვებულები', 'რადიოჰოლდინგ \"ფორტუნას\" გრანდიოზული ღონისძიება - \"ოქროს ტალღა 2018\" დასრულდა. დიდ საკონცერტო დარბაზში ქართული მუსიკის ზეიმი შედგა. 15 ნომინაციაში გამარჯვებულები გამოვლინდნენ, მათ შორის, მთავარი გამარჯვებული, წლის სიმღერის ტიტულის მფლობელები - ნოდიკო ტატიშვილი და სალომე ბაკურაძე გახდნენ დუეტისთვის \"ერთხელ წვიმიან ქალაქში\" (სიმღერის ავტორი: ლილიკო ნემსაძე, ტექსტის ავტორი: ირინა სანიკიძე).\n15 ნომინაციიდან 14 კომპეტენტურმა ჟიურიმ ფარული კენჭისყრით გამოავლინა, მეთხუთმეტე - ინტერნეტრჩეული კი „ოქროს ტალღის“ საიტზე ხმის მიცემის შედეგებით გამოვლინდა და ის გიგი ადამაშვილია.\n\nსაღამოს სპეციალური სტუმარი ჰყავდა - \"გრემის\" ორგზის მფლობელი ამერიკელი შემსრულებელი, ლიზა ფიშერი, რომელმაც საქართველოს ეროვნულ სიმფონიურ ორკესტრთან (ნიკოლოზ რაჭველის ხელმძღვანელობით) კომპოზიციები შეასრულა და მაღალი საშემსრულებლო კლასი აჩვენა. კონცერტზე იმღერეს: ნანი ბრეგვაძემ, ეკა მამალაძემ, ნატალია ქუთათელაძემ, სტეფანე მღებრიშვილმა, ნინო ქათამაძემ, სოფო ნიჟარაძემ, „შვიდკაცამ,“ ნინა სუბლატმა...\n\n\"ოქროს ტალღა 2018\"-ს ნომინაციები და გამარჯვებულები ასეთია:\n\nწლის დებიუტი: 17 და ლევან ბეიტრიშვილი – „იმიტომ რომ“ (სიმღერა და ტექსტი: ლევან ბეიტრიშვილი)\nწლის დუეტი: ვერიკო ტურაშვილი და თემო საჯაია – „თოვს“ (მუსიკისა და ტექსტის ავტორი: თემო საჯაია)\nწლის რიმეიქი, ანუ ახალი ვერსია: ლელა წურწუმია და გიორგი მახარაშვილი – „რა კარგი ხარ სიყვარულო“ (კომპოზიტორი: გოგი ცაბაძე / ტექსტი: მორის ფოცხიშვილი)\nწლის ჯგუფი და ანსამბლი: ანსაბლი \"თეატრალურის კვარტეტი“ – წერილი (კომპოზიტორი: ჯემალ სეფიაშვილი / ტექსტი: პაატა ნაცვლიშვილი)\nწლის საუკეთესო ქალაქური სიმღერა: ლაშა ღლონტი – „შენ რომ დიდი იქნები“ (კომპოზიტორი: მამუკა ჩარკვიანი / ლექსი: ჯანსუღ ჩარკვიანი)\nინტერნეტრჩეული: გიგი ადამაშვილი - \"ქარი ქრის\" (მუსიკის და ტექსტის ავტორი: ნატო ღოღობერიძე)\nწლის მუსიკალური ტელეპროექტი: „მხოლოდ ქართული“, სამაუწყებლო კომპანია „რუსთავი 2“.\nმუსიკალური პროდიუსინგი: გიორგი კერესელიძე, „ისთერნ პრომოუშენი“.\nქართული მუსიკის პოპულარიზაცია ქვეყნის ფარგლებს გარეთ: ქეთი მელუა და „გორის ქალთა კამერული გუნდი“.\nრადიოჰოლდინგ „ფორტუნას“ რჩეული – სტეფანე მღებრიშვილი\nტელეკომპანია Music Box-ის რჩეული – ვერიკო ტურაშვილი და თემო საჯაია – „თოვს“\nმუსიკის განვითარებაში შეტანილი განსაკუთრებული წვლილი – გიო ხუციშვილი\nწლის საუკეთესო მომღერალი მამაკაცი: თემურ თათარაშვილი – „გული ადამიანობს“ (მუსიკისა და ტექსტის ავტორი: ცირა ბზიშვილი)\nწლის საუკეთესო მომღერალი ქალი: სოფო ნიჟარაძე – „მე საიდუმლოს შენახვა ვიცი“ (კომპოზიტორი: გოგი ცაბაძე / ტექსტი: მორის ფოცხიშვილი)\n\n\nსალომე ბაკურაძე, \"ოქროს ტალღა 2018\"-ის გამარჯვებული:\n\"იმდენმა ნომინაციამ ჩამიქროლა, კინაღამ ავიკაპიწე კაბა და სახლში წავედი. მთლად ცენტრალურ ნომინაციაში გამარჯვებას არ ველოდი. არადა, ძალიან გულით მინდოდა, ამ სცენაზე რაღაც ფორმით ვმდგარიყავი. მადლობა თითოეულ იმ ადამიანს, ვინც ეს გადაწყვეტილება მიიღო, რომ ასეთი სიხარული მამანიჭეს\".\nნოდიკო ტატიშვილი, \"ოქროს ტალღა 2018\"-ის გამარჯვებული:\n\"დიდი მადლობა მინდა გადავუხადო რადიოჰოლდინგ `ფორტუნას~ ამ დღესასწაულისთვის, ვინც ამ მაგარ საღამო-დაჯილდოებაზე ზრუნავს, რაღაც ისე დაემთხვა, თამარ ჩიგოგიძემ, რადიოს ხელმძღვანელმა, `ოქროს ტალღის~ 5-წლიანი არსებობის ისტორიაში მეორედ გამომაცხადა. 5 წლის წინ, სოფო გელოვანთან ერთად და ახლა, ჩემს სალომე ბაკურაძეთან ერთად. ეს ლილიკო ნემსაძის მუსიკაა, ტექსტის ავტორი ირინა სანიკიძეა, მუსიკალური პროდიუსინგი ბორიკო შხიანს ეკუთვნის, ჩავწერეთ `ბრავო რეკორდში\", ვიდეოს რეჟისორი ნესტან სინჯიკაშვილია, ვიდეოს პროდიუსერი კი თაკო დოლაბერიძე. ყველას დიდი მადლობა!\"\n ', 'kulturashoubiznesis', '2018-09-12 13:06:24.716718', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sxvadasxva/nodikodasalome_2018-06-27_6yjKK0JjIVfYKU.jpg', '2018-06-27 15:24:00', '[\'სალომე ბაკურაძე\', \'ნოდიკო ტატიშვილი\', \'ოქროს ტალღა 2018\']', 5, '', 0, '', 978, '', ''),
(24, '', '700-ზე მეტი გიდი და ტურისტული სააგენტოს წარმომადგენელი მთიან აჭარას გაეცნო', '<p>აჭარის ტურიზმის დეპარტამენტის ტურისტული პროდუქტების განვითარების სააგენტო აგრძელებს მთიანი აჭარის პოპულარიზაციას. ამჯერად, სააგენტომ საქართველოში მოქმედი მსხვილი ტურისტული სააგენტოების წარმომადგენლებს მაჭახელას ხეობის ტურისტული პროდუქტები გააცნო. ინფოტურის მონაწილეებმა მთიან აჭარაში მოგზაურობა ქემალ თურმანიძის ეთნოგრაფიული მუზეუმიდან დაიწყეს, სადაც 4000-ზე მეტი ექსპონატით აჭარაა წარმოდგენილი. მუზეუმის შემდეგ ისინი სოფელ მირვეთს ესტუმრნენ, სადაც ულამაზესი ბზების ხეივანი, ჩანჩქერი და თაღოვანი ხიდი დაათვალიერეს. მაჭახელას ხეობაში სტუმრობისას კი ინფოტურის მონაწილეებმა მაჭახელას თოფის ტურისტული მარშრუტი გაიარეს, რომელიც გვარას ციხეს, მეორე მსოფლიო ომის დროინდელ ქვემეხს, მაჭახელას თოფის მონუმენტს, ცხემლარას თაღოვან ხიდსა და ზედა ჩხუტუნეთის ისტორიულ-ეთნოგრაფიულ მუზეუმს მოიცავს. ისინი მაჭახელას ფოლკლორული გუნდის მიერ შესრულებულ ცეკვებსაც დაესწრნენ და საოჯახო-სასტუმრო სახლში ადგილობრივი კერძები დააგემოვნეს. აჭარის ტურიზმის დეპარტამენტის ტურისტული პროდუქტების განვითარების სააგენტო რეგიონში არასაზღვაო ზოლს მიღმა არსებული ტურისტული პროდუქტების განვითარება/პოპულარიზაციის მიმართულებით მუშაობს. დღემდე მთიან აჭარაში 15-მდე სხვადასხვა თემატიკის ტურისტული მარშრუტის განვითარება მოხდა, რომელთა პოპულარიზაციის მიზნით სააგენტომ ბოლო ორ წელში 700-ზე მეტ გიდსა და ტურისტული სააგენტოს წარმომადგენელს გააცნო მთიანი აჭარა.</p>', 'sazogadoeba', '2018-09-12 13:06:30.597191', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/reklama/acharaa_2018-06-27_4ISwRengexOYt.jpg', '2018-06-27 15:49:00', '[\'აჭარის ტურიზმი\']', 0, 'cczemetigididaturistulisaagentostsarmomadgenelimtianacharasgaeno', 0, '', 163, '', ''),
(25, '', 'ვინ უფრო მეტ ქონებას ფლობს საქართველოში მამაკაცები თუ ქალები? - კვლევის შედეგები', 'საქართველოს სტატისტიკის ეროვნულმა სამსახურმა აზიის განვითარების ბანკთან ერთად კვლევის შედეგები წარმოადგინა, რომელიც ეხება მონაცემთა შეგროვებას, აქტივების ფლობასა და მეწარმეობას გენდერული თვალსაზრისით. როგორც პრეზენტაციის დაწყებამდე საქსტატის აღმასრულებელი დირექტორის მოადგილემ, თენგიზ ცეკვავამ ჟურნალისტებს განუცხადა, კვლევამ აჩვენა, რომ საქართველოში ზოგიერთი აქტივის ფლობის მიხედვით საგრძნობლად დიდია სხვაობა ქალსა და მამაკაცს შორის. \nმისივე განმარტებით, აღნიშნული კვლევის მიზანი იყო ის, რომ დაედგინათ, როგორ ფლობს საქართველოს მოსახლეობა სხვადასხვა სახის აქტივებს, რომელიც საბოლოო ჯამში ქალის როლს განსაზღვრავს. ასევე, რამდენად უწყობს ხელს ამ როლის გაძლიერებას და რამდენად არის ეს დაბალანსებული გენდერული თვალსაზრისით.\n\"აღნიშნული კვლევის მიზანი სწორედ არის მეთოდოლოგიის შექმნა, რომელსაც გაერო-ს სტატისტიკის განყოფილება აწარმოებს უკვე ბოლო 4-5 წლის განმავლობაში. ამ კვლევის შედეგებით, საქართველოში ჩვენ პრაქტიკულად ვეხმარებით იმ გლობალური მეთოდოლოგიის შექმნაში, თუ როგორ არის განაწილებული აქტივები მამაკაცსა და ქალს შორის. კვლევამ აჩვენა, რომ მამაკაცები პრაქტიკულად ფლობენ ყველა აქტივის მიხედვით უფრო მეტ აქტივს და მის ღირებულებას. განსხვავება არის საკმაოდ მაღალი სასოფლო დასახლებებში, ვიდრე ქალაქში. საკმაოდ მნიშვნელოვანი სხვაობაა სასოფლო-სამეურნეო მიწის შემთხვევაში, ანუ ასეთი მიწის ფლობა მამაკაცებში დაახლოებით ორჯერ და უფრო მეტჯერ არის გავრცელებული, ვიდრე ქალებში\", - განაცხადა ცეკვავამ. განაგრძეთ კითხვა', 'ekonomika', '2018-09-12 13:06:31.341287', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sxvadasxva/fuli9854_2018-06-27_wB2QEQwUk3.jpg', '2018-06-27 15:34:00', '[\'ქონება\']', 1, '', 0, '', 973, '', ''),
(26, '', '187 ქართველი კოსმოსური სამეფოს მოქალაქეა - გაგიგიათ ასგარდიის შესახებ?', '<p>ფიქრობთ, რომ დედამიწაზე მოვლენები ძალიან ცუდად ვითარდება და საერთოდ დიდი სიამოვნებით მიატოვებდით ამ პლანეტას და სადმე სხვაგან გადასახლდებოდით?! შესაძლოა, ეს ფიქრი რეალობად იქცეს თუ ასგარდიის მოქალაქე გახდებით. წარმატების შემთხვევაში ახლად ჩამოყალიბებული ეს \"კოსმოსური სამეფო\" მთვარის კოლონიზებას ფიქრობს. \"კოსმოსური სამეფო\" ასგარდია 20 თვის წინ ჩამოყალიბდა. მას უკვე აქვს კონსტიტუცია, ჰყავს არჩევითი პარლამენტი და, რაც მთავარია, 200 ათასზე მეტი მოქალაქე. მიმდინარე კვირის ორშაბათს კი ასგარდიის ლიდერის, იგორ აშურბეილის ინაუგურაცია გაიმართა. აშურბეილი რუსი ინჟინერი, კომპიუტერული მეცნიერი და ბიზნესმენია, რომელსაც სურს კოსმოსში პირველი სრულად დამოუკიდებელი სახელმწიფო შექმნას. ასგარდიის ყველაზე მეტი მოქალაქე ამერიკის შეერთებული შტატებიდან - 26 969 ადამიანი, თურქეთიდან - 22 862 ადამიანი და ინდოეთიდანაა -17 570 ადამიანი. ჯამში ასგარდიის მოქალაქეობა მსოფლიოს 224 ქვეყნის წარმომადგენელმა მიიღო, მათ შორის კი ქართველებიც არიან. განაგრძეთ კითხვა</p>', 'mozaika', '2018-09-12 13:06:32.049310', 'https://cdn.ambebi.ge/media/__thumbs__/thumb/630x415/images/2018/sxvadasxva/asgardia_2018-06-27_VsfXgjdvlpwiA6.jpg', '2018-06-27 15:58:00', '[\'ასგარდია\']', 6, 'jqartvelikosmosurisamefosmoqalaqeagagigiatasgardiisshesakheb', 0, '', 141, '', '');
INSERT INTO `trainings` (`id`, `source`, `title`, `text`, `category`, `scraped_at`, `img`, `origin_date`, `tags`, `comments_number`, `slug`, `date`, `origin_url`, `views`, `keywords`, `description`) VALUES
(40, '', '\"რუსთავი2\"-ის წილებისთვის ბრძოლას ეროსი კიწმარიშვილის ოჯახი იწყებს', '<p>ეს განცხადება ტელეკომპანიის დამფუძნებლის მეუღლემ, ია კიწმარიშვილმა გააკეთა, რომელმაც თქვა, რომ სამართლებრივი ბრძოლა უახლოეს მომავალში დაიწყება.&nbsp;ია კიწმარიშვილმა&nbsp;იურიტებთან კონსულტაციები უვე გაიარა.</p>\n<p>&nbsp;</p>\n<p>&bdquo;<em>მე</em><em>, </em><em>რა</em> <em>თქმა</em> <em>უნდა</em><em>, </em><em>როგორც</em> <em>ეროსის</em> <em>სამართალმემკვიდრე</em> <em>გავაგრძელებ</em> <em>მის</em> <em>დაწყებულ</em> <em>საქმეს</em> <em>და</em> <em>ღრმად</em> <em>ვარ</em> <em>დარწმუნებული</em><em>, </em><em>რომ</em> <em>ეროსის</em> <em>ღვაწლი</em><em>, </em><em>ნიჭი</em><em>, </em><em>შრომა</em> <em>არა</em> <em>მხოლოდ</em><em> \"</em><em>რუსთავი</em><em> 2\"-</em><em>ის</em> <em>საქმეში</em><em>, </em><em>არამედ</em> <em>მთლიანად</em> <em>საქართველოს</em><em>, </em><em>თავისუფალი</em> <em>მედიის</em> <em>განვითარებისთვის</em> <em>დახარჯული</em> <em>მისი</em> <em>ეს</em> <em>ენერგია</em><em>, </em><em>როგორც</em> <em>მინიმუმ</em> <em>ამით</em> <em>მაინც</em> <em>უნდა</em> <em>დაუბრუნდეს</em><em>.</em></p>\n<p><em>მე</em> <em>ღრმად</em> <em>ვარ</em> <em>დარწმუნებული</em><em>, </em><em>რომ</em> <em>ეს</em> <em>კარგად</em> <em>ესმის</em> <em>ქიბარ</em> <em>ხალვაშსაც</em><em>, </em><em>ეს</em> <em>კარგად</em> <em>ესმის</em> <em>დღევანდელ</em> <em>ხელისუფლებასაც</em><em>. </em><em>მე</em> <em>ყველანაირი</em> <em>უფლება</em> <em>მაქვს</em><em>, </em><em>როგორც</em> <em>გავიარე</em> <em>კონსულტაცია</em> <em>ჩემს</em> <em>იურისტებთან</em> <em>მოვითხოვო</em> <em>ეროსის</em> <em>წილი</em><em>, </em><em>როგორც</em> <em>მის</em> <em>სამართალმემკვიდრემ</em> <em>და</em> <em>მე</em> <em>ამას</em> <em>გავაკეთებ</em> <em>და</em> <em>დაველოდები</em> <em>უკვე</em> <em>ალბათ</em> <em>სასამართლოს</em> <em>გადაწყვეტილებას</em><em>, </em><em>მაგრამ</em> <em>ჩემთვის</em> <em>აგრეთვე</em> <em>ძალიან</em> <em>მნიშვნელოვანი</em> <em>და</em> <em>საინტერესოა</em> <em>თავად</em> <em>ბატონი</em><em>&nbsp;</em><em>ქიბარი</em><em>&nbsp;</em><em>რას</em> <em>ფიქრობს</em> <em>ამის</em> <em>შესახებ</em><em>. \"</em><em>რუსთავი</em><em> 2\"-</em><em>ის</em><em> 100% </em><em>დაუბრუნდა</em> <em>ქიბარ</em> <em>ხალვაშს</em><em>. </em><em>მე</em> <em>პირველ</em> <em>რიგში</em><em>, </em><em>ვულოცავ</em> <em>მას</em> <em>ამ</em> <em>გადაწყვეტილებას</em><em>, </em><em>ალბათ</em> <em>ძალიან</em> <em>გამორჩეული</em> <em>ადამიანი</em> <em>უნდა</em> <em>იყო</em><em>, </em><em>რომ</em> <em>შენს</em> <em>სასარგებლოდ</em><em>, </em><em>ესე</em> <em>არაფრით</em><em>, </em><em>დაუმსახურებლად</em> <em>მიიღო</em> <em>ესეთი</em> <em>საჩუქარი</em><em>. </em><em>ყველამ</em> <em>კარგად</em> <em>იცის</em><em>, </em><em>რომ</em> <em>ეს</em> <em>ადამიანი</em> <em>შემთხვევით</em> <em>მოხვდა</em> <em>ამ</em> <em>ტელევიზიაში</em> <em>და</em> <em>ყველაფერი</em><em>, </em><em>რაც</em> <em>ახლა</em> <em>ხდება</em><em>, </em><em>ეს</em> <em>მე</em> <em>პირადად</em><em>, </em><em>რაღაც</em> <em>აბსურდის</em> <em>თეატრს</em> <em>მაგონებს</em><em>&ldquo;</em><em> - </em><em>ამბობს</em> <em>კიწმარიშვილი</em><em>.</em></p>\n<p>&nbsp;</p>\n<p>ეროსი კიწმარიშვილის ძმა, ზურაბ კიწმარიშვილი მისი ძმის გარდაცვალებასთან დაკავშირებულ საეჭვო დეტალებზე საუბრობს:</p>\n<p><em>&bdquo;</em><em>პასუხები</em> <em>არ</em> <em>გვაქვს</em> <em>და</em> <em>აქედან</em> <em>გამომდინარე</em><em>, </em><em>ვთვლი</em><em>, </em><em>რომ</em> <em>ამაში</em> <em>ყველაფერში</em> <em>ჩანს</em> <em>ამ</em> <em>ორგანოების</em> <em>ნება</em><em>, </em><em>რომ</em> <em>საქმე</em> <em>არ</em> <em>ყოფილიყო</em> <em>ისეთი</em> <em>მიმართულებით</em> <em>წასული</em><em>, </em><em>სადაც</em> <em>მათ</em> <em>გაუჭირდებოდათ</em> <em>რეალური</em> <em>მიზეზების</em> <em>დადგება</em><em>. </em><em>მარტივად</em> <em>და</em> <em>ერთფეროვნად</em> <em>იმუშავეს</em> <em>და</em> <em>შედეგი</em> <em>ყველამ</em> <em>კარგად</em> <em>ვიცით</em><em>&ldquo;</em></p>', '22', '', 'https://newsebi.ge/admin/uploads/erosi.jpg_2809.jpg', '', '', 0, 'rustaviwistsilebistvisbrdzolaserosikitsmarishvilisojakhiitsyebs', 1565266019, '', 194, '', ''),
(49, '', 'TV პირველის დამფუძნებელი, ვახტანგ წერეთელი სასამართლოში დღეს დაიკითხება', '<p>TV პირველის დამფუძნებელი ვატო წერეთელი დღეს, 8 აგვისტოს, 15:00 საათზე საქალაქო სასამართლოში, მოსამართლე ა.კალატოზიშვილის თანდასწრებით დაიკითხება.</p>\n<div class=\"fb-quote fb_iframe_widget\" data-href=\"http://www.tabula.ge/ge/story/153798-tv-pirvelis-damfudznebeli-vaxtang-tsereteli-sasamartloshi-1500-saatze-daikitxeba\">&nbsp;</div>\n<p>შეგახსენებთ, რომ TV პირველის დამფუძნებელი ვახტანგ წერეთელი 6 აგვისტოს პროკურატურაში დაიბარეს. ვატო წერეთლის თქმით, იგი შეკითხვებზე პასუხს მხოლოდ მაგისტრი მოსამართლის წინ გასცემდა.</p>\n<p>\"პროკურატურაში დამიბარეს. ნებისმიერ კითხვაზე გავცემ პასუხს მხოლოდ მოსამართლის თანდასწრებით, თუმცა წინასწარ გეუბნებით, ტვ პირველს არ მოგაგუდინებთ! ეს ტელევიზია არც არავის გავლენის ქვეშ გადავა და არც არავის ტრენდზე! შანსი გაქვთ ნული! ყველას ვერ დაიჭერთ! ყველას ვერ დააშინებთ! ყველა შეტევას გავუძელით და ამასაც გავუძლებთ!\" - წერს ვატო წერეთელი Facebook-ზე.&nbsp;</p>\n<p>შეგახსენებთ, რომ ვატო წერეთელი ბიზნესმენ ავთანდილ წერეთლის შვილია, რომელიც თავის მხრივ, ერთ-ერთი მთავარი ფიგურაა იმ ტრანზაქციებში, რომლებმაც პროკურატურა TBC ბანკის დამფუძნებლებს ედავება და რის გამოც საქალაქო სასამართლომ ბიზნესმენებს აღკვეთის ღონისძიების სახით 700 000 -&nbsp;700 000 ლარი შეუფარდა. ეს ტრანზაქცია გახდა გაცხადებული მიზეზი საქართველოს ეროვნული ბანკის პრეზიდენტის, კობა გვენეტაძის, მხრიდან მოთხოვნისა, ხაზარაძესა და ჯაფარიძეს TBC ბანკის სამეთვალყურეო საბჭოში თანამდებობები დაეტოვებინათ.</p>\n<p>ამასთან, ავთანდილ წერეთელი და ტვ პირველი იმ წერილშიც ფიგურირებს, რომელზეც მამუკა ხაზარაძე ამტკიცებს, რომ შინაგან&nbsp;საქმეთა მინისტრ გიორგი გახარიასგან მიიღო. წერილში, რომელიც ამჟამად ლონდონში ექსპერტიზაზეა გაგზავნილი, მამუკა ხაზარაძისგან ითხოვენ, რომ \"უახლოეს 5 დღეში TV1 უნდა დაჯდეს TV იმედის ტრენდზე, გადავიდეს მაუწყებლობის საგანგებო რეჟიმზე (ეს უნდა დავინახოთ არხის სარედაქციო პოლიტიკიდან)\", წინააღმდეგ შემთხვევაში წერილის ავტორი ადრესატს რეპუტაციის განადგურებით ემუქრება.&nbsp;</p>', '22', '', 'https://newsebi.ge/admin/uploads/cc0b95d5772934983082e68352a5006c_thumb.png', '', '', 0, 'pirvelisdamfudznebelivakhtangtseretelisasamartloshidghesdaikitkheba', 1565253679, '', 192, '', ''),
(50, '', 'თსუ-ის ლექტორმა მიმისა და Facebook-ზე გინების გამო სტუდენტს უჩივლა', '<p>&nbsp;</p>\n<p>ივ. ჯავახიშვილის სახელობის თბილისის სახელმწიფო უნივერსიტეტის ლექტორი, რომელმაც სტუდენტს ფეისბუკის დახურულ ჯგუფში გავრცელებული მიმის და კომენტარებში დაწერილი გინების შემდეგ უჩივლა, განცხადებას ავრცელებს.</p>\n<p><strong>წყარო &bdquo;ნეტგაზეთი&ldquo;&nbsp;netgazeti.ge</strong></p>\n<p>გიორგი გორაშვილი ამბობს, რომ ჯგუფში, სადაც მიმი გავრცელდა, მისი თითქმის ყველა სტუდენტი, კურსამთავრებული, მეგობარი და კოლეგა &ndash; იურისტები არიან გაწევრიანებულნი და სწორედ მათგან შეიწყო, რომ ბუბა ნაჭყებიამ აღნიშნული პოსტი გამოაქვეყნა:</p>\n<p>&ldquo;ჩემთვის სრულიად მოულოდნელი და შეურაცხმყოფელი იყო ის ფაქტი, რომ იურისტების მრავალათასიან ფეისბუქ ჯგუფ &ndash; TSU Faculty of Law (2016)-ში, სადაც თითქმის ყველა ჩემი სტუდენტი, კურსდამთავრებული, მეგობარი, კოლეგა &ndash; იურისტები (რომელთაგანაც შევიტყვე შეურაცხყოფის ფაქტის შესახებ) არიან გაწევრიანებულნი, თბილისის სახელმწიფო უნივერსიტეტის სტუდენტმა ბუბა ნაჭყებიამ 2019 წლის 30 ივნისს საჯაროდ გამოაქვეყნა ჩემი ლანღვა-გინების (დედის გინება) შემცველი პოსტი, რაც არაერთხელ განმეორდა (მათ შორის დღესაც), როგორც ზემოთ აღნიშნულ, ისე სხვა ფეისბუქ ჯგუფში სახელწოდებით TSU Faculty of Law (ფარდის მიღმა)-ში, რომელიც შექმნა უშუალოდ ამ უკანასკნელმა. დღევანდელი მდგომარეობით სტუდენტის მოქმედებამ შეიძინა შეურაცხმყოფელი გადაკიდების ხასიათი&rdquo; &ndash; ამბობს გორაშვილი.</p>\n<p>გორაშვილი აცხადებს, რომ თავად სტუდენტ ბუბა ნაჭყებიას ლექტორი არ ყოფილა, თუმცა მას თსუ-ის დაცვის სამსახურიდან იცნობდა, რომელსაც გორაშვილი ხელმძღვანელობს ნაჭყებია კი დასაქმებული იყო. რაც შეეხება კომენტარებს გორაშვილი მიიჩნევს, რომ სტუდენტმა პოპულარობის მიღწევის ამორალური გზა აირჩია:</p>\n<p>&ldquo;ის თანატოლებს ამით აჩვენებს, რომ მას შეუძლია ლანძღოს და აგინოს ივანე ჯავახიშვილის სახელობის თბილისის სახელმწიფო უნივერსიტეტის უსაფრთხოების სამსახურის უფროსს, მაგრამ ვფიქრობ გაცნობიერებული არ აქვს რას აკეთებს. რეალურად არ არსებობს იმის საფუძველი, რომ ზიზღი და სიძულვილი, რომელსაც ის ამდენი ხნის განმავლობაში გამოხატავს ჩემი მისამართით, ობიექტური გარემოების გამო ჰქონოდა და ჩემ მიმართ განხორციელებული არაერთი ლანძღვა-გინება მხოლოდ ხულიგნური მოტივაციითაა ნაკარნახევი&rdquo; &ndash; ამბობს ლექტორი.</p>\n<p>მისი თქმით, სოციალურ ქსელებში გავრცელებული ლანძღვა-გინებისა და ბულინგის მსხვერპლი ბოლო პერიოდში არაერთი ლექტორი გახდა:</p>\n<p>&ldquo;ამიტომაც ფაქტთან დაკავშირებით, სასამართლოში საქართველოს ადმინისტრაციულ სამართალდარღვევათა კოდექსის 166-ე მუხლით (წვრილმანი ხულიგნობა) მიმდინარე ადმინისტრაციული სამართალდარღვევის შესახებ წარმოებას გააჩნია, როგორც ადამიანური, ისე პედაგოგიური და პროფილაქტიკური მნიშვნელობა. სწორედ ამიტომ, სასამართლო სხდომაზე დავაყენე შუამდგომლობა, რომ თუ მოცემული ფაქტი ჩაითვლება ადმინისტრაციულ გადაცდომად, სასამართლომ დისკრეციის ფარგლებში დააკისროს პირს ადმინისტრაციული პასუხისმგებლობა, მაგრამ გაათავისუფლოს სახდელისაგან. ბუბა ნაჭყებიამ უნდა გააცნობიეროს, რომ სიტყვისა და გამოხატვის თავისუფლება ადამიანის პირადი ღირსების ხელყოფას არ ნიშნავს&rdquo; &ndash; ამბობს გორაშვილი.</p>\n<p>&nbsp;</p>\n<p>ფოტოზე, რომელზეც ლექტორი &nbsp;გიორგი გორაშვილი ბოდიბილდერ ქალთან ერთადაა გამოსახული, ბუბა ნაჭყებიამ დააწერა &ldquo;როცა ცოლზე ვერ იძალადებ&rdquo;. როგორც სტუდენტმა &ldquo;ნეტგაზეთს&rdquo; უამბო, დახურულ ჯგუფში აღნიშნულ მიმზე კომენტარიც დაწერა, სადაც გორაშვილის მისამართით შეიგინა.</p>\n<p>&nbsp;</p>\n<p><img src=\"/admin/uploads/67631473_1406901336126521_7524020509105717248_n.png\" alt=\"\" width=\"367\" height=\"462\" /></p>\n<p>&nbsp;</p>\n<p><img src=\"/admin/uploads/68296394_909768482690313_1846985153033797632_n.png\" alt=\"\" width=\"471\" height=\"141\" /></p>\n<p>ამის შემდეგ დაახლოებით 1 კვირაში სტუდენტს შსს-დან დაუკავშირდნენ:</p>\n<p>&ldquo;პოსტის დადებიდან სადღაც 1 კვირაში მირეკავს ვინმე გამომძიებელი ანი და მეუბნება, რომ დამიბარა სამმართველოში, არ მიხსნის, თუ რატომ. თან მირეკავს ისე, რომ იგებს დედაჩემი და იმავე დღეს ნერვული იშემიით გადამყავს საავადმყოფოში. შესაბამისად, გამოცხადებაც ვერ შევძელი. ორ დღეში მირეკავს ისევ და მეუბნება, რომ აი, მაშინ რომ არ გითხარი, ვინ დაწერა განცხადება, ახლა გეტყვიო &ndash; გორაშვილმაო. რა თქმა უნდა, მაგის თავი არ მქონდა, რომ მესაუბრა, და ვუთხარი, ცოტა ხანი ჩამოსვლას ვერ ვახერხებდი და გამოეგზავნა ირიდიულ მისამართზე უწყება&rdquo; ,- იხსენებს სტუდენტი.</p>\n<p>მისი თქმით, დედის საავადმყოფოდან გაწერის შემდეგ საკითხით დაინტერესდა, თუმცა, ვინაიდან უწყება არ მისვლია და კურსელებსაც არ სჯეროდათ, რომ ლექტორი უჩივლებდა, ხუმრობად ჩათვალა:</p>\n<p>&ldquo;რომ გავიგე, რომ მართლა გამომძიებელი მირეკავდა, მივედი.&nbsp;ადმინისტრაციული სამართალდარღვევის ოქმი შეადგინა, რასაც ხელი არ მოვაწერე. თუმცა, მიუხედავად ამისა, ვითხოვე მისი ჩაბარება, რათა იურისტთან გამევლო კონსურლტაცია, რაზეც უარი მივიღე. ასევე ვთხოვე განემარტა ხელის არმოწერით დამდგარი სმართლებრივი შედეგები. მოკლედ, ოქმის ჩაბარების მოთხოვნაზე, იურისტისთვის რომ მიმეტანა, მტკიცა უარი. წადი, ისე უთხარი, სიტყვაზე გენდობიანო. მეორე დღეს მირეკავს დაახლოებით ღამის 20:00 საათზე და ხვალ არის პროცესიო&rdquo; ,- იხსენებს სტუდენტი.</p>\n<p>როგორც ბუბა ნაჭყებია ამბობს, ამის შემდეგ ლექტორმა &ldquo;ფეისბუკზე&rdquo; მისწერა და უთხრა, რომ ის ვერც სამართალს და ვერც სამართლიანობას ვერასოდეს ისწავლიდა.</p>\n<p>სტუდენტის თქმით, ადმინისტრაციული სამართალწარმოება წვრილმანი ხულიგნობის მუხლით დაიწყო და შემდეგი სასამართლო პროცესი 14 აგვისტოსაა დანიშნული.</p>\n<p>&ldquo;ნეტგაზეთი&rdquo; აღნიშნულ საკითხზე თსუ-ის პრესსამსახურს დაუკავშირდა და გიორგი გორაშვილთან დაკავშირება სთხოვა. უნივერსიტეტში გვითხრეს, რომ გორაშვილი რამდენიმე წუთში საკუთარ ფეისბუკ-გვერდზე გამოაქვეყნებს განცხადებას, თუმცა კომენტარი ლექტორს ამ დრომდე (7 აგვისტო, 23:50) არ გაუვრცელებია.</p>\n<p>თსუ-ის ადმინისტრაციაში კი ამბობენ, რომ &nbsp;ნებისმიერ მოქალაქეს, მათ შორის, უნივერსიტეტის თითოეულ თანამშრომელს, თუ თვლის, რომ დაირღვა მისი უფლებები, შეუძლია მიმართოს სასამართლოს.</p>\n<p>უნივერსიტეტში ამბობენ, რომ ამ საკითხზე აუცილებლად იმსჯელებენ &nbsp;იურიდიული ფაკულტეტის საბჭო და თსუ-ის ეთიკის კომისია:</p>\n<p>&ldquo;რამდენადაც ჩვენთვის ცნობილია, სტუდენტმა სოციალურ ქსელში განსაკუთრებულად შეურაცხმყოფელი სიტყვებით მოიხსენია ლექტორი, რომელმაც გადაწყვიტა სამართლებრივი გზით რეაგირება და სტუდენტისთვის პასუხისმგებლობის დაკისრება სამართლებრივი სანქციების და გადასახადების გარეშე&rdquo;, &ndash; აცხადებენ თსუ-ში.</p>\n<p>&nbsp;</p>\n<p><strong>წყარო &bdquo;ნეტგაზეთი&ldquo; netgazeti.ge</strong></p>', '22', '', 'https://newsebi.ge/admin/uploads/%E1%83%92%E1%83%98%E1%83%9D%E1%83%A0%E1%83%92%E1%83%98-%E1%83%92%E1%83%9D%E1%83%A0%E1%83%90%E1%83%A8%E1%83%95%E1%83%98%E1%83%9A%E1%83%98-660x350.jpg', '', '', 0, 'tsuisleqtormamimisadaacebookzeginebisgamostudentsuchivla', 1565256371, '', 191, '', ''),
(52, '', '„ტვ პირველის“ დირექტორი ვახტანგ წერეთელი ფიქრობს, რომ პროკურატურას მამამისის, ბიზნესმენ ავთანდილ წერეთლის წინააღმდეგ სისხლის სამართლის საქმის აღძვრა სურს', '<p>როგორც &bdquo;ტვ პირველის&ldquo; დამფუძნებელმა, ვახტანგ წერეთელმა ივარაუდა პროკურატურას მამამისის, ბიზნესმენ ავთანდილ წერეთლის წინააღმდეგ სისხლის სამართლის&nbsp;საქმის აღძვრა სურს.</p>\n<p>ვახტანგ წერეთელის განცხადებით, რომელიც თბილისის საქალაქო სასამართლოსთან გააკეთა, სამართალდამცველები მასზე მანიპულირებენ მამის წინააღმდეგ დევნის დაწყებით:</p>\n<p>&bdquo;ჩემი აზრით, უნდათ ჩემი ოჯახის წევრზე, მამაზე სისხლის სამართლის საქმის აღძვრა და ამით ჩემი აზრით, შეეცდებიან ჩემზე პირადად მანიპულირებას&ldquo;, - განაცხადა ვახტანგ წერეთელმა.</p>\n<p>ვახტანგ წერეთელი სასამართლოში ხაზარაძე-ჯაფარიძის საქმეზე დაიკითხა.</p>', '22', '', 'https://newsebi.ge/admin/uploads/cc0b95d5772934983082e68352a5006c_thumb.png', '', '', 0, 'tvpirvelisdireqtorivakhtangtseretelifiqrobsromprokuraturasmamamisisbiznesmenavtandiltseretlistsinaaghmdegsiskhlissamartlissaqmisaghdzvrasurs', 1565267457, '', 165, '', ''),
(53, '', 'ლარი დოლართან მიმართებაში 1.5 თეთრით, ხოლო ევროსთან 2.3 თეთრით გაუფასურდა', '<p>9 აგვისტოდან 1 აშშ დოლარი 2.9488 ლარი ეღირება, ხოლო 1 ევროს ფასი 3.3038 ლარამდე გაიზრდება.</p>\n<p>კონკრეტულად, ეროვნული ბანკის ახალი მონაცემებით, ხვალიდან ლარი დოლართან მიმართებაში 0.0150 პუნქტით, ხოლო ევროსთან მიმართებაში 0.0232 პუნქტით გაუფასურდება.</p>\n<p>დღეს, 8 აგვისტოს, საქართველოს ეროვნული ბანკის ოფიციალური გაცვლითი კურსით, 1 ამერიკული დოლარის ღირებულება 2.9338 ლარია, ხოლო 1 ევრო 3.2806 ლარი ღირს.</p>', '22', '', 'https://newsebi.ge/admin/uploads/axali-lari.jpg', '', '', 0, 'laridolartanmimartebashijtetritkholoevrostanwxtetritgaufasurda', 1565271215, '', 266, '', ''),
(54, '', 'ბათუმში შშმ პირებისთვის ადაპტირებული პლაჟი გაიხსნა ', '<p>ბათუმის ბულვარში ადაპტირებული პლაჟი გაიხსნა. წელს პირველად შშმ პირები ზღვაში შესვლას და ბანაობას დამოუკიდებლად შეძლებენ. ბათუმის ბულვარმა ეტლით მოსარგებლე პირებისთვის ზღვაში შესასვლელი ხუთი საცურაო ტივტივა ეტლი შეიძინა, მოეწყო პლაჟზე გადასასვლელი ადაპტირებული ბილიკი, საშხაპე, საპირფარეშო და გამოსაცვლელი.&nbsp;შშმ პირებისთვის ადაპტირებული პლაჟი ბათუმის ბულვარის სანაპიროზე, რესტორან &bdquo;ძველი გემის&ldquo; მოპირდაპირე მხარეს მდებარეობს. ბათუმის ბულვარის ინფორმაციით, საპლაჟო ინფრასტრუქტურა შეზღუდული შესაძლებლობების მქონე პირთა საჭიროებებს სრულად არის მორგებული.&nbsp;ეტლით სარგებლობა მომხმარებლისთვის უფასო იქნება.</p>\n<p>&nbsp;</p>\n<p><a href=\"https://www.facebook.com/BatumiBoulevard/videos/1351589331666717/\">https://www.facebook.com/BatumiBoulevard/videos/1351589331666717/</a></p>', '22', '', 'https://newsebi.ge/admin/uploads/%E1%83%A8%E1%83%A8%E1%83%9B-%E1%83%9E%E1%83%98%E1%83%A0%E1%83%94%E1%83%91%E1%83%98%E1%83%A1-%E1%83%9E%E1%83%9A%E1%83%90%E1%83%9F%E1%83%98.jpg', '', '', 0, 'batumshishshmpirebistvisadaptirebuliplazhigaikhsna', 1565340916, '', 191, '', ''),
(55, '', 'პროკურატურამ ნიკა გვარამიას ბრალი წაუყენა', '<p>გვარამიას ბრალი სისხლის სამართლის კოდექსის 220-ე მუხლით წაუყენეს, რაც საწარმოს ხელმძღვანელობითი&nbsp;და წარმომადგენლობითი&nbsp;უფლებამოსილების გამოყენებას, ამ ორგანიზაციის კანონიერი ინტერესების საწინააღმდეგოდ მოქმედებას გულისხმობს, რამაც მნიშვნელოვანი ზიანი გამოიწვია.&nbsp;</p>\n<p>უწყების განმარტებამ საკითხზე ასეთია:</p>\n<p>&bdquo;გამოძიებით დადგენილია, რომ ნიკა გვარამიას მიერ საწარმოს ხელმძღვანელობითი და წარმომადგენლობითი უფლებამოსილების ბოროტად გამოყენებით ,,სამაუწყებლო კომპანია რუსთავი 2&ldquo;-მა ვერ მიიღო 6 763 510 ლარი, რითაც საწარმოს დიდი ოდენობით ზიანი მიადგა.</p>\n<p>ნიკა გვარამიას მიერ შესაძლო ჩადენილი ქმედება გამოიხატა შემდეგში:</p>\n<p>2012 წლის ნოემბრიდან ნიკა გვარამია დანიშნული იყო შ.პ.ს. ,,სამაუწყებლო კომპანია რუსთავი 2&ldquo;-ის დირექტორად, ხოლო 2014 წლის სექტემბრიდან - ამავე კომპანიის გენერალურ დირექტორად.</p>\n<p>საწარმოს წესდების თანახმად, &bdquo;სამაუწყებლო კომპანია რუსთავი 2&ldquo;-ს მესამე პირებთან ურთიერთობაში წარმოადგენს გენერალური დირექტორი, რომელიც ვალდებულია კეთილსინდისიერად და კომპანიის ინტერესების დაცვით უზრუნველყოს მისი ყოველდღიური მართვა და საქმიანობა, იმოქმედოს კომპანიის და პარტნიორების ბიზნეს ინტერესებით, უზრუნველყოს წესდების უპირობო და კეთილსინდისიერი შესრულება.</p>\n<p>ასევე, &bdquo;მეწარმეთა შესახებ&ldquo; საქართველოს კანონის თანახმად, საწარმოს ხელმძღვანელი კომპანიის საქმეებს უნდა გაუძღვეს კეთილსინდისიერად და უნდა მოქმედებდეს იმ რწმენით, რომ მისი ეს მოქმედება ყველაზე ხელსაყრელია კომპანიისთვის.</p>\n<p>მიუხედავად ზემოაღნიშნული ვალდებულებებისა, ნიკა გვარამია ბოროტად იყენებდა თავის ხელმძღვანელობით და წარმომადგენლობით უფლებამოსილებას, არ მოქმედებდა კეთილსინდისიერად და სამაუწყებლო კომპანია რუსთავი 2-ის კანონიერი ინტერესებიდან გამომდინარე.</p>\n<p>კერძოდ, 2015 წლის 16 იანვარს შ.პ.ს, ,,სამაუწყებლო კომპანია რუსთავი 2&ldquo;-ის სახელით ნიკა გვარამიამ ხელშეკრულება გააფორმა შ.პ.ს &bdquo;ინტერ მედია პლიუსთან&ldquo;, რომლის მფლობელებიც არიან მისი მეგობრები - ზ.გ. და კ.ჯ., ხოლო დირექტორი, ,,სამაუწყებლო კომპანია რუსთავი 2&ldquo;-ის ყოფილი ფინანსური დირექტორი - ზ.ი.</p>\n<p>ხელშეკრულების თანახმად, &bdquo;სამაუწყებლო კომპანია რუსთავი 2&ldquo;-მა &bdquo;ინტერ მედია პლიუსს&ldquo; დაუთმო საკუთარი არხების (,,რუსთავი 2&ldquo;-ის, ,,ახალი არხის&ldquo; (იგივე ,,კომედი არხის&ldquo;) და ,,მარაოს&ldquo;) ეთერში კომერციული რეკლამის განთავსების უფლება.</p>\n<p>მხარეთა შეთანხმებით, კომერციული რეკლამის განთავსების უფლების დათმობისათვის ანაზღაურება, ყოველთვიურად, ,,ინტერ მედია პლიუსის&ldquo; მიერ ფაქტობრივად მოხმარებული კომერციული სარეკლამო დროის ოდენობის მიუხედავად, წინასწარ შეთანხმებული ოდენობით უნდა განხორციელებულიყო.</p>\n<p>ნიკა გვარამია მოქმედებდა რა შ.პ.ს. ,,სამაუწყებლო კომპანია რუსთავი 2&ldquo;-ის კანონიერი ინტერესების საწინააღმდეგოდ და მისი მეგობრების კუთვნილი კომპანიის - შ.პ.ს. ,,ინტერ მედია პლიუსისათვის&ldquo; გამორჩენის მისაღებად, ხელშეკრულებით განსაზღვრულ პერიოდში, კომერციული რეკლამის განთავსების უფლების დათმობისათვის ანაზღაურების შესახებ შ.პ.ს ,,ინტერ მედია პლიუსთან&ldquo; გაფორმებული ყოველთვიური შეთანხმებებით, განზრახ არ მოითხოვა ტელეკომპანიის კუთვნილი 6 763 510 ლარი, რითაც მის მეგობრებს მისცა შესაძლებლობა, შ.პ.ს. &bdquo;სამაუწყებლო კომპანია რუსთავი 2&ldquo;-ზე რეკლამის განთავსების სანაცვლოდ მიღებული დიდი ოდენობით თანხების აკუმულირება მოეხდინათ საკუთარი კომპანიის ანგარიშზე და არ გადაეხადათ ტელეკომპანიისთვის.</p>\n<p>შედეგად, 2015 წლის საანგარიშო პერიოდში შ.პ.ს. ,,სამაუწყებლო კომპანია რუსთავი 2&ldquo;-ის მიერ მიღებულმა დეკლარირებულმა ზარალმა 7 377 230 ლარი შეადგინა, ამავე პერიოდში, შ.პ.ს &ldquo;ინტერ მედია პლიუსის&rdquo; დეკლარირებულმა მოგებამ კი - 8 690 664 ლარი.</p>\n<p>ასევე, გაცნობებთ, რომ მიმდინარეობს აქტიური საგამოძიებო მოქმედებები ,,რუსთავი 2&ldquo;-ზე რეკლამის განსათავსებლად &bdquo;ინტერ მედია პლიუსის&ldquo; კონტრაქტორი კომპანიებიდან მიღებული დიდი ოდენობით თანხების ხარჯვის კანონიერების შესწავლის მიზნით.</p>\n<p>ამ ეტაპზე დადგენილია, რომ კომპანიამ 2016 წლის დეკემბრის ნასყიდობის ხელშეკრულებით, (შ.პ.ს ,,ინტერ მედია პლიუსს&ldquo; ამ ხელშეკრულების გაფორმებისას წარმოადგენდა რუსთავი 2-ის იურისტი დიმიტრი საძაგლიშვილი) საკუთრებაში მიიღო, ქ.თბილისში, ვაკის ერთ-ერთ პრესტიჟულ უბანში მდებარე 565 226 ლარის ღირებულების 2 საცხოვრებელი ბინა, საერთო ფართით, 240 კვ.მ. 2017 წლის მარტში, ორივე ბინა საკუთრებაში გადაეცა რუსთავის 2-ის იმდროინდელ გენერალურ დირექტორს ნიკა გვარამიას, რომელმაც იმავე წლის ივლისში და სექტემბერში საცხოვრებელი ბინების რეალიზაცია მოახდინა - საერთო ჯამში 602 521 ლარად.</p>\n<p>როგორც უკვე აღვნიშნეთ, გამოძიება ასევე აქტიურად სწავლობს &bdquo;ინტერ მედია პლიუსის&ldquo; და &bdquo;სამაუწყებლო კომპანია რუსთავი 2&ldquo;-ის სხვა კონტრაქტორი კომპანიების კუთვნილი დიდი ოდენობით თანხების ხარჯვის კანონიერებას, რის შესახებაც საზოგადოებას ეცნობება დამატებით.</p>\n<p>ნიკა გვარამია დღეს დაბარებულია საქართველოს გენერალურ პროკურატურაში ბრალდების შესახებ დადგენილების წარდგენის მიზნით. ბრალის წარდგენის შემდეგ საქართველოს გენერალური პროკურატურა სასამართლოს მიმართავს აღკვეთის ღონისძიების შეფარდების შუამდგომლობით&ldquo;, - განაცხადეს პროკურატურაში.</p>', '22', '', 'https://newsebi.ge/admin/uploads/1564125805_171110.jpg', '', '', 0, 'prokuraturamnikagvaramiasbralitsauyena', 1565347583, '', 235, '', ''),
(56, '', 'ნიკა გვარამიას პასუხი პროკურატურის განცხადებაზე', '<p>ნიკა გვარამიას ბრალი სისხლის სამართლის კოდექსის 220-ე მუხლით წაუყენეს, რაც საწარმოს ხელმძღვანელობითი&nbsp;და წარმომადგენლობითი&nbsp;უფლებამოსილების გამოყენებას, ამ ორგანიზაციის კანონიერი ინტერესების საწინააღმდეგოდ მოქმედებას გულისხმობს, რამაც მნიშვნელოვანი ზიანი გამოიწვია.&nbsp;</p>\n<p>ნიკა გვარამიამ საპასუხოდ ფეისბუქზე სტატუსი გამოაქვეყნა:</p>\n<p>&bdquo;აი მთლად ასეთ სამარცხვინობას ნამდვილად არ ველოდი.</p>\n<p>ვალის ხელშეკრულება მაქვს ინტერმედიასთან და ნატურით გადამიხადეს. სახლი გავყიდე და იქიდან აღებული ფული ვასესხე ინტერმედიას, ხელფასები რომ გაგვესტუმრებინა. ყველა დოკუმენტუა ინტერმედიაშიბდა ამოღებულია ეგ დოკუმენტები პროკურატურის მიერ. დაკითხვაზე მაინც გეკითხათ რამე ამ საკითხზე. თუ ბრალის საფუძველი იყო, საერთოდ როგორ არ გიხსენებიათ?</p>\n<p>ღიად და დაუფარავად: კურუფცია ის თემაა, რომელთან შედარებით, უმძიმესი დანაშაულები მემსუბუქება. ესაა<span class=\"text_exposed_show\">&nbsp;ჩემი წითეკი ხაზი და უკვე მეორეჯერ გადაკვეთა ივანიშვილმა.</span></p>\n<div class=\"text_exposed_show\">\n<p>ხოდა, ახლა ჩემ პასუხს დაელოდეთ. დედას მოგიტყნავ ბიძინა ივანიშვილი. ხო გაგაფარჩაკე 7 წელი, ახლა ბოლომდე მივიყვან და ზუსტად მე ჩავიბარებ შენ კაპიტულაცისდ. პირადად. გპირდები.&ldquo;</p>\n</div>', '22', '', 'https://newsebi.ge/admin/uploads/235069013.jpg', '', '', 0, 'nikagvaramiaspasukhiprokuraturisgankhadebaze', 1565347857, '', 190, '', ''),
(57, '', 'ქიბარ ხალვაში რუსთავი 2-ს ყიდის', '<p>ქიბარ ხალვაში ტელევიზიას ყიდის. მან ამის შესახებ განცხადება გაავრცელა. ქიბარ ხალვაში &bdquo;რუსთავი 2&ldquo;-ის 100%-ის მფლობელია.</p>\n<p>Newsebi.ge ამ განცხადებას უცვლელად გთავაზობთ:</p>\n<p>&bdquo;თითქმის ერთი თვე გავიდა, რაც მრავალწლიანი სასამართლო დავების შედეგად დავიბრუნე სამაუწყებლო კომპანია &bdquo;რუსთავი2&ldquo;.</p>\n<p>რა თქმა უნდა, თავიდანვე ვვარაუდობდი, რომ კომპანიის ყოფილი გენერალური დირექტორი, რომელსაც &bdquo;რუსთავი2&ldquo; მხოლოდ პოლიტიკური ბრძოლის ინსტრუმენტად მიაჩნდა, კეთილსინდისიერად არ მართავდა კომპანიას. მოულოდენელი მხოლოდ ის აღმოჩნდა, რომ, როგორც უკვე ნაწილობრივ გაირკვა, ის, პრაქტიკულად, ძარცვავდა მას.</p>\n<p>არაერთხელ მითქვამს, რომ სასამართლო დავის დაწყების მომენტიდან, &bdquo;რუსთავი2&ldquo;-ის ყოფილმა გენერალურმა დირექტორმა ყველა ხერხი გამოიყენა იმისათვის, რომ კომპანია დაეზარალებინა. ალბათ ყველას ახსოვს, რომ სწორედ ზარალის თავიდან აცილების მიზნით, 2015 წლის ნოემბერში ვითხოვდით კომპანიის დროებით მართვაში გადაცემას, თუმცა განვითარებული მოვლენებიც ალბათ ასევე ყველას გახსოვთ. სამწუხაროდ, დადგა ის შედეგი, რასაც ვვარაუდობდი.</p>\n<p>დღეს არხის ყოფილი გენერალური დირექტორი უკვე ღიად იმუქრება, რომ მის მიერ 7 წლის განმავლობაში &bdquo;ნალოლიავებ&ldquo; კომპანიას გაანადგურებს. არადა, ჩემთვის ცხადია, რომ დავის დაწყების პირველივე დღიდან, იგი სწორედ კომპანიის განადგურებით იყო დაკავებული და მუქარა, პრაქტიკულად, შესრულებული აქვს, - ჩემი სიტყვების გადამოწმება, ნებისმიერი დაინტერესებული ადამიანისათვის, ძალიან მარტივია.</p>\n<p>დღეს შემიძლია სრული პასუხისმგებლობით განვაცხადო, რომ სამაუწყებლო კომპანია რუსთავი2, ნიკა გვარამიას რამდენიმეწლიანი ზრუნვისა და ლოლიავის შედეგად, კატასტროფისწინა მდგომარეობაში აღმოჩნდა. მისი კრედიტორული დავალიანება 70.000.000 ლარს უახლოვდება, საიდანაც მხოლოდ სახელმწიფო ბიუჯეტის მიმართ დავალიანება 27.000.000 ლარს შეადგენს. რუსთავი 2-ს პრაქტიკულად ყველას ვალი აქვს - წყლის მომწოდებელი კომპანიიდან დაწყებული, ეგზიტპოლების ჩამტარებელი ამერიკული კომპანიით დამთავრებული. ვალის დიდი ნაწილი დაგროვილია ბოლო რამდენიმე წლის განმავლობაში, სწორედ იმ პერიოდში, რაც დავა დავიწყე და ცხადია, რომ ყველაფერი მიზანმიმართულად ხდებოდა. აქვე ვიტყვი, რომ აბსურდულია საუბრები, თითქოს ჩვენს მიერ მოთხოვილმა ყადაღას შეეძლო კომპანია დაეზარალებინა. დღემდე ვერ ვნახე რომელიმე ექსპერტული დასაბუთება ან დასკვნა, რაც ამ ზარალს დაადასტურებდა.</p>\n<p>ჩემთვის ცხადია და ნათელია ის სქემებიც, როგორ მუშაობდა კომპანია და სად და როგორ მიემართებოდა კომპანიის კუთვნილი თანხები, თუმცა ეს სხვა დავის საგანია და დარწმუნებული ვარ ამ დავაშიც გავიმარჯვებ.</p>\n<p>მანამდე კი, კომპანიაა გადასარჩენი, რომელიც გაკოტრების პირას არის მიყვანილი. დღეს ყველა ფაქტობრივი და სამართლებრივი საფუძველი არსებობის იმისათვის, რომ დაიწყოს კომპანიის გადახდისუუნარობის საქმის წარმოება. &bdquo;რუსთავი2&ldquo;-ის აქტივები, რომლითაც თურმე უსაფუძვლოდ გავმდიდრდი, იმ დავალიანების მესამედსაც კი არ შეადგენს, რაც გვარამიამ დაუტოვა კომპანიას.</p>\n<p>სამწუხაროდ, ჩემი ფინანსური შესაძლებლობები კომპანიის ღრმა კრიზისიდან გამოსაყვანად არ არის საკმარისი. ამიტომ, მსურს ღიად და საჯაროდ განვაცხადო, რომ მზად ვარ ვისაუბრო ნებისმიერ დაინტერესებულ პირთან, ვინც იყიდის რუსთავი 2-ს, დაეხმარება მას გამოვიდეს კრიზისიდან და გახდეს წარმატებული კომპანია. შესაბამისად მე, დავიბრუნებ იმ ზარალს, რომელიც მომადგა კომპანიის მიზანმიმართული გაკოტრების მცდელობამ.</p>\n<p>ერთადერთი, ვისათანაც არ ვაპირებ საუბარს, იქნება &bdquo;რუსთავი2&ldquo;-ის ყოფილი არაფორმალური მფლობელი და მმართველი მიხეილ სააკაშვილი.</p>\n<p>გადავწყვიტე, გავყიდო &bdquo;რუსთავი 2&ldquo; გამჭვირვალე კონკურსის წესით მასზე, ვინც ყველაზე მაღალ ფასს გადაიხდის. იმის გათვალისწინებით, რომ კომპანია მწვავე ფინანსური კრიზისის წინაშე დგას, კონკურსი უნდა დასრულდეს ერთი კვირის ვადაში.</p>\n<p>იმავდროულად, პოლიტიკური თუ სხვა ხასიათის მანიპულაციების თავიდან ასაცილებლად, ვისაუბრებ მხოლოდ იმ პირებთან, ვინც წარმოადგენს საკუთარ განზრახულობათა სერიოზულობის დასტურს, რაც შეიძლება იყოს საბანკო გარანტია ან სპეციალურ საკონკურსო ანგარიშზე არანაკლებ 1.000.000 აშშ დოლარის თანხის განთავსება.</p>\n<p>კონკურსში გამარჯვებულს, საგარანტიო თანხა ჩაეთვლება გადასახდელ ფასში, დამარცხებულს - ფული უკან დაუბრუნდება, ხოლო იმ შემთხვევაში, თუ გამარჯვებული დადგენილ ვადაში სრულად არ გადაიხდის კომპანიის საფასურს, საგარანტიო თანხას დაკარგავს.</p>\n<p>ყველა პირი, ვისაც სურვილი ექნება გამოეხმაუროს ჩემს წინადადებას, ვალდებული იქნება საჯაროდ გამოხატოს საკუთარი პოზიცია, რის შემდეგაც მზად ვიქნები განვიხილო შემოთავაზებები და სრულად გავაცნო კომპანიის ფინანსური მდგომარეობა.</p>\n<p>იმედი მაქვს, რომ &bdquo;რუსთავი2&ldquo; კვლავ წარმატებული კომპანია გახდება! მანამდე კი ვაგრძელებთ მუშაობას, რათა დავძლიოთ მიმდინარე პრობლმები და გადავწყვიტოთ პირველი რიგის ამოცანები.&ldquo;</p>', '22', '', 'https://newsebi.ge/admin/uploads/qibar-xalvashi.jpg', '', '', 0, 'qibarkhalvashirustaviwsyidis', 1565600503, '', 184, '', ''),
(58, '', 'კაცს, რომელიც ზღვაში ძაღლის გადასარჩენად შევიდა და დაიღუპა, ძეგლს დაუდგამენ', '<div class=\"itemIntroText\">\n<p>ქობულეთში, შტორმის დროს ზღვაში ძაღლების გადასარჩენად შესულ და დაღუპულ ავთანდილ ცხვედიანს ძეგლს დაუდგამენ.&nbsp;<a href=\"http://tv25.ge/news.php?lang=ge&amp;id=14854\" target=\"_blank\" rel=\"noopener noreferrer\">&bdquo;ტვ 25&ldquo;</a>-ის ინფორმაციით, ქობულეთის მუნიციპალიტეტის მერია მხარს უჭერს სოციალურ ქსელში ამ მოთხოვნით დაწყებულ კამპანიას.&nbsp;</p>\n<div class=\"fb-quote fb_iframe_widget\" data-href=\"http://www.tabula.ge/ge/story/154008-qobuletshi-zghvashi-dzaghlis-gadarchenis-dros-daghupul-kacs-dzegls-daudgamen\">&nbsp;</div>\n</div>\n<div class=\"itemFullText\">\n<p>&bdquo;არა მხოლოდ მივესალმებით, არამედ მზად ვართ ჩვენი მხრიდან მაქსიმალურად დავუდგეთ გვერდით ამ იდეის/სურვილის განხორციელებას. უკვე დავიწყეთ ამ საკითხზე მუშაობა და ვცდილობთ კომუნიკაცია დავამყაროთ უშუალოდ, როგორც პეტიციის ინიციატორთან, ასევე ძეგლის/მემორიალის მოქანდაკესთან. ჩვენი სურვილია აღნიშნული იდეა მივიყვანოთ ბოლომდე. გვინდა აღვნიშნოთ, რომ ფაქტი არის ძალიან მნიშვნელოვანი და ასეთი ჰუმანური შემთხვევები არ რჩება დაუფასებელი&ldquo;, &ndash; განაცხადეს ქობულეთის მერიაში.</p>\n<p>ქობულეთის მერმა, მირიან ქათამაძემ &bdquo;რეგინფოს&ldquo; დაუდასტურა, რომ ამ იდეის განხორციელებას ბოლომდე მიჰყვებიან.</p>\n<p>51 წლის ავთანდილ ცხვედიანი ზღვაში 5 აგვისტოს დაიხრჩო. მისი მეგობრების ინფორმაციით, შტორმის დროს მან ერთი ძაღლის გადარჩენა მოასწრო, მეორესთან ერთად კი დაიღუპა.</p>\n<p>წყარო&nbsp;<em><span class=\"nanospell-typo\"><a href=\"https://reginfo.ge/people/item/16098-kazs,-romeliz-qobuletshi,-zgvashi-waglebis-gadasarchenad-shevida-da-daigupa,-wegls-daudgamen?fbclid=IwAR3L1571JgbhF2u4pdl99phq0SCnxo1_pM-9xXfbYBGBUuxnee4EXHTNm7Q\" target=\"_blank\">რეგინფო</a>.</span></em></p>\n</div>', '22', '', 'https://newsebi.ge/admin/uploads/c0031d0e8a9008a744d70c4329f8c45e_XL.jpg', '', '', 0, 'kasromelizghvashidzaghlisgadasarchenadshevidadadaighupadzeglsdaudgamen', 1565695464, '', 236, '', ''),
(59, '', 'თბილისში 17 წლის ბიჭი დაჭრეს. მიზეზი სავარაუდოდ ძაღლების ჩხუბია', '<p>9 აგვისტოს 17 წლის ბიჭი ძაღლს ასეირნებდა. სეირნობისას ძაღლმა სხვა ძაღლს უკბინა, რომლის პატრონი 37 წლის კაცი იყო. ამ შემთხვევას მოჰყვა შელაპარაკება.</p>\n<p><a href=\"https://www.interpressnews.ge/ka/article/559956-17-clis-bichi-romelic-tbilisshi-zaglebis-chxubis-gamo-dachres-komatozur-mdgomareobashia\">სააგენტო &ldquo;ინტერპრესნიუსი&rdquo;</a>&nbsp;და ტელეკომპანია &ldquo;იმედის&rdquo; ცნობით, შელაპარაკების შემდეგ არასრულწლოვანი თავის ძმასთან ერთად კვლავ დაბრუნდა ადგილზე დაკარგული ჯვრის საპოვნელად, რა დროსაც კაცმა მას თავის არეში,&nbsp;ცეცხლსასროლი იარაღით, რამდენიმე ჭრილობა მიაყენა.</p>\n<p>ჩიქობავას ქუჩაზე მომხდარი ინციდენტისას მსუბუქი დაზიანებები დაჭრილის ძმამაც მიიღო.</p>\n<p>დაჭრილი მოზარდი თავდაპირველად ალადაშვილის კლინიკაში მოათავსეს, თუმცა შემდგომ ღუდუშაურის კლინიკაში გადაიყვანეს. დაწესებულების დირექტორის მოადგილის, მარინა გელანტიას თანახმად, ის ამ დრომდე მძიმე მდგომარეობაშია და რეანიმაციულ განყოფილებაში რჩება.</p>\n<p>შინაგან საქმეთა სამინისტრომ თბილისში დააკავა კაცი, რომელმაც არასრულწლოვანი ბიჭი, სავარაუდოდ, ძაღლების ჩხუბის გამო დაჭრა.</p>\n<p>შინაგან საქმეთა სამინისტროში ინციდენტს ადასტურებენ, თუმცა მომხდარის დეტალებსა არ საუბრობენ. უწყების ცნობით, განზრახ მკვლელობის მცდელობის ბრალდებით პოლიციამ 1982 წელს დაბადებული კაცი დააკავა. ბრალის დამტკიცების შემთხვევაში მას 7-დან 15 წლამდე პატიმრობა ემუქრება.</p>', '22', '', 'https://newsebi.ge/admin/uploads/dont-cross.jpg', '', '', 0, 'tbilisshijtslisbichidachresmizezisavaraudoddzaghlebischkhubia', 1565698547, '', 188, '', ''),
(60, '', 'ბორჯომში ბიუჯეტიდან დაფინანსებულ კონცერტში მონაწილეობას ნინი ქარსელაძე და მარიკა თხელიძე მიიღებენ', '<div class=\"global-text-content article-body\">\n<p>ნინი ქარსელაძე და მარიკა თხელიძე ბორჯომში ბიუჯეტიდან დაფინანსებულ კონცერტზე იმღერებენ. როგორც ვიცით, ისინი სახელისუფლებო პარტიის მხარდამჭერები არიან. მათ გარდა, \"ბორჯომობა 2019-ზე\", რომელიც 17 აგვისტოს გაიმართება, მონაწილეობას მიიღებენ გიგი ადამაშვილი, დათო გომართელი და ზვიად ბოლქვაძე. მათთვის ჰონორარის სახით, ჯამში, 14 350 ლარია გათვალისწინებული.</p>\n<p>On.ge-სთან საუბრისას ბორჯომის მერმა, ლევან ლიპარტიამ განაცხადა, რომ \"ბორჯომობის\" კონცერტზე გამომსვლელი მომღერლები მას და ბორჯომელებს მოსწონთ:</p>\n<p>\"ყველას მოსწონს, ვისთანაც იყო საუბარი... [გამოკითხვა] ბორჯომში ჩავატარეთ. ჩვენმა თანამშრომლებმა [ჩაატარეს]\",&nbsp;ის ამბობს, რომ \"არაფერ შუაშია\" ხელისუფლების მიმართ მარიკა თხელიძისა და ნინი ქარსელაძის სიმპათია \"ბორჯომობაზე\" მათ მიპატიჟებაზე.</p>\n<p class=\"last-element\">&nbsp;</p>\n</div>\n<footer class=\"article-footer article-body-mirror\"></footer><footer class=\"article-footer article-body-mirror\"></footer><footer class=\"article-footer article-body-mirror\">წყარო On.ge</footer>', '22', '', 'https://newsebi.ge/admin/uploads/%E1%83%A5%E1%83%90%E1%83%A0%E1%83%A1%E1%83%94%E1%83%9A%E1%83%90%E1%83%AB%E1%83%94-678x335.jpg', '', '', 0, 'borjomshibiujetidandafinansebulkonertshimonatsileobasniniqarseladzedamarikatkhelidzemiigheben', 1565703670, '', 220, '', ''),
(61, '', 'შსს-მ 1002 აბი სუბოტექსი და 293 აბი MDMA ამოიღო', '<p>შინაგან საქმეთა სამინისტროს საგანგებო ბრიფინგზე განაცხადეს, რომ ამოღებულია განსაკუთრებით დიდი ოდენობის &ndash; 1002 აბი ნარკოტიკული საშუალება სუბოტექსი. ასევე 164 ნატეხი და დაფხვნილი ნარკოტიკი, ამ დანაშაულში ბრალდებულ პირს 8-დან 20-წლამდე პატიმრობა ემუქრება. დაკავებულია&nbsp; ერთი პირი&nbsp;ნარკოტიკული საშუალების უკანონო შეძენა-შენახვის ბრალდებით.&nbsp;სამართალდამცველებმა ბრალდებული&nbsp;თბილისი-სენაკი-ლესელიძის საავტომობილო გზაზე დააკავეს და ავტომობილის ჩხრეკისას ნივთმტკიცებად ამოიღეს&nbsp;&bdquo;ბუპრენორფინის\" შემცველი ნარკოტიკული საშუალება \"სუბუტექსის\" 1002 აბი, 164 ნატეხი და დაფხვნილი ნარკოტიკი, რომლებზეც დანიშნულია შესაბამისი ექსპერტიზები.</p>\n<p>სამართალდამცველებმა ნარკოდანაშაულისთვის&nbsp;თბილისი-სენაკი-ლესელიძის საავტომობილო გზაზე დააკავეს კიდევ ერთი პირი. ჩხრეკისას ამოიღეს&nbsp;&bdquo;MDMA\"-ს შემცველი 293 აბი. შსს-ს ინფორმაციით ასევე დააკავეს&nbsp;წარსულში მრავალჯერ ნასამართლევი 2 ნარკორეალიზატორი. გამოძიების საფუძველზე დადგინდა, რომ&nbsp;ბრალდებულები ნარკოტიკებს სისტემატურად ყიდდნენ.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '24', '', 'https://newsebi.ge/admin/uploads/%E1%83%A1%E1%83%A3%E1%83%91%E1%83%9D.jpg', '', '', 0, 'shssmjccwabisuboteqsidawxabiamoigho', 1565773624, '', 201, '', ''),
(62, '', 'ოკუპანტმა რუსმა სამხედროებმა გუგუტიანთკარში მავთულხლართების გაბმა განაგრძეს', '<p>ოკუპანტებმა&nbsp;სოფელ&nbsp;<span class=\"nanospell-typo\">გუგუტიანთკარში</span>&nbsp;მავთულხლართების მონტაჟი განაახლეს. ამ ინფორმაციას&nbsp;სახელმწიფო უსაფრთხოების სამსახური&nbsp;ადასტურებს.</p>\n<p>სუს-ში აცხადებენ:</p>\n<p>\"ჩვენი შეფასებით, ეს არის მორიგი უკანონო და უკიდურესად დესტრუქციული ქმედება. ცენტრალური ხელისუფლების მიერ, ერგნეთში, ინციდენტების პრევენციის და მათზე რეაგირების მექანიზმის შეხვედრაზე აღნიშნული საკითხი მწვავედ იქნება დაყენებული\".</p>\n<p>ამავე სოფელში მავთულხლართების გაბმა 7 აგვისტოსაც დაიწყეს, თუმცა იმავე საღამოს სამუშაოები შეჩერდა.</p>', '22', '', 'https://newsebi.ge/admin/uploads/mavt.jpg', '', '', 0, 'okupantmarusmasamkhedroebmagugutiantkarshimavtulkhlartebisgabmaganagrdzes', 1565775891, '', 190, '', ''),
(63, '', '[VIDEO] დიმიტრი ცინცაძის ოსკარზე წარდგენილი ფილმის „შინდისი“ თრეილერი', '<p>2008 წლის 11 აგვისტოს სოფელ შინდისთან რუსეთის სამხედრო ნაწილთან უთანასწორო ბრძოლაში გმირულად დაეცა მეორე ქვეითი ბრიგადის ოცეულის 17 ქართველი ჯარისკაცი.</p>\n<p>ფილმის ოსკარზე წარდგენის გადაწყვეტილება 12-კაციანმა კომისიამ მიიღო ფარული კენჭისყრის საფუძველზე. კომისიაში შედიოდნენ როოგრც კინოკრიტიკოსები, ისე რეჟისორები, მსახიობები, პროდიუსერები.</p>\n<p>წარმოგიდგენთ&nbsp;დიმიტრი ცინცაძის ფილმის \"შინდისი\" თრეილერს</p>\n<p><a href=\"https://www.facebook.com/GeorgianNationalFilmCenter/videos/2492612837637799/\">https://www.facebook.com/GeorgianNationalFilmCenter/videos/2492612837637799/</a></p>', '26', '', 'https://newsebi.ge/admin/uploads/%E1%83%A8%E1%83%98%E1%83%9C%E1%83%93%E1%83%98%E1%83%A1%E1%83%98.jpg', '', '', 0, 'dimitriinadzisoskarzetsardgenilifilmisshindisitreileri', 1565784831, '', 245, '', ''),
(65, '', '„იმედის“ ჟურნალისტთა ნაწილი ემიჯნება 2008 წლის ომზე გადაღებული ფილმის „მთავარ ხაზს“', '<p>ჟურნალისტები თავიანთ პროტესტს FACEBOOK-ის მეშვეობით გამოთქვამენ.</p>\n<p>ნანა ლეჟავა წერს:&nbsp;</p>\n<p>&bdquo;არ ვარ \"ქრონიკაში\", მაგრამ ვარ \"იმედში\"!!! არ ვიზიარებ რუსეთ-საქართველოს ომის შესახებ მომზადებული მასალის ერთ-ერთ მთავარ ხაზს. მიუღებელია რუსეთის ჯარის საქართველოში იძულებით შემოჭრის თაობაზე გამოთქმული ვერსია და ამას წლების განმავლობაში ომის თემაზე ჩვენ მიერ მომზადებული რეპორტაჟები ადასტურებს!<a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%A0%E1%83%A3%E1%83%A1%E1%83%94%E1%83%97%E1%83%98%E1%83%9D%E1%83%99%E1%83%A3%E1%83%9E%E1%83%90%E1%83%9C%E1%83%A2%E1%83%98%E1%83%90?source=embed&amp;epa=HASHTAG\" target=\"_blank\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">რუსეთიოკუპანტია</span></span></a>!&nbsp;<span class=\"_5afx\"><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%A5%E1%83%98%E1%83%9B%E1%83%94%E1%83%93%E1%83%98%E1%83%90?source=embed&amp;epa=HASHTAG\" target=\"_blank\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">აქიმედია</span></a>&ldquo;.</span></p>\n<p><span class=\"_5afx\">ლევან კვატაშიძე ასეთ პოსტს აქვეყნებს:</span></p>\n<p><span class=\"_5afx\">&bdquo;არ ვიზიარებ რუსეთ-საქართველოს ომის შესახებ მომზადებული მასალის ერთ-ერთ მთავარ ხაზს. მიუღებელია რუსეთის ჯარის საქართველოში იძულებით შემოჭრის თაობაზე გამოთქმული ვერსია და ამას წლების განმავლობაში ომის თემაზე ჩვენ მიერ მომზადებული რეპორტაჟები ადასტურებს!&ldquo;</span></p>\n<p><span class=\"_5afx\">ნანუკა ქაჩაია წერს:</span></p>\n<p><span class=\"_5afx\">&bdquo;</span>არ ვიზიარებ რუსეთ-საქართველოს ომის შესახებ მომზადებული მასალის ერთ-ერთ მთავარ ხაზს. მიუღებელია რუსეთის ჯარის საქართველოში იძულებით შემოჭრის თაობაზე გამოთქმული ვერსია და ამას წლების განმავლობაში ომის თემაზე ჩვენ მიერ მომზადებული რეპორტაჟები ადასტურებს!</p>\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%A5%E1%83%A0%E1%83%9D%E1%83%9C%E1%83%98%E1%83%99%E1%83%90?source=embed&amp;epa=HASHTAG\" target=\"_blank\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ქრონიკა</span></span></a><br /><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%A0%E1%83%A3%E1%83%A1%E1%83%94%E1%83%97%E1%83%98%E1%83%9B%E1%83%A2%E1%83%94%E1%83%A0%E1%83%98%E1%83%90?source=embed&amp;epa=HASHTAG\" target=\"_blank\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">რუსეთიმტერია</span></span></a><span class=\"_5afx\">&ldquo;</span></p>\n<p>საუბარია ფილმზე, რომელიც &ldquo;იმედის&rdquo; ეთერში 11 აგვისტოს გავიდა, სახელწოდებით &ldquo;ჩვენ მშვიდობით მოვიგებთ სხვის დაწყებულ ომს&rdquo;. ფილმში 2008 წლის აგვისტოში განვითარებულ მოვლენებში ყოფილი ხელისუფლების პასუხისმგენლობაზეა საუბარი და ნათქვამია, რომ &ldquo;ნაციონალურმა მოძრაობამ&rdquo; ომის შედეგად &ldquo;ლეგიტიმაციის საჭირო ხარისხი მოიპოვა&rdquo;.</p>\n<p>&nbsp;</p>', '22', '', 'https://newsebi.ge/admin/uploads/F81D8BFF-17DC-4EB3-A90D-D8E2D8105533_w650_r1_s.jpg', '', '', 0, 'imediszhurnalisttanatsiliemijnebawcctslisomzegadaghebulifilmismtavarkhazs', 1565862714, '', 190, '', ''),
(66, '', 'დეკანოზ გიორგი მამალაძის ოჯახი პრეზიდენტს მის შეწყალებას სთხოვს - ჯანმრთელობის მდგომარეობა უკიდურესად დამძიმდა', '<p>&bdquo;მოთხოვნის განახლების აუცილებლობა გამოიწვია იმან, რომ დეკანოზის ჯანმრთელობის მდგომარეობა კვლავ უკიდურესად მძიმეა\" - ამბობს ადვოკატი გიორგი ფანცულაია.</p>\n<p>დეკანოზ გიორგი მამალაძის ოჯახი პრეზიდენტს მის შეწყალებას სთხოვს. ადვოკატებმა პრეზიდენტის ადმინისტრაციაში მიმართვა უკვე შეიტანეს. მათი თქმით, დეკანოზი უკვე 6 თვეა, მარჯვენა კიდურებს ვერ ამოძრავებს და დამოუკიდებლად ვერ გადაადგილდება.</p>', '22', '', 'https://newsebi.ge/admin/uploads/cms-image-000039932-e1492014885594.png', '', '', 0, 'dekanozgiorgimamaladzisojakhiprezidentsmisshetsyalebasstkhovsjanmrtelobismdgomareobaukiduresaddamdzimda', 1565944688, '', 183, '', ''),
(67, '', 'გურიაში თხილის ბაღში დატოვებული ბავშვი იპოვეს', '<p>გურიაში, კერძოდ ოზურგეთში, თხილის ბაღში ახალშობილი იპოვეს. ამის შესახებ ინფორმაციას შსს ავრცელებს.</p>\n<p>სავარაუდოდ დედამ იქვე იმშობიარა და ახალშობილი დატოვა. ახალშობილი მას შემდეგ იპოვეს, რაც დედა ჯანმრთელობის გაუარესების გამო კლინიკაში მოხვდა.</p>\n<div class=\"fb-quote fb_iframe_widget\" data-href=\"http://www.tabula.ge/ge/story/154133-ozurgetshi-txilis-baghshi-mitovebuli-axalshobili-ipoves\">&nbsp;</div>\n<p>შინაგან საქმეთა სამინისტრო ამის შესახებ განცხადებას ავრცელებს - &bdquo;მიმდინარე წლის 16 აგვისტოს, გამთენიისას, შინაგან საქმეთა სამინისტროს გურიის პოლიციის დეპარტამენტში ოზურგეთის საავადმყოფოდან შევიდა შეტყობინება, რომ სამედიცინო დაწესებულებაში მიიყვანეს მშობიარობის შემდგომი გართულებებით ახალგაზრდა ქალი, რომელსაც ჩვილი თან არ ჰყავდა.&nbsp;ოზურგეთის რაიონული სამმართველოს თანამშრომლებმა ოპერატიულად დაადგინეს ახალგაზრდა ქალის საცხოვრებელი ადგილი და დაუყოვნებლივ გავიდნენ აღნიშნულ მისამართზე. ადგილზე მისულმა სამართალდამცველებმა ჩვილი თხილის ბაღში მიტოვებული იპოვეს. ახალშობილი სიცოცხლისთვის საფრთხის შემცველ მდგომარეობაში იმყოფებოდა, ამიტომ პოლიციელებმა სასწრაფო დახმარების ბრიგადა ადგილზე გამოიძახეს. ვიდრე მედიკოსები აგდილზე მივიდოდნენ სამართალდამცველებმა თავად აღმოუჩინეს პირველადი დახმარება&ldquo;.</p>\n<p>სასწრაფო დახმარების ბრიგადამ&nbsp;ახალშობილი საავადმყოფოში გადაიყვანა.&nbsp;ამდროისთვის მის სიცოცხლეს საფრთხე არ ემუქრება.</p>\n<p>მომხდარ ფაქტთან დაკავშირებით გამოძიება სსკ-ის 19-112- ე მუხლით მიმდინარეობს, რაც დედის მიერ ახალშობილის განზრახ მკვლელობის მცდელობას გულისხმობს.</p>', '22', '', 'https://newsebi.ge/admin/uploads/dont-cross.jpg', '', '', 0, 'guriashitkhilisbaghshidatovebulibavshviipoves', 1565946468, '', 414, '', ''),
(68, '', 'მამუკა ხაზარაძე იმ ადამიანებს სახლებს დაჰპირდა, რომელთა სახლიც საოკუპაციო ხაზს მიღმა მოექცევა', '<p>მამუკა ხაზარაძე უგუტიანთკარელ გივი რაზმაძის ოჯახს დახმარებას შეჰპირდა. ბოლო დღეებში რუსი სამხედროების მიერ მავთულხართების მონტაჟის გამო რაზმაძის სახლი მავთულხართებს მიღმა მოექცა.</p>\n<p>მამუკა ხაზარაძემ ამის შესახებ განცხადება გააკეთა:</p>\n<p>&bdquo;რუსული მცოცავი ოკუპაცია ყოველდღიურად გვართმევს სამშობლოს ნაწილს. ეს არის ბრძოლა ყოველი გოჯი ქართული მიწისთვის, ამ ომს თავისი გმირები ჰყავს &ndash; იქ მცხოვრები ადამიანები, რომლებიც შიშველი ხელებით ცდილობენ საკუთარი ოჯახების და ქართული მიწის დაცვას.</p>\n<p>დღეს მათ სახლი წაართვეს, რომელიც უკვე ოკუპირებულ 20% -ს მიემატა.&nbsp;ამ ოჯახებმა ისევ უნდა იცხოვრონ თავიანთ მიწაზე, სადაც ახლა მავთულხლართებს ავლებენ რუსი ჯარისკაცები.&nbsp;ჩვენი მოვალეობაა მათთან ერთად ვიდგეთ. ამიტომ გეგუტიანთკარში გივი რაზმაძის ოჯახს უახლოეს ერთ თვეში ახალი სახლი ექნება. აქვე მინდა ვთხოვო ქართულ ბიზნესს &ndash; დაეხმარონ იქ მცხოვრებ ადამიანებს&ldquo;.</p>', '22', '', 'https://newsebi.ge/admin/uploads/%E1%83%9B%E1%83%90%E1%83%9B%E1%83%A3%E1%83%99%E1%83%90%20%E1%83%AE%E1%83%90%E1%83%96%E1%83%90.png', '', '', 0, 'mamukakhazaradzeimadamianebssakhlebsdahpirdaromeltasakhlisaokupaiokhazsmighmamoeqeva', 1565948386, '', 200, '', ''),
(71, '', 'რუსი ოკუპანტები გუგუტიანთკარში დღეს კვლავ გამოჩნდნენ', '<p>საოკუპაციო ძალების წარმომადგენლებმა&nbsp;რკინის ბოძები სატვირთო მანქანებით მიიტანეს.&nbsp;</p>\n<p>მავთულხლართების გაბმის პროცესი&nbsp;3 დღის განმავლობაში შეჩერებული იყო.&nbsp;გორის მუნიციპალიტეტის სოფელ&nbsp;გუგუტიანთკარში&nbsp;ოკუპანტებმა რამდენიმე დღის წინ საოკუპაციო ხაზი&nbsp;გადმოწიეს, რის&nbsp;შედეგადად, ორი ოჯახის&nbsp;რაზმაძეებისა&nbsp;და&nbsp;გუგუტიშვილების&nbsp;სახლები ოკუპირებულ ტერიტორიაზე მოხვდა. საოკუპაციო ძალებმა სოფელში მავთულხლართებისა და&nbsp;ძელების&nbsp;მონტაჟი აგვისტოს ომიდან მე-11 წლისთავზე, 7 აგვისტოს დაიწყეს.</p>\n<p>ოკუპანტებმა ბოლო დღეების განმავლობაში საოკუაციო ხაზის მიმდებარე სოფლებიდან საქართველოს 8 მოქალაქე გაიტაცეს და ცხინვალის იზოლატორში გადაიყვანეს.&nbsp;</p>\n<p>წყარო Tabula.ge</p>', '22', '', 'https://newsebi.ge/admin/uploads/gugut.jpg', '', '', 0, 'rusiokupantebigugutiantkarshidgheskvlavgamochndnen', 1566208646, '', 246, '', ''),
(74, '', 'პრეზიდენტის მრჩევლად КГБ-ის ყოფილი ოფიცერი დაინიშნა – “რუსთავი 2”', '<p>&ldquo;რუსთავი 2&rdquo;-ის ინფორმაციით, საქართველოს პრეზიდენტის მრჩევლად თავდაცვისა და უშიშროების საკითხებში КГБ-ის ყოფილი ოფიცერი დიმიტრი ლეჟავა დაინიშნა.</p>\n<p>ეროვნული ბიბლიოთეკის არქივში დაცული ინფორმაციით,&nbsp;დიმიტრი ლეჟავა არის ბრიგადის გენერალი. იგი 1983-1994 წლებში მუშაობდა საქართველოს სახელმწიფო უშიშროების ორგანოებში, 1994-96 წლებში &ndash; სახელმწიფო დაცვის სპეცსამსახურში, 1996-98 წლებში &ndash; ეროვნული უშიშროების საბჭოს აპარატში (1996-1998). ასევე, იყო საქართველოს თავდაცვის სამინისტროს კადრების მთავარი სამმართველოს უფროსი.</p>\n<p>საქართველოს პრეზიდენტის ადმინისტრაციაში ჯერჯერობით არ აკეთებენ კომენტარს დიმიტრი ლეჟავას დანიშვნის შესახებ.</p>\n<p>&ldquo;დღეს არის სამშაბათი, პრესპიკერის ბრიფინგის დღე. პრესსპიკერი არის შვებულებაში და დაგროვილ კითხვებზე განცხადება დღეს დღის ბოლომდე გავრცელდება&rdquo;, &ndash; უთხრეს &ldquo;ნეტგაზეთს&rdquo; პრეზიდენტის ადმინისტრაციაში.</p>\n<p>პრეზიდენტის ოფიციალურ ვებ-გვერდზე არ არის ასახული ინფორმაცია დიმიტრი ლეჟავას შესახებ, თუმცა პრეზიდენტის მრჩევლის სტატუსით წარსდგა ის 16 აგვისტოს თავდაცვის აკადემიაში, სადაც&nbsp;93-მა ლეიტენანტმა საზეიმო ვითარებაში ფიცი დადო. ღონისძიებაზე საქართველოს პრეზიდენტის მრჩეველმა<span class=\"text_exposed_show\">&nbsp;თავდაცვისა და უსაფრთხოების საკითხებში დიმიტრი ლეჟავამ ქვეყნის პრეზიდენტის მილოცვის ტექსტი წაიკითხა.</span></p>\n<p>უშიშროების საბჭოს მდივნის ყოფილი მოადგილე თეონა აქუბარდია მიიჩნევს, რომ დიმიტრი ლეჟავას დანიშვნა&nbsp; კითხვის ნიშნებს აჩენს, ერთი მხრივ, მისი კომპეტენციის და მეორე მხრივ, წარსული საქმიანობის გამო.</p>\n<p>&ldquo;ბატონ ლეჟავას წარსული, რომელიც იძებნება ინტერნეტში, დაკავშირებულია საბჭოთა უშიშროების სამსახურებთან. მიუხედავად იმისა, რომ საქართველოში ლუსტრაციის კანონი არ არის და ჩვენ ასე გაცხადებულად არ გვაქვს გამოქვეყნებული სია, ვინ მუშაობდა რუსულ სპეცსამსახურებთან იმ პერიოდში, მოგეხსენებათ, საბჭოთა პერიოდში უშიშროების სამსახურების სპეციფიკა იყო იმგვარი, რომ მათ, რა თქმა უნდა, თანამშრომლობა ჰქონდათ&nbsp; КГБ-ის მოსკოვის სპეცსამსახურებთან. ამიტომ,&nbsp; ეს დანიშვნა მინიმუმ კითხვის ნიშნის შემცველია. მე კითხვის ნიშნის ქვეშ დავაყენებდი მისი კომპეტენციის საკითხსაც. ბოლოს საჯარო უწყებაში ლეჟავა მუშაობდა 2003 წლამდე, თავდაცვის სამინისტრო კადრების უფროსი იყო. რამდენად იცნობს ის თავდაცვისა და უსაფრთხოების დასავლურ&nbsp; სტანდარტებს, რამდენად არის ინფორმირებული იმ რეფორმებზე, რასაც თავდაცვის უწყება ახორციელებს ნატო-ში გაწევრების კუთხით, რა განათლება და კვალიფიკაცია აქვს, ესეც კითხვის ნიშნის გვეშ დგას&rdquo;, &ndash; განუცხადა &ldquo;ნეტგაზეთს&rdquo; აქუბარდიამ.</p>\n<p>თეონა აქუბარდია ყურადღებას ამახვილებს იმ ფაქტზეც, რომ სავარაუდოდ, სწორედ დიმიტრი ლეჟავა იქნება პრეზიდენტის წარმომადგენელი ეროვნული უსაფრთხოების საბჭოში, ექნება დაშვება საიდუმლო ინფორმაციაზე და იქნება პრეზიდენტის ადმინისტრაციის შუამავალი რგოლი როგორც თავდაცვის სამინისტროსთან, ისე ეროვნული უსაფრთხოების საბჭოსთან კოორდინაციაში.</p>\n<p>&ldquo;როცა მოხდა შეთანხმება პრეზიდენტსა და მთავრობას შორის ეროვნული უსაფრთხოების საბჭოსთან დაკავშირებთ, გაკეთდა დათქმა, რომ პრეზინეტს ეყოლებოდა საბჭოში&nbsp; წარმომადგენელი. წესით, მრჩეველი თავდაცვისა და უსაფრთხოების საკითხებში იქნება საბჭოში წარმოდგენილი, ვინაიდან ადმინისტრაციაში ის არის ყველაზე კომპეტენტური ამ საკითხში მას შემდეგ, რაც ეროვნული უშიშროების საბჭო აღარ არის პრეზიდენტის დაქვემდებარებაში&rdquo;, &ndash; განაცხადა აქუბარდიამ.</p>', '26', '', 'https://newsebi.ge/admin/uploads/%E1%83%93%E1%83%98%E1%83%9B%E1%83%98%E1%83%A2%E1%83%A0%E1%83%98-%E1%83%9A%E1%83%94%E1%83%9F%E1%83%90%E1%83%95%E1%83%90.jpg', '', '', 0, 'prezidentismrchevladisyofiliofieridainishnarustaviw', 1566299469, '', 212, '', ''),
(77, '', 'ამაზონი ტყე იწვის - 2500 აქტიური ცეცხლის კერა ბრაზილიაში', '<p>&nbsp;</p>\n<p>ამაზონის ტყეში 2500-ზე მეტი აქტიური ცეცხლის კერაა. ცეცხლის ბრაზილიის ტერიტორიაზე მძვინვარებს და მისი ჩაქრობა ვერ ხერხდება. ხანძრის პროცესს აკვირდებიან კოსმოსიდან, საიდანაც იგზავნება სურათები, რომელში კარგად ჩანს ხანძრის მასშტაბები, რაც გლობალური დათბობის ფონზე კიდევ უფრო დიდ ზიანს აყენებს დედამიწის ეკოსისტემას.</p>', '22', '', 'https://newsebi.ge/admin/uploads/forest-fire.jpg', '', '', 0, 'amazoni-tye-itsvis---2500-aqtiuri-ekhlis-kera-braziliashi', 1567415010, '', 218, '', ''),
(78, '', 'სასწრაფოდ: მამუკა ბახტაძე გადადგა', '<p>მამუკა ბახტაძემ დღეს განაცხადა, რომ იგი ტოვებს პრემიერის თანამდებობდას და რომ დეტალურ ინფორმაციას გადადგომის მიზეზის შესახებ ჟურნალისტებთან გადაცემებში განმარტავს დღის განმავლობაში.</p>\n<p>პრემიერის თანამდებობას გახარია დაიკავებს, ხოლო შინაგან საქმეთა მინისტრი ღარიბაშვილი იქნება.</p>', '19', '', 'https://newsebi.ge/media/pjimage.png', '', '', 0, 'sastsrafod-mamuka-bakhtadze-gadadga', 1567416681, '', 262, '', ''),
(80, '', 'სასწრაფოდ: გახარია პრემიერ-მინისტრია', '<p>დღეს ბიძინა ივანიშვილმა განაცხადა, რომ პრემიერ-მინისტრი გიორგი გახარია იქნება, რომელიც აქამდე შინაგან საქმეთა მინისტრის პოსტს იკავებდა.</p>', '19', '', 'https://newsebi.ge/media/gaxa.jpg', '', '', 0, 'sastsrafod-gakharia-premier-ministria', 1567498263, '', 378, '', '');
INSERT INTO `trainings` (`id`, `source`, `title`, `text`, `category`, `scraped_at`, `img`, `origin_date`, `tags`, `comments_number`, `slug`, `date`, `origin_url`, `views`, `keywords`, `description`) VALUES
(81, '', 'ამას არავინ ელოდა ვრცელდება შემაშფოთებელი ინფორმაცია სამცხე-ჯავახეთის სომხები „დამოუკიდებლობას“ მოითხოვენ საქართველოს ნატოში გაწევრიანების შემთხვევაში', '<p><span style=\"font-size: 12pt;\">საფრთხე მკვეთრად იზრდება. იქამდე, რომ სამცხე-ჯავახეთის სომხები საქართველოს ნატოში გაწევრიანების შემთხვევაში &bdquo;დამოუკიდებლობას&ldquo; მოითხოვენ.&bdquo;შ.ტოროსიანი: იმ შემთხვევაში, თუ საქართველო NATO&ndash;ში გაწევრიანდება, სავსებით მოსალოდნელია, რომ ჯავახეთში თურქული ჯარი დააყენონ.&nbsp;ჯავახკში სომხური თემის აჯანყება გარდაუვალია&ldquo;, &ndash; წერს&nbsp;&nbsp;&bdquo;საქართველო NATO-ს წევრი იმ შემთხვევაში გახდება, თუ ჯავახეთს სომხებს დაუთმობს&ldquo; &ndash; ასეთი ინფორმაცია ცოტა ხნის წინ გამოქვეყნდა რამდენიმე ქართულ მედიაში, კერძოდ საიტზე&nbsp;</span><br /><span style=\"font-size: 12pt;\">&bdquo;იმ ფონზე, რომ ამა წლის სექტემბერში საქართველომ შესაძლოა, NATO&ndash;ში გაწევრიანების სამოქმედო გეგმა მიიღოს, სომეხ ექსპერტთა წრეებში ჯავახეთის სომხური სათვისტომოს პოზიციებზე საუბრობენ და აცხადებენ, რომ ყირიმის რუსეთთან მიერთების მაგალითზე ჯავახეთის სომხურმა დიასპორამ შესაძლოა, დამოუკიდებლობა მოითხოვოს&ldquo;, &ndash; წერს გამოცემა.</span><br /><span style=\"font-size: 12pt;\">გასაგებია, რომ ამ &bdquo;დამოუკიდებლობის&ldquo; შემდეგ, ყირიმის მსგავსად, მოითხოვენ სამცხე-ჯავახეთის შესვლას სომხეთში. ოღონდ უკვე არა &bdquo;ყირიმის&ldquo; მიხედვით, არამედ &bdquo;ყარაბაღის სცენარის&ldquo; მიხედვით. ანუ საქართველოს წინააღმდეგ სამხედრო აგრესიით, გენოციდით და ეთნიკური წმენდით ქართული და სხვა არა სომეხი მოსახლეობის წინააღმდეგ.</span><br /><span style=\"font-size: 12pt;\">&bdquo;საქართველოს ნატო-ში გაწევრიანების შემთხვევაში, მოსალოდნელია, რომ ჯავახეთში თურქეთის ჯარი გამოჩნდეს&ldquo;, &ndash; განაცხადა სომხეთის დეპუტატმა, სომხური კავშირის &bdquo;ჯავახკის&ldquo; თავმჯდომარემ შირაკ ტოროსიანმა და დასძინა, რომ &bdquo;სომხური საზოგადოების სეპარატისტული ქმედებები გამორიცხულია, მაგრამ შესაძლებელი&ldquo;.</span><br /><span style=\"font-size: 12pt;\">გამონათქვამები &bdquo;გამორიცხულია, მაგრამ შესაძლებელი&ldquo; სომეხი ნაციონალისტების პირიდან ერთს ნიშნავს ასეთი ქმედებები აუცილებლად განხორციელდება. იმ საბაბით, რომ თურქეთი ნატოს წევრი ქვეყანაა.</span><br /><span style=\"font-size: 12pt;\">ეს ყველაფერი საერთო პროვოკაციული პოლიტიკური სპეკულაციაა.&nbsp;</span><br /><span style=\"font-size: 12pt;\">შეგახსენებთ, რომ ნატოს წევრი, მაგალითად, საბერძნეთია. მაგრამ ეს არ ნიშნავს იმას, რომ სამცხე-ჯავახეთში საქართველოს ნატო-ში გაწევრიანების შემთხვევაში საბერძნეთის ჯარები განთავსდება. როგორც ნატო-ს წევრები, არც თურქეთი და არც საბერძნეთი ერთმანეთის ტერიტორიაზე არ განათავსებენ თავიანთ ჯარებს.</span><br /><span style=\"font-size: 12pt;\">&bdquo;საქართველოს NATO&ndash;ში გაწევრიანება გლობალური პრობლემაა, ზუსტად ამ ასპექტში განვითარდება ახალი დაპირისპირება საქართველო&ndash;რუსეთს შორის. ამავდროულად, თურქული ჯარის საქართველოში შესაძლო შემოყვანა შეშფოთებას იწვევს&ldquo;, &ndash; აღნიშნა სომხეთის პარლამენტის დეპუტატმა.</span><br /><span style=\"font-size: 12pt;\">შირაკ ტოროსიანი ასევე იმუქრება: &bdquo;იქნება ეს NATO თუ სხვა ნებისმიერი ორგანიზაცია ნებისმიერი სხვა სახელით, ჯავახეთის სომხურ ეთნოსში ეს ნაბიჯი თავდაცვის რეფლექსს გამოიწვევს&ldquo;. ანუ ნებისმიერი გარე პოლიტიკური მოქმედებები საქართველოში, როგორც სუვერენული სახელმწიფოსი &ndash; არის მხოლოდ საბაბი სომხური სეპარატიზმის აქტივიზაციისთვის სამცხე-ჯავახეთში.</span><br /><span style=\"font-size: 12pt;\">&bdquo;ეს ჩვენში გენეტიკურად დევს. რა თქმა უნდა, საქართველოს შეუძლია, გახდეს NATO&ndash;ს წევრი და მას თავისი ამოცანები აქვს, თუმცა სომხური ეთნოსი არასდროს აიტანს თურქ ჯარისკაცებს მათი დასახლების ადგილებში, მიუხედავად იმისა, თუ რომელ სახელმწიფოში ცხოვრობენ სომხები&ldquo;, &ndash; განაცხადა შირაკ ტოროსიანმა და დასძინა, რომ &bdquo;სომხების მხრიდან სეპარატისტული მოქმედებები არ პროგნოზირდება, თუმცა თურქული ჯარის შემოყვანა სერიოზულ დაპირისპირებას გამოიწვევს&ldquo;.</span><br /><span style=\"font-size: 12pt;\">შირაკ ტოროსიანმა, განაცხადა, რომ სამცხე-ჯავახეთში თურქეთის ჯარების ყოფნის შემთხვევაში, სერიოზული სომხური &bdquo;აჯანყება&ldquo; გარდაუვალი იქნება. &bdquo;ამაში ეჭვი არ მეპარება&ldquo;, &ndash; აღნიშნა მან.</span><br /><span style=\"font-size: 12pt;\">ამრიგად, სომეხი ნაციონალისტების სცენარი ნათელია. ისინი &bdquo;მიეჯაჭვნენ&ldquo; სეპარატიზმის საბაბად იმ ფაქტს, რომ თურქეთი ნატო-ს წევრია. თურქეთის სავარაუდო &bdquo;საფრთხეზე&ldquo; დაყრდნობით, ისინი აპირებენ სამცხე-ჯავახეთში სეპარატისტული ამბოხების წარმოშობას ნებისმიერ დროს, საქართველოს ნატო-ში გაწევრიანების პროცესში და უკვე ემზადებიან ამისთვის.</span><br /><span style=\"font-size: 12pt;\">ის ფაქტი, რომ სომხეთის ხელისუფლებაში, პროდასავლური მთავრობაა, რომელიც ნატოსთან თანამშრომლობს &ndash; ეს მათ სულაც არ აცბუნებს.&nbsp;</span><br /><span style=\"font-size: 12pt;\">მათთვის მთავარია სეპარატისტული აჯანყების და აგრესიის მიზეზი &bdquo;ყარაბაღის სცენარის მიხედვით&ldquo; საქართველოსთან მიმართებაში.</span></p>', '22', '', 'https://timenews.ge/uploads/posts/2019-12/medium/1575408271_ameni.jpg', '', '', 0, 'amas-aravin-eloda-vreldeba-shemashfotebeli-informaia-samkhe-javakhetis-somkhebi-damoukideblobas-moitkhoven-saqartvelos-natoshi-gatsevrianebis-shemtkhvevashi', 1575479853, '', 355, '', ''),
(82, '', 'რა მოხდა რეალურად VIDEO: აფრენიდან ჩამოვარდნამდე - უკრაინული ბოინგ-ის უკანასკნელი რეისი', '<p>თვითმფრინავის&nbsp;აფრენისა&nbsp;და ჩამოვარდნის გრაფიკული ვიდეოკადრები ვრცელდება.<br />ბოინგ737-თან კავშირი თეირანის იმამ&nbsp;ხომეინის&nbsp;აეროპორტიდან აფრენის შემდეგ რამდენიმე წუთში გაწყდა.<br />8 იანვარს, თეირანში &bdquo;უკრაინის საერთაშორისო ავიახაზების&ldquo; კუთვნილი Boeing 737 ჩამოვარდა. ბორტზე 168 მგზავრი და ეკიპაჟის 9 წევრი იყო. ყველა დაიღუპა.<br />CBS-ის&nbsp;ინფორმაციით, თეირანში ჩამოვარდნილ უკრაინულ თვითმფრინავს, ირანის ანტისარაკეტო თავდაცვითი სისტემის მიერ ნასროლი, რუსული რაკეტა შეცდომით მოხვდა.&nbsp;</p>\n<p><iframe style=\"border: none; overflow: hidden;\" src=\"https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2FMadaTopNews%2Fvideos%2F2840957339257919%2F&amp;show_text=0&amp;width=560\" width=\"560\" height=\"315\" frameborder=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p>&nbsp;</p>', '22', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%95%E1%83%98%E1%83%90.jpg', '', '', 0, 'ra-mokhda-realurad--afrenidan-chamovardnamde---ukrainuli-boing-is-ukanaskneli-reisi', 1578688568, '', 752, '', ''),
(83, '', 'დედამ 15 წლის შვილს მეგობარ ბიჭთან შეუსწრო - ქალიშვილმა კი დედა მოკლა', '<p>რუსეთში, ომსკის საავადმყოფოში 43 წლის ქალი მრავალმხრივი ტრავმებით გარდაიცვალა. ის საკუთარმა 15 წლის ქალიშვილმა მოკლა, რომელსაც ამ დანაშაულის ჩადენაში მისი 18 წლის მეგობარი ბიჭი დაეხმარა.</p>\n<p>გამოძიების ვერსიით, ჩხუბი დედა-შვილს შორის 30-31 დეკემბრის ღამეს წარმოიშვა. ამ კონფლიქტის დროს შვილის მეგობარმა ქალს დანით რამდენიმე ჭრილობა მიაყენა, შვილი კი თავსა და ტანზე ჩაქუჩს და დანას ურტყამდა.</p>\n<p>დაჭრილმა ქალმა მეგობართან დარეკვა მოასწრო, რომელმაც სასწრაფო გამოიძახა. ამის მიუხედავად, მისი გადარჩენა ვერ მოხერხდა. ის საავადმყოფოში გარდაიცვალა.</p>\n<p>ადგილობრივი პორტალის ცნობით, კონფლიქტის მიზეზი გახდა ის, რომ ქალი სამსახურიდან სახლში დროზე ადრე დაბრუნდა და შვილი უცხო ბიჭთან ერთად ლოგინში დაინახა. ის მათ პოლიციის გამოძახებით დაემუქრა.</p>\n<p>მომხდარზე დაწყებულია სისხლის სამართლის გამოძიება. ორივე ეჭვმიტანილი დაპატიმრებულია.</p>', '24', '', 'https://newsebi.ge/media/kill.jpg', '', '', 0, 'dedam-15-tslis-shvils-megobar-bichtan-sheustsro---qalishvilma-ki-deda-mokla', 1578689608, '', 1707, '', ''),
(84, '', 'სულ ცოტა 8-10 ნაკბენი აქვს - ბაგა-ბაღში ბავშვმა ბავშვი დაკბინა (ფოტო)', '<div class=\"text\">\n<p>თბილისში, კერძო ბაგა-ბაღში ერთმა ბავშვმა მეორე დაკბინა. ინფორმაცია და ფოტოები ბავშვის დედამ სოციალურ ქსელში გამოაქვეყნა.</p>\n<p>&bdquo;მოკლედ სიტუაცია ასეთია, ბაგა-ბაღში ჩემი შვილი ბავშვმა დაკბინა! დღეს მირეკავს ბაგა-ბაღის დირექტორი სამ საათზე და მიბარებს ბაღში, მეც მაშინვე მივედი. გამიღეს კარი და მითხრეს დედიკო შენი შვილი დაკბინეს. პირველი რაც გავიფიქრე იყო მწერი, ამ დროს გამოდის ჩემი შვილი ოთახიდან გულმოსული და ნაწვალები, გავოგნდი ველოდები ახსნას თუ რა მოხდა ამ დროს პასუხს ვერავინ მცემს და ვცდილობ არ ავყვე ემოციებს, რადგან სიტუაცია ძალზედ დამაბნეველი იყო. გამოიყვანეს ჩემი შვილის ტოლი გოგო და მეუბნებიან ამან დაკბინა ამის ბრალია გავმწარდი და ვუთხარი რომ ბავშვების&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">კიარა</span>&nbsp;მათი უყურადღებობის ბრალი იყო! იმ დროს ბავშვის დამშვიდების გარდა ვერაფერზე ვფიქრობდი, თან ძალიან&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ვმწარდებოდი</span>!</p>\n<p><img src=\"https://scontent.ftbs4-1.fna.fbcdn.net/v/t1.0-9/81758526_2374991465939400_4730134713870581760_n.jpg?_nc_cat=107&amp;_nc_ohc=ny_rJu0gBxEAQkTTJ1Tgkcelod6WAFnYYhvKXN649DTbzbLeVLTy09J3A&amp;_nc_ht=scontent.ftbs4-1.fna&amp;oh=483fe527909d625568a5503c2d54c89a&amp;oe=5EA1363B\" alt=\"\" width=\"570\" height=\"760\" /></p>\n<p>წარმოიდგინეთ რამდენად უყურადღებოები იყვნენ, სხვა ბავშვმა გაიღვიძა, გადავიდა ჩემი შვილის საწოლში, დაკბინა სახეზე, ხელებზე და მხოლოდ თავში სულ ცოტა 8-10 ნაკბენი აქვს. ეს რაც გაუწითლდა და დაეტყო. ყურზე, ხელებზე&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">დაკბენილია,</span>&nbsp;სახეზეც და წარმოიდგინეთ, მინიმუმ 15 წუთი მაინც იყვნენ მარტო და ჩემი შვილი ტიროდა მთელი ეს პერიოდი, ამ დროს კი ყურადღებას არავინ აქცევდა!</p>\n<p>მხოლოდ ორი არგუმენტი მითხრეს. პირველად რომ შევიხედე ეძინათ, მეორედ როცა შევიხედე იქ ყოფილა გადასული. ასევე ახსენა, რომ ანიმატორები ყოფილან თურმე მისული! ხოდა სად ეცალათ ბავშვისთვის&ldquo;, - წერს მარი ლაზიშვილი.</p>\n<p>&nbsp;</p>\n<div class=\"text\">&nbsp;</div>\n<div class=\"gallery\">&nbsp;</div>\n<p>&nbsp;</p>\n</div>\n<div class=\"comments\">&nbsp;</div>', '22', '', 'https://newsebi.ge/media/bavhvi.png', '', '', 0, 'sul-ota-8-10-nakbeni-aqvs---baga-baghshi-bavshvma-bavshvi-dakbina-foto', 1578691889, '', 290, '', ''),
(85, '', 'სამწუხარო ინფორმაცია სოფელ გამარჯვებაში 26 წლის ბიჭი გარდაცვლილი ნახეს - ის სოფლის რწმუნებულის ძმისშვილია', '<div class=\"text\">\n<p>გარდაბნის მუნიციპალიტეტის სოფელ გამარჯვებაში 26 წლის ახალგაზრდა გარდაცვლილი ნახეს.</p>\n<p>გარდაცვლილი სოფლის რწმუნებულის, გიორგი&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მახათაძის</span>&nbsp;ძმისშვილია. როგორც გიორგი&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მახათაძემ</span>&nbsp;&bdquo;ინფო რუსთავს&ldquo; განუცხადა, ჩამომხრჩვალი&nbsp;ახალგაზრდა პირუტყვის სადგომში დედამ იპოვა.</p>\n<p>&bdquo;ბიზნესი ჰქონდა, ფერმერი იყო. საქონელის საჭმელად შევიდა, დედამისს წყალი უნდა&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">შეეწოდებინა</span>. შევიდა და ასეთი სურათი დახვდა. ქეიფობდა, მოვიდა, კარგ ხასიათზე იყო, განწყობა კარგი ჰქონდა. ვერ ვხვდებით რა მოხდა. არანაირი პრობლემა არ გააჩნდა, პირიქით, რომ გაიგებდა ვინმემ თავი მოიკლაო, არ მოსწონდა&ldquo;, - აცხადებს სოფლის რწმუნებული გიორგი მახათაძე.</p>\n<p>გამოძიება სსკ-ის 115-ე მუხლით დაიწყო, რაც თვითმკვლელობამდე მიყვანას გულისხმობს.</p>\n<p>&nbsp;</p>\n<p>წყარო: &bdquo;ინფორუსთავი&ldquo;</p>\n</div>', '27', '', 'https://newsebi.ge/media/ambulance.jpg', '', '', 0, 'samtsukharo-informaia-sofel-gamarjvebashi-26-tslis-bichi-gardavlili-nakhes---is-soflis-rtsmunebulis-dzmisshvilia', 1578693466, '', 1307, '', ''),
(86, '', 'სასწრაფოდ: ამ წუთებში ხდება ცნობილი- -  \"ილოცეთ გთხოვთ ცოტა ხნის წინ დაფიქსირდა გულის გაჩერება\"', '<p>&ldquo;ანიტა ოპერაციაზე შეყავთ!<br />მარიკომ ძალიან გთხოვათ ყველას რომ ილოცოთ ანიტასთვის!</p>\n<p>ცოტა ხნის წინ დაფიქსირდა გულის გაჩერება.</p>\n<div class=\"text_exposed_show\">\n<p>როგორც ექიმებმა აცნობეს ოჯახს, გადაწყდა ეკმოს აპარატის ჩაყენება (ეს აპარატი გულს დაეხმარება მუშაობაში და მოგვაგებინებს 3-4 კვირას)<br />ამ წუთებში ელოდებიან ექიმ ბალაკრიშნანის მისვლას კლინიკაში.</p>\n<p><span class=\"_5mfr\"><span class=\"_6qdm\">❗️</span></span>ძალიან გთხოვთ გაითვალისწინოთ ჩვენი მდგომარეობა, ამაზე მეტი არაფრის თქმა ამ დროისთვის არ შეგვიძლია!</p>\n<p><span class=\"_5mfr\"><span class=\"_6qdm\">', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90.jpg', '', '', 0, 'sastsrafod-am-tsutebshi-khdeba-nobili-----iloet-gtkhovt-ota-khnis-tsin-dafiqsirda-gulis-gachereba', 1578695959, '', 3150, '', ''),
(87, '', 'ირაკლი ჩარკვიანის და ქეთათოს ქალიშვილი შეყვარებულთან ერთად - გოგონას პიკანტური ფოტო, რომელიც მთელი საზოგადოება...', '<p>ირაკლი ჩარკვიანის და ქეთათოს ქალიშვილის პიკანტური ფოტო, სოციალურ ქსელებში განხილვის საგანი გახდა. გოგონა შეყვარებულს ვნებიანად კოცნის .</p>\n<p>&nbsp;</p>\n<p><a class=\"fancybox-thumbs\" href=\"https://www.newposts.ge/img/photos2/1578745720243539.jpg\" data-fancybox-group=\"thumb\"><img title=\"\" src=\"https://www.newposts.ge/img/photos2/1578745720243539.jpg\" alt=\"\" /></a><a class=\"fancybox-thumbs\" href=\"https://www.newposts.ge/img/photos2/1578745720431293.jpg\" data-fancybox-group=\"thumb\"><img title=\"\" src=\"https://www.newposts.ge/img/photos2/1578745720431293.jpg\" alt=\"\" /></a></p>', '27', '', 'https://newsebi.ge/media/%E1%83%92%E1%83%9D%E1%83%92%E1%83%9D.jpg', '', '', 0, 'irakli-charkvianis-da-qetatos-qalishvili-sheyvarebultan-ertad---gogonas-pikanturi-foto-romelic-mteli-sazogadoeba', 1578751049, '', 743, '', ''),
(88, '', 'უკრაინის რეისზე შემთხვევით გადარჩენილი მგზავრი და ბორტგამცილებლის უკანასკნელი პოსტი', '<p><strong>ანდრეი ბუზაროვი კიევში უნდა გაფრენილიყო იმავე რეისით, რომელიც 8 იავარს დილით ჩამოვარდა თეირანში.</strong></p>\n<p>&nbsp;</p>\n<p><br /><br /><br />საერთაშორისო მიმომხილველი ანდრეი ბუზაროვი თეირანი-კიევის იმავე რეისზე უნდა დამჯდარიყო, რომელიც თეირანის აეროპორტის მახლობლად ჩამოვარდა, მაგრამ იღბლიანმა შემთხვევამ მას სიცოცხლე შეუნარჩუნა.</p>\n<p>&nbsp;</p>\n<p><img title=\"შემთხვევით გადარჩენილი მგზავრი და\nბორტგამცილებლის უკანასკნელი პოსტი\" src=\"http://server5.intermedia.ge/article_images/small/202001/202001091037396227.jpg\" alt=\"image\" /></p>\n<p>&nbsp;</p>\n<p><br />ანალიტიკოსი ახლო აღმოსავლეთში კონფერენციაში მონაწილეობისთვის ჩაფრინდა, რის შემდეგაც იგი აპირებდა სამშობლოში დაბრუნებას. გასულ კვირას, მან \"უკრაინის საერთაშორისო ავიახაზების\" ოფისს ბილეთის შესაძენად მიაკითხა და თავდაპირველად სურდა 8 იანვარს გაფრენა, რადგან ღონისძიების ორგანიზატორებმა მხოლოდ იქ ყოფნის პერიოდში დაუფინანსეს სასტუმროს ხარჯები, თუმცა ავიაკომპანიის თანამშრომლებმა შეძლეს კლიენტის გადარწმუნება.</p>\n<p>&nbsp;</p>\n<p><img title=\"შემთხვევით გადარჩენილი მგზავრი და\nბორტგამცილებლის უკანასკნელი პოსტი\" src=\"http://server5.intermedia.ge/article_images/small/202001/202001091037246227.jpg\" alt=\"image\" /></p>\n<p>&nbsp;</p>\n<p>მათ ურჩიეს ერთი დღის შემდეგ გაფრენა, რადგან ხუთშაბათს ბილეთები იაფია, რის შედეგადაც, მიმომხილველმა დამატებით ერთი დღე სასტუმროში საკუთრი ჯიბიდან გადაიხადა. ამან გადაარჩინა მისი სიცოცხლე.</p>\n<p>&nbsp;</p>\n<p><br /><br />თუმცა ბუზაროვს კიდევ რამდენიმე დღე მოუწევს თეირანში ყოფნა, რადგან ავიაკატასტროფის შემდეგ დროებით შეწყდა ავიარეისები.</p>\n<p>&nbsp;</p>\n<p><br /><br /><br /><br /><br /><br /></p>\n<p>&nbsp;</p>\n<p>ინტერნეტში ვრცელდება ერთ-ერთი ბორტგამცილებლის, 28 წლის ვალერია ოვჩარუკის უკანასკნელი პოსტი სოციალურ ქსელში \"სამუშაო - მე შენ მიყვარხარ!\"</p>\n<p>&nbsp;</p>\n<p><img title=\"შემთხვევით გადარჩენილი მგზავრი და\nბორტგამცილებლის უკანასკნელი პოსტი\" src=\"http://server5.intermedia.ge/article_images/small/202001/202001091059066227.png\" alt=\"image\" /></p>\n<p>&nbsp;</p>\n<p>პოსტებია ბანგკოკიდან, ტორონტოდან, დელიდან და ვილნიუსიდან....თითქოსდა ახალგაზრდა გოგონამ აისრულა უმეტესი თანატოლების აუხდენელი ოცნება - მოენახულებინა მსოფლიო..მაგრამ..</p>\n<p>&nbsp;</p>\n<p><img title=\"შემთხვევით გადარჩენილი მგზავრი და\nბორტგამცილებლის უკანასკნელი პოსტი\" src=\"http://server5.intermedia.ge/article_images/small/202001/202001091059216227.jpg\" alt=\"image\" /><br /><br /></p>\n<p>&nbsp;</p>\n<p>ეკიპაჟის წევრები მთლიანად უკრაინელები იყვნენ.</p>\n<p>&nbsp;</p>\n<p><br />შეგახსენებთ, 8 იანვარს დილით თეირანში აფრენიდან 8 წუთში ჩამოვარდა უკრაინული ავიახაზების ლაინერი ბოინგ-737, დაიღუპა ყველა-176 კაცი(167 მგზავრი და ეკიპაჟის 9 წევრი.)დაღუპულთა შორის არიან უკრაინის, ირანის, კანადის, გერმანიის, დიდი ბრიტანეთის, შვედეთისა და ავღანეთის მოქალაქეები</p>', '27', '', 'https://newsebi.ge/media/ukrain%20air%20plane.jpg', '', '', 0, 'ukrainis-reisze-shemtkhvevit-gadarchenili-mgzavri-da-bortgamcileblis-ukanaskneli-posti', 1578758876, '', 1087, '', ''),
(89, '', 'სასწრაფოდ: ამ წუთებში ვრცელდება ძალიან სამწუხარო ინფორმაცია - ანიტას ორგანიზმმა აპარატი ვერ მიიღო..ფილტვებში გამოიწვია სისხლდენა', '<p style=\"font-weight: 400;\">ანიტა ფაცაციას ოჯახის ახლობელი სოციალურ ქსელში ახალ ინფორმაციას ავრცელებს:</p>\n<p style=\"font-weight: 400;\">&bdquo;ანიტას ორგანიზმმა აპარატი ვერ მიიღო, ფილტვებში გამოიწვია სისხლდენა. შეიყვანეს საოპერაციოში,ამბობენ, რომ 4-6 საათი გაგრძელდება ოპერაცია, ამჯერად შიგნიდან უნდა ჩადგეს აპარატი.</p>\n<p style=\"font-weight: 400;\">წუხანდელი ღამე მედიკოსების თქმით სასწაული იყო, 0% იყო შანსიო, ხელის მასაჟით ავამუშავეთ გულიო...გავაგრძელოთ გულმხურვალე ლოცვა&ldquo;.</p>\n<p style=\"font-weight: 400;\">ორი წლის ანიტა ფაცაციას გულზე აქვს უმძიმესი დაავადება &ndash; დილატაციური კარდიომიოპათია.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20(1).jpg', '', '', 0, 'sastsrafod-am-tsutebshi-vrceldeba-dzalian-samtsukharo-informacia---anitas-organizmma-aparati-ver-miighofiltvebshi-gamoitsvia-siskhldena', 1578766807, '', 7045, '', ''),
(90, '', 'ირანელები თვითმფრინავის ჩამოგდების გამო პრეზიდენტის გადადგომას ითხოვენ (ვიდეო)', '<p>ირანის მიერ უკრაინული ლაინერის ჩამოგდების აღიარების შემდეგ თეირანში საპროტესტო აქცია იმართება. ამის შესახებ Reuters-ი ადგილობრივ მედიაზე დაყრდნობით წერს.&nbsp;</p>\n<p>გამოცემის ინფორმაციით, აქციის მონაწილეები ქვეყნის მთავრობის საწინააღმდეგო ლოზუნგებს სკანდირებენ, მათ გენერალ ყასემ სოლეიმანის ფოტოები დახიეს. ისინი ქვეყნის უზენაესის სასულიერო ლიდერის აიათოლა ჰამენეის გადადგომასაც ითხოვენ. დემონსტრაციაში ათასამდე ადამიანი იღებს მონაწილეობას.&nbsp;</p>\n<p><iframe style=\"border: none; overflow: hidden;\" src=\"https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2Fturantvaz%2Fvideos%2F2830505690333841%2F&amp;show_text=0&amp;width=476\" width=\"476\" height=\"476\" frameborder=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"></iframe></p>', '27', '', 'https://newsebi.ge/media/%E1%83%98%E1%83%A0%E1%83%90%E1%83%9C.png', '', '', 0, 'iranelebi-tvitmfrinavis-chamogdebis-gamo-prezidentis-gadadgomas-itkhoven-video', 1578773800, '', 739, '', ''),
(91, '', 'სასიხარულო ინფორმაცია ამ წუთბში ხდება ცნობილი დიალიზმა კარგად ჩაიარა! ანიტა ინარჩუნებს სტაბილურობას!', '<p>58-ე ღამე მშვიდობისა!</p>\n<p>დიალიზმა კარგად ჩაიარა!</p>\n<p>&nbsp;ანიტა ინარჩუნებს სტაბილურობას.<span class=\"text_exposed_show\"><br />ექიმები გვარწმუნებენ რომ საკუთარი შესაძლებლობების მაქსიმუმს აკეთებენ.</span></p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;როგორც მოგახსენეთ, პოსტ-საოპერაციო 24 საათი კრიტიკული იქნება.</p>\n<p>&nbsp;რადგან ბავშვი მართვით სუნთქვის აპარატზეა, ექიმები მას ხელოვნური ძილის მდგომარეობაში ამყოფებენ.<br />მიუხედავად ამისა, ანიტამ გაიღვიძა დედიკოს ხმაზე.</p>\n<p>&nbsp;მომდევნო დღეების განმავლობაში, ხშირად გამოაფხიზლებენ, ნევროლოგიისა და გულის მუშაობის შესამოწმებლად.</p>\n<p>&nbsp;ხვალიდან დაიწყება სისხლში ინფექციისა და სოკოს საწინააღმდეგო მკურნალობა.</p>\n<p><span class=\"_5mfr\"><span class=\"_6qdm\"> &nbsp;</span></span>&nbsp;ჩვენი ელჩი, არჩილ ძულიაშვილი, გუშინ მთელი ღამის განმავლობაში ხაზზე იყო, ხოლო დღეს დილით კი უკვე ქალაქ ჩენაიში ჩაფრინდა და ანიტას ოჯახს ყველა სახის დახმარებას უწევს.</p>\n<p>&nbsp;ჩვენ გვჯერა სასწაულების და თქვენი ერთიანობის ძალის!<br /><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a>&nbsp; სთვის</p>\n</div>\n<p>&nbsp;</p>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90.jpg', '', '', 0, 'sasikharulo-informacia-am-tsutbshi-khdeba-cnobili-dializma-kargad-chaiara-anita-inarchunebs-stabilurobas', 1578785972, '', 1109, '', ''),
(93, '', 'უახლესი ინფორმაცია ინდოეთიდან ამ წუთებში ხდება ცნობილი რა მდგომარეობაშია ბავშვი?', '<p>პატარა ანიტას ბებია, თამუნა გლურჯიძე ბავშვის ჯანმრთელობის მდგომარეობის შესახებ ახალ ინფორმაციას ავრცელებს:</p>\n<p>&bdquo;შუადღე მშვიდობისა, მეგობრებო.<br />ანიტას დილანდელი ამბებიდან:<br />შეგახსენებთ, რომ როცა პირველად ანიტას მდგომარეობა დამძიმდა &ndash; ექიმები მისი გადარჩენის შანსს 0%- ით აფასებდნენ. მაგრამ, მოხდა სასწაული და იმ ექიმის შეუპოვრობის წყალობით, ვინც დაახლოებით 1 სთ-ს განმავლობაში გულის მასაჟს უკეთებდა ჩვენ გოგოს და თქვენი სასწაულმოქმედი ლოცვის შემწეობით &ndash; ანიტამ შემდგომში კიდევ ერთ პროცედურას ( ეკმოს დაყენება ) და ოპერაციას ( ფილტვების სისხლისგან და სითხისგან ამოსუფთავება და ეკმოს ჩადგმა ) გაუძლო.<br />ექიმი ბალაკრიშნანის თქმით, ოპერაცია იყო ურთულესი და მისი დასრულების შემდეგ ანიტას შანსებს აფასებედნენ -50%-50%ზე.<br />გუშინ მოხდა დიალიზის გადასხმა, რაც ანიტამ კარგად გადაიტანა.<br />მაჩვენებლები პოსტ- ოპერაციული მდგომარეობისთვის შესაბამის ნორმაში იყო.<br />ხშირად აღვიძებდნენ გულის მუშაობის შესამოწმებლად და გულის მუშაობით კმაყოფილები იყვნენ.<br />დღეს უკვე ექიმი ბალაკრიშნანის თქმით უკეთესი მდგომარეობაა.<br />მუცელსა და ფილტვებში სითხის რაოდენობამ იკლო.<br />ჩვენი გოგოც ჩურჩულით ახერხებს:<br />დედიკოს და მამიკოს შეატყობინოს, რომ ორივე უყვარს &hellip;<br />&hellip;რომ გაბრაზებულია ექიმებზე.<br />&hellip;რომ, ბ-ნ არჩილს &ldquo;შესჩივლოს&rdquo; და აჩვენოს ფუფუები ხელებზე.<br />&hellip;რომ მოითხოვოს &ldquo;მატყუარა&rdquo; და მოითხოვოს შუქის გათიშვა, რადგან არ სიამოვნებს მის პრინცესულ თვალებს, თან არა მხოლოდ მის საწოლთან, არამედ მთლიან ბლოკში.<br />დიალიზის გადასხმა გრძელდება და ელოდებიან ბრონქოსკოპიის და სისხლის ანალიზის პასუხებს, სხვა ინფექციის არსებობის გადასამოწმებლად და შესაბამისი მკურნალობის დასაწყებად.<br />გმადლობთ, თქვენი სიტყვის ძალით და რწმენით ანიტასთვის მოფიქრალო ადამიანებო.<br />მადლობა ვუთხრათ ღმერთს, იმისთვის, რომ გვისმენს და არ გვტოვებს.<br />და გთხოვთ, გთხოვთ, აუცილებლად განვაგრძოთ ლოცვა.<br />( ნათლობის სახელი ანიტა)&ldquo; &ndash; წერს თამუნა გლურჯიძე.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20(2).jpg', '', '', 0, 'uakhlesi-informacia-indoetidan-am-tsutebshi-khdeba-cnobili-ra-mdgomareobashia-bavshvi', 1578832852, '', 3105, '', ''),
(94, '', 'არ გაფრინდე გთხოვ - უკრაინელი პილოტის მეუღლის ბოლო თხოვნა', '<p>ირანში ჩამოვარდნილი თვითმფრინავის პილოტს მეუღლე სთხოვდა, რომ ფრენა არ განეხორციელებინა. ამის შესახებ &bdquo;ინდეფენდენთი&ldquo; წერს. კატერინა გაპონენკო იმედოვნებდა, რომ დაძაბული ვითარების გამო ფრენა გაუქმდებოდა, თუმცა ეს ასე არ მოხდა.</p>\n<p>&bdquo;მე ვთხოვე, რომ ეს არ გაეკეთებინა, არ გაფრენილიყო, მაგრამ მიპასუხა რომ თუ ფრენა დაიგეგმა უნდა გაფრენილიყო და ამას ის გააკეთებდა&ldquo; - განაცხადა გაპონენკომ</p>\n<p>გამოცემა წერს, რომ პილოტს საერთო ჯამში, სულ 11,000 საათიანი ფრენის გამოცდილება ჰქონდა.&nbsp;</p>', '27', '', 'https://newsebi.ge/media/meugle.png', '', '', 0, 'ar-gafrinde-gtkhov---ukraineli-pilotis-meughlis-bolo-tkhovna', 1578833456, '', 1075, '', ''),
(96, '', '\"როცა ღვიძავს, ჩურჩულით ახერხებს დედა მამა ორივე მიყვარს\" - ანიტა', '<p>მდგომარეობის შესახებ წერს და აცხადებს, რომ დიალიზის გადასხმა გრძელდება და ელოდებიან ბრონქოსკოპიის და სისხლის ანალიზის პასუხებს.</p>\n<p><br />&bdquo;შეგახსენებთ, რომ როცა პირველად ანიტას მდგომარეობა დამძიმდა - ექიმები მისი გადარჩენის შანსს 0%- ით აფასებდნენ. მაგრამ, მოხდა სასწაული და იმ ექიმის შეუპოვრობის წყალობით, ვინც დაახლოებით 1 სთ-ს განმავლობაში გულის მასაჟს უკეთებდა ჩვენ გოგოს და თქვენი სასწაულმოქმედი ლოცვის შემწეობით - ანიტამშემდგომში კიდევ ერთ პროცედურას (ეკმოს დაყენება) და ოპერაციას (ფილტვების სისხლისგან და სითხისგან ამოსუფთავება და ეკმოს ჩადგმა) გაუძლო.</p>\n<p>ექიმი ბალაკრიშნანის თქმით, ოპერაცია იყო ურთულესი და მისი დასრულების შემდეგ ანიტას შანსებს აფასებედნენ -50%-50%ზე.</p>\n<p>გუშინ მოხდა დიალიზის გადასხმა, რაც ანიტამ კარგად გადაიტანა.</p>\n<p>მაჩვენებლები პოსტ-ოპერაციული მდგომარეობისთვის შესაბამის ნორმაში იყო.</p>\n<p>ხშირად აღვიძებდნენ გულის მუშაობის შესამოწმებლად და გულის მუშაობით კმაყოფილები იყვნენ.</p>\n<p>დღეს უკვე ექიმი ბალაკრიშნანის თქმით, უკეთესი მდგომარეობაა.</p>\n<p>მუცელსა და ფილტვებში სითხის რაოდენობამ იკლო.<br />თუმცა, მომდევნო 2-3 დღე მაინც არის მნიშვნელოვანი და განსაკუთრებულად საყურადღებო.</p>\n<p>ჩვენ გოგოსაც როცა ღვიძავს, ჩურჩულით ახერხებს:<br />დედიკოს და მამიკოს შეატყობინოს, რომ ორივე უყვარს ...<br />...რომ გაბრაზებულია ექიმებზე.</p>\n<p>...ახერხებს, რომ, ბ-ნ არჩილს &bdquo;შესჩივლოს&ldquo; და აჩვენოს ფუფუები ხელებზე.</p>\n<p>...რომ მოითხოვოს &bdquo;მატყუარა&ldquo; და მოითხოვოს შუქის გათიშვა, რადგან არ სიამოვნებს მის პრინცესულ თვალებს, თან არა მხოლოდ მის საწოლთან, არამედ მთლიან ბლოკში.</p>\n<p>დიალიზის გადასხმა გრძელდება და ელოდებიან ბრონქოსკოპიის და სისხლის ანალიზის პასუხებს, სხვა ინფექციის არსებობის გადასამოწმებლად და შესაბამისი მკურნალობის დასაწყებად.</p>\n<p>გმადლობთ, თქვენი სიტყვის ძალით და რწმენით ანიტასთვის მოფიქრალოადამიანებო.</p>\n<p>მადლობა ვუთხრათ ღმერთს, იმისთვის, რომ გვისმენს და არ გვტოვებს.</p>\n<p>და გთხოვთ, გთხოვთ, აუცილებლად განვაგრძოთ ლოცვა.<br />(ნათლობის სახელი ანიტა)&ldquo;, - წერს ოჯახის ახლობელი.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20%E1%83%93%E1%83%94%E1%83%93%E1%83%90.jpg', '', '', 0, 'roca-ghvidzavs-churchulit-akherkhebs-deda-mama-orive-miyvars---anita', 1578860713, '', 766, '', ''),
(97, '', 'ვანო მერაბიშვილთან დაკავშირებით ახალი ინფორმაცია ვრცელდება ის საპატიმროს ტოვებს...', '<p>შინაგან საქმეთა ყოფილი მინისტრი, მსჯავრდებული&nbsp;<a href=\"https://www.interpressnews.ge/ka/profiles/88-ivane-merabishvili\" target=\"_blank\">ვანო მერაბიშვილი</a>&nbsp;თითქმის 7-წლიანი პატიმრობის შემდეგ, პენიტენციურ დაწესებულებას,&nbsp;ე.წ. მატროსოვის ციხეს 20 თებერვალს დატოვებს. მერაბიშვილს პატიმრობის ვადა სწორედ ამ დღეს ეწურება.</p>\n<p>ყოფილი პრემიერ-მინისტრი და ყოფილი შინაგან საქმეთა მინისტრი,&nbsp;<a href=\"https://www.interpressnews.ge/ka/profiles/88-ivane-merabishvili\" target=\"_blank\">ვანო მერაბიშვილი</a>&nbsp;2013 წლის მაისში დააკავეს. ის სასჯელს რამდენიმე საქმეზე იხდის, მათ შორის, 2011 წლის 26 მაისის აქციის დარბევის, სანდრო გირგვლიანის საქმეზე მტკიცებულებების დამალვის, ვალერი გელაშვილის მიმართ ფიზიკური ანგარიშსწორების, კვარიათის აგარაკისა და ამომრჩევლის მოსყიდვის საქმეზე.</p>\n<p>&nbsp;</p>\n<p>სასჯელის შთანთქმის პრინციპით, მერაბიშვილს საბოლოოდ სასჯელის სახედ და ზომად 6 წლითა და 9 თვით თავისუფლების აღკვეთა შეეფარდა.</p>\n<p>ამჟამად სასამართლოში მერაბიშვილის წინააღმდეგ 7 ნოემბრის აქციის დარბევისა და &bdquo;ტელეიმედში&ldquo; შეჭრის საქმის განხილვა მიმდინარეობს. აღნიშნულ საქმეზე მერაბიშვილს უფლებამოსილების გადამეტებას ედავებიან.</p>', '19', '', 'https://newsebi.ge/media/%E1%83%95%E1%83%90%E1%83%9C%E1%83%9D.jpg', '', '', 0, 'vano-merabishviltan-dakavshirebit-akhali-informacia-vrceldeba-is-sapatimros-tovebs', 1578864923, '', 1418, '', ''),
(98, '', 'ექიმების ბოლო ინფორმაცია ანიტასთან დაკავშირებით   კიდევ 2-3 დღე იქნება კრიტიკული', '<p>59-ე ღამე, 68700-ზე მეტი ანიტელი და საოცარი ერთიანობაა ამ ჯგუფში!</p>\n<p>ანიტას მდგომარეობა სტაბილურია, როგორც ექიმებმა თქვეს, კიდევ 2-3 დღე იქნება კრიტიკული, თუმცა, ამ ეტაპზე სასიცოცხლო მაჩვენებლები დამაკმაყოფილებელია.</p>\n<p>&nbsp;დღეს დაიწყო სისხლში სოკოსა და ინფექციის საწინააღმდეგო მკურნალობა.</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;რაც შეეხება ფილტვებს, საბედნიეროდ ბრონხოსკოპიის შდეგად არანაირი ბაქტერია არ ამოთესილა, დღეს გადაღებული რენტგენოგრაფიის მიხედვით ფილტვების მდგომარეობა შედარებით უკეთესია, ექიმები იმედოვნებენ, რომ მიმდინარე პროცესები მალე იმ დონეზე ალაგდება, რომ შესაძლებელი გახდება ანიტას მართვით სუნთქვის აპარატიდან მოხსნა.</p>\n<p>&nbsp;შეგახსენებთ, რომ ანიტას გული დიდი ხნით იყო გაჩერებული, რის გამოც ახლა ყველა ორგანოს მუშაობისთვის დახმარება სჭირდება. მიუხედავად ამისა, იგეგმება დიალიზის შემცირება, გაუმჯობესებულია ღვიძლისა და კუჭის ფუნქციონირება და რაც მთვარია აბსოლუტურად გადარჩენილია ნევროლოგია.</p>\n<p>&nbsp;ანიტას ხშირად აღვიძებენ, ბავშვი კონტაქტურია და ჩურჩულით ყველაფერს აგებინებს მშობლებს.</p>\n<p>&nbsp;რაც ანიტას გარშემო ხდება ნამდვილად სასწაულია, ამ სასწაულის მიზეზი კი თქვენ ხართ!<br /> &nbsp;ყველას დიდ მადლობას გიხდით ამხელა სიყვარულისთვის, თქვენი თანადგომა ჩვენთვის ძალიან დიდი იმედია!</p>\n<p>ჩვენ ყველა ერთად ვაგრძელებთ ბრძოლას&nbsp;<a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a>&nbsp; სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90.jpg', '', '', 0, 'eqimebis-bolo-informacia-anitastan-dakavshirebit---kidev-2-3-dghe-iqneba-kritikuli', 1578872980, '', 654, '', ''),
(99, '', 'სააკაშვილის სკანდალური განცხადება თეა წულუკიანზე', '<p>&ldquo;ივანიშვილი თეა წულუკიანს ფულს უხდის ყოველთვიურად 30-40 ათას დოლარს, ამას აკეთებ იმისთვის, რომ ეზიზღება საქართველო, იმიტომ რომ მამამისი იყო ყველაზე დიდი ჯალათი უზენაეს სასამართლოში, ჩვენ გავაგდეთ თავის დროზე სასამართლოდან, რომელიც ხალხს ხვრეტდა მასობრივად.<br />თეა წულუკიანი პასუხს გვაგებინეს თავის მამაზე. იმის შემდეგ მისი შურისძიება არის ოჯახური მთელ საქართველოზე&rdquo; -</p>\n<p><strong>მიხეილ სააკაშვილი &ndash; საქართველოს მესამე პრეზიდენტ</strong></p>\n<div>&nbsp;</div>\n<p><strong>ტელეკომპანია &ldquo;მთავარი&rdquo;</strong></p>', '19', '', 'https://newsebi.ge/media/%E1%83%9B%E1%83%98%E1%83%A8%E1%83%90%20%E1%83%97%E1%83%94%E1%83%90.jpg', '', '', 0, 'saakashvilis-skandaluri-ganckhadeba-tea-tsulukianze', 1578924443, '', 1086, '', ''),
(100, '', 'მიხეილ სააკაშვილი სკანდალურ ფოტოს აქვეყნებს', '<p>7 წლის წინ მესტიის ცენტრში გაჩერდა საათი, 7 წელია მესტიას არ დამატებია არცერთი ახალი სერიოზული შენობა, გაჩერდა ყველა დაგეგმილი გზის და გვირაბის მშენებლობა, არ დამატებია არცერთი საბაგირო, გარდა ჩემს მიერ ადრე შეძენილისა), მესტიაში გაჩერდა ცხოვრება და ამდენი წელი ეს საათიც კი ვერ შეაკეთეს-აი ესაა ოლიგარქის მიერ გაჩერებული დროის ქრონიკა.&nbsp;<a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%A1%E1%83%90%E1%83%A5%E1%83%90%E1%83%A0%E1%83%97%E1%83%95%E1%83%94%E1%83%9A%E1%83%9D%E1%83%A8%E1%83%98%E1%83%A3%E1%83%9C%E1%83%93%E1%83%90%E1%83%92%E1%83%90%E1%83%97%E1%83%94%E1%83%9C%E1%83%93%E1%83%94%E1%83%A1?source=feed_text&amp;epa=HASHTAG&amp;__xts__%5B0%5D=68.ARAfDZJOHPCd0RJk8kDPGm_9MsdJBcCZJ8SezeMFC2Q1ctaFs6cBnd-ObDquZs7Prl-Fu5rDqtWCwYjzbbQOpun3aD1iZVVK4MLnAz-_AT0-TXTgAG3mtajeOBJaKDriIHRNzgJG7cKm86sTvI2Zd7CwhLI8_uDUapxFsYQvJeoG_b7ax-nGcrF1EFJeHL0sGZhWBw_QHSk3Y7ehwPOIyzj3HVuT9G7aUXrf05lbtywLApm_ZY05XjPs0AmWdXQSpZLfPJpaVboT0JZK9J4HtSLxIgvcPMDfN1L_tXgOrgHRZIL8hS6xMDrU-PHQCyBu2AEa&amp;__tn__=%2ANK-R1.g\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">საქართველოშიუნდაგათენდეს</span></span></a>!&nbsp;</p>\n<p><img src=\"/media/%E1%83%9B%E1%83%98%E1%83%A8%E1%83%90.jpg\" alt=\"\" width=\"486\" height=\"688\" /></p>', '27', '', 'https://newsebi.ge/media/saakashvili.jpg', '', '', 0, 'mikheil-saakashvili-skandalur-fotos-aqveynebs', 1578934213, '', 669, '', ''),
(101, '', 'ამ წუთებში ვრცელდება უკანასკნელი ინფრომაცია ონდოეთიდან  ანიტას მდგომარეობა ისევ კრიტიკულ ფაზაშია', '<p>59-ღამე მშვიდობისა ანიტელებო!</p>\n<p>&nbsp;ანიტას მდგომარეობა ისევ კრიტიკულ ფაზაშია, თუმცა ორგანიზმი ინარჩუნებს სტაბილურობას.</p>\n<p>&nbsp;გრძელდება დიალიზი და სისხლში გავრცელებული ინფექციის საწინააღმდეგო მკურნალობა.</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;ჯერ-ჯერობით ბავშვის შინაგან ორგანოებს უჭირთ ფუნქციონირება, ამიტომ ძალიან მნიშვნელოვანია გულის ამუშაობა, რომ სხვა ორგანოებზე დატვირთვა შემცირდეს. ამჟამად გულის ყველა ფუნქციას ჩანერგილი აპარატი ასრულებს.</p>\n<p>&nbsp;ბოლო კვლევის მიხედვით, აღარ აღინიშნება სოკოს ინფექცია, ნამდვილად დაძლეულია თუ არა ბაქტერია, ამის დასადგენად დღეს განმეორებით მოხდა სისხლის ბაქტერიოლოგიური გამოკვლევა.</p>\n<p>&nbsp;ექიმი ბალაკრიშნანი აღნიშნავს, რომ ანიტას კონტაქტზე გამოსვლა და ის რომ მისი ნევროლოგია არ დაზიანებულა არის ძლიან საოცარი და მნიშვნელოვანი ფაქტი.</p>\n<p>&nbsp;ყველას გილოცავთ დამდეგ ძველით ახალ წელს!</p>\n<p>ეს წელი ჩვენი გამარჯვების იქნება!</p>\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a>&nbsp;სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90.jpg', '', '', 0, 'am-tsutebshi-vrceldeba-ukanaskneli-infromacia-ondoetidan--anitas-mdgomareoba-isev-kritikul-fazashia', 1578947539, '', 5651, '', ''),
(102, '', 'სასწრაფოდ: აღიარებითი ჩვენება', '<p>მიხეილ სააკაშვილი სოაციალურ ქსელში აქვეყნებს ვიდეო მიმართვას შემდეგი სათაურით - \"სასწრაფოდ!-აღიარებითი ჩვენება\".</p>\n<p><iframe style=\"border: none; overflow: hidden;\" src=\"https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2FSaakashviliMikheil%2Fvideos%2F2464954333832307%2F&amp;show_text=0&amp;width=560\" width=\"560\" height=\"316\" frameborder=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"></iframe></p>', '27', '', 'https://newsebi.ge/media/misha.jpg', '', '', 0, 'sastsrafod-aghiarebiti-chveneba', 1579027627, '', 845, '', ''),
(103, '', 'მთავარი არხის ექსკლუზივი ბიძინა ივანიშვილის მეორედ მოსვლა ის პრემიერ მინისტრის პოსტზე ბრუნდება', '<p>მთავარი არხის ექსკლუზიური ინფორმაციით ბიძინა ივანიშვილი პრემიერ მინისტრად ბრუნდება. ბოლო ხანებში აქტიურად განიხილება მოქმედი პრემიერის გიორგი გახარიას გადადგომასთან დაკავშირებით, მის მემკვიდრედ განიხილებოდა პარლამენტის მოქმედი თავმჯდომარე არჩილ თალაკვაძე და რეგიონალური განვითარებისა და ინფრასტრუქტურის მინისტრი, ვიცე-პრემიერი მაია ცქიტიშვილი.&nbsp; მაგრამ სიუჟეტიდან ჩანს აღნიშნულ პოსტს ისევ ივანიშვილი აპირებს ჩაიბაროს.</p>\n<p><iframe style=\"border: none; overflow: hidden;\" src=\"https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2FTvMtavari%2Fvideos%2F513092419320767%2F&amp;show_text=0&amp;width=560\" width=\"560\" height=\"315\" frameborder=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"></iframe></p>', '27', '', 'https://newsebi.ge/media/%E1%83%98%E1%83%95%E1%83%90%E1%83%9C%E1%83%98%E1%83%A8%E1%83%95%E1%83%98%E1%83%9A%E1%83%98-%E1%83%91%E1%83%98%E1%83%AB%E1%83%98%E1%83%9C%E1%83%90.jpg', '', '', 0, 'mtavari-arkhis-eqskluzivi-bidzina-ivanishvilis-meored-mosvla-is-premier-ministris-postze-brundeba', 1579031907, '', 2034, '', ''),
(104, '', 'რამდენიმე წუთის წინ გავრცელდა ინფორმაცია ბაკურიანში ანრი ოხანაშვილი სცემეს', '<p>ბაკურიანში დეპუტატ ანრი&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ოხანაშვილს</span>&nbsp;ფიზიკურად გაუსწორდნენ. ამის შესახებ ინფორმაციას &bdquo;რუსთავი 2&ldquo; ავრცელებს.</p>\n<p>პარლამენტის წევრი, ბაკურიანის ერთ ერთ რესტორანში, ოჯახთან ერთად ვახშმობდა, სადაც ერთ-ერთმა პირმა მას ჯერ სიტყვიერი შეურაცხყოფა მიაყენა, შემდეგ კი ფიზიკურად გაუსწორდა.</p>\n<p>მომხდარი &bdquo;პრაიმტაიმს&ldquo; შინაგან საქმეთა სამინისტროში დაუდასტურეს, როგორც უწყებაში აცხადებენ თავდამსხმელი სსკ-ის 173-ე ადმინისტრაციული მუხლით დააკავეს, ფაქტზე კი გამოძიება 151-ე მუხლით მიმდინარეობს რაც მუქარას გულისხმობს.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%A0%E1%83%98.jpg', '', '', 0, 'ramdenime-tsutis-tsin-gavrcelda-informacia-bakurianshi-anri-okhanashvili-scemes', 1579032546, '', 287, '', ''),
(105, '', 'ამ წამს გავრცელდა უკანასკნელი ცნობები ინდოეთიდან ანიტა გმირულად ელოდება როდის გათავისუფლდება მართვით სუნთქვის აპარატისგან', '<p>&nbsp;60 ღამე, საოცარი ერთიანობა და 1 უსაყვარლესი გოგოს გარშემო გაერთიანებული 69000-ზე მეტი ადამიანი- ეს არის ანიტელების ჯგუფი!</p>\n<p>ანიტა ინარჩუნებს სტაბილურობას. ორგანიზმში სისხლის მიმოქცევა შედარებით აღდგენილია. მიმდინარეობს ინტენსიური მკურნალობა ღვიძლის ფუნქციონირების გამოსასწორებლად.<br />გრძელდება დიალიზი და სისხლში ინფექციის საწინააღმდეგო მკურნალობა.</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;რაც მთავარია ანიტა კონტაქტურია, ჩურჩულით ელაპარაკება ოჯახის წევრებს, აქტიურად ამოძრავებს კიდურებს და გმირულად ელოდება როდის გათავისუფლდება მართვით სუნთქვის აპარატისგან.</p>\n<p>&nbsp;უფრო შემართებით არიან ანიტას მშობლებიც!</p>\n<p>&nbsp;თქვენი სიყვარული ყოველდღიურად ძალებით ავსებს ანიტას ოჯახს, თითოეული თქვენგანის ჩართულობა უზომოდ დასაფასებელია!</p>\n<p>ჩვენ უნდა გავიმარჯვოთ!<br /><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a>&nbsp; სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/anita.jpg', '', '', 0, 'am-tsams-gavrcelda-ukanaskneli-cnobebi-indoetidan-anita-gmirulad-elodeba-rodis-gatavisufldeba-martvit-suntqvis-aparatisgan', 1579035510, '', 13652, '', ''),
(106, '', 'მთელი საქართველო შეძრა – “ინგოროყვას კლინიკაში ჯანმრთელ ადამიანს ქიმიოთერაპია დაუნიშნეს”', '<p>თათული თეთრაული სოციალურ ქსელში, ფოტოს აქვეყნებს და წერს:</p>\n<p>როცა კიბო არ გკლავს და გკლავენ ექიმები&hellip;.<br />აუცილებლად დასაწერი,წასაკითხი და გასაზიარებელი პოსტი&hellip;<br />ვეცდები დავწერო მოკლედ (შეძლებისდაგვარად) და დეტალურად&hellip;<br />დაახლოვებით 2თვის წინ ზურა საავადმყოფოში მოხვდა სათესლე ჯირკვლის ტკივილით. სასწრაფომ გადაიყვანა ინგოროყვას კლინიკაში და გამოკვლევებიც იქვე ჩატარდა. მეორე დღეს დადგინდა სათესლე ჯირკვლის სიმსივნე და დაინიშნა სასწრაფო ოპერაცია&hellip; ჩემი დიდი წინააღმდეგობის მიუხედავად ზურამ გადაწყვიტა რომ ინგოროყვაშივე უნდა გაეკეთებინა ოპერაცია.<br />17 სექტემბერს ჩატარებული ოპერაციის შემდეგ შევდივარ ექიმთან და მეუბნება რომ სიმსივნე არის ავთვისებიანი და არის ეჭვი რომ მეტასტაზები წასულია მუცლის ღრუში.<br />დეტალურად არაა საჭირო გადმოვცე ჩემი რეაქცია&hellip;ვერც გადმოვცემ მარტო ის ვიცი რომ მთელი დღე გლოვაში და ტირილში გავატარე. იქამდე გვქონდა გაკეთებული MRI და ყველა საჭირო გამოკვლევა რის მიხედვითაც ჩანდა რომ ყველა ორგანო იყო სუფთა მაგრამ ოპერაციის მერე ჩვენმა ექიმმა მოგვთხოვა ახალი გამოკვლევები რომლებიც უნდა ჩატარებულიყო იმავე კლინიკაში.არც ამ გამოკვლევებით გამოჩნდა სადმე რამე საეჭვო მაგრამ<br />მაინც (არ ვიცი რატო და ალბად არც თვითონ იციან) გადაწყდა ქიმიოთერაპია&hellip;<br />დაჟინებული მოთხოვნით ქიმიის კურსი უნდა ჩატარებულიყო სასწრაფოდ.</p>\n<p>ქიმიოთერაპია დაგვინიშნა შალვა ჭოველიძემ რომელმაც ჩაატარა ოპერაცია. ამ დროს რა მდგომარეობა იყო ჩვენს სახლში თუ ტვინში მხოლოდ ჩვენ ვიცით და არავის ვუსურვებ გამოსცადოს მაგრამ დამიჯერეთ ძალიან მძიმეა&hellip; მივედით დათქმულ დროს, შევდივართ ქიმიოთერაპევტთან რომელსაც შევყავართ ოთახში და გევუბნება რომ ზურას არ სჭირდება ქიმია, რომ ის ოპერაციის მერე აბსოლიტურად ჯანმრთელია და რომ ის არ გააკეთებს ქიმიას&hellip; შოკში ვიყავით, ზურა ტიროდა სიხარულით&hellip; მე ვერც სიხარული გამოვხატე, ვეღარ გავიგე რა მოხდა&hellip; დიდი მადლობა გადავუხადეთ ქიმიოთერაპევტს და წამოვედით ( მხოლოდ ამ ქაბატონის გამო არ მინდოდა ამ პოსტის გასაჯაროვება მაგრამ ვერც ამ ამბავს გავატარებდი ასე ჩუმად) ძალიან ბედნიერები ვართ ძააალიან მაგრამ ხანმოკლე აღმოჩნდა სიხარული. დაახლოვებით 2 საათში იგივე ქიმიოთერაპევტი გვირეკავს და გვეუბნება რომ რაღაცეებს გადახედა და შეეშალა, აუცილებლად და თან მეორე დღესვე უნდა დაიწყონ ქიმიოთერაპია..<br />ალბად ყველა ხვდებით რაც მოხდა იქ.. და რატო შეიცვალა აზრი ამ ქალბატონმა.<br />ბევრი რომ არ ვწერო ჩემი უახლოვესი მეგობრის დაჟინებით ჯერ ანალიზის პასუხები გავაგზავნეთ თურქეთში და მერე სასწრაფოდ წავედით ერთ-ერთ კლინიკაში სადაც დაგვხვდა ორი ქართველი გოგო მარიამი და ხატია ( სამწუხაროდ გვარები არ მახსოვს,უღრმესი მადლობა მათ ყველაფრისთვის)გაკეთდა ყველაფერი რაც საჭირო იყო და წამოვედით&hellip; 2 დღის მერე დაგვირეკა ხატიამ და მოგვილოცა,<br />ზურა არის აბსოლიტურად ჯანმრთელი, არც ერთ ორგანოზე არ არის მეტასტაზი და რა თქმა უნდა ჯანმრთელ ადამიანს არ სჭირდება ქიმიოთერაპია&hellip;<br />ეს იყო ნამდვილად დიდი სიხარული!<br />ახლიდან დავიწყეთ ცხოვრება.</p>\n<p>დამიჯერეთ ხალხო ეს პოსტი არის ყველაზე მსუბუქი რაც შეიძლება ჩვენს მდგომარეობაზე დამეწერა.ეს ორი თვე რა ჯოჯოხეთი გავიარეთ, რამდენი ვიტირეთ,რამდენი ვიდარდეთ და რამდენჯერ დაგვენგრა მოლოდინი ვერ წარმოიდგენთ&hellip; რამდენ ორშაბათს ველოდეთ განაჩენივით, პასუხების ლოდინში&hellip;რამდენჯერ ერთმანეთსაც ვეღარ ველაპარაკებოდით და თავს ვისულელებდით თითქოს არაფერი ხდებოდა და თითქოს ქიმიაც არაფერი იყო,მერე რა&hellip; იმდენი ადამიანი იკეთებსო და სინამდვილეში ვიცოდით ეს ყველაფერი რამხელა ძალასთან და ნერვიულობასთან იყო დაკავშირებული.ყველაფერი გადავაგორეთ! სუსტ ადამიანად არასდროს ვთვლიდი თავს მაგრამ ამდენი ძალა თუ მქონდა ეხლა გავიგე&hellip; ვყველაფერი გავიარეთ ჩვენი ძალიან მაგარი ოჯახების და უძალიანმაგრესი მეგობრების დახმარებით რომლებიც დიაგნოზის დასმის წამიდან, ოპერაციის ჩათვლით დღემდე გვიდგანან გვერდით მორალურად თუ ეკონომიურად. ვუყურებდი მათ და ვხედავდი რომ ყველაფრის გამკეთებლები იყვნენ ჩვენთვის!<br />ძალიან დიდი მადლობა ყველაფრისთვის,ჩვენ ვართ ყველაზე მდიდარი ადამიანები თქვენით!<br />მაქვს კითხვა ბატონ შალვა ჭოველიძესთან, ბატონო შალვა ხედავდით ჩემს განადგურებულ თვალებს და მაინც გაგვწირეთ რამოდენიმე თვიანი ტანჯვისთვის&hellip;.( რისთვისაც არ გაგვიმეტეს უცხო ქვეყნის ექიმებმა)<br />რატომ??????<br />ადამიანს რომელმაც მოიშორა სიმსივნე და აღარანაირი მეტასტაზი თუ სხვა პრობლემა აღარ ქონდა ორგანიზმში, რატომ დაუნიშნეთ 6 ქიმიოთერაპია?<br />გამიხარდება ამ პოსტით ერთ ადამიანს მაინც თუ დავაფიქრებ და გადავარჩენ&hellip;<br />ჯანმრთელობას გისურვებთ და მათ ვინც უკვე ებრძვის ამ სენს ძალიან ძალიან მალე გამოჯანმრთელებას</p>\n<p><a href=\"http://alia.ge/news/37197\" target=\"_blank\" rel=\"noreferrer noopener\">წყარო</a></p>', '27', '', 'https://newsebi.ge/media/aaas.png', '', '', 0, 'mteli-saqartvelo-shedzra--ingoroyvas-klinikashi-janmrtel-adamians-qimioterapia-daunishnes', 1579097765, '', 13602, '', ''),
(107, '', 'სასწრაფოდ: უახლესი ინფორმაცია ინდოეთიდან ანიტასთან დაკავშირებით ამ დრომდე გრძელდება დიალიზი და ინფექციის საწინააღმდეგო ანტიბიოტიკოთერაპია', '<p>61-ე საღამო მშვიდობისა ანიტელების ჯარს!</p>\n<p>&nbsp;ანიტას დღეს ბილირუბინის მაჩვენებელი თითქმის ნორმამდე დაეწია და შესაბამისად სიყვითლემაც გაუარა.</p>\n<p>&nbsp;ამ დრომდე გრძელდება დიალიზი და ინფექციის საწინააღმდეგო ანტიბიოტიკოთერაპია.</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;როგორც ექიმმა თქვა, სანამ ჩვენი გოგოს გული ეკმოს აპარატის დახმარებით მუშაობს, მას მოუწევს რეანიმაციულ ბლოკში ყოფნა, სადაც მშობლების მუდმივი ყოფნა არ შეიძლება.<br /> &nbsp;ამის გამო ცოტა მოვიწყინეთ, მაგრამ გვჯერა, რომ მალე ანიტას მდგომარეობა და დონორის გამოჩენა, ექიმებს გულის გადანერგვის საშუალებასაც მისცემს!</p>\n<p>გვინდა კიდევ ერთხელ, გულითადი მადლობა გადავუხადოთ საქართველოს სრულუფლებიან ელჩს ინდოეთში, ბატონ არჩილ ძულიაშვილს, რომელიც ამ დრომდე ქალაქ ჩენაიში რჩება და ყველანაირ დახმარებას უწევს ანიტას ოჯახს.</p>\n<p>&nbsp;დიდი მადლობა თითოეულ თქვენგანს ამ უდიდესი თანადგომისთვის!</p>\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a> სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/anit.jpg', '', '', 0, 'sastsrafod-uakhlesi-informacia-indoetidan-anitastan-dakavshirebit-am-dromde-grdzeldeba-dializi-da-infeqciis-satsinaaghmdego-antibiotikoterapia', 1579119059, '', 5258, '', ''),
(108, '', 'სამწუხარო ინფორმაცია ავარია თბილისში გარდაცვლილია 20 წლის ბიჭი', '<p>თბილისში, ვაშლიჯვარში ავტოსაგზაო შემთხვევა მოხდა.</p>\n<p>არსებული ინფორმაციით, ერთმანეთს ორი მსუბუქი ავტომობილის შეეჯახა. შედეგად გარდაიცვალა ერთი და დაშავდა ოთხი ადამიანი.</p>\n<p>როგორც საქართველოს პირველ არხს შინაგან საქმეთა სამინისტროში განუცხადეს, ფაქტზე დაწყებულია გამოძიება სისხლის სამართლის კოდექსის 276-ე მუხლის მეექვსე ნაწილით, რაც ტრანსპორტის მოძრაობის უსაფრთხოების ან ექსპლუატაციის წესის დარღვევას გულისხმობს, რამაც ადამიანის სიცოცხლის მოსპობა გამოიწვია.</p>', '27', '', 'https://newsebi.ge/media/avaria.jpg', '', '', 0, 'samtsukharo-informacia-avaria-tbilisshi-gardacvlilia-20-tslis-bichi', 1579131641, '', 7586, '', ''),
(115, '', 'ბოლო ცნობები ინდოეთიდან ექიმების ვარაუდით სისხლში ინფექციის დაძლევას დაახლოებით ერთი თვე დასჭირდება', '<p>&nbsp;62-ე ღამემშვიდობისა ანიტელებო!</p>\n<p>&nbsp;ვინც ჯერ ანიტას მეგობრების გადასარჩენად შექმნილ ჯგუფში არ ხართ, გთხოვთ, გადადით ბმულზე და შემოგვიერთდით, რომ ერთად ვაკეთოთ სიკეთე ანიტას სახელით:</p>\n<p>&nbsp;</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;რაც შეეხება ჩვენს გოგოს:<br />ჯერჯერობით მისი მდგომარეობა უცვლელია.<br /> დღეს დიდი თხოვნის შემდეგ მარიკო რეანიმაციულ განყოფილებაში ჩვეულებრივზე მეტ ხანს გააჩერეს, რაც ძალიან გვახარებს.</p>\n<p>&nbsp;გრძელდება ანტიბიოტიკოთერაპია, ექიმების ვარაუდით სისხლში ინფექციის დაძლევას დაახლოებით ერთი თვე დასჭირდება.<br /> &nbsp;ამ ეტაპზე ისევ არის დიალიზის საჭიროება.<br /> ბილირუბინის მაჩვენებელმა ცოტათი დაიწია და თითქმის ნორმის ზღვარს გაუტოლდა.</p>\n<p>&nbsp;ჩვენი ელჩი ისევ რჩება ანიტას ოჯახის გვერდით და ძალიან დიდ მხარდაჭერას უწევს მათ.</p>\n<p>&nbsp;ანიტას წინ ხანგრძლივი მკურნალობა და რთული გზა ელის და ამ გზაზე თქვენი თანადგომის იმედი გვაქვს!</p>\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a> სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/anita%20(1).jpg', '', '', 0, 'bolo-cnobebi-indoetidan-eqimebis-varaudit-siskhlshi-infeqciis-dadzlevas-daakhloebit-erti-tve-daschirdeba', 1579207036, '', 5835, '', ''),
(116, '', 'საზარელი შემთვევა აჭარაში დედამ ახალშობილი შვილი მოკლა', '<p>ხელვაჩაურის ერთ-ერთ სოფელში მცხოვრები ქალი ახალშობილის განზრახ მკვლელობის მუხლით გაასამართლეს. მას მოსამართლე ნუგზარ მგელაძემ 4 წლით თავისუფლების აღკვეთა შეუფარდა, რაც ჩაეთვალა პირობით გამოსაცდელი ვადით - ინფორმაციას ამის შესახებ გამოცემა \"ბათუმელები\" აქვეყნებს.<br /><br /> <br /><br />გამოძიების ვერსიით, საძინებელ ოთახში &bdquo;მშობიარობის შემდეგ უმალვე კისრის ორგანოებზე დაწოლით მან განზრახ მოკლა მამრობითი სქესის ახალშობილი&hellip;&ldquo;, &ndash; აღნიშნულია განაჩენში. ადგილზე მისულ პოლიციელებს ახალშობილი უკვე გარდაცვლილი დახვდათ, ქალი კლინიკაში გადაიყვანეს. ბრალდებულმა დანაშაულის ჩადენა აღიარა და უდავოდ მიიჩნია ყველა მტკიცებულება, რაც პროკურორმა მის წინააღმდეგ წარმოადგინა.<br /><br />&bdquo;სასამართლო მიიჩნევს, რომ ბრალდებული, რომელიც ადრე არ არის ნასამართლევი, აღიარებს, ინანიებს და მძიმედ განიცდის ჩადენილ დანაშალუს, სასჯელი უნდა დაენიშნოს იმ ზომით, რაც შეესაბამება მსჯავრდებულის ქმედების სიმძიმეს, მის პიროვნებას და დანაშაულის შემდგომ ქცევას და რაც არ იქნება მკაცრი და უსამართლო, რაც სასამართლოს აზრით უფრო მეტად შეუწყობს ხელს სამართლიანობის აღდგენას და მის საზოგადოებაში ინტეგრაციას,&ldquo; &ndash; წერია განაჩენში.<br /><br />20 წლის ქალი სისხლის სამართლის კოდექსის 112 -ე მუხლის შესაბამისად გაასამართლეს. ეს მუხლი გულისხმობს &bdquo;დედის მიერ ახალშობილის განზრახ მკვლელობას მშობიარობისას ან მშობიარობის შემდეგ უმალვე&ldquo;. დანაშაული ისჯება შინაპატიმრობით ვადით ექვსი თვიდან ორ წლამდე ან თავისუფლების აღკვეთით ვადით სამიდან ხუთ წლამდე.</p>\n<p><a href=\"http://geoposts.ge/society/4220--20-.html\">წყარო</a></p>', '27', '', 'https://newsebi.ge/media/%E1%83%A1%E1%83%90%E1%83%A1%E1%83%AC%E1%83%A0%E1%83%90%E1%83%A4%E1%83%9D.jpg', '', '', 0, 'sazareli-shemtveva-acharashi-dedam-akhalshobili-shvili-mokla', 1579261613, '', 5003, '', ''),
(117, '', 'უკანასკნელი ინფორმაცია ინდოეთიდან  ექიმები ებრძვიან სეფსისს სისხლის მიმოქცევა კიდურებში გართულებულია, განსაკუთრებით გამუქებულია ხელები', '<p>ღამე 63-ე</p>\n<p>&nbsp;ანიტას მდგომარეობა ისევ სტაბილურად მძიმეა.</p>\n<p>&nbsp;ექიმები ებრძვიან სეფსისს და პოლიორგანულ უკმარისობას.</p>\n<div class=\"text_exposed_show\">\n<p>რადგანაც გულის ყველა ფუნქციას მხოლოდ ეკმოს აპარატი ასრულებს, სისხლის მიმოქცევა კიდურებში გართულებულია, განსაკუთრებით გამუქებულია ხელები.<br />გუშინ დაიწყო ახალი პრეპარატის გადასხმა ამ პრობლემის მოსაგვარებლად, ექიმების თქმით შედეგს 48 საათის შემდეგ უნდა ველოდოთ.</p>\n<p>&nbsp;მიუხედავად იმისა, რომ ჩვენი გოგო ძალიან მოწყენილია, მაინც ეკონტაქტება მშობლებს და მოთმინებით ელოდება სასუნთქი მილისგან გათავისუფლებას.</p>\n<p>&nbsp;როგორც ყველა ექიმი აღნიშნავს, ანიტა საკმაოდ ძლიერი გოგოა, ამიტომ ჩვენ გვჯერა, რომ მისი ბრძოლისუნარიანობა, თქვენი ერთიანობა, ლოცვა და სიყვარული მალე გამარჯვებამდე მიგვიყვანს!</p>\n<p>ყველაფერი კარგად უნდა იყოს!</p>\n</div>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20(1).jpg', '', '', 0, 'ukanaskneli-informacia-indoetidan--eqimebi-ebrdzvian-sefsiss-siskhlis-mimoqceva-kidurebshi-gartulebulia-gansakutrebit-gamuqebulia-khelebi', 1579294132, '', 16465, '', ''),
(123, '', 'ვინ არის სურამში მოკლული 26 წლის ქალი, რომელიც ქმარმა მოკლა', '<p>სურამში მომხდარ მკვლელობასთან დაკავშირებით ,,დიანიუსისთვის\" დამატებითი დეტალები ხდება ცნობილი. მეზობლების ინფორმაციით, ქალი ყოფილმა ქმარმა ნაჯახით მოკლა, რის შემდეგაც 32 წლის ბრალდებული შემთხვევის ადგილიდან მიიმალა. არსებული ინფორმაციით, გარდაცვლილი 26 წლის გოგოა, რომელსაც 4 წლის შვილი დარჩა.<br /><br />ამ წუთებში შემთხვევის ადგილზე ექსპერტ-კრიმინალისტები მუშაობენ.<br /><br />გამოძიება სისხლის სამართლის კოდექსის 109-ე მუხლის მეორე ნაწილის &bdquo;ვ&ldquo; პუნქტით დაიწყო, რაც ოჯახის წევრის მიმართ დამამძიმებელ გარემოებაში ჩადენილ განზრახ მკვლელობას გულისხმობს.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%A1%E1%83%A3%E1%83%A0%E1%83%90%E1%83%9B%E1%83%98%20%E1%83%9B%E1%83%99%E1%83%95%E1%83%9A%E1%83%94%E1%83%9A%E1%83%9D%E1%83%91%E1%83%90.jpg', '', '', 0, 'vin-aris-suramshi-mokluli-26-tslis-qali-romelic-qmarma-mokla', 1579353433, '', 2041, '', '');
INSERT INTO `trainings` (`id`, `source`, `title`, `text`, `category`, `scraped_at`, `img`, `origin_date`, `tags`, `comments_number`, `slug`, `date`, `origin_url`, `views`, `keywords`, `description`) VALUES
(125, '', 'თბილისში ირანელებმა   ქართველი გოგო სასტიკად სცემეს   – გოგონას უმძიმესი ოპერაცია ჩაუტარდა და ამ დრომდე რეანიმაციაშია ', '<aside class=\"mashsb-container mashsb-main mashsb-stretched\">\n<div class=\"mashsb-box\">\n<div class=\"mashsb-buttons\">&ldquo;ქართული მარშის&rdquo; ლიდერი სანდრო ბრეგაძე სოციალურ ქსელში წერს:</div>\n</div>\n</aside>\n<p>&ldquo;დავძაბუნდით და ფულზე იყიდება ყველაფერი !!! აბა დამენახეთ-&ldquo;ქართულ მარშს&rdquo; რომ აკრიტიკებდით-ირანელ ინვესტორებს აფრთხობენო !!! არ დაგვიჯეროთ არა და მალე სახლებში შემოგვივარდებიან ეს &ldquo;ბარბაროსები&rdquo;&mdash;- როგორც დადასტურებულად გახდა ცნობილი ირანელების ბანდა 15 იანვარს, დაახლოებით 21:00 საათიდან 21:30-საათამდე თავს დაესხა პეროვსკაიას ქუჩაზე მდებარე ვალუტის ჯიხურს !!! მოლარე ოპარატორი სავალუტო ჯიხურს კეტავდა. მას თავს დაესხა რამდენიმე ირანელი, დაახლოებთ 30 წლამდე ასაკის მამაკაცები. გოგონა სასტიკად სცემეს. სავარაუდოდ, ცდილობდნენ მის გაგუდვას !!!</p>\n<p>რაც შეეხება ნაცემ გოგონას, მას ფეხზე უმძიმესი ოპერაცია ჩაუტარდა და ამ დრომდე რეანიმაციაშია !!!</p>', '24', '', 'https://newsebi.ge/media/ccc.jpg', '', '', 0, 'tbilisshi-iranelebma---qartveli-gogo-sastikad-scemes----gogonas-umdzimesi-operacia-chautarda-da-am-dromde-reanimaciashia-', 1579377164, '', 11768, '', ''),
(126, '', 'ამ წამს გავრცელდა უკანასკნელი ცნობები ინდოეთიდან ანიტა ამ ეტაპზე ისევ დგას დიალიზის საჭიროება', '<p>64-ე ღამე ჩვენს ჯგუფში</p>\n<p>&nbsp;ანიტას მდგომარეობა უცვლელია.<br />&nbsp;გრძელდება ძლიერი ანტიბიოტიკოთერაპია სეფსისის დასაძლევად.<br />&nbsp;ამ ეტაპზე ისევ დგას დიალიზის საჭიროება.<span class=\"text_exposed_show\"><br />&nbsp;უკეთებენ გადასხმას გულის კუმშვისა და სისხლის მიმოქცევის გასაუმჯობესებლად.</span></p>\n<div class=\"text_exposed_show\">\n<p>თქვენ ერთხელ უკვე მოახდინეთ სასწაული, როდესაც ანიტა ინდოეთამდე ჩაფრინდა. ზუსტად ასეთი სასწაული გვჭირდება ახლაც!</p>\n<p>&nbsp;ზოგი ხშირად ვლოცულობთ, ზოგი არც ისე, ზოგი საერთოდ არ ვლოცულობთ, მაგრამ ანიტას დედიკო ძალიან მორწმუნეა, ამიტომ, ყველას მთელი გულით გთხოვათ, ვისაც როგორ შეგიძლიათ ისე ვითხოვოთ ან უბრალოდ ვინატროთ ანიტას კარგად ყოფნა.</p>\n<p>&nbsp;შეგახსენებთ, რომ შეიქმნა სივრცე სხვა ბავშვების დასახმარებლად, მიჰყევით ბმულს, ერთად ვაკეთოთ სიკეთე ანიტას სახელით!</p>\n<p>&nbsp;</p>\n<p><span class=\"_5mfr\"><span class=\"_6qdm\">❗️</span></span>&nbsp;აქვე, მინდა კიდევ ერთხელ ვთხოვო საინფორმაციო სააგენტოებს, მოერიდონ მწვავე სათაურების გამოქვეყნებას.</p>\n<p>თქვენი სიყვარულის იმედი გვაქვს, რომელიც სასწაულებს ახდენს<br /><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" type=\"\" data-ft=\"{\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a>&nbsp;სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/anita.jpg', '', '', 0, 'am-tsams-gavrcelda-ukanaskneli-cnobebi-indoetidan-anita-am-etapze-isev-dgas-dializis-sachiroeba', 1579383414, '', 12227, '', ''),
(127, '', 'ბოლო ინფორმაცია ინდოეთიდან ანიტა ძალიან აქტიურად ეკონტაქტა მშობლებს და ცხვირიდან ზონდიც კი მოიძრო', '<p>&nbsp;65-ე ღამემშვიდობისა ანიტელებო!</p>\n<p>&nbsp;ჩვენი გოგოს მდგომარეობა უცვლელია.</p>\n<p>&nbsp;ექიმები ისევ ებრძვიან სეფსისს და პოლიორგანულ უკმარისობას.</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;დღეს შეუმცირეს დამაძინებელი საშუალებების დოზა, რის ფონზეც ძალიან აქტიურად ეკონტაქტა მშობლებს და ცხვირიდან ზონდიც კი მოიძრო.</p>\n<p>&nbsp;ექიმ ბალაკრიშნანის თქმით, მიუხედავად იმისა, რომ ანიტას ჯანმრთელობა არ გაუმჯობესებულა, კარგია რომ არ აღინიშნება მდგომარეობის უკუსვლა.</p>\n<p>ჩვენ ისევ თქვენი სიყვარულის იმედი გვაქვს და იმის, რომ თქვენი თანადგომა, ლოცვა და დადებითი ენერგია სასწაულებს მოახდენს!</p>\n<p>&nbsp;როგორც ანიტას დედიკოს აცნობეს, რეანიმაციული განყოფილების მთლიანი გუნდი თვალს ადევნებს ანიტას გარშემო სოციალურ ქსელში მიმდინარე ამბებს, მათი თქმით ექიმების გუნდიც ლოცულობს ამ განსაკუთრებული გოგოსთვის!</p>\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a> სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90.jpg', '', '', 0, 'bolo-informacia-indoetidan-anita-dzalian-aqtiurad-ekontaqta-mshoblebs-da-ckhviridan-zondic-ki-moidzro', 1579468026, '', 8458, '', ''),
(128, '', 'ნანუკა ჟორჟოლიანი სკანდალურ განცხადებას ავრცელებს', '<p>ვაახ, რა ამბები გამომიტოვებია:) როდის იყო ჩვენ ვწყვეტდით ვინ, სად მოვა. რაც არ უნდა გავლენიანი იყოს ტელევიზია და ცალკეული ჟურნალისტი, მაინც არავინ ეკითხება ვინ-სად მივა. თუმცა პირადი მოსაზრება ყველას შეუძლია ჰქონდეს:) ოცნებებიც.</p>\n<p>რაც შეეხება მიშას ერთპიროვნულ მმართველობას, რომელიც გაბუს თქმით თურმე ყოფილა, ძალიან ქოცური ნარატივია და ვწუხვარ რომ მისგან მესმის ის, რასაც გავრილოვები ამბობენ.</p>\n<p>&nbsp;</p>\n<p><iframe style=\"border: none; overflow: hidden;\" src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fnanuka.zhorzholiani%2Fposts%2F10157949857469350&amp;width=500\" width=\"500\" height=\"274\" frameborder=\"0\" scrolling=\"no\"></iframe></p>', '27', '', 'https://newsebi.ge/media/2019070722351886669.jpg', '', '', 0, 'nanuka-zhorzholiani-skandalur-ganckhadebas-avrcelebs', 1579545154, '', 3336, '', ''),
(129, '', 'უახლესი ინფორმაცია ინდოეთიდან ამ წუთებში ხდება ცნობილი  ხელები შეფუთული აქვს, მაინც ახერხებს  ინტუბაციის მილის წვალებას', '<p>66-ე ღამეა ერთად ვართ!</p>\n<p>მდგომარეობა ისევ სტაბილურად მძიმეა.</p>\n<p>&nbsp;ექიმები ცდილობენ გააუმჯობესონ სისხლის მიმოქცევა, რადგან სისხლი რთულად მიეწოდება კიდურებს და ანიტას ხელები გაუმუქდა.</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;გრძელდება ძლიერი ანტიბიოტიკოთერაპია სეფსისის სამკურნალოდ.</p>\n<p>&nbsp;ამ ეტაპზე ისევ დგას დიალიზის საჭიროება.</p>\n<p>&nbsp;როგორც ექიმებმა აღნიშნეს, ანიტა რეანიმაციული განყოფილების ყველაზე ცელქი პაციენტია.<br /> &nbsp;მიუხედავად იმისა, რომ ხელები შეფუთული აქვს, მაინც ახერხებს ზონდის გამოძრობას და ინტუბაციის მილის წვალებას, ამიტომ, რაც დამაძინებლების დოზა შეუმცირეს, ექიმები ხშირად ეძახიან<br />ანიტას დედიკოს დასახმარებლად.</p>\n<p>&nbsp;ჩვენ იმედით და მოთმინებით ველოდებით ჩვენი გოგოს ჯანმრთელობის მდგომარეობის გაუმჯობესებას !</p>\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a>&nbsp; სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/anit.jpg', '', '', 0, 'uakhlesi-informacia-indoetidan-am-tsutebshi-khdeba-cnobili--khelebi-shefutuli-aqvs-mainc-akherkhebs--intubaciis-milis-tsvalebas', 1579554173, '', 6486, '', ''),
(130, '', 'რა მოხდა მაია ასათაინი ცხოვრებაში- 42 წლის გიჟი ხომ გინახავთ? მომილოცეთ, მეგობრებო', '<p>რა ვიდეოს აქვეყნებს მაია ასათიანი ამას არავინ მოელოდა შემდეგი სათაურით - \"42&nbsp;წლის&nbsp;გიჟი&nbsp;ხომ&nbsp;გინახავთ?&nbsp;მომილოცეთ, მეგობრებო!\"</p>\n<p>&nbsp;</p>\n<p>&nbsp;<iframe style=\"border: none; overflow: hidden;\" src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fkv147%2Fposts%2F2664252193691489&amp;width=500\" width=\"500\" height=\"463\" frameborder=\"0\" scrolling=\"no\"></iframe></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '27', '', 'https://newsebi.ge/media/maia.jpg', '', '', 0, 'ra-mokhda-maia-asataini-ckhovrebashi--42-tslis-gizhi-khom-ginakhavt-momilocet-megobrebo', 1579614785, '', 1634, '', ''),
(131, '', 'სასწრაფოდ: მოულოდნელი სიურპრიზი ქართველი ემიგრანტებისთვის ', '<p>2020 წლის გაზაფხულზე&nbsp;<a href=\"https://avia.ge/germaniis-aviabiletebi/\">გერმანიაში</a>&nbsp;ძალაში შევა კანონი, რომელიც ამ ქვეყანაში ევროკავშირის არაწევრი ქვეყნის მოქალაქეებს ლეგალურად დასაქმების და პროფესიული განათლების მიღების უფლებას მისცემს.</p>\n<h3><strong>აღნიშნული კანონი საქართველოს მოქალაქეებზეც გავრცელდება.</strong></h3>\n<p>შრომის ბაზრის კვლევის ინსტიტუტის ცნობით, 2019 წლის მესამე კვარტალში გერმანიაში 1,36 მილიონი თავისუფალი ვაკანსია იყო და ამ რაოდენობის მხოლოდ გერმანელი მოქალაქეებით შევსება შეუძლებელი აღმოჩნდა.</p>\n<h2><strong>&nbsp;კადრების დეფიციტი ფიქსირდება ისეთ სფეროებში, როგორებიცაა :</strong></h2>\n<ul>\n<li>მათემატიკა, ინფორმატიკა და ტექნიკა, სამშენებლო სექტორი და მედიცინა. ბევრი თავისუფალი ადგილია სასტუმროებისა და რესტორნების ბიზნესში. ასევე, ავადმყოფებისა და მოხუცების მომვლელთა მცირე რაოდენობაც შეიმჩნევა.</li>\n</ul>\n<p>სწორედ ეს გახდა ახალი კანონის შემოღების მიზეზი, რაც ევროკავშირის არაწევრი ქვეყნების მოქალაქეებს საშუალებას მისცემს საკუთარი პროფესიით დასაქმდნენ ევროკავშირის წევრ ქვეყანაში და ეს ყველაფერი კანონის ფარგლებში მოხდეს. ასევე, გეგმავენ, რომ ამ ქვეყნებში გაცემული დიპლომების გერმანიაში აღიარების პროცესი კიდევ უფრო გაამარტივონ.</p>\n<p>ვაკანსიების ჩამონათვალს უცხოელი სპეაციალისტები სპეციალურ ვებპორტალზე ნახავენ და ასევე, გაეცნობიან იმ უნარ-ჩვევების ჩამონათვალს, რომლებიც ამ ვაკანსიების დასაკმაყოფილებლად იქნება აუცილებელი. მათ შორის იქნება გერმანული ენის ცოდნა.</p>', '27', '', 'https://newsebi.ge/media/emigrant.jpg', '', '', 0, 'sastsrafod-moulodneli-siurprizi-qartveli-emigrantebistvis-', 1579631534, '', 4133, '', ''),
(132, '', '67-ე ღამე, ანიტას მდგომარეობა ისევ უცვლელია, ამ წამებშ ხდება ცნობილი ახალი ინფორმაცია', '<p>67-ე სიკეთის ღამემშვიდობისა!</p>\n<p>ანიტას მდგომარეობა უცვლელია. მკურნალობა მაქსიმალურად მიმართულია ინფექციის დასაძლევად.</p>\n<p>როგორც უკვე გითხარით, ექიმ ბალაკრიშნანის თქმით, ისიც, რომ არ აღინიშნება მდგომარეობის უკუსვლა - კარგი ამბავია.</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;ძალიან ბევრმა მოგვწერეთ კითხვით სანდოა თუ არა ინდოელი ექიმების მკურნალობის მეთოდი.</p>\n<p>&nbsp;შეგახსენებთ, რომ ინდოეთი ერთადერთი ქვეყანაა, რომელმაც მიიღო ანიტა, რისთვისაც მათი ძალიან მადლიერები ვართ, ხოლო ექიმი ბალაკრიშნანი კი ერთ-ერთი საუკეთესო ბავშვთა კარდიოქირურგია მსოფლიოში.</p>\n<p>&nbsp;გარდა ამისა, ჩვენ ყოველდღიური კონტაქტი გვაქვს ანიტას მკურნალ ექიმთან დავით ბერიშვილთან, რომელიც საქართველოს საუკეთესო ბავშვთა კარდიოქირურგია, ანიტას ავადმყოფობის პირველივე დღეებიდან აქტიურად ჩართულია და ყველა სახის დახმარებას გვიწევს დისტანციურად. მისი შეფასებით ანიტას მკურნალობა ამ ეტაპზე სრულიად სწორად მიმდინარეობს.</p>\n<p>გვინდა აღვნიშნოთ, რომ დავით ბერიშვილმა თბილისში ანიტას გასინჯვისთანავე, გარდა დიაგნოზისა ყველა სწორი მიმართულება მოგვცა, სწორედ მან ახსენა პირველმა ინდოეთში გამგზავრება და დღემდე, ყველა სასარგებლო რჩევას ამ ადამიანისგან და მისი ბავშვთა კარდიოქირურგების არაჩვეულებრივი გუნდისგან ვიღებთ.</p>\n<p>&nbsp;კიდევ ერთხელ გავიმეორებთ, რომ ქართველები ძალიან ძლიერი და კარგი ერი ვართ!<br />ერთად ყველაფერს შევძლებთ!<br /><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" type=\"\" data-ft=\"{\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a> სთვის</p>\n</div>', '22', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20(3).jpg', '', '', 0, '67-e-ghame-anitas-mdgomareoba-isev-ucvlelia-am-tsamebsh-khdeba-cnobili-akhali-informacia', 1579639071, '', 4743, '', ''),
(133, '', 'ინფრომაცია, რომელიც სულ რამდენიმე წუთია გავრცელდა და ფაქტს ოჯახიც ადასტურებს გარდაიცვალა ყოფილი პრემიერ მინისტრი', '<p>85 წლის ასაკში საქართველოს ყოფილი პრემიერ-მინისტრი თენგიზ&nbsp;სიგუა გარდაიცვალა.</p>\n<p>სიგუას გარდაცვალების ფაქტს მისი ოჯახის ახლობლები ადასტურებენ.</p>\n<p>ზვიად გამსახურდიას&nbsp;პრეზიდენტობის პერიოდში 1990 წლის 15&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ნოემბერიდან</span>&nbsp;&ndash; 1991 წლის 18 აგვისტომდე სიგუა იყო&nbsp;მინისტრთა საბჭოს თავმჯდომარე. გამსახურდიას&nbsp;მთავრობის დამხობის შემდეგ სიგუა დაინიშნა&nbsp;პრემიერ-მინისტრის&nbsp;მოვალეობების დროებით შემსრულებლად.</p>\n<p>1992 წლის 8 ნოემბერს ის დაინიშნა&nbsp;საქართველოს პრემიერ-მინისტრად, თანამდებობიდან კი 1993 წლის 5 აგვისტოს გადადგა.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%A1%E1%83%98%E1%83%92%E1%83%A3%E1%83%90.jpg', '', '', 0, 'infromacia-romelic-sul-ramdenime-tsutia-gavrcelda-da-faqts-ojakhic-adasturebs-gardaicvala-yofili-premier-ministri', 1579641994, '', 2305, '', ''),
(134, '', 'სასწრაფოდ: ვრცელდება  ანიტას დედის საგანგებო მიართვა', '<p>&ldquo;თქვენ ხართ საოცარი ადამიანები, შექმენით საოცარი სივრცე, სადაც ერთი პატარა ნეგატივის მარცვალიც კი ვერ ახერხებს შემოღწევას. თუმცა ამ სივრცის გარეთ შემთხვევით წავაწყდი რამდენიმე კომენტარს, რომელმაც გული გამიგლიჯა, ამიტომ გადავწყვიტე კარგად განვმარტო. ქვეყნებმა სხვადასხვა მიზეზის გამო გვითხრეს უარი (ძირითადად ეს მიზეზი იყო მათი კანონმდებლობა).<br />საბედნიეროდ, 21-ე საუკუნეში არსებობს უამრავი გზა ამ დაავადების მართვისა. მათ შორის ერთ-ერთია ხელოვნური გული, რომლის საშუალებითაც ჩვენ შევძლებთ მშვიდად დაველოდოთ დონორს. ამოვიკითხე კომენტარები, სადაც ხალხი მიიჩნევს, რომ ანიტას ექიმები ხელს არ კიდებენ იმიტომ, რომ ფიქრობენ მაინც არ ეშველება. არა მეგობრებო!!! არა და არააა!!! ეს არც გაიფიქროთ.<br />მსგავსი რამ არც ერთ კლინიკას არ დაუსახელებია მიზეზად. ხსნა და საშველი არსებობს, მთავარია რომელიმე კლინიკა დაგვთანხმდეს და ანიტა იქნება ჯანმრთელი და ბედნიერი. მე გპირდებით ამას!!! გთხოვთ, არავინ გაივლოთ გულში, რომ გამოსავალი არ არსებობს, რადგან ეს არის სიცრუე.&nbsp;პ.ს. ვიდეოს დავურთავ, სადაც ანიტა ასე ბოროტულად იცინის, იმათი მისამართით, ვისაც მისი გამოჯანმრთელების არ სჯერათ</p>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20(2).jpg', '', '', 0, 'sastsrafod-vrceldeba--anitas-dedis-sagangebo-miartva', 1579644223, '', 14470, '', ''),
(135, '', 'სასწრაფოდ: უკანასნელი ცნობები ინდოეთიდან სასიხარულო ინფორმაცია, ამ წუთებშ ხდება ცნობილი', '<p>68-ე ღამე ბედნიერებისა მეგობრებო!</p>\n<p>&nbsp;ანიტას ორგანიზმში უკვე არსებული ინფექცია უკან იხევს, მაგრამ დღევნდელი კვლევით, სისხლში ახალი ბაქტერია ამოითესა, რომლის ზუსტ სახეობას ექიმები ხვალ გაგვაცნობენ.</p>\n<p>&nbsp;გრძელდება დიალიზი და სისხლის მიმოქცევის გასაუმჯობესებელი პრეპარატების გადასმა.</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;ბავშვის ხელები სისხლის მიმოქცევის დარღვევის გამო ისევ გამუქებულია.<br /> თუმცა, სწორედ მათი დათვალიერება-შესწავლით გაჰყავს დრო ანიტას, რადგან რეანიმაციულ განყოფილებაში მისნაირი ცელქი არავინ არაა და კარგად ვერ ერთობა.</p>\n<p>&nbsp;მიუხედავად იმისა, რომ ჩვენი გოგო მართვით სუნთქვის აპარატზეა, ხშირად სთხოვს დედიკოს საყვარელი საწოვარას მოწოდებას და მის მოხმარებასაც ახერხებს.</p>\n<p>&nbsp;ჩვენ კი მოთმინებით, თქვენი სიყვარულის, ლოცვისა და დადებითი ენერგიის იმედით, ველოდებით ანიტას მდგომარეობის გაუმჯობესებას!</p>\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a> სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20(1).jpg', '', '', 0, 'sastsrafod-ukanasneli-cnobebi-indoetidan-sasikharulo-informacia-am-tsutebsh-khdeba-cnobili', 1579725359, '', 7942, '', ''),
(136, '', 'თემურ წიკლაურის უდიდესი განსაცდელი და ტკივილი', '<p>მომღერალი თემურ წიკლაური თითქმის ნახევარი საუკუნეა სცენაზე დგას და თავისი სიმღერებით მსმენელს უდიდეს სიხარულს და სიამოვნებას ჩუქნის.</p>\n<p>&ldquo;იყიდება საქართველო&rdquo;, &ldquo;საქართველოს მანანებო&rdquo;, &ldquo;გააჩერეთ დედამიწა ჩავდივარ&rdquo;, &ldquo;უფლისციხესთან&rdquo;, &ldquo;იარონ&rdquo;, &ldquo;გული არა ბერდება&rdquo;, &ldquo;ჰერიო ბიჭებო&rdquo;, &ldquo;ყველა ხევსური და ყველა სვანი&rdquo;, &ndash; ეს მომღერლის მიერ შესრულებული სიმღერების მხოლოდ მცირე ჩამონათვალია. თემურ წიკლაურის ანგარიშზე 200-ზე მეტი სიმღერა და რამდენიმე მიუზიკლია, მათგან ყველაზე მეტად საპასუხისმგებლო მისთვის მიუზიკლი &ldquo;ფიროსმანია&rdquo;:</p>\n<p>&ldquo;სიმღერა &ldquo;იყიდება საქართველო&rdquo; 1987 წელს შეიქმნა. მაშინ თითქოს ისეთი არაფერი მოელოდა საქართველოს&hellip; ეს ფიროსმანის არია იყო, რომელიც თავის ქვეყანას ტიროდა.&rdquo; &ndash; სამწუხაროდ, ეს სიმღერა საქართველოში სულ უფრო და უფრო აქტუალურია.</p>\n<p>მომღერლის მოღვაწეობის საუკეთესო წლები ანსამბლ &ldquo;ივერიას&rdquo; უკავშირდება, თუმცა თემურ წიკლაურის სიმღერასთან კავშირი ბავშვობიდან დაიწყო. სულ პატარამ ხალხური სიმღერა შეისწავლა. უცხო ენათა ინსტიტუტში მოხვედრამ კი მისი მუსიკალური მომავალი საბოლოოდ განსაზღვრა &ndash; მომღერალი ლეგენდარულ ანსამბლ &ldquo;ივერიაში&rdquo; მოხვდა, სადაც ცხოვრების თანამგზავრს ლილი ზღვაურს შეხვდა და უკვე ათეული წლებია ერთად მიუყვებიან ცხოვრების სავალ ბილიკს. წყვილს თითქმის ნახევარსაუკუნოვანი ცხოვრების განმავლობაში ბევრი სიხარული და ტკივილი შეხვდა. ყველაზე დიდი სიხარული საყვარელი მსმენელისთვის გამართული კონცერტები, წარმატებული გასტროლები, სრული ანშლაგები, შვილების &ndash; ქეთის და გიორგის დაბადება იყო, ყველაზე დიდი ტკივილი კი შვილის &ndash; გიორგი გარდაცვალება. ბიჭი 6 წლის ასაკში ხარება დღეს გარდაიცვალა. მომღერალს მიაჩნია, რომ ეს უფლისგან დაშვებული განსაცდელი იყო, რომელიც ცოლ-ქმარმა მძიმედ, მაგრამ მაინც გადაიტანა:</p>\n<p>&ldquo;ხალხმა უზარმაზარი პატივი მცა და დარბაზში სანთლებანთებული დამხვდა გიორგის დასაფლავების შემდეგ&hellip; ეს შემზარავიც იყო და დიდი პასუხისმგებლობაც.&rdquo;</p>\n<p>პირადი ტრაგედიის მიუხედავად, თემურ წიკლაური სწორედ სიმღერამ, სცენამ და მაყურებლის უსაზღვრო სიყვარულმა გადაარჩინა. იგი დღემდე უმღერის სამშობლოს, სიყვარულს და მეგობრობას &ndash; იმას, რაც მისთვის ყველაზე მნიშვნელოვანია და ძვირფასია.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%97%E1%83%94%E1%83%9B%E1%83%A3%E1%83%A0-%E1%83%AC%E1%83%98%E1%83%99%E1%83%9A%E1%83%90%E1%83%A3%E1%83%A0%E1%83%98.jpg', '', '', 0, 'temur-tsiklauris-udidesi-gansacdeli-da-tkivili', 1579731536, '', 3661, '', ''),
(137, '', 'კათოლიკოს-პატრიარქი, უწმინდესი და უნეტარესი ილია მეორე ბათუმში, კლინიკა „მედინაში“ გადაიყვანეს', '<p>საქართველოს კათოლიკოს-პატრიარქი, უწმინდესი და უნეტარესი ილია მეორე ბათუმში, კლინიკა &bdquo;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მედინაში</span>&ldquo; გადაიყვანეს.</p>\n<p><span class=\"nanospell-typo\" data-cke-bogus=\"true\">ბათუმ-ლაზეთის</span>&nbsp;ეპარქიაში აცხადებენ, რომ კლინიკაში იგი გეგმური გამოკვლევის მიზნით მივიდა და მისი ჯანმრთელობის მდგომარეობა სტაბილურია.</p>\n<p>&bdquo;პატრიარქი რამდენიმე დღეა, აჭარაში იმყოფება, იგი საჭიროებს პერიოდულ გამოკვლევებს, რაც 2018 წლის შემდეგ არ ჩაუტარებია. კლინიკაში სწორედ ამ მიზნით მივიდა. მისი ჯანმრთელობის მდგომარეობა არ გაუარესებულა&ldquo;, &ndash; განაცხადა საქართველოს პირველ არხთან საუბრისას დეკანოზმა იოანე გორელიშვილმა.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%98%E1%83%9A%E1%83%98%E1%83%90-%E1%83%9B%E1%83%94%E1%83%9D%E1%83%A0%E1%83%94.jpg', '', '', 0, 'katolikos-patriarqi-utsmindesi-da-unetaresi-ilia-meore-batumshi-klinika-medinashi-gadaiyvanes', 1579774568, '', 710, '', ''),
(138, '', 'ვინ არის ქუთაისში გარდაცვლილი 22 წლის გოგო, რომელიც სავარაუდოდ გრიპის ვირუსს ემსხვერპლა', '<p>ზუგდიდის მუნიციპალიტეტის სოფელ რუხში მცხოვრები 22 წლის სალომე გაგუა, სავარაუდოდ, გრიპის ვირუსის გართულებით გარდაიცვალა.</p>\n<p>როგორც გარდაცვლილის ნათესავები აცხადებენ, გოგონას ზუგდიდის რეფერალურ საავადმყოფოში შესაბამისი დახმარება ვერ გაუწიეს და მისი რეფერირება ქუთაისის საავადმყოფოში &bdquo;უნიქალ მედში&ldquo; გახდა საჭირო, თუმცა დახმარება იქაც ვერ აღმოუჩინეს.</p>\n<p>&ldquo;თავიდანვე ვირუსზე იყი საუბარი ექიმებმა თვითონ მკითხეს, თქვენთან ვინმე უცხოეთიდან ხომ არ იყო ჩამოსულიო, ჩინურ მაღაზიაში ხომ არ იყო ნამყოფიო. ვირუსზე ქონდათ ეჭვი და ამიტომ იყო ამაზე ლაპარაკი&rdquo; &ndash; განაცხადა გარდაცვლილის დედამ თამილა ჯაჭვლიანმა.</p>\n<p>ოჯახის წევრების თქმით, გოგონა ქუთაისიდან თბილისში კატასტროფის მანქანით გადაყვანის დროს გარდაიცვალა.</p>\n<p>საზოგადოებრივი ჯანდაცვის ცენტრის ხელმძღვანელმა ნანა ოდიშარიამ &bdquo;ლაივპრესს&ldquo; უთხრა, რომ პაციენტი, რომელიც მეძუძური დედაა, ქუთაისში გარდაიცვალა.</p>\n<p>&bdquo;დადასტურებულად არ შეგვიძლია ვთქვათ, რომ ეს იყო გრიპის ვირუსი. როგორც ვიცი, ლაბორატორიული ნიმუშები გაგზავნილია და დღეს დღის ბოლოს ველოდებით პასუხს&ldquo;, &ndash; აღნიშნა ნანა ოდიშარიამ.</p>\n<p>გარდაცვლილის ახლობლები მომხდარში ექიმებს ადანაშაულებენ და შესაბამის უწყებებს რეაგირებისკენ მოუწოდებენ.</p>', '27', '', 'https://newsebi.ge/media/salome.jpg', '', '', 0, 'vin-aris-qutaisshi-gardacvlili-22-tslis-gogo-romelic-savaraudod-gripis-viruss-emskhverpla', 1579796791, '', 2129, '', ''),
(139, '', 'ბოლო ინფორმაცია ინდოეთიდან სამწუხაროა განსაკუთრებით მძიმე მდგომარეობაში აქვს მარცხენა ხელის თითები', '<p>ღამე 69-ე..</p>\n<p>&nbsp;როგორც იცით, ბაქტერიოლოგიური კვლევის მიხედვით ანიტას სისხლში ახალი ინფექცია ამოითესა, ამის გამო მას სამი სახის ახალ ანტიბიოტიკურ პრეპარატებს უკეთებენ.</p>\n<p>&nbsp;გრძელდება დიალიზი და სისხლის მიმოქცევის გასაუმჯობესებელი პრეპარატების გადასხმა.<br />ანიტას კიდურებში სისხლი ცუდად ცირკულირებს, განსაკუთრებით მძიმე მდგომარეობაში აქვს მარცხენა ხელის თითები.</p>\n<p>&nbsp;აქვე, კიდევ ერთხელ მინდა მოვუწოდო საინფორმაციო სააგენტოებსა და სხვადასხვა გვერდების ადმინისტრატორებს, მოერიდეთ დეზინფორმაციის გავრცელებასა და მწვავე სათაურების გამოქვეყნებას!</p>\n<p>&nbsp;ჩვენ ვიცით, რომ ანიტა ძალიან მებრძოლი გოგოა და მას თქვენი სიყვარული უფრო მეტად აძლიერებს!</p>\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a> სთვის</p>', '27', '', 'https://newsebi.ge/media/anita%20(1).jpg', '', '', 0, 'bolo-informacia-indoetidan-samtsukharoa-gansakutrebit-mdzime-mdgomareobashi-aqvs-marckhena-khelis-titebi', 1579810917, '', 12417, '', ''),
(140, '', 'ვინ არიან ცაგერში ავარიის დროს დაღუპულები', '<p>ცაგერის მუნიციპალიტეტის სოფელ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ჩხუტელში</span>&nbsp;სამძებრო სამუშაოების შედეგად ორი მამაკაცის ცხედარი იპოვეს. მესამე ცხედარს მაშველები ამ დრომდე ეძებენ.&nbsp;</p>\n<p>ავარიის დროს დაღუპულები არიან: დაახლოებით, 60 წელს გადაცილებული ჯონი კვიტაშვილი, 31 წლის თორნიკე ჭიჭინაძე და დაახლოებით, 25 წლის აკაკი მეშველიანი. მაშველები თორნიკეს ჭიჭინაძეს ამ დრომდე ეძებენ.</p>\n<p>ავტომობილი&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ცხენისწყალის</span>&nbsp;არხში&nbsp;გუშინ&nbsp;ღამით გადავარდა. არსებული ინფორმაციით, მასში სამი მგზავრი იმყოფებოდა, ისინი მდინარის დინებამ გაიტაცა.</p>\n<p><br />მომხდარზე გამოძიება შინაგან საქმეთა სამინისტრომ სსკ-ის 276-ე მუხლით დაიწყო.</p>', '27', '', 'https://newsebi.ge/media/bijebi.jpg', '', '', 0, 'vin-arian-cagershi-avariis-dros-daghupulebi', 1579872510, '', 1315, '', ''),
(141, '', 'უკანასკნელი ცნობები ინდოეთიდან - \"ჩვენი გოგოს მდგომარეობა სტაბილური მაგრამ საკმაოდ მძიმეა\"', '<div id=\"js_2mb\" class=\"_5pbx userContent _3576\" data-testid=\"post_message\" data-ft=\"{&quot;tn&quot;:&quot;K&quot;}\">\n<div id=\"id_5e2b3cce39efb8a13460409\" class=\"text_exposed_root text_exposed\">\n<p>70-ე ღამემშვიდობისა ანიტელებო!</p>\n<p>ჩვენი გოგოს მდგომარეობა სტაბილური მაგრამ საკმაოდ მძიმეა.</p>\n<p><span class=\"_5mfr\"><span class=\"_6qdm\">&nbsp;</span></span>იგი ამ დრომდე იმყოფება რეანიმაციულ განყოფილებაში, მართვით სუნთქვისა და ეკმოს გულის აპარატზე.<span class=\"text_exposed_show\"><br /> &nbsp;გრძელდება სეფსისის მკურნალობა, ახალ ინფექციასთან საბრძოლველად შერჩეულია ანტიბიოტიკური პრეპარატი, რომლის ეფექტურობის დადგენა გარკვეულ დროს საჭიროებს.<br /> &nbsp;უახლოეს მომავალში ანიტას გაუკეთდება განმეორებითი დოპლეროგრაფია, რითიც დადგინდება კიდურებში სისხლის მიმოქცევის ხარისხი.</span></p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;დღეს ძალიან ბევრმა მომწერეთ კითხვით თანდაყოლილია თუ არა ანიტას დაავადება რაზეც პასუხია -არა.</p>\n<p>&nbsp;ბავშვი დაიბადა ჯანმრთელი და იშვიათად ავადობდა. გარდა ამისა, ახალშობილობის პერიოდში, საპროფილაქტიკოდ აქვს გაკეთებული გულის ულტრასონოგრაფია, რომლის საფუძველზეც გულის არანაირი დაზიანება და თანდაყოლილი დაავადება არ გამოვლენილა.<br /> &nbsp;ანიტამ გადაიტანა ვირუსული ინფექცია, გარკვეული პერიოდის შემდეგ მისი მდგომარეობა დამძიმდა, რის გამოც მოხდა მისი სტაციონარში მოთავსება, სადაც დაფიქსირდა გულის დაავადება.</p>\n<p>&nbsp;თუმცა ჩვენი გოგო ისეთი ძლიერია, რაც არაერთმა ექიმმა დაგვიდასტურა, რომ ვიცით მალე ყველაფერს დაძლევს და დაგვიბრუნდება სამშობლოში.<br /><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a>&nbsp;<span class=\"_5mfr\"><span class=\"_6qdm\">❤</span></span>&nbsp;სთვის</p>\n</div>\n</div>\n</div>\n<div class=\"_3x-2\" data-ft=\"{&quot;tn&quot;:&quot;H&quot;}\">&nbsp;</div>', '22', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90.jpg', '', '', 0, 'ukanaskneli-cnobebi-indoetidan---chveni-gogos-mdgomareoba-stabiluri-magram-sakmaod-mdzimea', 1579895758, '', 3485, '', ''),
(142, '', 'ახლახანს თურქეთში საშინელი მიწისძვრა მოხდა, მსგავსი თურქეთის ისტორიას არ ახსოვს – ნახეთ რა ხდება ამ წუთებში იქ', '<p>თურქეთის სანაპიროებთან ეგეოსის ზღვაში 6,7 მაგნიტუდის სიმძლავრის მიწისძვრა მოხდა. ამის შესახებ&nbsp;BBC&nbsp;წერს.&nbsp;</p>\n<p>სეისმოლოგების ცნობით, ეპიცენტრი საკურორტო ქალაქ ბოდრუმიდან 10 კილომეტრის და საბერძნეთის კუნძულ კოსიდან 16 კილომეტრის მოშორებით მოხდა. ამიტომაც მიწისქვეშა ბიძგები ორივე ქვეყანაში იგრძნობოდა.</p>\n<p>მიწისძვრა იმდენად ძლიერი იყო, რომ მცირე ზომის ცუნამიც წარმოიშვა. მსხვერპლის და ნგრევის შესახებ ინფორმაცია ჯერჯერობით არ გავრცელებულა.</p>', '27', '', 'https://newsebi.ge/media/turket.jpg', '', '', 0, 'akhlakhans-turqetshi-sashineli-mitsisdzvra-mokhdamsgavsiturqetis-istorias-ar-akhsovs--nakhet-ra-khdeba-am-tsutebshiiq', 1579900830, '', 3315, '', ''),
(143, '', 'ბიძინა ივანიშვილის მოულოდნელი გადაწყვეტილება', '<p>რატომ ვერ გაცოცხლდება ვადამდელი არჩევნების თემა? რის გამო გადაიწია რუსეთის პოლიტტექნოლოგების ახალი სქემების ამოქმედებამ საქართველოში? რას აჯერებენ პატრიოტთა ალიანსის ერთ-ერთ ლიდერ ირმა ინაშვილს, რომელიც აშშ-ის საელჩოსთან საპროტესტო აქციას გეგმავს? ამ და სხვა საკითხებზე &ldquo;ახალი თაობა&rdquo; ესაუბრა ყოფილ დეპუტატს, &ldquo;საქართველოს გადარჩენის მოძრაობის&rdquo; ლიდერ მირიან მირიანაშვილს.<br /><strong>&ndash; ოპოზიციონერები ისევ აყენებენ ვადამდელი საპარლამენტო არჩევნების გამართვის საკითხს. ეს შესაძლებელია?</strong><br />&ndash; ვადამდელი საპარლამენტო არჩევნების თემა მკვდარია. ამის მსურველებს ვადები ხელიდან გაუსხლტათ. &ldquo;ახალ თაობასთან&rdquo; მისაუბრია იმაზე, რომ რიგგარეშე არჩევნების ხელოვნურად გამოწვევას ახდენდა რუსეთი. 2019 წლის ბოლოს ამას რუსი პოლიტტექნოლოგები აკეთებდნენ &ldquo;ქართული ოცნებისა&rdquo; და ე.წ. ოპოზიციური ერთობის მონაწილეობით. მიზანი იყო, საქართველოში ვადამდელი არჩევნებით რუსეთს მოეხდინა პოლიტიკური რენოვაცია დროის იმ მონაკვეთში, როცა აშშ-ს ამისათვის ნაკლებად ეცლებოდა. რუსეთში მიმდინარე პროცესებმაც გამოაჩინა, რატომ ჩქარობდა რუსეთი.<br /><strong>&ndash; რატომ ჩქარობდა? თავის ქვეყანაში რეფორმირება უნდა წამოეწყო?</strong><br />&ndash; ცხადია. რუსეთს ჯერ უნდა მოეთავებინა საქმეები საქართველოში და შემდეგ დაეწყო ის ტრანსფორმაცია, რომელიც დაწყებულია.<br /><strong>&ndash; რუსეთი თავის მმართველობით სისტემას ცვლის, თუმცა, ეს არ ნიშნავს, რომ საქართველოსთვის ვეღარ მოიცლის. თქვენ ამბობდით, რომ კრემლი საკუთარი პოლიტტექნოლოგების დახმარებით საქართველოში თებერვლიდან ახალ სქემებს აამუშავებდა.</strong><br />&ndash; ახალი სცენარები ახალ მატრიცაზეა გათვლილი. თვითონ პუტინმა ხომ იცოდა, რასაც აპირებდა თავის სახელმწიფოში! საქართველოს პოლიტიკური რუსული დრამატურგია ამაზე უნდა ყოფილიყო მისადაგებული. ასეც არის დაგეგმილი. ერთი ეგაა, რომ გეგმების ამუშავება ერთი კვირით გადაიწევს და პოლიტიკური დადგმის მაყურებლები თებერვლის პირველ კვირაში ვიქნებით.<br /><strong>&ndash; ოპოზიცია 4 თებერვლიდან აქციებს აანონსებს.</strong><br />&ndash; რაც ამ ოპოზიციამ დააანონსა, თვენახევრის წინ ვთქვი. ოპოზიცია ახმიანებს რუსების დავალებას. გეგმის დეტალები თვითონ ოპოზიციამ არ იცის. 14 დეკემბრიდან რუსეთის დირიჟორობით საქართველოში პოლიტიკური თეატრი დროებით გამოირთო. პოლიტიკოსებმა ხალხს უთხრეს, რომ ტაიმ-აუტს იღებენ.<br />რუსი დირიჟორებისთვის ამხელა პაუზა ჩავარდნაა. პაუზების დროს ხანდახან თვითშემოქმედების ელემენტები იჩენს თავს. არჩევნები მოდის და პოლიტიკური თეატრი დღის წესრიგიდან ვერ ჩამოხსნის საარჩევნო თემას.<br /><strong>&ndash; ეს თემა მუდმივად ტრიალებს, მათ შორის, მოლაპარაკებებზეც.</strong><br />&ndash; საარჩევნო თემას დაემატა გახარიას საკითხი. თავიდანვე ჩაფიქრებული იყო, რომ არჩევნების წინ ყველა პრობლემას გადააბრალებდნენ გახარიას. მას გაწირავდნენ, როგორც პრორუსულ ფიგურასაც. ივანიშვილისთვის ყველაზე მნიშვნელოვანი იქნებოდა ქულების დაწერა ამერიკელების თვალში. გახარიას გაშვება მას სჭირდება დივიდენდებისათვის. ამერიკიდან ეს დივიდენდები არ ჩანს.<br /><strong>&ndash; თუ მომავალშიც ვერ დაინახავს სარგებელს, მაშინ გახარიას გაწირვას აზრი ეკარგება?</strong><br />&ndash; რასაკვირველია. ბოლო პერიოდში ივანიშვილი აშშ-ში სხვა გზავნილებსაც უშვებს. ერთ-ერთი საკითხია დავით უსუფაშვილის კანდიდატურა.<br /><strong>&ndash; საუბარია დავით უსუფაშვილის მომავალ პოზიციაზე?</strong><br />&ndash; დიახ. ივანიშვილს მომავალ პარლამენტში თავმჯდომარედ დავით უსუფაშვილი უნდა. მას ჰგონია, რომ ეს გეგმა გაუადვილებს ურთიერთობას აშშ-სთან.<br /><strong>&ndash; სინამდვილეში, ამერიკელებს ამით ვერ მოიმადლიერებს?</strong><br />&ndash; ამერიკელები უსუფაშვილის კანდიდატურას გულგრილად ხვდებიან. იმაზე, თუ რატომ ვერ შეათანხმებს ივანიშვილი უსუფაშვილის კანდიდატურას, შემიძლია მომავალ ინტერვიუში გითხრათ.<br />ამითაც გამოაშკარავდა, რომ უსუფაშვილი &ldquo;ლელოში&rdquo; ივანიშვილის დასტურით მივიდა, თვითონ &ldquo;ლელო&rdquo; კი არ არის ივანიშვილის ოპოზიცია. რაც უნდა ისტერიკები მოაწყონ &ldquo;ლელოს&rdquo; ლიდერებმა, ინფორმირებულ ხალხს ვერ დააჯერებენ, რომ ოპოზიციაში არიან. ბიძინა ივანიშვილი შოკში ჩააგდო ენდიაის ბოლო კვლევამ.<br /><strong>&ndash; შოკში რატომ ჩაააგდო? &ldquo;ქართული ოცნების&rdquo; 20% და საკუთარი მაღალი ნეგატიური რეიტინგი არ უნდა ყოფილოყო მოულოდნელი.</strong><br />&ndash; რეიტინგებში არ არის საქმე. ბიძინა ივანიშვილს ეგონა, რომ იმ დროს მაინც, როცა კონტაქტებს ეძებს ამერიკაში, ენდიაის შეეძლო, კვლევა საერთოდ არ ჩაეტარებინა. ყველაფერი ერთმანეთს დაემთხვა დროსა და სივრცეში.<br /><strong>&ndash; ნაცმოძრაობის წევრებს თუ დავუჯერებთ, ივანიშვილი ვაშინგტონს აშანტაჟებს და საგარეო კურსის რუსეთისკენ შეტრიალებით იმუქრება.</strong><br />&ndash; ვაშინგტონს ვერ აშანტაჟებენ გავლენიანი სახელმწიფოების ლიდერებიც კი. ამას ვერ აკეთებენ ირანი, თურქეთი, ჩინეთი და ხანდახან &ndash; რუსეთი. ვინ დაიჯერებს, რომ ივანიშვილი აშშ-ს აშანტაჟებს! ასეთი განცხადებები სასაცილოა და საფრთხის შემცველი თვითონ ივანიშვილისთვის.<br /><strong>&ndash; ენდიაის კვლევების შედეგები მარტო ივანიშვილისათვის არ არის გულის მოსაკლავი. 26 იანვარს პატრიოტთა ალიანსი აშშ-ის საელჩოსთან ენდიაისა და აირაის წინააღმდეგ ატარებს საპროტესტო აქციას. პარტიას ამ ორგანიზაციების აკრძალვა უნდა.</strong><br />&ndash; ივანიშვილმა ამერიკელებს შეუთვალა, რომ არ მოიაზრებს საპარლამენტო ძალებად აფიშირებულ პრორუსულ ძალებს &ndash; პატრიოტთა ალიანსს და ბურჯანაძის პარტიას. ინაშვილს ამას გადაბრუნებულად უყვებიან. ალიანსის კურატორი რუსეთის სახელმწიფო დუმიდან კალაშნიკოვი ინაშვილს აწვეთებს, რომ ეს მოთხოვნა აშშ-ს ოფიციალური წარმომადგენლებიდან მოდის. რაც უნდა ოდიოზური რუსული ძალა იყოს ინაშვილის პარტია, ამერიკელები მის პარლამენტში შეშვება-არშეშვებაზე არ ილაპარაკებენ. აბსოლუტურად გამორიცხულია, ვინმემ ამაზე სიტყვა დაძრას. ეს იქნებოდა დემოკრატიის პრინციპების ხელყოფა. ასეთი რამის გამო ნებისმიერი ამერიკელი მოხელე გამოემშვიდობებოდა თავის თანამდებობას.<br />ინაშვილს თუ პრეტენზიის გამოთქმა უნდა, ჯობია, იმას წაუყენოს, ვინც პაიკივით სწირავს და არა აშშ-ის საელჩოს, რომელიც არაფერ შუაშია. მისი პროტესტის საფუძველი ესაა და არა &ndash; აირაი და ენდიაი.<br /><strong>&ndash; მესამე პრეზიდენტი შორიდან აქტიურობას აგრძელებს. მას რა როლი აქვს მომავალ პროცესებში?</strong><br />&ndash; ბოლო პერიოდში სააკაშვილის მიმართ რუსები უარყოფითად განეწყვნენ. ისინი უკვე თვლიან, რომ სააკაშვილი ბალასტია. რუსების თვალში სააკაშვილი ხელს უშლის რუსეთის გეგმებს, რომლებსაც დირიჟორები ადგენენ ფსევდოდასავლური ოპოზიციის გასაქაჩად.<br />ამ მიზეზით ფსევდოოპოზიციური წრეებიდან სააკაშვილზე მიმდინარეობს შეტევები. სააკაშვილთან აფილირებული ჯგუფები, რუსების დავალებით, მასზე თავდასხმებს უფრო გააძლიერებენ. რუსეთში მიხვდნენ, რომ სააკაშვილს ამერიკაში ნდობის ნატამალი არ გააჩნია. იგი რუსეთთან ასოცირდება.<br />დირიჟორებს იმედი აქვთ, რომ შემდგომ პოლიტიკურ სპექტაკლებში საქართველოს ცრუ პროდასავლურ ოპოზიციას მის გარეშე ჩააბამენ.<br />დარწმუნებული ვარ, ეს პროგნოზიც ახდება, ისევე, როგორც გამართლებულა ჩემი სხვა პროგნოზები.</p>\n<p><a href=\"https://akhalitaoba.ge/2020/01/ivanishvils-momaval-parlamentshi-thavmjdomared-davith-usuphashvili-unda/?fbclid=IwAR0PFEQkFCz1u-1JUSr7glh5hE8xPXr9G8yyYldarP-ckmVESjOkKQ9xoF4\">წყარო</a></p>', '19', '', 'https://newsebi.ge/media/bidzina%20usufa.jpg', '', '', 0, 'bidzina-ivanishvilis-moulodneli-gadatsyvetileba', 1579905538, '', 1840, '', ''),
(144, '', 'ნახეთ, როგორი ბავშვი მომიკლეს  – აღარ მყავს ჩემი ანგელოზი, ერთადერთი შვილის სიკვდილს არავის ვაპატიებ', '<p><strong>&ldquo;ბავშვს მუდმივი ყურადღება სჭირდებოდა, რადგან სტომაში გროვდება ნახველი, რომელიც პერიოდულად უნდა ამოიტუმბოს, სხვა შემთხვევაში, ბავშვი გაიგუდებოდა. 4 წელი და 8 თვე ანდრიას სტომა ედგა და ჩვენთან არაფერი მოსვლია, მან იცოდა, რომ არ უნდა მოეგლიჯა, თორემ გაიგუდებოდა&rdquo;<br /></strong><br />ანდრიას მამა, ვანო დვალიშვილი: &ldquo;აღარ მყავს ჩემი ანგელოზი, ერთადერთი შვილის სიკვდილს არავის ვაპატიებ&rdquo;<strong>ბავშვს მუდმივი ყურადღება სჭირდებოდა, რადგან სტომაში გროვდება ნახველი, რომელიც პერიოდულად უნდა ამოიტუმბოს, სხვა შემთხვევაში, ბავშვი გაიგუდებოდა. 4 წელი და 8 თვე ანდრიასსტომა ედგა და ჩვენთან არაფერი მოსვლია, მან იცოდა, რომ არ უნდა მოეგლიჯა, თორემ გაიგუდებოდა&rdquo;<br /><br />ანდრიას მამა, ვანო დვალიშვილი: &ldquo;აღარ მყავს ჩემი ანგელოზი, ერთადერთი შვილის სიკვდილს არავის ვაპატიებ&rdquo;<br /></strong><br />22 აგვისტოს გერმანიაში გარდაცვლილი 4 წლის&nbsp;<strong>ანდრია დვალიშვილის&nbsp;</strong>ცხედარი სამშობლოში 28 აგვისტოს, მარიამობას ჩამოასვენეს. 19 აგვისტოს ოჯახმა ანდრია&nbsp;გერმანიაში სამკურნალოდ გაგზავნა, მაშინ ვერავინ იფიქრებდა, რომ პატარა შინ ცოცხალი ვერ დაბრუნდებოდა.<br />ჯერჯერობით, გარდაცვალების ოფიციალური მიზეზი უცნობია. გამოძიება ექსპერტიზის დასკვნას ელოდება, რომელზეც საქმის ბედია დამოკიდებული.</p>\n<div class=\"code-block code-block-3\">&nbsp;</div>\n<p>4 წლის ანდრია ოჯახმა ასოციაცია &ldquo;ჯანმრთელი ბავშვების დახმარებით&rdquo; 19 აგვისტოს გერმანიაში გაგზავნა. ასოციაცია&shy; თანამშრომლობს ორგანიზაცია Friedensdorf&ndash;თან (&ldquo;მშვიდობის სოფელი&rdquo; &ndash; ბავშვთა&shy; საერთაშორისო ორგანიზაცია), რომელიც ომის ვეტერანებისა და მძიმე სოციალურ პირობებში მცხოვრები ოჯახების შვილებს&shy; მკურნალობასა და ოპერაციის ხარჯებს (მათ შორის, მგზავრობის) სრულად აფინანსებს. თუმცა ერთი პირობით &ndash; ბავშვი მშობლების გარეშე მიემგზავრება და მკურნალობის განმავლობაში ბავშვთა სოფელში მარტოა.<br />ამ პირობაზე დათანხმდნენ დვალიშვილებიც. სამწუხაროდ, ანდრია გერმანიაში&shy; ჩასვლიდან მესამე დღეს გარდაიცვალა. ოჯახის თქმით, ისინი ოთხი დღე ეძებდნენ ბავშვის ცხედარს და მომხდარის შესახებ ინფორმაცია ვერ მოიპოვეს.<br />ასოციაცია &ldquo;ჯანმრთელი ბავშვების&rdquo; დამფუძნებლის,<strong>&nbsp;მედეა აბრამიას</strong>&nbsp;თქმით, ბავშვის ცხედარი არ დაკარგულა და სამშობლოში მისი გადმოსვენების გაჭიანურება ობიექტური მიზეზით იყო განპირობებული:</p>\n<p>-&ldquo;ბავშვი შაბათს, 22 აგვისტოს დილით გარდაიცვალა. შაბათ-კვირას გერმანიის ყველა სტრუქტურა ისვენებს. ამიტომ გადმოსვენება გაჭიანურდა.<br /><strong><br /><em>&ndash; რა გახდა გარდაცვალების მიზეზი?</em></strong><br />&ndash; ზუსტი დასკვნა ჯერ მეც არ მინახავს.&shy; ბავშვს ტრაქეის მძიმე ფორმის სტენოზი (სასუნთქი გზების შევიწროება) და თანდაყოლილი გულის მანკი ჰქონდა. ოპერაციის შემდგომ, რომელიც საქართველოში გაუკეთდა, ტრაქეოსტომა ჩაუდგეს. ოთხშაბათს ბავშვი ჩავიყვანეთ, ხოლო ხუთშაბათსა და პარასკევს გამოკვლევები ჩაუტარდა. ტრაქეოსტომა ჩაუდგეს, შედარებით დიდი ზომის, რომ მილი ოდნავ გაფართოებულიყო. ერთი წლის მერე ოპერაცია იყო დაგეგმილი. თუმცა, მოულოდნელად ბავშვის მდგომარეობა დამძიმდა. მომხდარით ჩვენც შოკირებული ვართ. ჩვენი ასოციაცია 2005 წლიდან საქმიანობს და ამ ხნის განმავლობაში ეს პირველი შემთხვევაა, რომ სამკურნალოდ გაგზავნილი ბავშვი დაიღუპა.</p>\n<p><em>&ldquo;კვირის პალიტრა&rdquo; გორში იმყოფებოდა. დვალიშვილების ოჯახში ენით აუწერელი ტრაგედია ტრიალებს. &ldquo;ჩემი ანგელოზი,&shy; როგორ მომიკლეს, აღარ მყავს, ჩემი ერთა&shy;დერთი შვილის სიკვდილს არავის ვაპატ&shy;იებ&rdquo;,&rdquo;- თავჩაქინდრული, ცრემლიანი თვალებით გვესაუბრებოდა ანდრიას მამა, რომელიც ბავშვის სიკვდილში ასოციაცია &ldquo;ჯანმრთელი ბავშვების&rdquo; წარმომადგენელს ანა ბერულავასა და ფრიდენდორფის -ის პერსონალს ადანაშაულებს. მისი თქმით, ანდრია უყურადღებობით გარდაიცვალა.</em></p>\n<p><a href=\"https://pirveli.online/%E1%83%9C%E1%83%90%E1%83%AE%E1%83%94%E1%83%97-%E1%83%A0%E1%83%9D%E1%83%92%E1%83%9D%E1%83%A0%E1%83%98-%E1%83%91%E1%83%90%E1%83%95%E1%83%A8%E1%83%95%E1%83%98-%E1%83%9B%E1%83%9D%E1%83%9B%E1%83%98/?fbclid=IwAR0OrIaOJ5HvphMdH_Z8DU8BbESpNPCrsXjS18nINyCn0uX9-hFAfhk-jw0\">განაგრძეთ კითხვა</a></p>\n<p>&nbsp;</p>', '27', '', 'https://newsebi.ge/media/bavshvi.jpg', '', '', 0, 'nakhet-rogori-bavshvi-momikles---aghar-myavs-chemi-angelozi-ertaderti-shvilis-sikvdils-aravis-vapatieb', 1579971207, '', 15472, '', ''),
(145, '', 'ანიტას დედის საგანგებო მიმართვა ინდოეთიდან ამ წუთებშ ვრცელდება', '<ul class=\"_5a_q _5yj1\" dir=\"ltr\">\n<li class=\"_2cuy _509q _2vxa\">71-ე ღამემშვიდობისა ანიტას გულშემატკივრებო. მიხარია, რომ ამ ჯგუფში ფეხს ვერ იკიდებს აგრესია და ნეგატივი. ძალიან მადლობელი ვარ, 71.000 ადამიანი ერთი აზრისა და სიყვარულის ირგვლივ ხართ გაერთიანებულები. სააგენტოებთან მექნება მოკრძალებული თხოვნა, რომ მოერიდონ მწვავე სათაურებს. ანიტელებო, გთხოვთ ენდოთ მხოლოდ ამ ჯგუფში გავრცელებულ ინფორმაციას</li>\n<li class=\"_2cuy _509q _2vxa\">რადგანაც რეანიმაციაში შესვლა დიდი პრობლემაა, მეტი დრო გამომიჩნდა თქვენთან სასაუბროდ და დღეს შემაჯამებელსაც მე დავწერ. ანიტა ისევ ძველებურად <span class=\"text_exposed_show\">მოწყენილია, მაგრამ მოთმინებით ელოდება როდის გათავისუფლდება ამ მოწყობილობებისგან. დღეს შევთანხმდით, რომ ბებოს მეორე ვაზასაც გავუტეხავთ (ერთი თბილისში ყოფნისას დაამტვრია). მოკლედ, მისი გონება მუდამ მომართულია ცელქობისკენ. ჯანმრთელობის მდგომარეობა უცვლელია, ამიტომ გადავწყვიტე რამდენიმე ხშირადდასმულ შეკითხვაზე გაგცეთ პასუხები.</span></li>\n</ul>\n<div class=\"text_exposed_show\">\n<div class=\"_2cuy _3dgx _2vxa\">1. რატომ ვცდილობ რეანიმაციაში უკანონო შეჭრას? <span class=\"_47e3 _5mfr\" title=\"smile emoticon\"><span class=\"_7oe\">:)</span></span></div>\n<div class=\"_2cuy _3dgx _2vxa\">მიუხედავად დიდი გასანცდელისა, აბსოლუტურად ჯანსაღი ფსიქიკა მაქვს და კარგად ვაცნობიერებ რა არის ჩემი შვილისთვის კარგი. დაბადების წამიდან მე და ანიტა სულ ერთად ვართ. ახლა კი, ყველაზე მძიმე პერიოდში, დარჩა მარტო. თქვენ არ გინახავთ მისი შეშინებული თვალები, როდესაც იქ შევდივარ. არც ერთი ნორმალური დედა არ მიატოვებს ამ დროს შვილს და ზუსტად ვიცი დაცვას კი არ მთას გადადგამს გვერდით და ისე შეაღწევს მის სანახავად. ექიმებიც აცნობიერებენ იმას, რომ 2 წლის ბავშვის აბსოლუტურად უდედოდ დარჩენა არ შეიძლება და ისინიც ხშირად მაძლევენ შესვლის ნებას. ფიზიკური ჯანმრთელობის გარდა, არსებობს ადამიანის, მითუმეტეს ბავშვის ფსიქიკა, რომელიც ვინ იცის როგორ ზარალდება ასეთ დროს.</div>\n<div class=\"_2cuy _3dgx _2vxa\">2. თუკი იყო მკურნალობის შანსი, რატომ თქვა ევროპამ უარი?</div>\n<div class=\"_2cuy _3dgx _2vxa\">ევროპაში არსებობს კანონი, რომლის მიხედვითაც გულის გადანერგვას უკეთებენ მხოლოდ საკუთარ მოქალაქეებს (მიზეზია დონორთა ორგანოების სიმცირე). ავსტრიას მკურნალობაზე არ უთქვამს უარი, თუმცა მკურნალობის პროცესში, რომ მომხდარიყო ის, რაც ინდოეთში მოხდა, ქირურგიულ ჩარევას ვერ გააკეთებდნენ, თავისი კანონიდან გამომდინარე. აქედან გამომდინარე, ჩვენ სასწრაფოდ უნდა დაგვეტოვებინა ევროპა და წამოვსულიყავით ისეთ ქვეყანაში, სადაც ყველანაირი პროცედურა ჩაუტარდებოდა ანიტას, რაც იმ მომენტისათვის საჭირო გახდებოდა. ევროპასთან ვცადეთ მოლაპარაკება, რომ ხელოვნური გული მაინც გადაენერგათ, რათა ბავშვისთვის თვითმფრინავით მგზავრობა ყოფილიყო უსაფრთხო, შემდეგ კი წამოვიდოდით ინდოეთში, მაგრამ ამაზეც უარი მივიღეთ, რადგან ხელოვნური გულის გადანერგვა ავტომატურად დონორის რიგში ჩაყენებას გულისხმობს.</div>\n<div class=\"_2cuy _3dgx _2vxa\">ამავე კანონის მიხედვით გვითხრა უარი თურქეთმაც.</div>\n<div class=\"_2cuy _3dgx _2vxa\">3. რატომ არ წავიყვანეთ რუსეთში? ლეო ბოკერია უშველიდა.</div>\n<div class=\"_2cuy _3dgx _2vxa\">მთელი რუსეთი და უკრაინა ინდოეთში მოდის გადასანერგად. ახლაც ნახევარი კლინიკა სავსეა რუსულენოვანი პაციენტებით. 10 წლამდე ბავშვებში გულის გადანერგვა რუსეთში არ კეთდება.</div>\n<div class=\"_2cuy _3dgx _2vxa\">4. რატომ თქვა ბელორუსიამ უარი?</div>\n<div class=\"_2cuy _3dgx _2vxa\">რუსეთის მსგავსად, ბელორუსიაც არ მუშაობს 10 წლამდე პაციენტებთან.</div>\n<ul class=\"_5a_q _5yj1\" dir=\"ltr\">\n<li class=\"_2cuy _509q _2vxa\">მაშასადამე, ერთადერთი გამოსავალი იყო ინდოეთში წამოსვლა, მაგრამ გამზადებულ დონორს ვერც ერთი ქვეყანა ვერ დაგახვედრებს, რადგან დონორი უნდა იყოს ტრაგიკულად დაღუპული ადამიანი, რომელიც ზომით, წონით, სისხლის ჯგუფითა და სხვადასხვა კრიტერიუმებით შეესაბამება პაციენტს და რომლის მშობლებიც გამოთქვამენ მზაობას, რომ გააკეთონ კეთილი საქმე და გადაარჩინონ სხვა ბავშვის სიცოცხლე. აქედან გამომდინარე, ჩამოსვლისთანავე ვერავინ გაუკეთებდა გადანერგვას. დონორის გამოჩენიდან დაახლოებით 36 საათი გვაქვს გადასანერგად.</li>\n<li class=\"_2cuy _509q _2vxa\">ინდოეთზე მეც არ მქონდა კარგი წარმოდგენა და ამიტომ წავედი თავიდან ევროპაში. მას შემდეგ, რაც უბრალოდ სხვა გზა არ გვქონდა წამოვედით აქ. რეალობა სხვანაირი აღმოჩნდა. ვართ 4-5 ვარსკვლავიანი სასტუმროს ტიპის პალატაში. საავადმყოფო არის თანამედროვე ტექნოლოგიებით აღჭურვილი და ვისაც დაგაინტერესებთ, შეგიძლიათ იხილოთ კლინიკის სამგანზომილებიანი ტური. რაც შეეხება ანიტას ექიმს, ექიმ ბალაკრიშნას, ეს არის საკმაოდ დიდი გამოცდილების მქონე ქირურგი, რომელსაც 26.000-ზე მეტი გადანერგვის ოპერაცია აქვს ჩატარებული და ამის შემდეგ მოდი ნუ გამოვუცხადებთ ამ ძალიან კარგ ადამიანებს უნდობლობას.</li>\n<li class=\"_2cuy _509q _2vxa\">ექიმი ბალაკრიშნას, ტაქტიკა ასეთია: ის ცდილობს, რაც შეიძლება დიდი ხნით გადაავადოს გულის გადანერგვა ან საერთოდ დაუმორჩილოს პაციენტი მკურნალობას, რათა აირიდოს თავიდან ეს ურთულესი ოპერაცია. ანიტასთანაც ამის მცდელობით დაიწყო, მაგრამ ეს დაავადება არის ვერაგი და არაპროგნოზირებადი. ახლა იძულებულები ვართ სხვადასხვა მექნიკური ხელსაწყოების საშუალებით დაველოდოთ დონორს. თუმცაღა, რეანიმაციაში მწოლიარე პაციენტების უმრავლესობას ხშირად ეთესებათ სისხლში სხვადასხვა სახის ინფექცია. ეს მსოფლიოს ყველა რეანიმაციის ზოგადი პრობლემაა და არა მხოლოდ ინდოეთის.</li>\n</ul>\n<div class=\"_2cuy _3dgx _2vxa\">ჩემ გარშემო არიან მეგობრების არმია, ოჯახის წევრები და ამ ადამიანებმა მსოფლიო შეაზანზარეს. დამერწმუნეთ მსოფლიოს ყველა წამყვანმა კლინიკამ იცის უკვე ანიტას შესახებ. თითქმის ყოველდღიური კავშირი მაქვს იტალიაში ძალიან მაგარ ქართველ ქირურგთან, გერმანიაში უძლიერეს ინფექციონისტთან, ავსტრიაში კარდიოქირურგთან და საქართველოში კლინიკა &bdquo;ჯერარსის&ldquo; წამყვან სპეციალისტთან, დავით ბერიშვილთან და მის გუნდთან. აბსოლუტურად, ყველა ინფორმირებულია ანიტას მკურნალობის დეტალებზე და მათი აზრითაც, საუკეთესო გადაწყვეტილება მივიღეთ ინდოეთში წამოსვლით.</div>\n<div class=\"_2cuy _3dgx _2vxa\">ასე რომ, ინდოელი ექიმების თავდაუზოგავი მონდომება და თქვენი ლოცვა ერთად დიდ სასწაულს მოახდენს. თქვენც და მეც ამის გვჯერა მთელი გულით...&nbsp;</div>\n</div>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20%E1%83%93%E1%83%94%E1%83%93%E1%83%90.jpg', '', '', 0, 'anitas-dedis-sagangebo-mimartva-indoetidan-am-tsutebsh-vrceldeba', 1579985797, '', 7482, '', ''),
(148, '', 'სასწრაფოდ: უკანასნელი ცნობები ინდოეთიდან  ', '<div id=\"js_71\" class=\"_5pbx userContent _3576\" data-testid=\"post_message\" data-ft=\"{&quot;tn&quot;:&quot;K&quot;}\">\n<div id=\"id_5e2de24cec0a77306826599\" class=\"text_exposed_root text_exposed\">\n<p>&nbsp;72-ე ღამემშვიდობის ანიტას უძლიერეს გუნდს!</p>\n<p>&nbsp;ჩვენი გოგოს ზოგადი მდგომარეობა უცვლელია, ექიმები აქტიურად იბრძვიან სეფსისის და პოლიორგანული უკმარისობის დასამარცხებლად.</p>\n<p>ანიტას დედიკო ძალიან განიცდის ბავშვის კიდურების გამუქებას, განსაკუთრებულად ცუდ მდგომარეობაშია მარცხენა ხელის თითები, რომლებიც მარიკოს თქმით, დღეს უფრო გაშავდა.</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;ექიმების განმარტებით, კიდურების მდგომარეობის გამოსწორება მეტწილად ანიტას ორგანიზმზეა დამოკიდებული.<br />ჩვენ კი იმედი გვაქვს, რომ ამდენი ხალხის სიყვარული დაეხმარება ანიტას ორგანიზმს იყოს მეტად ბრძოლისუნარიანი!</p>\n<p>&nbsp;ყოველ დღე ვკითხულობთ თქვენს პოსტებს და კომენტარებს, ვხვდებით რამდენ ადამიანს შეგიყვარდათ ჩვენი ანიტა და ამის გამო, თავს უფლებას ვაძლევთ ათასჯერ გთხოვოთ ანიტასკენ მიმართოთ თქვენი სიყვარული, ლოცვა და დადებითი ენერგია!</p>\n<p>ჩვენ თქვენი იმედი გვაქვს!<br /><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a> სთვის</p>\n</div>\n</div>\n</div>\n<div class=\"_3x-2\" data-ft=\"{&quot;tn&quot;:&quot;H&quot;}\">\n<div data-ft=\"{&quot;tn&quot;:&quot;H&quot;}\">\n<div class=\"mtm\">\n<div class=\"_5cq3 _1ktf\" data-ft=\"{&quot;tn&quot;:&quot;E&quot;}\">\n<div id=\"u_fetchstream_2_2e\" class=\"uiScaledImageContainer _4-ep\">&nbsp;</div>\n</div>\n</div>\n</div>\n</div>', '27', '', 'https://newsebi.ge/media/anita%20(2).jpg', '', '', 0, 'sastsrafod-ukanasneli-cnobebi-indoetidan--', 1580069515, '', 12381, '', ''),
(149, '', 'სასწრაფოდ: ვრცელდება კობი ბრაიანტის თვითმფრინავის ჩამოვარდნის ექსკლუზიური კადრები', '<p>კობი ბრაიანტის თვითმფრინავის ჩამოვარდნის კადრები, რამაც ეს პიროვნება იმსხვერპლა.</p>\n<p><iframe style=\"border: none; overflow: hidden;\" src=\"https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2FGetinfo777%2Fvideos%2F260491474931826%2F&amp;show_text=0&amp;width=464\" width=\"464\" height=\"476\" frameborder=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<div class=\"_6dic\">&nbsp;</div>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%95%E1%83%98%E1%83%90%E1%83%99%E1%83%90%E1%83%A2%E1%83%90%E1%83%A1%E1%83%A2%E1%83%A0%E1%83%9D%E1%83%A4%E1%83%90.jpg', '', '', 0, 'sastsrafod-vrceldeba-kobi-braiantis-tvitmfrinavis-chamovardnis-eqskluziuri-kadrebi', 1580078182, '', 5585, '', ''),
(150, '', 'სასწრაფოდ: ავარია ბერი გაბრიელ სალოსის ქუჩაზე გადაცვლილია 4 დან 6 წლამდე ბავშვი', '<p>ბერი გაბრიელ სალოსის გამზირზე ავტოსაგზაო შემთხვევა მოხდა.</p>\n<p>არსებული ინფორმაციით, გარდაცვლილია ერთი ადამიანი.&nbsp;თვითმხილველების ინფორმაციით, სულ მცირე სამი ადამიანია დაშავებული და ისინი &bdquo;ნიუ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ჰოსპიტალსში</span>&ldquo; არიან&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">გადაყვანილები</span>.</p>\n<p>როგორც შსს-ში აცხადებენ, მომხდარზე გამოძიება სისხლის სამართლის კოდექსის 276-ე მუხლის მე-6 ნაწილით დაიწყო, რაც ტრანსპორტის მოძრაობის უსაფრთხოების ან ექსპლუატაციის წესის დარღვევას გულისხმობს, რამაც ადამიანის სიცოცხლის მოსპობა გამოიწვია.</p>\n<p>&nbsp;</p>\n<p>როგორც &ldquo;კვირას&rdquo; კორესპონდეტი ადგილიდან იუწყება გარდაცვლილია ბავშვი. მისივე ინფორმაციით, ბავშვის ვინაობა დაუდგენელია, რადგან ბავშვის ოჯახის წევრები ამ დროისთვის შემთხვევის ადგლზე არ მისულან.<br /><br />თვითმხილველები ამბობენ,რომ ბავშვის ასაკი 4- დან 6 წლამდე იქნებოდა.<br /><br />როგორც &ldquo;კვირას&rdquo; შსს-ში განუცხადეს აღნიშნულ ფაქტზე გამოძიება სსკ-ს 276 -ე მუხლის მეექსვსე ნაწილით დაიწყო, რაც ტრანსპორტის მოძრაობის უსაფრთხოების ან ექსპლუატაციის წესის დარღვევას გულისხმობს.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%98%E1%83%A1%E1%83%90%E1%83%9C%E1%83%98.jpg', '', '', 0, 'sastsrafod-avaria-beri-gabriel-salosis-quchaze-gadacvlilia-4-dan-6-tslamde-bavshvi', 1580153992, '', 5058, '', ''),
(151, '', 'ამ წამს გავრცელდა უკანასკნელი ცნობები ინდოეთიდან ინფექციის დაძლევასთან ერთად სისხლის მიმოქცევაც გაუმჯობესდება', '<p>73-ე ღამე მშვიდობისა!<br /> &nbsp;ანიტას ძალიან სჭირდება, რომ მისი სახელით კარგი საქმეები ვაკეთოთ!<br /> &nbsp;ამიტომ ყველას გელოდებით სიკეთის აურზაურის ჯგუფში!<br /> &nbsp;შემოგვიერთდით, დაგვეხმარეთ, რომ კიდევ ბევრჯერ დავამტკიცოთ ამ ერთი ციდა ქვეყნის ერთიანობა და სიძლიერე!<br />გადადით ბმულზე და დაგვემატეთ!<span class=\"text_exposed_show\"><br />&nbsp;https://bit.ly/2SY7aIk</span></p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;რაც შეეხება ჩვენს გოგოს,<br />მდგომარეობა ისევ სტაბილური, მაგრამ მძიმეა.<br />მოთმინებით ველოდებით მისი ჯანმრთელობის გაუმჯობესებას!</p>\n<p>&nbsp;კიდურების მდგომარეობა ჯერჯერობით უცვლელია, ინფექციის დაძლევასთან ერთად სისხლის მიმოქცევაც გაუმჯობესდება, ამიტომ გრძელდება ძლიერი ანტიბიოტიკოთერაპია!</p>\n<p>&nbsp;მთელი გულით გიხდით მადლობას რომ უკვე 73 დღე-ღამე ჩვენთან ერთად ხართ!</p>\n<p>&nbsp;ანიტას ამბების დაწყების დღიდან არც ფინანსურად არც მორალურად და არც სულიერად არ მიგვატოვეთ!<br />&nbsp;თქვენი თანადგომა ძალიან აძლიერებს ანიტას, მის ოჯახს და ჩვენ!</p>\n<p>ყველაფერი კარგად იქნება<br /><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a>სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/anitan.jpg', '', '', 0, 'am-tsams-gavrcelda-ukanaskneli-cnobebi-indoetidan-infeqciis-dadzlevastan-ertad-siskhlis-mimoqcevac-gaumjobesdeba', 1580157524, '', 8709, '', '');
INSERT INTO `trainings` (`id`, `source`, `title`, `text`, `category`, `scraped_at`, `img`, `origin_date`, `tags`, `comments_number`, `slug`, `date`, `origin_url`, `views`, `keywords`, `description`) VALUES
(152, '', 'უკანასკნელი ინფორმაცია ინდოეთიდან გოგო მოწყენილია, დედიკოს ნახვაზე გული უჩუყდება, ცდილობს რაღაც უთხრას,', '<p>74-ე ღამე და 71000-ზე მეტი ანიტელია ამ ჯგუფში!</p>\n<p>შემოგვიერთდით ასევე ანიტას მეგობრებისთვის შექმნილ სივრცეში, სადაც ერთად, სიკეთის აურზაურს მოვაწყობთ!<br /> https://bit.ly/2SY7aIk</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;ჩვენი გოგო მოწყენილია, დედიკოს ნახვაზე გული უჩუყდება, ცდილობს რაღაც უთხრას, მაგრამ სათქმელს კარგად ვერ აგებინებს ინტუბაციის მილის გამო, რაც კიდევ უფრო აღიზიანებს.</p>\n<p>&nbsp;ექიმებმა სცადეს მარჯვენა მხარეს შეემცირებინათ ეკმოს აპატარის მუშაობა, თუმცა, გარკვეული დროის შემდეგ, ისევ აპარატის სრული დატვირთვით ჩართვა მოუწიათ.</p>\n<p>&nbsp;ჩვენ გვჯერა, რომ მალე მისი მდგომარეობა საგრძნობლად გაუმჯობესდება!<br />ამაში მას ჩვენი ერთიანობა და სიყვარული დაეხმარება!</p>\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" type=\"\" data-ft=\"{\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a> სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/%E1%83%93%E1%83%94%E1%83%93%E1%83%90%20%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90.jpg', '', '', 0, 'ukanaskneli-informacia-indoetidan-gogo-motsyenilia-dedikos-nakhvaze-guli-uchuydeba-cdilobs-raghac-utkhras', 1580242500, '', 1131, '', ''),
(153, '', 'თურქეთისთვის ეს მიწისძვრა კატასტროფის წინმსწრები ნიშანია', '<p>თურქეთის პროვინცია ელიზიღში (მოსახლეობა 400 ათასი ადამიანი), ქალაქ სივრიჯის რაიონში პარასკევს, 24 იანვარს, დაახლოებით 21:55 საათზე, ძლიერი მიწისძვრა მოხდა. 6, 8 მაგნიტუდის რყევა 15 წამის განმავლობაში გრძელდებოდა. ამას 288 აფტერშოკი მოჰყვა, რომელთა სიმძლავრე 5, 4&minus;დან 3, 3&minus;მაგნიტუდას შეადგენდა.</p>\n<p>&nbsp;</p>\n<div class=\"_2cuy _3dgx _2vxa\">ბოლო მონაცემებით, დაღუპულია 25 ადამიანი. დაშავებულთა რაოდენობამ 1500&minus;მდე კაცს მიაღწია. ნგრევის მასშტაბები, ხელისუფლების ინფორმაციით, დიდია. განადგურებულია რამდენიმე ათეული შენობა და ძლიერაა დაზიანებული 80&minus;ზე მეტი.</div>\n<div class=\"_2cuy _3dgx _2vxa\">ამ დროისათვის სამაშველო ოპერაციები კვლავ გრძელდება. ნანგრევებიდან ამოყვანილია 40&minus;ზე მეტი ადამიანი. გავრცელებული ინფორმაციით, ნანგრევებში კვლავ რჩება ხალხი.</div>\n<div class=\"_2cuy _3dgx _2vxa\">ქვემოთ გვსურს შეგახსენოთ რამდენიმე წინასწარმეტყველება, რომლებიც თურქეთში მიწისძვრების შესახებ აქვს წარმოთმული ქალბატონ ლელა კაკულიას. ეს წინასწარმეტყველებები თავის დროზე გამოქვეყნებულია როგორც საავტორო გაზეთში, ისე შესულია წიგნის &bdquo;ახალი სიტყვა&ldquo; სხვადასხვა წლების გამოცემებში.</div>\n<div class=\"_2cuy _3dgx _2vxa\"><span class=\"_4yxo\">2000 წელი, 25 ოქტომბერი</span></div>\n<div class=\"_2cuy _3dgx _2vxa\">მომავალში ვხედავ თურქეთში ძლიერ მიწისძვრას!</div>\n<div class=\"_2cuy _3dgx _2vxa\"><span class=\"_4yxo\">2008 წელი, 20 ნოემბერი, ურეკი</span></div>\n<div class=\"_2cuy _3dgx _2vxa\">თურქეთში ვხედავ ისევ დიდ მიწისძვრას. ამას ვერავინ შეაჩერებს. ვიმეორებ: იქნება დიდი მიწისძვრა. წინმსწრები მოვლენებით ადვილი მისახვედრი იქნება, რომ ხალმა უნდა დატოვოს ეს დიდი ქალაქი, მაგრამ იფიქრებენ, ეს პატარა ბიძგები იყო და მეტი არაფერიო. აი აქ შეცდებიან!!! ასეა, ბედისწერას ვერ გაექცევი. კი ვწინასწარმეტყველებ ამ მოვლენას, მაგრამ, როგორც ყოველთვის, ყურს მიღმა გაუშვებენ. როცა ასრულდება, მაშინ გაოგნდებიან, მაგრამ, რა? უამრავი ადამიანი იღუპება, ვხედავ. ძალიან მეცოდებიან, მაგრამ მათ ვერავინ უშველით. ამ გაფრთხილებასაც ვერ გამოიყენებენ.</div>\n<div class=\"_2cuy _3dgx _2vxa\"><span class=\"_4yxo\">2010 წელი, 17 თებერვალი</span></div>\n<div class=\"_2cuy _3dgx _2vxa\">ფრთხილად, ადამიანებო! დედამიწაზე მხოლოდ პოლიტიკა კი არ იცვლება, არამედ მისი უდიდებულესობა ბუნებაც. ბუნების დიდი რისხვა დაატყდება მრავალ ქვეყანას. ვხედავ, თურქეთში დიდი მიწისძვრა იქნება, რომელიც მთელ თურქეთს მოიცავს. იქნება წინასწარ ამის ნიშნები და თუკი ჩვენს წინასწარმეტყველებებს გაითვალისწინებენ, ბევრი გადარჩება. ეს თურქეთისთვის ძალიან მნიშვნელოვანი ინფორმაციაა.</div>\n<div class=\"_2cuy _3dgx _2vxa\"><span class=\"_4yxo\">2010 წელი, 30 მარტი</span></div>\n<div class=\"_2cuy _3dgx _2vxa\">ვიმეორებ: თურქეთში ვხედავ დიდ მიწისძვრას, რომელიც თურქულ ეკონომიკას თითქმის მთლიანად ანადგურებს. ეს ძალიან ძვირი დაუჯდება თურქეთის სახელმწიფოს. თითქოს ბუნებამ მათთვის მოიცალა.</div>\n<div class=\"_2cuy _3dgx _2vxa\"><span class=\"_4yxo\">2011 წელი, 17 მაისი, დილის 6 საათი</span></div>\n<div class=\"_2cuy _3dgx _2vxa\">თურქეთი უნდა უფრთხილდეს დიდ მიწისძვრებს. თუმცა ვერაფერს გახდებიან. ამ მოვლენებს ვერავითარი ძალა ვერ შეაჩერებს, რაც უნდა მოიმოქმედონ.</div>\n<div class=\"_2cuy _3dgx _2vxa\"><span class=\"_4yxo\">2013 წელი, 15 აპრილი</span></div>\n<div class=\"_2cuy _3dgx _2vxa\">დედამიწა ბევრ საიდუმლოს მალავს!</div>\n<div class=\"_2cuy _3dgx _2vxa\">ბუნება კი ისევ მძვინვარებს, იქნება დიდი მიწისძვრები, წყალდიდობები, ვულკანებიც ამოიფრქვევა, მაგრამ ბევრი ადამიანი გადარჩება. ყველაზე საშიში ადგილი იქნება იაპონია, ჩინეთი, ირანი, ამერიკის რამდენიმე შტატი, თურქეთი &mdash; რომელიც განსაკუთრებით მიწისძვრას უნდა უფრთხილდეს! ასევე რუსეთი &mdash; რომელიც უნდა უფრთხილდეს ცეცხლს, ვულკანს, წყალდიდობებსა და რადიაციულ გაჟონვებს. ისე, თითქმის დედამიწის ყველა კუთხეში მოიქნევს ბუნება კუდს. მე ჩამოვთვალე ყველაზე რთული ადგილები, მაგრამ ახლოსაა ის დროც, როცა ყველაფერი დაწყნარდება, ბუნება დამშვიდდება და დედამიწა კარგა ხნით დაისვენებს. ადამიანებიც შეიცვლებიან. საერთოდ, ბევრი რამ შეიცვლება...</div>', '27', '', 'https://newsebi.ge/media/lela.jpg', '', '', 0, 'turqetistvis-es-mitsisdzvra-katastrofis-tsinmstsrebi-nishania', 1580246084, '', 973, '', ''),
(154, '', 'დათუნა სარალიძის დედის პირველი ინტერვიუ ჩემი სამყარო მაქვს, სადაც ცოცხალია, მიცინის, მელაპარაკება', '<p>2017 წლის დეკემბერში, ხორავას ქუჩაზე, მოზარდებს შორის მომხდარმა სისხლიანმა&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">გარჩევამ</span>&nbsp;მთელი საქართველო შეძრა.</p>\n<p>საქმის გამოძიება დღემდე გრძელდება. რა შემთხვევაზეა საუბარი, ამის შეხსენება საზოგადოებას არ სჭირდება.</p>\n<p>სიმართლის გარკვევას და შვილის მკვლელის დასჯას ერთ-ერთი მოზარდის, დავით&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">სარალიძის</span>&nbsp;მამა მესამე წელია ითხოვს.</p>\n<p>ამ დროის განმავლობაში არავის გაუგია და მოკლული მოზარდის დედის სიტყვა.</p>\n<p>უმძიმესი ტრაგედიის შემდეგ, დავით&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">სარალიძის</span>&nbsp;დედამ პირველი, ძალიან მძიმედ მოსასმენი&nbsp;<strong>ინტერვიუ&nbsp;&bdquo;ალიას&ldquo; მისცა</strong>.</p>\n<p><strong>ნათია სარალიძე:</strong></p>\n<p>- როცა დავდექით იმის წინაშე, რომ ჩვენ ორიდან ერთი უნდა წასულიყო უცხოეთში სამუშაოდ, გადავწყვიტე, მე წავსულიყავი &ndash; ჯერ ერთი, ზაზას ჯანმრთელობის მდგომარეობის გამო, მეორეც, გადავწყვიტე, რომ ბიჭს მამის ხელი სჭირდება. ზაზას უნდოდა წასულიყო, მაგრამ გადავაფიქრებინე და მე წავედი.<br />იმ წელს უკვე უნდა ჩამოვსულიყავი.</p>\n<p><strong>მე და დათუნას ყოველდღიური ურთიერთობა გვქონდა, ტანად იყო დიდი, თორემ, პატარა ბავშვივით იყო, ყველაფერს მიყვებოდა და მაჩვენებდა და მეკითხებოდა, ეს მიხდება? ეს როგორ მაქვს?</strong></p>\n<p>არასოდეს უთხოვია ჩემთვის ფული ან საჩუქარი, ყოველთვის იმას მპასუხობდა, არაფერი მინდა, მინდა მალე ჩამოხვიდე, მომენატრეო. საჩუქრები, თუნდაც მცირე, პატარა ბავშვივით უხაროდა, ამიტომ, ვცდილობდი ხოლმე, მცირედი მაინც გამომეგზავნა და გამეხარებინა.<br /><strong>იმ წელს მთხოვა პირველად, მეგობრები ბაკურიანში მიდიან და შეგიძლია, მეც გამიშვაო? დავპირდი, რომ გავუშვებდი, ვკითხე, რამდენი გინდა ფული-თქო, შენ რამდენიც შეგეძლებაო &ndash; მიპასუხა.</strong><br /><strong>გადავწყვიტე, რომ მესიამოვნებინა და დამემახსოვრებინა მისთვის მეგობრებთან ერთად ბაკურიანში წასვლა.</strong><br /><strong>მეგობრებთან წასულა და ყველასთვის უხარებია, მერე მიყვებოდნენ, დედა ბაკურიანში მიშვებს, ფულს მიგზავნისო.</strong></p>\n<p>უამრავი სათამაშო ჰქონდა, უყვარდა სათამაშოები, ეს დათუანიაც მისი სათამაშოა, ვითომ ეჭიდავებოდა, ხოლმე. ყველასთან შეეძლო თამაში, 2 წლის ბავშვთანაც კი.<br />ძალიან კეთილი და თბილი იყო, ყველა უყვარდა, სულ იცინოდა. შეყვარებული იყო. მომიყვა და რომ გავიგე, ვინ უყვარდა, შევუქე არჩევანი და ისე გაუხარდა, რომ შევუქე&hellip;</p>\n<p>იმ დღეს არ დამირეკა, ვერც მე დავურეკე და აფორიაქებული ვიყავი, არ ყოფილა მანამდე ასეთი. მივწექი, მაციებდა და ჩამეძინა. ღამე გამაღვიძა შეგრძნებამ, რომ დღეს არ მილაპარაკია ჩემებთან, პირველ რიგში ტელეფონს დავხედე, სადაც უკვე იყო ზაზას ნარეკი&hellip;</p>\n<p><strong>მაშინ მითხრეს, რომ დათუნა დაჭრილი იყო&hellip;</strong><br /><strong>სანამ არ ჩამოვფრინდი, არ ვიცოდი, რომ&hellip;</strong><br /><strong>ყველამ იცოდა, ჩემს გარდა. რომ ჩამოვფრინდი, მაშინ მითხრა ზაზამ, იმის მერე, უკვე ბუნდოვნად მახსოვს ყველაფერი&hellip;</strong></p>\n<p>არც არაფერს ვკითხულობდი, არაფრის გაგება არ მინდოდა, არც ის მინდოდა ვინმესთან ამაზე მესაუბრა, ახლაც ასე ვარ, არ მინდა, რადგან ჩემთვის დათუნა ცოცხალია, ჩემი სამყარო მაქვს, სადაც ისევ ყოველ დღე ვესაუბრები, ჩემს სამყაროში დათუნა ისევ ისეთი თბილი და მოსიყვარულეა.<br />არავისი დანახვა არ მინდოდა, მაშინ მითქვამს, ჩემი სიცოცხლე&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">დასრულდა-თქო</span>, მერე მარიამი მახსენებს, მეც ხომ ვარ თქვენი შვილი, ჩემთვის ხომ უნდა იცოცხლოო.</p>\n<p><strong>ვპასუხობ, რომ გახდება დედა და მიხვდება თავად, რას ვგულისხმობ.&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მარიამისთვისაც</span>&nbsp;დამთავრდა ძმის სიცოცხლე და მარიამიც ცუდადაა, ისიც განიცდის, მაგრამ ხედავს ჩვენს მდგომარეობას და ჩვენს გამხნევებას ცდილობს ამ სიტყვებით. მაგრამ, მარიამს ეყოლება შვილი და მიხვდება, რა ბედნიერებაა შვილი, რას ნიშნავს მშობლისთვის შვილი. შვილის გარეშე შენ ის აღარ ხარ, რაც იყავი და ვეღარასოდეს იქნები.</strong></p>\n<p>დათუნას მეგობრები სულ აქ არიან, არც ჩვენ გვშორდებიან, არც მარიამს, კუდში დაჰყვებიან, ცდილობენ ძმის ფუნქცია შეასრულონ, გააცილონ, დაელოდონ, დაურეკონ, სად არის, რამდენ ხანში დაბრუნდება. არც ერთ მოსულ სტუმარს, ბავშვს, დიდს, მე ჩემს ტკივილს არ დავანახებ. არსად დავდივარ, არ მინდა ჩემი ტკივილით ადამიანები შევაწუხო. გინდა არ გინდა წუხდებიან, თუნდაც იმით, რომ შავი მაცვია, თუნდაც იმით, რომ ჩემი თანდასწრებით ისე ვერ იმხიარულებენ, ასე მგონია.</p>\n<p><strong>სულ რამდენიმე თვის წინ დავიწყე ინფორმაციის წაკითხვა, არაფრის მოსმენა არ მინდოდა, რაც იმ ამბავს ეხებოდა, საერთოდ გვარებიც არ ვიცოდი&hellip;</strong><br /><strong>მახსოვს, სამძიმარზე მოსული მასწავლებლებიდან ერთმა მითხრა &ndash; შენი შვილი ყველამ მიატოვა, ყველა გაიქცაო&hellip; &ndash; ეს სიტყვები მახსოვს. ხშირად მიფიქრია მერე ამ სიტყვებზე&hellip; დათუნა არ დატოვებდა, არასოდეს არავის დატოვებდა გაჭირვებაში&hellip;</strong></p>\n<p><br /><strong>არც სუბელიანი ვიცოდი ვინ იყო, მე ვიყავი სახლში, რომ მოვიდა, ხატი და ბიბლია რომ მოიტანა. ბოდიში რომ მოგვიხადა, ვერც მივხვდი, რისთვის გვიხდიდა ეს კაცი ბოდიშებს, მერე ზაზას ვუთხარი და ზაზამ მითხრა ვინც იყო.</strong></p>\n<p>ვბრაზობ თუ არა რომელიმეზე? არც კი ვფიქრობ მაგაზე.<br />მინდა აღიარონ და სიმართლე თქვა, მერე ვინ როგორ დაისჯება, უფალს მივანდობ, არასოდეს არც ერთი არ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">დამიწყევლია</span>&hellip;<br />ერთ-ერთი მშობელს მოსვლა უნდოდა, ეს არ იყო კალანდიას მშობელი, მაშინ არავისთან საუბარი არ მინდოდა, მერე აღარ გაუმეორებია თხოვნა, ახლა რომ მოვიდეს, დაველაპარაკები, მოვუსმენ&hellip;<br />ბოლო თვეების მანძილზე დავიწყე იმის კითხვაც რაც წერენ ჩვენზე და ჩვენს ოჯახზე, რამდენ ტალახს გვესვრიან თურმე, რისთვის, რას გვთხოვენ, ვერ ვიგებ?</p>\n<p><br />განსაკუთრებით მძიმეა იმ ხალხისგან ლანძღვა, რომლებსაც მეგობრებად ვთვლიდით, რას ითხოვენ ჩვენი ოჯახისგან და ზაზასგან, რატომ არ მოკვდა რუსთაველზე მარტო დარჩენილი?</p>\n<p><strong>ივანიშვილს შვილიშვილის დაბადება მიულოცა&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ზაზამო</span>&nbsp; &ndash; წერდნენ, ცოტა რომ დაფიქრდნენ, მიხვდებიან, რომ ივანიშვილს ზაზამ მიულოცა ის, რაც ზაზას, რაც ჩვენ აღარ გვეღირსება, ჩვენი გვარის შთამომავალი აღარ გვეღირსება და კი არ მიულოცა, ეს შეახსენა &ndash; ნუთუ ეს ასე ძალიან რთული გასაგებია?</strong></p>\n<p>ამდენ სისაძაგლეს რომ წერენ ჩვენზე, არ ფიქრობენ, რომ ამას მე და მარიამი ვკითხულობთ? ჩვენი ოჯახი რომელიც ისედაც ძალიან ცუდ დღეშია, ამას რომ წაიკითხავს, მაგაზე არ ფიქრობენ?</p>\n<p>ერთადერთი რაც მინდა, აღიარონ, თქვან სიმართლე, მოინანიონ.<br />მონანიების და&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">აღირების</span>&nbsp;ნაცვლად,&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">დათუნასთვისაც</span>&nbsp;კი დაიწყეს ტალახის სროლა, რა აღარ დააბრალეს.<br />მე იმათიც მესმის, მშობლები არიან და ცდილობენ თავიანთი შვილების დაცვას, მაგრამ ასე და ამ გზით ვერ დაიცავენ, სისხლი ისედაც ყველაზე რთული&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მოსანანიებელია</span>&hellip;</p>\n<p><strong>სიმართლე გითხრათ, მე არც ის მაინტერესებს ციხეში ისხდებიან, თუ არა, ჩემთვის რა მნიშვნელობა აქვს? რას&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">შემიცვლის</span>? რას&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">შემიმსუბუქებს</span>? გარდა იმისა, რომ ეცოდინებათ, რომ თუ სხვის შვილსაც დაუშავებენ &ndash; დაისჯებიან &ndash; ამის გარდა, რას შეცვლის, გთხოვთ, მითხრათ?</strong><br /><strong>ჩვენ გვინდა სიმართლე გაირკვეს, დანარჩენი, წლები, სასჯელი, სასამართლო &ndash; ყველაფერი სხვისი შვილების დასაცავადაა.</strong></p>\n<p>პატრიარქი დამეხმარა ძალიან&hellip; მასთან საუბარი მამშვიდებს, მისი ნახვა მამშვიდებს. უდიდესი ძალა მომცა. ეკლესიაში დავდივარ ხშირად, მინდა ჩემს შვილს ყველაფერი ისე გავუკეთო, როგორც საჭიროა.</p>\n<p><strong>ყველაზე მეტად ის წლები მენანება, რომელიც უცხოეთში დათუნას გარეშე გავატარე.</strong></p>\n<p><strong>ახლა რომ ვფიქრობ, ყველაფერი უფლის ნება იყო, უფლის ნება იყო, რომ მე წავსულიყავი უცხოეთში, არ ვიცი, სწორად როგორ ავხსნა, იმ წლების მანძილზე, როცა არ ვცხოვრობდით ერთად, როცა მხოლოდ შორიდან&nbsp;ვხედავდი და ვისმენდი მის ხმას, ხომ შევეჩვიე, რომ ვერ ვეხებოდი და ვიხუტებდი და ახლაც იმ მდგომარეობაში ვარ, ჩემი სამყარო მაქვს, სადაც ჩემი შვილი ცოცხალია, მელაპარაკება, მიცინის, ამბებს&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მიყვება</span>, შეჭრილ, თუ წამოზრდილ თმებს მაჩვენებს და მეკითხება: &ndash; მიხდება?</strong></p>\n<p>&nbsp;</p>\n<p><a href=\"https://www.alia.ge/%E1%83%94%E1%83%A5%E1%83%A1%E1%83%99%E1%83%9A%E1%83%A3%E1%83%96%E1%83%98%E1%83%A3%E1%83%A0%E1%83%98-%E1%83%98%E1%83%9C%E1%83%A2%E1%83%94%E1%83%A0%E1%83%95%E1%83%98%E1%83%A3-%E1%83%93%E1%83%90%E1%83%97/?fbclid=IwAR1SEIX7rWjk4KthJVOYv9u-A9Yth5JYpakJRGbQV427hJGXDOtsfuE7qEw\"><strong>წყარო: ალია</strong></a></p>', '27', '', 'https://newsebi.ge/media/%E1%83%93%E1%83%97%E1%83%A3%E1%83%9C%E1%83%90.jpg', '', '', 0, 'datuna-saralidzis-dedis-pirveli-interviu-chemi-samyaro-maqvs-sadac-cockhalia-micinis-melaparakeba', 1580249605, '', 3675, '', ''),
(155, '', 'სასწრაფოდ: ამ წუთებში ვრცელდება უმძიმესი ინფორმაცია  ანიტას შინაგანი სისხლდენა დაეწყო, მდგომარეობა კრიტიკულია', '<p>ანიტელებო&nbsp; &nbsp;უკვე მერამდენედ, მაგრამ თქვენდამი უდიდესი რწმენით სავსე კიდევ ერთხელ გთხოვთ ილოცოთ ანიტასთვის.<br />ჩვენი გოგოს მდგომარეობა კრიტიკულია, ბავშვს აქვს შინაგანი სისხლდენა.<br /> მარიკო და გიორგი არ უშინდებიან ამ განსაცდელს ისევე როგორც ჩვენ, რადგან თქვენი ლოცვის იმედი გვაქვს.<br /> ეს არის ის სასწაული რამაც აქამდე მოგვიყვანა და ამდენი განსაცდელისგან გვიხსნა.<br /> ეს არის ის რაც მიგვიყვანს ანიტას გამოჯანმრთელებამდე.</p>', '22', '', 'https://newsebi.ge/media/anita.jpg', '', '', 0, 'sastsrafod-am-tsutebshi-vrceldeba-umdzimesi-informacia--anitas-shinagani-siskhldena-daetsyo-mdgomareoba-kritikulia', 1580313681, '', 4884, '', ''),
(156, '', 'გთხოვთ ყველმ ვილოცოთ ანიტას გადარჩენისთვის ის მძიმე მდგომარეობაშია მას შინაგანი სისხლდენა აქვს რაც სავარაუდოდ გამოწვეულია იმით, რომ ორგანიზმი ვეღარ ეგუება ეკმოს აპარატს', '<p>&nbsp;ღამე 75-ე.<br />ვიცით, ყველა ღელავთ... თუმცა გთხოვთ გაითვალისწინოთ ჩვენი მდგომარეობაც, ინფორმაციას გაგებისთანავე გაწვდით.</p>\n<p>&nbsp;ანიტას აქვს შინაგანი სისხლდენა, რაც<br />სავარაუდოდ გამოწვეულია იმით, რომ ორგანიზმი ვეღარ ეგუება ეკმოს აპარატს.</p>\n<div class=\"text_exposed_show\">\n<p>&nbsp;ექიმ ბალაკრიშნანის თქმით, ყველაფერი კონტროლის ქვეშ აქვს, იგი ცდილობს მოძებნოს საუკეთესო გამოსავალი ამ სიტუაციიდან. ამ ეტაპზე განიხილება გულის ორივე პარკუჭზე აპარატის დაყენება, თუმცა გასათვალისწინებელია სეფსისის კუთხით მდგომარეობა.</p>\n<p>&nbsp;გაკეთდა სისხლის ბაქტერიოლოგიური კვლევა, რომლის პასუხსაც გარკვეული დრო სჭირდება.</p>\n<p>&nbsp;როგორც აგვიხსნეს, სისხლდენა სასწრაფო ქირურგიულ ჩარევას არ საჭიროებს, ამიტომ, გრძელდება მკურნალობა და შემდგომი ნაბიჯების დაგეგმვა.</p>\n<p><span class=\"_5mfr\"><span class=\"_6qdm\">', '27', '', 'https://newsebi.ge/media/anita%20(3).jpg', '', '', 0, 'gtkhovt-yvelm-vilocot-anitas-gadarchenistvis-is-mdzime-mdgomareobashia-mas-shinagani-siskhldena-aqvs-rac-savaraudod-gamotsveulia-imit-rom-organizmi-veghar-egueba-ekmos-aparats', 1580331665, '', 3659, '', ''),
(158, '', 'ვინ არის იტალიაში გარდაცვლილი ქართველი ემიგრანტი ქალი', '<p>იტალიაში, საქართველოს მოქალაქე გარდაიცვალა. როგორც ინტერნეტ გაზეთი Gazzetta di Reggio წერს, კვირა დილით via Roolo Gessi 3 ნომერში გარდაცვლილი იპოვეს ქართველი ქალი, 1966 წლის 20 ივლისს დაბადებული ელზა სიუკაევა.</p>\n<p>მედიის ცნობით, პოლიცია ადგილზე გარდაცვლილი ქალის ბიძაშვილის და ბინის მეპატრონის გამოძახების საფუძველზე მივიდა.</p>\n<p>ელზა სიუკაევა იტალიაში დაახლოებით 14 წელი იმყოფებოდა, არ ყოფილა დაქორწინებული და ოჯახის წევრები საქართველოში ყავდა.</p>\n<p>როგორც მედია წერს, გარდაცვლილი ქალი სპორტის დიდი გულშემატკივარი იყო და მილანის ყველა თამაშს ესწრებოდა. მილანის ხათრით, ის მხოლოდ წითელ და შავს სამოსს იცმევდა. ასევე, მას სახლი მილანის ფერებში ჰქონდა მოწყობილი.</p>\n<p>მედიის ცნობით, ელზამ საქართველოში პატარა სახლი Rossoneri-ს ავეჯით და მოწყობილობით აშენა და ის ვერასდროს ახერხებდა იქ ცხოვრებას.</p>', '27', '', 'https://newsebi.ge/media/emigranti.jpg', '', '', 0, 'vin-aris-italiashi-gardacvlili-qartveli-emigranti-qali', 1580415379, '', 2638, '', ''),
(159, '', 'ეს არის ლოცვა ანიტასთვის თხოვნაა მაქსიმალურად გაავრცელეთ უფალს ებარებოდა პატარა ანგელოზო', '<p>ლოცვა ანიტას გამოჯანმრთელებისთვის</p>\n<p>ტროპარი</p>\n<p>შენ მხოლო ხარ , ქრისტე , მსწრაფლ შემწე , მსწრაფლ გამოაჩინე ზეცით საფარველი შენი ჭირვეულსა მხევალსა შენსა ანიტასა ზედა და იხსენ სნეულებათაგან , ჭირთა და მწარეთა სალმობათაგან ; და აღადგინენ მაქებელად შენდა და მადიდებელად სამარადისოდ , მეოხებითა ღვთისმშობელისაითა , მხოლოო კაცთმოყუარე .</p>\n<div class=\"text_exposed_show\">\n<p>კონდაკი</p>\n<p>სალმობისა სარეცელსა ზედა მდებარესა და სასიკვდილო წყლულებითა მოწყლულსა , ვითარცა ოდესმე აღადგინე , მაცხოვარ , სიდედრი იგი პეტრესი და განრღვეული ცხედარსა ზედა ტვირთული , ეგრევე აწცა , მოწყალეო , ვნებულსა ამას მოხედენ და განკურნენ , რამეთუ შენ მხოლო ხარ უძლურებათა და სალმობათა , და სნეულებათა ნათესავისა ჩვენისათა მტვირთველიდა ყოველივე ძალგიძა , ვითარცა მრავალმოწყალე ხარ .</p>\n<p>ლოცვა</p>\n<p>მეუფეო ყოვლისა მპყრობელო , მკურნალო სულთა და ხორცთა ჩვენთაო , რომელი დაამდაბლებ და აღამაღლებ , რომელი სწყლავ და კვალად განკურნავ ; ძმასა ამას ჩვენსა სნეულსა ზედა მოხედენ მოწყალებითა შენითა , მოყავ მარჯვენაი შენი უხილავი , სავსე ლხინებითა და კურნებითა . განკურნე მხევალი ესე შენი ა ნ ი ტ ა და აღადგინე ესე ცხედრისაგან სნეულებისა მისისა , და შეჰრისხენ სულსა ამას უძლურებისასა , და განაშორე ამისგან ყოველივე წყლულებაი და ყოველივე სალმობაი , ყოველივე გვემაი და ყოველივე მხურვალებაი , გინა ცხროდა რაოდენი რაი არს ამის თანა ბრალი , გინა უსჯულოებაი მიუტევენ ულხინენ , შეუნდვენ კაცთმოყვარებისა შენისათვის. უფალო , შეიწყალენ დაბადებული ესე შენი ქრისტე იესოს მიერ , უფლისა ჩვენისა , რომლისა არს დიდებაი თანა ყოვლადწმიდით , სახიერით და ცხოველსმყოფელით სულით შენითურთ აწ და მარადის და უკუნითი-უკუნისამდე . ამინ .</p>\n</div>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20%E1%83%93%E1%83%94%E1%83%93%E1%83%90.jpg', '', '', 0, 'es-aris-locva-anitastvis-tkhovnaa-maqsimalurad-gaavrcelet-ufals-ebareboda-patara-angelozo', 1580418978, '', 4611, '', ''),
(161, '', 'ვინ არის ქართველი ქალი, რომელიც თურქეთში ჩაცხრილეს', '<p>თურქეთში ქართველი ემიგრანტი მანქანაში ჩაცხრილეს, არიან დაჭრილებიც. შემთხვევის შედეგად დაიღუპა ირმა კრავეიშვილი. რაც შეეხება დაჭრილებს, ისინი საქართველოს მოქალაქეები არ არიან.&nbsp;</p>\n<p>ირმა კრავეიშვილი ქალაქის ერთ-ერთ ბარში მიმტანად მუშაობდა. თავდასხმა მასზე და კიდევ დანარჩენ ორ ქალზე სწორედ მისი სამუშაო დროის დასრულების შემდეგ განხორციელდა.</p>\n<p>როგორც &bdquo;პრაიმტაიმს&ldquo; საგარეო საქმეთა სამინისტროში განუცხადეს, საკონსულო თურქეთში ინფორმირებულია და კომუნიკაციაშია ახლობლებთან.&nbsp;</p>\n<p>&bdquo;ოფიციალური შეტყობინება არ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">შესულა</span>, თუმცა საკონსულო თურქეთში ინფორმირებულია. ოჯახის ახლობელთან არის კომუნიკაციაში, ისევე როგორც თურქეთის შესაბამის უწყებებთან&ldquo;- აცხადებენ საგარეო უწყებაში.&nbsp;</p>\n<p>&nbsp;</p>', '27', '', 'https://newsebi.ge/media/qali.png', '', '', 0, 'vin-aris-qartveli-qali-romelic-turqetshi-chackhriles', 1580508163, '', 1962, '', ''),
(162, '', 'მან ეს 2 წლის ასაკში შეძლო  - რა გზა გაიარა პატარა ანიტამ  გარდაცვალებამდე', '<p>&bdquo;ანიტამ ყველას გვიჩვენა იმის მაგალითი, თუ როგორ უნდა ვიბრძოლოთ სიცოცხლისთვის და მან ეს 2 წლის ასაკში შეძლო! დღეს მამამისს ვუთხარი, რომ იმდენად ძლიერი შვილი გვყავს, მგონი ვერ ვართმევთ თავს მის მშობლობას, რადგან ჩვენ ხშირად ვეცემით, ანიტა კი არასოდეს, არც ერთი წამით არ დანებებულა. მან დაამტკიცა, რომ სიცოცხლე ძალიან, ძალიან ტკბილია და ნებისმიერ ფასად უნდა ვიბრძოლოთ მის შესანარჩუნებლად &ndash; 20 დეკემბერს წერდა ანიტას დედა, მარიკო სადრაძე და მაშინ ყველაზე საზარელ ფიქრშიც კი არ დაუშვებდა, რომ იანვრის ბოლოს ეს მებრძოლი გოგო დანებდებოდა.&nbsp;</p>\n<p>ორი წლის ანიტა ფაცაციას უმძიმესი დაავადება დილატაციური კარდიომიოფატია რამდენიმე თვის წინ, თბილისში დაუდგინდა. დიაგნოზის შედეგად მცირეწლოვანს გულის გადანერგვა ესაჭიროებოდა. მანამდე კი სპეციალური აპარატის ჩადგმა იყო საჭირო, რომელიც გულს ხელოვნურად ამუშავებს. ოპერაციისთვის საჭირო იყო 300 000 ევრო.&nbsp;</p>\n<p>მამის, გიორგი ფაცაციას ნაამბობიდან ირკვევა, რომ ანიტას გასული წლის ივნისში შეხვდა ვირუსი. იწვა კლინიკაში. აგვისტოში დასასვენებლად იყო, როცა ისევ ცუდად გახდა. ეჭვი ჰქონდათ, რომ მოწამლული იყო. ღამით სუნთქვა უჭირდა, შფოთავდა და უენერგიოდ იყო.</p>\n<p>&bdquo;თავიდან მიოკარდიტის დიაგნოზი დაუსვეს. ბოლოს დილატაციური კარდიომიოპათია აღმოჩნდა. ეს დიაგნოზი გულისხმობს გულის უკმარისობას. გული ვერ ასრულებს თავის ფუნქციას და გადიდებულია, საკმარის სისხლს ვერ გადაამუშავებს&rdquo; - სოციალურ ქსელში წერდა ანიტას მამა, გიორგი ფაცაცია.</p>\n<p>თბილისში თვეზე მეტხნიანი მკურნალობის შემდეგ ბავშვის მდგომარეობა გაუარესდა და ოჯახმა ავსტრიაში გამგზავრების გადაწყვეტილება მიიღო.&nbsp;</p>\n<p>16 ნოემბერს სოციალურ ქსელში გავრცელდა ანიტა ფაცაციას დედის, მარიკო სადრაძის პირველი პოსტი, რომლითაც ის საზოგადოებისგან გვერდში დგომას და ფინანსურ დახმარებას ითხოვდა.</p>\n<p>როგორც დედა თავის განცხადებაში ყვებოდა, მარიკოს უჭირდა სუნთქვა და დედას მზერით შველას თხოვდა.&nbsp;</p>\n<p>&bdquo;გადავწყვიტეთ ავსტრიაში ლტოლვილად ჩაბარება. გამოვიარეთ უამრავი ტანჯვა, ტკივილი. ჩვენმა ჰუმანურმა ევროპამ ფაქტობრივად მის სიკვდილს მოაწერა ხელი. მითხრეს, რომ თუ მედიკამენტები უშველის, დავალევინებთ, ხოლო ოპერაცია თუ დასჭირდა, 1 წელი მაინც უნდა იყოთ აქ ნაცხოვრები, რომ გაგიკეთდეთო. ბავშვის მდგომარეობა დღითი დღე მძიმდება. არათუ 1 წელი, არამედ 1 დღეც კი გადამწყვეტია. 1 წელი ოპერაციაზე ლოდინი თვითონაც იციან, რომ წარმოუდგენელია, მაგრამ გამწირეს, 2 წლის ბავშვი გაწირეს&rdquo; - წერდა მარიკო.&nbsp;</p>\n<p>როგორც ანიტას მშობლები იუწყებოდნენ, ავსტრიელ ექიმებს სტაციონარში არ გადაჰყავდათ ბავშვი, რადგან ფაცაციები ავსტრიის მოქალაქეები არ იყვნენ. ანიტა ჩვეულებრივ, ბავშვთა კლინიკაში იწვა.</p>\n<p>ამ პოსტის გავრცელების შემდეგ გოგონას ფინანსური დახმარება უამრავმა ადამიანმა გაუწია. მათ შორის იყო თბილისის მერი კახა კალაძეც, რომელმაც ანიტას ოჯახს 30 000 ლარი გადაურიცხა, ხოლო თბილისის მერიამ შესაბამისი კალკულაციის მიღების შემდეგ, ანიტას მკურნალობა დანარჩენი თანხით დააფინანსა.&nbsp;</p>\n<p>სოციალურ ქსელში ანიტას დედა, მარიკო სადრაძე წერდა:&nbsp;</p>\n<p>&bdquo;ყოველ დღე ბატონი კახის უშუალო დავალებით მეკონტაქტებოდნენ და გამოთქვამდნენ მზაობას დახმარებისთვის. ყველაზე გულის ამაჩუყებელი ჩემთვის იცით, რა იყო? არა თანხით დახმარება, არამედ თურმე ბატონი კახი ყოველ დღე კითხულობდა - როგორ არის ის პატარა გოგოო?&ldquo;&nbsp;</p>\n<p>ავსტრიის ქალაქ გრაცის საავადმყოფოს რეანიმაციაში მოათავსებულ პატარაზე მოგვიანებით დედა წერდა:</p>\n<p>&bdquo;გაგვიმართლა, რომ შეგვხვდნენ ძალიან გულისხმიერი ექიმები, რომლებიც გულწრფელად შეწუხდნენ ანიტას მდგომარეობით და შეუტიეს აგრესიული თერაპიით. ამ მკურნალობამ ბავშვი კლინიკურად უკეთესობისკენ წამოიყვანა.&ldquo;&nbsp;</p>\n<p>იმ პერიოდში გოგონას მამას 34 წლის ახალგაზრდა მამაკაცმა საკუთარი გული შესთავაზა... &bdquo;თუკი ჩემი გული გამოადგება მზად ვარ დავუთმოო&hellip; ხალხო გესმით? გვთხოვა არ გაგვესაჯაროებინა, მაგრამ გაჩუმებაც აღარ შემიძლია&hellip; ადამიანი თავის სიცოცხლეს თმობს&ldquo; &ndash; წერდა მარიამ სადრაძე.</p>\n<p>ავსტრიის კლინიკისგან მიღებული უარის შემდეგ ანიტას ოპერაციაზე იტალიის კლინიკამაც უარი თქვა, მოგვიანებით კი, ბავშვის ოპერაციის ჩატარებაზე პასუხისმგებლობა ვერც ბელარუსმა აიღო. არადა, 13 დეკემბერს გოგონას ოჯახი ავსტრიიდან ბელორუსში გასამგზავრებლად ემზადებოდა&hellip;</p>\n<p>&bdquo;ანიტა ყველამ გაწირა&ldquo; &ndash; &bdquo;ფეისბუქზე&ldquo; წერდა აღშფოთებბული მამა. სწორედ ამ ყველაზე რთულ და სასოწარკვეთილ პერიოდში სოციალურ ქსელში გაკეთდა გვერდი - &bdquo;ანიტასთვის&ldquo;. სიცოცხლისთვის მებრძოლი პატარა გოგონასთვის, დედის თხოვნით, ქართველებმა ერთიანი ძალით ლოცვა დაიწყეს. მარიკო არაერთხელ სთხოვდა თანამემამულეებს ელოცათ მისი შვილისთვის. სწორედ ლოცვის ძალითა და მადლით ეძლეოდა პატარას ენერგია, რაზედაც ექიმები არაერთხელ განცვიფრებულან - მის მდგომარეობაში გონებაზე როგორ არის და ენერგია საიდან აქვსო...&nbsp;</p>\n<p>დეკემბრის შუა რიცხვებში პრემიერის დავალებით საგარეო საქმეთა სამინისტრო შესაბამის უწყებებთან კოორდინირებულად მუშაობდა გოგონას პრობლემის მოსაგვარებლად, ოჯახთან კი კომუნიკაცია პრემიერის აპარატს ჰქონდა. საქართველოს საგარეო საქმეთა მინისტრის, დავით ზალკალიანის განცხადებით, უწყება მცირეწლოვანი ანიტა ფაცაციას სიცოცხლის შესანარჩუნებლად ყველაფერს აკეთებდა. როგორც ზალკალიანმა &bdquo;ელჩების კონფერენცია 2019&ldquo;-ზე განაცხადა, ინდოეთის ერთ-ერთი კლინიკა პაციენტის მისაღებად მზად იყო.&nbsp;</p>\n<p>&bdquo;მცირეწლოვანი ბავშვის სიცოცხლის გადასარჩენად მთელი ჩვენი დიპლომატიური კორპუსი ჩართულია - შესაბამისი საელჩოები იტალიაში, ბელორუსში, ინდოეთში. მე ვთხოვე ჩვენს ელჩს ინდოეთში, რომ დღევანდელ ჩვენ შეკრებაზე არ დარჩეს და გაემგზავროს ინდოეთში, რადგანაც ამ ბავშვის გადარჩენა ძალიან მნიშვნელოვანია. დაგვთანხმდა ინდოეთის ერთ-ერთი კლინიკა, რომ შესაბამისი ოპერაცია ჩატარდეს. ყველა ზომას მივმართავთ იმისთვის, რომ ამ ბავშვს სიცოცხლე შევუნარჩუნოთ&ldquo;, - განაცხადა მინისტრი.</p>\n<p>ფრენის რისკის და მანძილის გამო ინდოეთის კლინიკას ბოლო ვერსიად განიხილავდნენ. თუმცა ეს უკანასკნელი შანსი აღმოჩნდა. როგორც ანიტას მშობლები წერდნენ, ადამიანური მხარდაჭერა ჰქონდათ საქართველოს ელჩისგან ინდოეთში - არჩილ ძულიაშვილისგან. ის აეროპორტში დახვდა ფაცაციებს, კლინიკაში აკითხავდა, მორალურად ედგა გვერდში.&nbsp;</p>\n<p>20 დეკემბერს ანიტა ავსტრიიდან ინდოეთში სპეციალური რეანო-თვითმფრინავით გადაიყვანეს. ფრენის პროცესს გართულებები არ მოჰ-ყოლია.&nbsp;</p>\n<p>&nbsp;</p>\n<p>მარიკო სადრაძე: - ჩემი ჩიტი თბილ ქვეყნებში ჩამოფრინდა. ფრენამ ჩაიარა იდეალურად. მთელი გზა ეძინა, მე კი მის მონაცემებს ეკრანზე მივშტერებოდი. ყველაფერი იმდენად კარგად იყო მთელი გზის მანძილზე, რომ ექიმებს ყურსასმენები ეკეთათ და პლანშტებში ფილმებს უყურებ&not;დნენ. ფრენის ბოლო ნახევარი საათი გაიღვიძა და გამოაცხადა: &ldquo;მე ბაჭია ვარო&rdquo;. ჩემი გოგო ინტენსიურ განყოფილებაში დააწვინეს და მარტო ერთხელ მომცეს ნახვის უფლება.</p>\n<p>ინდოეთში მსოფლიოში ყველაზე დიდი ტრანსპლანტოლოგიის ცენტრია. ჰყავთ დიდი პრაქტიკის და გამოცდილების მქონე ტრანსპლანტოლოგები. &bdquo;ანიტას ექიმი ბალაკრიშნანი 30 წლიანი სტაჟის მქონე ბავშვთა ტრანსპლანტოლოგია. იგი ამჟამად იმყოფება აშშ-ში და 23 დეკემბერს ჩავა ინდოეთში. მანამდე კი ანიტას კარგად დაასვენებენ და ყველა საჭირო ზომას მიიღებენ ხანგრძლივი მგზავრობის შემდეგ მისი ორგანიზმის მოსაძლიერებლად&rdquo; - წერდა გოგონას მამა, გიორგი ფაცაცია.&nbsp;</p>\n<p>&nbsp;ინდოელი ექიმების გადაწყვეტილებით, ანიტას თერაპიული კურსი უნდა ჩატარდებოდა, წარმატებით ჩატარების შემთხვევაში კი 2 წლის მოზარდს გულის გადანერგვის ოპერაცია აღარ დასჭირდება.</p>\n<p>ქალაქ ჩენაის კლინიკაში მყოფ ფაცაციებს შობას მოულოდნელად ინდოელი ბიზნესმენი მოევლინათ, რომელმაც ოჯახს სამკურნალო თანხის სრული დაფარვა აღუთქვა.</p>\n<p>ბიზნესმენი ს. იაგატრაკშაკანი ანიტას მდგომარეობით ჯერ კიდევ 2 წლის მოზარდის ინდოეთში ჩაფრენისას დაინტერესდა, მას შემდეგ კი ხშირად სტუმრობდა მოსანახულებლად. მარიკო სადრაძის ინფორმაციით, იაგატრაკშაკანის კომპანიის წარმომადგენლები ანიტას ოჯახს 7 იანვარს, საავადმყოფოში ესტუმრნენ.</p>\n<p>&ldquo;ეს იმდენად დიდი სასწაული იყო ჩვენთვის, რომ დაბნეულობისგან მადლობის თქმაც კი ძლივს მოვახერხეთ&rdquo;, &ndash; წერდა ანიტას დედა.</p>\n<p>იაგატრაკშაკანი ინდოეთში ერთ-ერთი ყველაზე ცნობილი ბიზნესმენი და ქველმოქმედია. სხვადასხვა წლებში იყო ინდოეთის პარლამენტის წევრი, მას აგრეთვე მრეწველობის მინისტრიც თანამდებობაც ეკავა. მისი მეუღლე ხელმძღვანელობს სასწავლებელს, რომელიც ეხმარება ოჯახებს, რომ მათმა შვილებმა საჭირო განათლება მიიღონ.</p>\n<p>ინტენსიური თერაპიის კურსი სიცხეების ფონზე მიმდინარეობდა. ანიტას მისი საყვარელი ფენოვანი ხაჭაპურის ჭამა ეკრძალებოდა, რადგან&nbsp; კვება ზონდთან ერთად უღიზიანებს ყელს. ექიმები ამბობდნენ, ის ძლიერი მებრძოლიაო.&nbsp;</p>\n<p>&bdquo;როგორც ექიმებმა აღნიშნეს, ანიტა რეანიმაციული განყოფილების ყველაზე ცელქი პაციენტია.</p>\n<p>მიუხედავად იმისა, რომ ხელები შეფუთული აქვს, მაინც ახერხებს ზონდის გამოძრობას და ინტუბაციის მილის წვალებას. ამიტომ, რაც დამაძინებლების დოზა შეუმცირეს, ანიტას დედიკოს ექიმები ხშირად ეძახიან&nbsp;დასახმარებლად&rdquo; - წერდა ოჯახის ახლობელი.</p>\n<p>ანიტას მდგომარეობა 9 იანვარს დამძიმდა. მას პნევმონია განუვითარდა. პაციენტი რენიმაციულ განყოფილებაში გადაიყვანეს და მართვით სუნთქვაზე იმყოფებოდა. ექიმები პნევმონიის ჩაცხრობას ელოდებოდნენ, თუმცა ოპერაციის გაკეთების გადაწყვეტილების მიღება გაცილებით ადრე გახდა საჭირო, რადგან ექიმებმა გოგონას გულის გაჩერება დააფიქსირეს. აპარატს, რომელიც პაციენტს ჩაუდგეს, გულის მუშაობა 3-4 კვირით უნდა გაეუმჯობესებინა.&nbsp;&nbsp;</p>\n<p>10 იანვარს დადგა ეკმოს აპარატის ჩანერგვის სასწრაფო საჭიროება. პირველი აპარატი ანიტას ორგანიზმმა არ შეითვისა, გამთენიისას გადაწყდა სხვა სახის აპარატის ჩადგმა.</p>\n<p>ოპერაცია 4-5 საათის განმავლობაში გრძელდებოდა. შედეგად ბავშვს ამოეტუმბა ფილტვებში ჩამდგარი სითხე, სისხლი, მოისპო ინფექციის კერა და ჩაინერგა აპარატი, რომელიც გულს ორი თვის განმავლობაში ხელოვნურად ამუშავებს.</p>\n<p>&nbsp;ანიტას ხელოვნური ძილის მდგომარეობაში ამყოფებდნენ. ჩატარებული კვლევების მიხედვით, მას სისხლში ამოეთესა ერთი-ერთი სოკოს და ინფექციის სახეობა. დადგა დიალიზის ჩატარების საჭიროება.</p>\n<p>მოგვიანებით ბავშვს სისხლის მიმოქცევა გაუუუარესდა. კიდურებს სისხლი რთულად მიეწოდებოდა და ამიტომ ხელები გამუქებული ჰქონდა, ფეხები - შეშუპეპული. დადგა სეფსისის სამკურნალოდ ანტიბიოტიკოთერაპიის გაკეთების საჭიროება.</p>\n<p>ანიტას ნათლისღება სოციალური ქსელის მეშვეობით საქართველოს პრეზიდენტმა მიულოცა: გილოცავთ ნათლისღების ბრწყინვალე დღესასწაულს. ამ დღის მადლი შეგეწიოთ. და შენ პატარა ანიტა, ძალა მოგცეს და ჯამრთელობა დაგიბრუნოს!</p>\n<p>იანვრის შუა რიცხვებში ბავშვს ბილირუბინის მაჩვენებელი თითქმის ნორმამდე დაეწია და შესაბამისად სიყვითლემაც გაუარა. აგრძელდებდნენ დიალიზის და ინფექციის საწინააღმდეგო ანტიბიოტიკოთერაპიას.</p>\n<p>&nbsp;&bdquo;როგორც ექიმმა თქვა, სანამ ჩვენი გოგოს გული ეკმოს აპარატის დახმარებით მუშაობს, მას მოუწევს რეანიმაციულ ბლოკში ყოფნა&rdquo; - წერდა ოჯახის ახლობელი.&nbsp;</p>\n<p>როგორც აღმოჩნდა, ორგანიზმმა აპარატი ვერ მიიღო. საუბედუროდ, ანიტას ორგანიზმში სისხლდენა დაიწყო. გოგონას დედა სოციალური ქსელის მეშვეობით ისევ ლოცვას ითხოვდა. ინდოეთის კლინიკის ექიმები გამოსავალს ეძებდნენ. სწორედ ასეთ გამოსავლად სახელდებოდა გულის ორივე პარკუჭზე აპარატის დაყენება. თუმცა გასათვალისწინებლად მიჩნევდნენ სეფსისის კუთხით მდგომარეობას. გაკეთდა სისხლის ბაქტერიოლოგიური კვლევა, რომლის პასუხსაც გარკვეული დრო სჭირდება. როგორ ექიმები მშობლებს ეუბნებოდნენ, სისხლდენა სასწრაფო ქირურგიულ ჩარევას არ საჭიროებდა, ამიტომ, გრძელდებოდა მკურნალობა და შემდგომი ნაბიჯების დაგეგმვა.</p>\n<p>ანიტას დედა ძალიან განიცდიდა ბავშვის კიდურების გამუქებას, ბავშვს განსაკუთრებულად ცუდ მდგომარეობაში ჰქონდა მარცხენა ხელის თითები, რომლებიც უფრო გაშავდა.</p>\n<p>ექიმების განმარტებით, კიდურების მდგომარეობის გამოსწორება მეტწილად ანიტას ორგანიზმზე იყო დამოკიდებული.</p>\n<p>13 იანვარს ანიტას გვერდზე გაჩნდა მამა სევერიანე მალაზონიას ნახატი, სადაც ის ფრთებით არის დახატული.&nbsp;</p>\n<p>მოგვიანებით ფრთიანი ანიტას დახატვა სხვასაც მოუნდა... ერთმა ფეისბუქმომხმარებელმა პოსტი გამოაქვეყნა და დაწერა, რომ ყინწვისის წმინდა ნიკოლოზის მონასტრის სასანთლეში ნახატი დახვდა.</p>\n<p>&bdquo;ეს დამხვდა გუშინ ყინწვისის წმ. ნიკოლოზის მონასტრის სასანთლეში... ღმერთმა გააძლიეროს ეს პატარა გმირი გოგო&ldquo; - წერს ქეთი ჩაფიძე.</p>\n<p>ნახატზე დედას ჩახუტებული ანიტა ფრთებითაა. სასულიერო პირის მიერ ფანქრით შესრულებული ეს ჩანახატი ერთგვარი წინასწამეტყველება აღმოჩნდა... ათ დღეში ანიტა &bdquo;გაფრინდა&ldquo; კიდეც...</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '27', '', 'https://newsebi.ge/media/anita%20(2).jpg', '', '', 0, 'man-es-2-tslis-asakshi-shedzlo----ra-gza-gaiara-patara-anitam--gardacvalebamde', 1580585890, '', 2894, '', ''),
(163, '', ' უმძიმესი ინფორმაცია ანიტას ჩამოასვენებენ დღეს 2 თებერვალს თხოვნაა არცერთი ჟურნალისტი არ მივიდეს იქ ', '<p>&nbsp;არ ვიცი მერამდენე ღამეა, რომ ტრადიციულად მოგესალმოთ...</p>\n<p>მნიშვნელოვან პოსტს ვწერ, მინდა ემოციების გარეშე მოგაწოდოთ ინფორმაცია, მაგრამ... ვწერ, ვშლი, ვწერ, ვშლი, ვწერ, ვშლი...</p>\n<p>ამდენი ხნის განმავლობაში, ყოველ ღამე გწერდით ანიტას, მისი დედიკოს და მამიკოს ამბებს.<span class=\"text_exposed_show\"><br />პასუხისმგებლობა ავიღე, დაგპირდით, რომ ყველა ინფორმაციას გაგაცნობდით. კრიტიკული სიტუაციების დროს მიჭირდა, არ მინდოდა არაფრის წერა, მაგრამ ვწერდი იმიტომ, რომ თქვენ არც ერთი წამი არ მიგვატოვეთ და არც ჩვენ გვქონდა თქვენი მიტოვების უფლება...</span></p>\n<div class=\"text_exposed_show\">\n<p>ვწერ, ვშლი, ვწერ... ძალიან მიჭირს ამ სიტყვების დაწერა:</p>\n<p>ანიტას ჩამოასვენებენ კვირას, 2 თებერვალს 20:15 საათზე.<br />სამთავრობო გასასვლელიდან გამოვლენ, ამიტომ შიგნით ვერ შეხვალთ.</p>\n<p>ძალიან მნიშვნელოვანი რამ უნდა ვთხოვო/მოვთხოვო ჟურნალისტებს!</p>\n<p>ძალიან გთხოვთ, არავინ არ მოხვიდეთ ფოტოების, სიუჟეტების, ლაივ/სინქრონების და კომენტარებისთვის!<br />ამას იმიტომ ვწერ, რომ ბევრმა გვთხოვა კომენტარი გაგვეკეთებინა (არ ვიცი რა კომენტარი შეიძლება გაგვეკეთებინა) მე და ჩემ მეგობრებს, რაც ძალიან მიუღებელია ამ სიტუაციაში.<br />ამიტომ გთხოვთ, დაფიქრდით სანამ რამეს მოიმიქმედებთ. თუნდაც ფოტო გადაიღოთ, დაფიქრდით ანიტას ოჯახის წევრები რას იგრძნობენ ამ ფოტოს რომ შეხვდებიან სოც. ქსელში.</p>\n<p><span class=\"_5mfr\"><span class=\"_6qdm\">▪️</span></span>&nbsp;ხუთშაბათს, 6 თებერვალს, უნივერსიტეტის ქუჩაზე მდებარე ამაღლების ეკლესიიდან გამოასვენებენ ანიტას...</p>\n<p>არ მჯერა, რომ ეს დავწერე...</p>\n<p>მადლობა რომ ბოლომდე იბრძოდით...<br />ბოდიში, რომ დაგპირდით და ეს ამბავი კეთილ დასასრულამდე ვერ მივიყვანეთ...</p>\n<p>ახლა უკვე ერთადერთი რასაც ვნატრობ, ანიტას მამამ, რომელსაც დღეს 28 წელი შეუსრულდა და დედამ რომელიც ჩემთვის ბეგობარზე, დაქალზე, დაზე მეტია და ახლა ჩემი გმირიც გახდა, ფიზიკურად მაინც გაუძლონ ამ ყველაფერს...</p>\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a> სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20%E1%83%90%E1%83%9C%E1%83%92%E1%83%94%E1%83%9A%E1%83%9D%E1%83%96%E1%83%98.jpg', '', '', 0, '-umdzimesi-informacia-anitas-chamoasveneben-dghes-2-tebervals-tkhovnaa-arcerti-zhurnalisti-ar-mivides-iq-', 1580594183, '', 5899, '', ''),
(164, '', 'პირველი ინტერვიუ ჩინეთიდან დაბრუნებული ქართველ გოგონასთან - რა განცხადებას ავრცელებს ის?', '<p>ჩინეთში წასული მოქალაქე ანანო ლებანიძე სამშობლოში დღეს ჩამოვიდა. ამის შესახებ მან სოციალურ ქსელში დაწერა.</p>\n<div class=\"code-block code-block-2\">\n<div id=\"chi10iota10567\">\n<div>\n<div class=\"Rv26F04\">მისი თქმით, იგი ჩინეთიდან დროებით გამოერიდა სიტუაციას.</div>\n</div>\n</div>\n</div>\n<p>&bdquo;ვიცი გაგიხარდებათ. ქართველ თანამშრომლებთან ერთად, დროებით არსებულ ვითარებას გამოვერიდე და საქართველოს დავუბრუნდი. ამისთვის განსაკუთრებული მადლობა ჩემს უფროსს და საქართველოს საელჩოს ჩინეთში. ვიცი, მალე ყველაფერი კარგად იქნება და იმ &bdquo;მონსტრიკსაც&ldquo;, ასეთ ამბებს რომ ატრიალებს, საბოლოოდ გაუყენებენ გზას.</p>\n<p>პ.ს. ხანგრძლივი მგზავრობის შემდეგ, ქართველი მესაზღვრის გაღიმებასაც კი და სიტყვებს კეთილი იყოს მშვიდობიანად დაბრუნება, სულ სხვა ფასი ჰქონია&ldquo;,- წერს ანანო ლებანიძე სოციალურ ქსელში.</p>\n<p>ანანო ლებანიძე&nbsp;<a href=\"https://heretifm.com/?p=111684\" target=\"_blank\" rel=\"noreferrer noopener\">&bdquo;რადიო&nbsp;ჰერეთთან&ldquo;</a>&nbsp;ყვება, როგორი იყო მდგომარეობა ჩინეთში და რამ გადააწყვეტინა ქვეყანაში დაბრუნება.</p>\n<p>მისი თქმით, პანიკა საქართველოში უფრო შეინიშნება, ვიდრე ადგილობრივებში.</p>\n<p>&bdquo;მე ვიმყოფებოდი სამხრეთ ჩინეთში, ქალაქ გუანჯოუში, საიდანაც გამოვფრინდი და მშვიდობიანად ჩამოვედი საქართველოში.&nbsp;გუანჯოუშიც&nbsp;დაფიქსირდა&nbsp;კორონავირუსის&nbsp;შემთხვევები, თუმცა სიკვდილი არ გამოუწვევია. ჩამოსვლისას აეროპორტში დაგვხვდნენ ექიმები, დაგვისვეს კითხვები,&nbsp;გაგვიზომეს&nbsp;სიცხე, დავტოვეთ ჩვენი მონაცემები. ჩემ შემთხვევაში არანაირი გამოვლინება არ ყოფილა, თუმცა ვცდილობ 2 კვირის განმავლობაში არ მქონდეს კონტაქტი სხვა ადამიანებთან,&nbsp;გადავაადგილდები&nbsp;პირბადით და&nbsp;გადამოწმებისთვის&nbsp;ექიმთანაც ვაპირებ მისვლას.</p>\n<p>ბოლო ერთი კვირა სახლიდან არ გავდიოდით, მხოლოდ საჭიროების შემთხვევაში. პანიკა საქართველოში უფრო იყო, როცა განერვიულებული ადამიანები მირეკავდნენ. იქ ასეთი პანიკა არ შეინიშნება, თუმცა მდგომარეობა რთულია, არის ბევრი დაინფიცირებული და საავადმყოფოებიც სავსეა&ldquo;,- ამბობს ანანო ლებანიძე.</p>\n<p>მისივე თქმით, იგი დაელოდება მოვლენათა განვითარებას და მხოლოდ ამის შემდეგ დაბრუნდება ჩინეთში.</p>\n<p>დღეს კორონავირუსის გამო გარდაცვალების 46 ახალი შემთვევა დაფიქსირდა, რამაც გარდაცვლილთა საერთო მაჩვენებელი 260-მდე გაზარდა.</p>\n<p>ბოლო 24 საათში ჩინეთში ინფიცირებულთა რაოდენობა რეკორდულად, დაახლოებით 2400 ერთეულით გაიზარდა.</p>', '27', '', 'https://newsebi.ge/media/444.jpg', '', '', 0, 'pirveli-interviu-chinetidan-dabrunebuli-qartvel-gogonastan---ra-ganckhadebas-avrcelebs-is', 1580681086, '', 901, '', ''),
(165, '', 'ექიმმა გვამცნო MRI-ის პასუხი, სიმსივნე დაპატარავდა! - უახლესი ინფორმაცია 19 წლის მარიამზე', '<p>19 წლის მარიამ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">კალომლეწავის შესახებ</span>, რომელსაც თავის ტვინზე მე-4 სტადიის სიმსივნე აქვს, უახლესი ინფორმაცია ვრცელდება.&nbsp;</p>\n<p>მარიამის მამა ივანე&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">კალომლეწავი</span>&nbsp;ყველას მადლობას უხდის თანადგომისთვის.&nbsp;</p>\n<p>&bdquo;გამომდინარე იქიდან, რომ მარიამის მამას არ აქვს სოციალური ქსელი, გვთხოვა, კალოს ჯგუფში&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">გაგვესაჯაროებინა</span>&nbsp;მის მიერ გამოგზავნილი წერილი: &bdquo;არ ვიცი ყველას მადლობა როგორ გადაგიხადოთ, სიტყვებით ეს არ აიხსნება, თუ რაოდენ მნიშვნელოვანი და ღირებულია ის თანადგომა და ის სიყვარული, რაც ამ პერიოდში სრულიად უცხო ხალხმა გაიღეთ ჩემი მარიამის და ჩემი ოჯახის მიმართ, რომ არაფერი ვთქვათ ახლობლებზე, მეგობრებზე,&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ნათევასავებსა</span>&nbsp;თუ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ნაცნობებზე</span>....<br />ერთი რამ ცხადია, რომ ყველაფერი უფლის ნებით ხდება და მჯერა რომ ეს გაღებული სიკეთე არც ერთ თქვენგანს არ დაგეკარგებათ უფლის წინაშე !<br />მე მჯერა უფლის ნების და აი, დღესაც მისი მოწყალებით&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">გაგვითენდა</span>&nbsp;სასიხარულო დილა, როდესაც მარიამის მკურნალმა ექიმმა გვამცნო&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">MRI-ის</span>&nbsp;პასუხი - სიმსივნე დაპატარავდა!&ldquo;,- წერენ ჯგუფში მარიამისთვის.&nbsp;</p>\n<p><img src=\"https://www.primetime.ge/uploads/gallery/news/02-2020/cf112863d5ca813b32b9e5e0276be477.PNG\" alt=\"\" width=\"493\" height=\"729\" /></p>\n<p><img src=\"https://scontent.ftbs4-1.fna.fbcdn.net/v/t1.0-9/82638251_2802615879776979_202854500845748224_n.jpg?_nc_cat=100&amp;_nc_ohc=hFKT9qv494MAX9EW7Di&amp;_nc_ht=scontent.ftbs4-1.fna&amp;oh=e40233a0a8530a8ef00f9eaaf331fc1a&amp;oe=5ED41C86\" alt=\"width=600\" height=\"597\" /></p>\n<p>&nbsp;</p>\n<p><strong>დაგვეხმარეთ მეგობრის გადარჩენაში</strong></p>\n<p><strong>დარეკეთ 0901 700 177</strong></p>\n<p><strong>ლიბერთი ბანკი</strong><br /><strong>#GE43LB0711170075564000</strong></p>\n<p><strong>TBC bank</strong><br /><strong>#GE97TB7716645061600008</strong></p>\n<p><strong>საქართველოს ბანკი</strong><br /><strong>#GE89BG0000000902975700</strong></p>\n<p><strong>მიმღები: ივანე&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">კალომლეწავი</span>&nbsp;( მარიამის მამა)</strong></p>\n<p>&nbsp;</p>', '22', '', 'https://newsebi.ge/media/mri.png', '', '', 0, 'eqimma-gvamcno--is-pasukhi-simsivne-dapataravda---uakhlesi-informacia-19-tslis-mariamze', 1580749568, '', 5635, '', ''),
(169, '', 'რამდენიმე წლის წინ მე მოგიწოდებდით რომ დაბრუნდით სამშობლოში, ახლა მე მოგიწოდებთ, რომ იყავით იქ სადაც ბრძანდებით', '<p><br />\"რამდენიმე წლის წინ მე მოგიწოდებდით რომ დაბრუნდით სამშობლოში. ახლა მე მოგიწოდებთ, რომ იყავით იქ სადაც ბრძანდებით, მაგრამ ამავე დროს იყავით სამშობლოში,\" - ასე მიმართა ემიგრანტებს ილია მეორემ დღეს, 27 მაისს, დიასპორის დღისადმი მიძღვნილ ფორუმზე.<br />\"მე მინდა მადლობა მოგახსენოთ, იმ სულიერი თუ მატერიალური დახმარებისათვის, რასაც თქვენ აკეთებთ სამშობლოსათვის. თქვენ უნდა დაგვეხმაროთ მცირე და საშუალო ბიზნესის შექმნაში. ჩვენ ყველაფერი უნდა გავაკეთოთ იმისათვის, რომ ჩვენმა შვილებმა, რომელნიც მოღვაწეობენ და ცხოვრობენ უცხოეთში, არ დაივიწყონ ქართული კულტურა, ეკლესიები და მონასტრები, რომელიც შეიქმნა უცხოეთში და გახდა ცენტრები ქართული სულიერი კულტურისა. შეიქმნა ქართული ცეკვის, სიმღერის და ლიტერატურის წრეები. ამაში აქტიური მონაწილეობა უნდა მიიღოთ თქვენ,\" - განაცხადა საქართველოს მართლმადიდებელი ეკლესიის პატრიარქმა, ილია მეორემ</p>', '27', '', 'https://newsebi.ge/media/%E1%83%98%E1%83%9A%E1%83%98%E1%83%90%20%E1%83%9B%E1%83%94%E1%83%9D%E1%83%A0%E1%83%94.jpg', '', '', 0, 'ramdenime-tslis-tsin-me-mogitsodebdit-rom-dabrundit-samshobloshi-akhla-me-mogitsodebt-rom-iyavit-iq-sadac-brdzandebit', 1580845147, '', 2617, '', ''),
(170, '', 'ანიტასთვის საბოლოოდ  დამშვიდობება  შეგეძლებათ დღეს   ხვალ, ხუთშაბათს კი გაფრინდება ცათა სასუფელში', '<p>ანიტელებო, როგორც იცით ჩვენი გოგო სამშობლოში დაბრუნდა...</p>\n<p>მასთან დამშვიდობებას შეძლებთ დღეს, ოთხშაბათს 18:00 საათიდან,<br />უნივერსიტეტის ქუჩაზე მდებარე საბურთალოს ამაღლების ეკლესიაში.</p>\n<div class=\"text_exposed_show\">\n<p>ხვალ, ხუთშაბათს 14:00 საათზე, ჩიტს გავაცილებთ და გაფრინდება სადღაც შორს, თბილ, ბედნიერების და სიხარულის ქვეყნებში... შორს, სადაც არაფერი ცუდი არ ხდება...<br />გწამდეთ... გაძლიერდით...</p>\n<p><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%E1%83%A1?source=feed_text&amp;epa=HASHTAG\" data-ft=\"{&quot;type&quot;:104,&quot;tn&quot;:&quot;*N&quot;}\"><span class=\"_5afx\"><span class=\"_58cl _5afz\">#</span><span class=\"_58cm\">ანიტას</span></span></a> სთვის</p>\n</div>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20%E1%83%93%E1%83%94%E1%83%93%E1%83%90.jpg', '', '', 0, 'anitastvis-sabolood--damshvidobeba--shegedzlebat-dghes---khval-khutshabats-ki-gafrindeba-cata-sasufelshi', 1580925694, '', 4409, '', ''),
(171, '', 'ამოვთხრი საფლავიდან ჩემი დის ცხედარს და დავასვენებ პოლიციის შენობის წინ', '<p>ზუგდიდში, 32 წლის ქალზე ძალადობის და თვითმკვლელობამდე მიყვანის ბრალდებით დაკავებული მამაკაცი მტკიცებულებების არქონის გამო, შესაძლოა 14 თებერვალს სასამართლო დარბაზიდან გაათავისუფლონ. ამის თქმის საფუძველს გარდაცვლილი ქალის ოჯახს სამხარაულის ექსპერტიზის დასკვნა აძლევს.</p>\n<p>&bdquo;ქუთაისში იმყოფებოდნენ დედაჩემი და ჩემი მეუღლე და მათ გააცნეს ექსპერტიზის დასკვნა. ამ დასკვნაში წერია, რომ ეკას (ჩემი დის სხეულზე) დაზიანებები არ არის თვითმკვლელობამდე მიყენებული, რასაც ოჯახი კატეგორიულად ვეწინააღმდეგებით. მე გადავუღე ჩემი დის ცხედარს ფოტოები, აქვს მრავლობითი დაზიანებები თავის არეში,უკან ყელი აქვს გამოჭრილი, ნაცემია და ნუთუ ეს არ უნდა ყოფილიყო დასკვნაში. ჩვენ ამ დასკვნას არ ვეთანხმებით. პოლიციის სამმართველოში გვეუბნებიან, პროკურატურაში მიდით, იქ გაგარკვევენ, ხოლო პროკურატურა გვეუბნება სამხარეო პოლიციაში გაგარკვევევნო. მოკლედ ასეა ჩვენი საქმე, ჯერ კიდევ ველოდებით დნმ-ის პასუხს, აი შემდეგ კი მოვითხოვთ ხელახალ ექსპერტიზას და ამოვთხრი საფლავიდან ჩემი დის ცხედარს და დავასვენებ პოლიციის შენობის წინ, არ დავთმობ მტკიცებულებების გაყალბებას, ვიცი ამ ყველაფრის უკან დგას და ჩემს ყოფილ სიძეს( დის ქმარს) ზურგს უმაგრებს მმართველი პარტიის ზუგდიდის მუნიციპალიტეტის საკრებულოს დეპუტატი ზაზა ხუბუა\",- განუცხადა &bdquo;პრაიმტაიმს\" გარდაცვლილი ქალის ძმამ ნუკრი მიქავამ.</p>\n<p>შინაგან საქმეთა სამინისტროს სამეგრელო-ზემო სვანეთის პოლიციის დეპარტამენტის თანამშრომლებმა, ზუგდიდის მუნიციპალიტეტის სოფელ შამგონაში 32 წლის ბაკურ სორდია დააკავეს, რომელიც მეუღლის თვითმკვლელობამდე მიყვანასა და ძალადობაშია ბრალდებული.</p>\n<p>სოფელ შამგონაში 32 წლის ეკა მიქავა მეზობლის, საკრებულოს წევრ ზაზა ხუბუას ბოსელში ჩამომხრჩვალი იპოვეს. დეპუტატი ხუბუა ოჯახის ახლობელია, რომელიც ოჯახური კონფლიქტის მოგვარებაში იყო ჩართული.</p>\n<p>გარდაცვლილ ეკა მიქავას სამი შვილი დარჩა, იგი შამგონის საბავშვო ბაღში აღმზრდელ-მასწავლებელად მუშაობდა. გარდაცვლილის ნათესავებს თვითმკვლელობის ვერსიის არ სჯერათ, ისინი აღნიშნავენ, რომ ახალგაზრდა ქალს სხეულზე დაზიანებები აღენიშნება, მას ქმართან გამუდმებით კონფლიქტი ჰქონდა, მეზობლების განცხადებით, ბაკურ სორდია ცოლს სისტემატურად სცემდა, თუმცა, არც ძალადობის მსხვერპლს და არც ოჯახის წევრებს პოლიციისთვის არ მიუმართავთ.</p>\n<p>&bdquo;ჩემი შვილი მესამე სახლში არ წავიდოდა და თავს არ ჩამოიხრჩობდა, ვარიანტი არ არის, გამორიცხულია, დაზიანება ზურგის არეში აქვსო. გამოეშვა ჩემი შვილი თავის შვილებიანად, ჩემთან მეყოლებოდა\"- აცხადებს დაღუპულის მამა.</p>\n<p>გარდაცვლილის ძმის, ნუკრი მიქავას თქმით კი, მის დას სავარაუდოდ, &bdquo;ჯერ სცემეს და მერე ჩამოკიდეს\".</p>\n<p>ახლობლები იმასაც ამბობენ, რომ ბაკურ სორდიას საყვარელი ჰყავდა და მასთან ბავშვიც ეყოლა, რაც ოჯახური კონფლიქტის მიზეზი გახდა.</p>\n<p>გამოძიება ოჯახში ძალადობისა და თვითმკვლელობამდე მიყვანის ფაქტებზე, საქართველოს სისხლის სამართლის კოდექსის 126-ე პრიმა მუხლის 1-ლი ნაწილით და 115- ე მუხლის 1-ლი ნაწილით მიმდინარეობს.</p>', '27', '', 'https://newsebi.ge/media/aaa.jpg', '', '', 0, 'amovtkhri-saflavidan-chemi-dis-ckhedars-da-davasveneb-policiis-shenobis-tsin', 1580936175, '', 2432, '', ''),
(172, '', 'მაპატიე დედა რომ ამ ქვეყანაზე გავჩნდი ვიცი რატომაც მიმატოვე ბავშვთა სახლში მიტოვებული 10 წლის ბავშვის წერილი დედას  ', '<h1><span style=\"font-size: 11px;\">ეს 10 წლის ბიჭუნა დედამ დაბადებისთანავე ბავშვთა სახლს მიაბა, მიზეზი დღემდე უცნობია. ბავშვმა წერილი მიწერა დედას, რომელიც გასაჯაროვდა. გთავაზობთ ამონარიდს: მაპატიე დედა, რომ გავჩნდი ამ ქვეყანაზე, შენ არაფერში გამტყუნებ, ყველაფერს თავისი მიზეზი აქვს, მაგრამ იცოდე რომ ძალიან მიყვარხარ და მენატრები. ბედნიერი ვიქნებოდი შენს გვერდით ყოფნით, მაგრამ ესეთ ბედზე დავბადებულვარო. გავიზრდები და მივხვდები ალბათ ყველაფრის მიზეზს. ყოველთვის მეყვარები ჩემო დედა.&nbsp;<br /><br />წყარო: წერილის ნაწილი ამოღებულია FB-დან,ერთ-ერთ დახურული ჯგუფიდან. </span></h1>\n<div id=\"SC_TBlock_718451\" class=\"SC_TBlock\">&nbsp;</div>', '27', '', 'https://newsebi.ge/media/%E1%83%93%E1%83%93%E1%83%93.jpg', '', '', 0, 'mapatie-deda-rom-am-qveyanaze-gavchndi-vici-ratomac-mimatove-bavshvta-sakhlshi-mitovebuli-10-tslis-bavshvis-tserili-dedas--', 1580939212, '', 942, '', '');
INSERT INTO `trainings` (`id`, `source`, `title`, `text`, `category`, `scraped_at`, `img`, `origin_date`, `tags`, `comments_number`, `slug`, `date`, `origin_url`, `views`, `keywords`, `description`) VALUES
(173, '', 'ინფექციური საავადმყოფოს დირექტორის თენგიზ ცერცვაძის განცხადება -  ახლახან შემოყვანილი პაციენტი    კორონავირუსით ინფიცირებულია?', '<p>თბილისისი ინფექციურ საავადმყოფოში ცოტა ხნის წინ, გრიპის სიმპტომებით ახალგაზრდა მამაკაცი შეიყვანეს, რომელმაც ჩინეთის დედაქალაქი 27 იანვარს დატოვა.</p>\n<p>ინფექციური საავადმყოფოს დირექორის თენგიზ ცერცვაძის განცხადებით,&nbsp;პაციენტის მდგომარეობა ამჟამად დამაკმაყოფილებელია, თუმცა აღენიშნება ხველა, თავის ტკივილი, სისუსტე, ტემპერატურა.</p>\n<p>&bdquo;ახლახან, ერთი საათიც არ არის გასული, შემოიყვანეს ახალგაზრდა მამაკაცი ეროვნებით ჩინელი, რომელმაც დატოვა პეკინი 27 იანვარს, ორი დღე იყო ყაზახეთში, შემდეგ ყაზახეთიდან შემოვიდა საქართველოში. იმყოფებოდა გუდაურში, ბაკურიანში და 4 რიცხვში, გუშინ წინ აღენიშნა ტემპერატურის მომატება. როგორც თვითონ და მისი თანხმლები პირი გადმოგვცემს, 38-ზე მეტი. ჰქონდა ხველა, თავის ტკივილები, ზოგადი სისუსტე. მან მიმართა საელჩოს და ონლაინ, ჩინელ ექიმებთან იტარებდა კონსულტაციებს, რომლებმაც დაუნიშნეს ანტიბიოტიკი და კიდევ რაღაც მედიკამენტი, რომელსაც ჩინურად აქვს წარწერები, ჯერ არ ვიცით, რა არის. მისი მდგომარეობა გაუარესდა 4 რიცხვის შემდეგ, აღარ დაკმაყოფილდა ონლაინ კონსულტაციით და შემოვიდა ჩვენთან. ამჟამად პაციენტის მდგომარეობა პრინციპში დამაკმაყოფილებელია, მაგრამ აქვს ჩივილები &ndash; ხველა, თავის ტკივილი, სისუსტე. ტემპერტურა ამჟამად 37.5 აქვს, მაგრამ ჰქონდა 38, როგორც თავად ამბობს&ldquo; ,- განაცხადა თენგიზ ცერცვაძემ.</p>\n<p>ცერცვაძის განმარტებით, არის ალბათობა, რომ პაციენტი ინფიცირებული იყოს ახალი ტიპის კორონავირუსით, თუმცა ამის მყარი კლინიკური ნიშნები არ არსებობს.</p>\n<p>&bdquo;იმის გათვალისწინებით, რომ მას აქვს მწვავე რესპირატორული ინფექცია და არის პეკინიდან ჩამოსული, ბუნებრივია, არსებობს ალბათობა, რომ შესაძლოა, ის იყოს ინფიცირებული ახალი კორონავირუსით, თუმცა ამის მყარი კლინიკური ნიშნები და არგუმენტები არ გვაქვს. ახლა პაციენტს გაუკეთებენ რენდგენოლოგიურ გამოკვლევას, აგრეთვე აღებულია ხახის ნაცხი და გაუკეთებენ გრიპზე გამოკვლევას. იქნებ ჩვეულებრივი გრიპი აქვს, რადგან გრიპს ჰგავს ძალიან. გაუკეთებენ სისხლის ანალიზს. ამ საღამოს რვა საათისთვის უკვე გვეცოდინება პასუხები და უფრო დამაჯერებელ პასუხს გაგცემთ. ხვალ იქნება უკვე ანალიზის პასუხი თვითონ კორონავისურის ინფექციაზე. აქამდე ვინც პაციენტები შემოსულან, იმათ არც პლევმონია ჰქონდათ, არც ჩვენთან მოსვლის შემდეგ ტემპერატურის მატება, არც ხველა, არც სხვა რაიმე კლინიკური გამოვლინებები და მათი ერთადერთი რისკის ფაქტორი იყო, რომ ისინი ჩამოსულები იყვნენ ჩინეთიდან. აქ მეტია კლინიკური გამოვლინებები, არის ხველა, ტემპერატურის მატება, ზოგადი სისუსტე, თუმცა ჯერ არ ვიცით რენტგენოგრაფიული კვლევის შედეგები. უშუალოდ კორონავირუსზე პასუხი ხვალ გვეცოდინება&ldquo; ,- განაცხადა თენგიზ ცერცვაძემ.</p>', '22', '', 'https://newsebi.ge/media/cercvadze.jpg', '', '', 0, 'infeqciuri-saavadmyofos-direqtoris-tengiz-cercvadzis-ganckhadeba----akhlakhan-shemoyvanili-pacienti----koronavirusit-inficirebulia', 1581006233, '', 621, '', ''),
(174, '', 'დღეს სამუდამოდ წახვედი, ახლა რა ვქნა? როგორ ვიცხოვრო?  ანიტას ბებია განცხადებას ავრცელებს', '<p>2 წლის ანიტას ბებია სოციალურ ქსელში ემოციურ პოსტს აქვეყნებს:</p>\n<p>\"დღეს სამუდამოდ წახვედი, ჩემო ბედნიერებავ. ვეღარ შეგეხები, ვეღარც ცივს და უმოძრაოს. მაინც რა ლამაზი იყავი, რა მხიარული, რა ტკბილი, რა არაამქვეყნიური. ვერ ვძღებოდი შენით. ჩახუტებულიც, ჩაკოცნილიც მენატრებოდი. სულ მენატრებოდი. იმხელა სიყვარული მასწავლე, ზიდვა მიჭირდა. თურმე მთელი ცხოვრების საკმარისი სიყვარული ამკიდე ერთიანად, ასე მალე წასვლას რომ აპირებდი, იმიტომ.</p>\n<p>ახლა რა ვქნა?! როგორ ვიცხოვრო?! როგორ ვაპატიო ჩემს თავს, გვერდით რომ არ გყავდი, როცა სიცოცხლისათვის იბრძოდი, როგორ?! მაპატიე, ჩემო ბედნიერებავ, ყველა მოუფერებელი დღისთვის მაპატიე. აქედან გეფერებოდი, მაგრამ შენ ეს არ იცოდი და იმ გაგლეჯილ, ნაწამებ გულში ალბათ ესეც გტკიოდა.</p>\n<p>ვერ გიშველე, ვერ დაგტოვე ამ წყეულ, უსამართლო, უშენოდაც სიცოცხლის გამგრძელებელ დედამიწაზე. ვერაფერი გავაკეთე შენი კისკისისთვის. დაგაღალატე. მაპატიე, ჩემო ბედნიერებავ, ჩემო ყველაზე დიდო სიყვარულო მთელ სამყაროში, ჩემო პატარავ, ჩემო ცქნაფაცქნუფა, ტკბილო, თბილო, დაუნდობლად სიცოცხლეწართმეულო გოგო. იმ სიყვარულისთვის მაპატიე, სამყაროზე დიდი რომ მეგონა და ჩემი პაწაწინა ანიტას სიცოცხლის გადასარჩენად სამყოფი რომ ვერ აღმოჩნდა.</p>\n<p>შენ ისეთი კეთილი ხარ, ვიცი, მაპატიებ. მაგრამ მე ვერ ვაპატიებ ვერასოდეს ვერც საკუთარ თავს, ვერც ამ სამყაროს, ვერც ვერანაირ არსებულ თუ არარსებულ ზე-ძალას. ნუთუ ერთი ციცქნა, ნაზი, პატარა, უწყინარი, უმწეო ანიტა ამძიმებდა ამ ცოდვილ დედამიწას იმდენად, რომ მისთვის პაწია ადგილიც ვერ გამოინახა?!</p>\n<p>რა გითხრა მეტი ჩემო ბედნიერებავ, მიყვარხარ და დღითიდღე კიდევ და კიდევ უფრო მეყვარები. ამას ნამდვილად გპირდები, ჩემო თვალებბრიალა გოგო, ჩემო საოცრებავ. რა ცოტა იცხოვრე და რა ბევრი მოახერხე - უამრავ ადამიანს ამოგვიტვიფრე მომავლისთვის ძალის მომცემი ლოცვა: ვიცოცხლოთ, გვიყვარდეს ანიტას -სთვის\", - წერს ანიტან ბებია თამუნა გლურჯიძე.</p>\n<p>2 წლის ანიტა ფაცაცია დღეს დაკრძალეს.</p>', '27', '', 'https://newsebi.ge/media/anita%20(4).jpg', '', '', 0, 'dghes-samudamod-tsakhvedi-akhla-ra-vqna-rogor-vickhovro--anitas-bebia-ganckhadebas-avrcelebs', 1581021982, '', 3443, '', ''),
(176, '', 'გუგული მაღრაძე სოციალური დახმარების გაუქმებას ითხოვს – ჩემთვის მიუღებელია...', '<p>ჩემთვის ძალიან მიუღებელია, 40 -50 წლის ჯან-ღონით სავსე ადამიანები წლების განმავლობაში სოციალურ შემწეობას იღებდნენ,&nbsp;&ndash; ამის შესახებ საპარლამენტო უმრავლესობის წევრმა&nbsp;გუგული მაღრაძემ&nbsp;პარლამენტის პლენარულ სხდომაზე განაცხადა, სადაც &bdquo;მინისტრის საათის&ldquo; ფორმატში ჯანდაცვის მინისტრ ეკატერინე ტიკარაძეს უსმენენ.</p>\n<p>გუგული მაღრაძე&nbsp;უმუშევრობის შემწეობის შემოღების ინიციატივით გამოდის.</p>\n<p>&bdquo;ხომ არ ჯობია განვასხვაოთ ისინი ვინც შრომისუუნაროა და არ შეეძლებათ მუშაობა და მათ მივცეთ სოციალური შემწეობა, ხოლო მათთვის, ვისაც პოტენციურად დასაქმება შეუძლია, იყოს უმუშევრობის დახმარება, რომელიც გარკვეული თვეების განმავლობაში გაგრძელდება. შემდეგ იქნება შეთავაზება პროფესიული განათლების, რაც უფასოა ან სოფლად მცხოვრები ადამიანისთვის იქნება საოჯახო მეურნეობის მოწყობაში დახმარება და ამ მიმართულებით მგონია, გაცილებით უფრო მეტ მოტივაციას შევუქმნით ადამიანებს&ldquo;,-აღნიშნა&nbsp;გუგული მაღრაძემ.</p>\n<p>&nbsp;</p>', '27', '', 'https://newsebi.ge/media/%E1%83%92%E1%83%A3%E1%83%92%E1%83%A3%E1%83%9A%E1%83%98.jpg', '', '', 0, 'guguli-maghradze-socialuri-dakhmarebis-gauqmebas-itkhovs--chemtvis-miughebelia', 1581113752, '', 8222, '', ''),
(177, '', 'მიხეილ ცაგარელი მოსახლეობას აფრთხილებს უმძმესი დღეებია...', '<p>განსაკუთრებული ყურადღების გამოჩენა გმართებთ 8-11 თებერვალს, რადგან ვენერას, ქირონის და შავი მთვარის შერწყმა სერიოზულ სირთულეებს შეუქმნის ნებისმიერის სასიყვარულო ურთიერთობას და ფინანსურ მდგომარეობას. გაიზრდება მოტყუების და ღალატის ალბათობა. ნუ აჰყვებით ცდუნებას, ფრთხილად გააბით ურთიერთობა ახალ ნაცნობებთან, რადგან ერთი-ორად გააქტიურდებიან თაღლითები.</p>\n<p>არ ღირს ზედმეტი ნერვიულობა, მოერიდეთ სიმძიმის აწევას, რადგან მთვარის ლომის ზოდიაქოს ნიშანში გადასვლით საგრძნობლად დასუსტდება გული და სისხლძარღვოვანი სისტემა.</p>\n<p>პოზიტიური და ნეგატიური დღე &ndash; ნაკლებად გაამართლებს ნიშნობა და ქორწინება, &nbsp;ხელშეკრულებების გაფორმება, ბინის შეცვლა და სესხის აღება.</p>\n<p>ჯანმრთელობა &ndash; გეომაგნიტური დღის ნეგატიური ენერგია უარყოფითად აისახება ნებისმიერის ჯანმრთელობაზე. გამოიწვევს არტერიული წნევის მატებას, თავის ტკივილს და უგუნებობას. ეცადეთ არ გადაიტვირთოთ და მეტი დაისვენოთ, აუცილებლობის შემთხვევაში კი, მიმართოთ წამლების პროფილაქტიკას. გაუფრთხილდით დასუსტებულ გულს და ხერხემალს.</p>\n<p>დღის ფერები და მინერალები &ndash; წითელი, ყვითელი, ლურჯი, ბეჟი და ნარინჯისფერი, ასევე ბრილიანტი, მთის ბროლი, სერდოლიკი, ქარვა და სარდიონი გააძლიერებენ თქვენს ბუნებრივ შარმს, კოსმოსის დადებითი ენერგიების მოზიდვით კი, გაზრდიან წარმატების შანსებს.</p>\n<p>ზოდიაქოს ნიშნები &ndash; იღბლიანი დღეა ვერძისთვის, მშვილდოსნისა და მერწყულისთვის, პრობლემების დაძლევა მოუწევთ კირჩხიბს, ქალწულს და მორიელს.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%AA%E1%83%90%E1%83%92%E1%83%90%E1%83%A0%E1%83%94%E1%83%9A%E1%83%98.jpg', '', '', 0, 'mikheil-cagareli-mosakhleobas-afrtkhilebs-umdzmesi-dgheebia', 1581199898, '', 1906, '', ''),
(178, '', 'ანიტას დედის პირველი განცხადება შვილის დაკრძალვის შემდეგ -  მე ანიტას დედიკო ვარ და ცოცხალი გადავრჩი', '<p>გამარჯობა, მე ანიტას დედიკო ვარ და ცოცხალი გადავრჩი. დიდი მადლობა თქვენ ამისთვის! მაპატიეთ, რომ არაფერი გამოგვივიდა. დავმარცხდით ამ ბრძოლაში მე და ანიტა. იმედები გაგიცრუეთ, მაგრამ ზუსტად ვიცი მასაც არ უნდოდა წასვლა. ბოლო წუთამდე მეუბნებოდა, რომ ვუყვარვარ და ჩემთან უნდა. მე ვგრძნობ, რომ ანიტა აქ არის. მუდმივად ჩემ გვერდითაა. ჩემზე წერთ ძლიერიაო, მაგრამ დამიჯერეთ ეს ძალა თქვენ მაპოვნინეთ. თქვენ დამაჯერეთ, რომ ჩემი გოგო განსაკუთრებულია და მეც ვალდებული ვარ ვიყო ღირსეული დედა მისთვის, ვიყო ისეთი, როგორსაც ჩვენი ანიტა იმსახურებს. მინდა მისი დაწყებული კეთილი საქმეები გავაგრძელოთ და არ გავჩერდეთ. ის ძალიან კეთილია. არ უნდოდა სხვა ბავშვის გული, არ წაიღო ჩემმა კეთილმა ადამიანმა. დედამისი ნატრობდა მის გადასარჩენად სხვის გულს, მაგრამ ანიტამ არ გააკეთა ეს. თავისი ნამცეცა გული აირჩია და ისე წავიდა. მინდა მისი სახელი სამუდამოდ გაგრძელდეს&hellip; სიკეთეები მისი სახელით არ დასრულდეს, და ღმერთს ვთხოვ მომცეს ამის ძალა. არ შეიძლება ასე ხშირად ირღვეოდეს ბუნების კანონზომიერება, არ უნდა დავუშვათ, რომ დედები აცილებდნენ შვილებს და არა პირიქით&hellip; მიყვარხართ ანიტელებო და თქვენ მაძლიერებთ&hellip;</p>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%9C%E1%83%98%E1%83%A2%E1%83%90%20%E1%83%93%E1%83%94%E1%83%93%E1%83%90.jpg', '', '', 0, 'anitas-dedis-pirveli-ganckhadeba-shvilis-dakrdzalvis-shemdeg----me-anitas-dediko-var-da-cockhali-gadavrchi', 1581335524, '', 1922, '', ''),
(179, '', 'კლასიკაა თუ სექსი პლიაჟზე როიალს რომ ვიბრატორივით ხმარობს - დაპირისპირება მანჩო გიორგობიანი ხატია ბუნიათიშვილზე', '<div id=\"js_3rf\" class=\"_5pbx userContent _3576\" data-testid=\"post_message\" data-ft=\"{&quot;tn&quot;:&quot;K&quot;}\">\n<p>გენიალური ქალი ელისო ვირსალაძე , მაღალი ხელოვნების ღირსეული წარმომადგენელი და საინტერესო ინტერვიუ!...<br />და ნუ იცით ეს კონტექსტიდან ამოგლეჯა, კატასტროფული არაფერი უთქვამს, ბევრ მუსიკოსზე დაისვა კითხვა და მათ შორის, ბუნიათიშვილზეც... ნაციონალური ნიშნით ხომ არ გამოარჩევდა?!. აღნიშნა, რომ ძალიან ნიჭიერია, მაგრამ ნამდვილი განათლება აკლია, რაც სამწუხაროაო.. და სხვებსაც არჩევს, ზოგადად, კომერციული მიზნებისთვის გაპაპსავებულ კლასიკურ მუსიკაზეც მსჯელობს.. ასეთ შესრულებებს, მაშინ სხვა სახელი უნდა ერქვასო...<br />ბუიათიშვილზეც მართალია , ჩემი აზრით... ხანდახან, კლასიკაა თუ \"სექსი პლიაჟზე\", რომ ვერ გაიგებ და როგორც ჩემმა მეგობარმა შეადარა -\"როიალს რომ ვიბრატორივით ხმარობს\"- \"საშინელებაა\", ალბათ ამაზე წამოცდა და შეცვალა მერე - \"ტალანტიაო\" ...<br />უმჯობესია, დაუჯეროს ვირტუოზს და განვითარდეს...)))</p>\n</div>\n<div class=\"_3x-2\" data-ft=\"{&quot;tn&quot;:&quot;H&quot;}\">\n<div data-ft=\"{&quot;tn&quot;:&quot;H&quot;}\">\n<div class=\"mtm\">\n<div id=\"u_fetchstream_38_1\" class=\"_6m2 _1zpr clearfix _dcs _4_w4 _41u- _59ap _2bf7 _64lx _3eqz _20pq _3eqw _2rk1 _359m _3n1j _5qqr\" data-ft=\"{&quot;tn&quot;:&quot;H&quot;}\">\n<div class=\"clearfix _2r3x\">\n<div class=\"lfloat _ohe\">\n<div class=\"_63yw\">\n<div class=\"_6ks\">\n<div id=\"u_fetchstream_38_7\" class=\"accessible_elem inlineBlock\">&nbsp;</div>\n<div class=\"_6l- __c_\">&nbsp;</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', '27', '', 'https://newsebi.ge/media/444%20(1).png', '', '', 0, 'klasikaa-tu-seqsi-pliazhze-roials-rom-vibratorivit-khmarobs---dapirispireba-mancho-giorgobiani-khatia-buniatishvilze', 1581373427, '', 2695, '', ''),
(180, '', 'გიგი უგულავას დაკავების შემდეგ რა განცხადებას ავრცელებს მისი ყოფილი მეუღლე', '<p>გიგი უგულავას ყოფილი მეუღლე მის ხელახლა დაპატიმრებას სოციალურ ქსელში ეხმაურება:</p>\n<p>&bdquo;გიგი, სანდრო, თქვენი სიყვარული მოერევა ყველა განსაცდელს. ძალინ მალე ისევ ერთად იქნებით. ბოროტება არის ხანმოკლე, სიყვარულს და სიკეთეს არ აქვს დასასრული. გიგი შენ ძალიან კარგი ადამიანი და ძლიერი კაცი ხარ. კიდევ ერთხელ გაუძელი, იქიდან ათასჯერ უფრო ძლიერი&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">დაბრუნდები</span>.&ldquo;</p>\n<p>შეგახსენებთ, თბილისის ყოფილი მერის, გიგი უგულავას საქმეზე უზენაესი სასამართლოს გადაწყვეტილება ცოტა ხნის წინ გამოცხადდა. მას 3 წლითა და ორი თვით თავისუფლების აღკვეთა მიუსაჯეს.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%92%E1%83%98%E1%83%92%E1%83%98.jpg', '', '', 0, 'gigi-ugulavas-dakavebis-shemdeg-ra-ganckhadebas-avrcelebs-misi-yofili-meughle', 1581451443, '', 2413, '', ''),
(181, '', 'გთავაზობთ 2020-წლის რეალურ  წინასწარმეტყველებას: აირჩიეთ შემთხვევითი რიცხვი, დაწერე კომენტარში და შემდეგ ნახეთ რა მოხდება მომავალში', '<p>ეს მკითხაობა სულ რაღაც რამდენიმე წუთს წაიღებს. მოდუნდი, ისუნთქე მშვიდად და გულმოდგინედ დაფიქრდი კითხვაზე, რომელზეც პასუხის მიღება გინდა. წარმოგიდგენთ სურათს ციფრებით, დახუჭეთ თვალები და ამოძრავეთ კურსორი. გარკვეულ ადგილას გააჩერეთ, თვალები გაახილეთ და ნახეთ რომელი რიცხვი ამოგივიდათ, შემდეგ კი წაიკითხეთ.</p>\n<p>1. წარმატება თქვენს მხარესაა. მალე ძალიან გაგიმართლებს, არ გაუშვა მომენტი!<br />2. დროა გამოხვიდეთ კომფორტის ზონიდან! არ შეუშინდეთ სიახლეს.<br />3. კარგი სიახლეები მალე კარზე მოგიკაკუნებენ.<br />4. იმედები სხვებზე დაამყარეთ, თუმცა ნურც თქვენ დარჩებით უმოქმედოდ!<br />5. ბედნიერება ძალიან ახლოსაა, უბრალოდ გარშემო მიმოიხედეთ.<br />6. არ გაუშვათ თქვენი შანსი.<br />7. ხანდახან საჭიროა უბრალოდ დინების მიმართულებით იცუროთ.<br />8. ვიღაც თქვენს ზურგს უკან თქვენზე ჭორაობს.<br />9. დაატორმუზე! გაიხსენე რა არის ცხოვრება და დატკბი მისით.<br />10. მშვენიერი ცხოვრება გელით.<br />11. კმარა ოცნება, დროა მიაღწიოთ მიზანს!<br />12. აკონტროლეთ საკუთარი სიტყვები. გახსოვდეთ ტყუილი ყველაზე არასასურველ სიტუაციაში გამოააშკარავდება.<br />13. ძალიან მალე მნიშვნელოვანი შეხვედრა გელით.<br />14. თქვენს ცხოვრებაში კარგი პერიოდი დაიწყო, არ გადაუხვიოთ.<br />15. სიტყვები ქარს არ გაატანოთ.<br />16. ყურადღება გაამახვილეთ სამსახურზე, დაწინაურება გელით.<br />17. დაივიწყეთ წარსული შეწყვიტეთ მასში ძრომიალი. იყურეთ მხოლოდ პირდაპირ!<br />18. თქვენ ბედის რჩეული ხართ.<br />19. ახლა საუკეთესო დროა იმისთვის, რომ ახალი ნაცნობები გაიჩინოთ.<br />20. ძალიან წარმატებული წელი გელით.<br />21. არ გაუშვათ წარმატება თქვენგან.<br />22. იცხოვრეთ დღევანდელით, იფიქრეთ ხვალინდელზე.<br />23. მოუსმინეთ ინტუიციას, საინტერესო რაიმეს გკარნახობთ.<br />24. ისაუბრეთ ფრთხილად, ყველა სიტყვას მნიშვნელობა აქვს.<br />25. გამოწვევები გელით, გამოიჩინეთ მოთმინება.<br />26. ღამე თქვენთვის ჯადოსნური დროა.<br />27. იყავით პოტიზიური და შთააგონეთ ეს სხვებსაც.<br />28. სასწრაფოდ გჭირდებათ დასვენება.<br />29. მორჩით ცხოვრებაზე წუწუნს &mdash; ის არც ისე ცუდია როგორც გეჩვენებათ.<br />30. არ დანებდეთ! ყველაფერი გამოვა, სულ ცოტა დარჩა.<br />31. ცხოვრება სასიამოვნო სიურპრიზს გიმზადებთ.<br />32. დროა მალე დაასრულოთ ძველი საქმეები.<br />33. თქვენი ოცნება მალე ახდება.<br />34. დაფიქრდით, სანამ ისაუბრებთ.<br />35. საკუთარი თავის მიმართ მეტი თავდაჯერებულობა გმართებთ.<br />36. წარმატება თქვენს გვერდითაა.<br />37. გექნებათ შანსი გაიცნოთ ახალი ადამიანები. არ გაუშვათ ის.<br />38. შეიყვარეთ საკუთარი თავი &mdash; და გარშემომყოფებიც შეგიყვარებენ.<br />39. მალე ძალიან მნიშვნელოვანი რამ მოხდება.<br />40. წინ გრძელი და მსუბუქი ცხოვრების გზა გაქვთ.<br />41. ყველაფერი გაცილებით უკეთაა, ვიდრე ფიქრობთ.<br />42. ენას კბილი დააჭირეთ, ზოგჯერ გაჩუმება სჯობს.<br />43. ცხოვრებაში კარდინალური ცვლილებები გელით.<br />44. თვენი ცხოვრება ტკბილია, როგორც ჟოლო.<br />45. არ იჩქაროთ სამსახურის გამოცვლა.<br />46. გამოხატეთ პატივისცემა გარშემომყოფების მიმართ, და ისინიც დაიწყებენ თქვენს დაფასებას.<br />47. არ გაჩერდეთ, მიზანთან ახლოს ხართ.<br />48. დაკავდით იმით, რაც გულით გსურთ.<br />49. აწონ-დაწონეთ თქვენი ქმედებები.<br />50. ფორტუნა დაგაჯილდოვებთ.<br />51. გააკეთეთ ისეთი რამ რაც თქვენს ხასიათში არაა. სასარგებლოდ წაგადგებათ.<br />52. იზრუნეთ მეგობრებზე.<br />53. დროა ცხოვრებიდან ყველაფერი ზედმეტი ჩამოიშოროთ.<br />54. საკუთარი თავი არ მოატყუოთ.<br />55. რისკი &ndash; სასიკეთო საქციელია.<br />56. დაიჭირეთ იღბალი.<br />57. არ შეგეშინდეთ სიახლის, იმოქმედეთ.<br />58. სასიამოვნო სიახლეებს ელოდეთ.<br />59. თქვენ საკუთარი ცხოვრების დიასახლისი ხართ. საკუთარი თავის იმედზე იყავით.<br />60. ბედნიერება სულ ახლოს გაქვთ.<br />61. გამოიყენეთ შანსი.<br />62. უბრალოდ იცურეთ დინების მიმართულებით.<br />63. ვიღაც თქვენს ზურგსუკან თქვენზე ჭორაობს.<br />64. დაუთმეთ საკუთარ თავს დრო, გჭირდებათ.<br />65. ცხოვრება მშვენიერია.<br />66. კმარა ოცნება, იმოქმედეთ.<br />67. საიდუმლოებები სააშკარაოზე გამოვა.<br />68. მალე საბედისწერო შეხვედრა გელით.<br />69. ცხოვრებაში კარგი პერიოდი გიდგებათ.<br />70. სიტყვები მნიშვნელოვანია, არ იკამათოთ.<br />71. არ გაუშვათ თქვენი შანსი.<br />72. ხანდახან უბრალოდ დინების მიმართულებით უნდა იცუროთ.<br />73. ვიღაც თქვენს ზურგსუკან თქვენზე ჭორაობს.<br />74. ენდეთ ინტუიციას, სწორად გკარნახობთ.<br />75. ფრთხილად ისაუბრეთ, ყველა სიტყვას მნიშვნელობა აქვს.<br />76. გამოწვევა გელით, მოთმინებით შეხვდით.<br />77. კარგი სიახლეები მალე კარზე მოგიკაკუნებენ.<br />78. იმედები სხვებზე დაამყარეთ, თუმცა ნურც თქვენ დარჩებით უმოქმედოდ!<br />79. გამოხატეთ პატივისცემა გარშემომყოფების მიმართ, და ისინიც დაიწყებენ თქვენს დაფასებას.<br />80. არ გაჩერდეთ, ახლოს ხართ მიზანთან.<br />81. იცხოვრეთ დღევანდელით, იფიქრეთ ხვალინდელზე.<br />82. ენდეთ ინტუიციას, სწორად გკარნახობთ.<br />83. ისაუბრეთ ფრთხილად, ყველა სიტყვას მნიშვნელობა აქვს.<br />84. გულს უსმინეთ.<br />85. თქვენ ამის ღირსი ნამდვილად ხართ.<br />86. თქვენი ცხოვრება მხოლოდ თქვენი საქმეა.<br />87. ცხოვრება მშვენიერია.<br />88. ფრთხილად იყავით ჯანმრთელობასთან.<br />89. გამოწვევები გელით, გამოიჩინეთ მოთმინება.<br />90. ღამე თქვენთვის ჯადოსნური დროა.<br />91. იყავით პოზიტიურები და გაუზიარეთ სხვებსაც.<br />92. არ გაუშვათ საკუთარი შანსი.<br />93. საჭიროა ცოტა დასვენება.<br />94. საკუთარ თავზე იზრუნეთ.<br />95. დიახ, ეს ისაა, რაც თქვენ გჭირდებათ.<br />96. მიენდეთ ინტუიციას, სწორს გკარნახობთ.<br />97. ისაუბრეთ ფრთხილად, ყველა სიტყვას მნიშვნელობა აქვს.<br />98. ცხოვრება მშვენიერია.<br />99. კმარა ოცნება, იმოქმედეთ.<br />100. საიდუმლოებებს ფარდა აეხდებათ.<br /><strong>ამ მარტივი მკითხაობით ხშირად შეგიძლიათ ისარგებლოთ, რადგანაც მოტივაციის ამაღლებაში დაგეხმარებათ. არც ბევრ დროს წაგართმევთ, საკმარისია უბრალოდ აირჩიოთ რიცხვი შემთხვევით და გაიგოთ საკუთარი ბედისწერა.</strong></p>', '27', '', 'https://newsebi.ge/media/%E1%83%AF%E1%83%AF%E1%83%AF.jpg', '', '', 0, 'gtavazobt-2020-tslis-realur--tsinastsarmetyvelebas-airchiet-shemtkhveviti-rickhvi-datsere-komentarshi-da-shemdeg-nakhet-ra-mokhdeba-momavalshi', 1581461486, '', 2500, '', ''),
(182, '', 'კარგი შედეგებია  ფილტვში სიმსივნე ზომაში ძალიან დაპატარავებულია', '<p>როგორც ზურამ &bdquo;<strong>პრაიმტაიმთან&ldquo;</strong>&nbsp;საუბრისას აღნიშნა, ხათუნას ფილტვში სიმსივნე ზომაში ძალიან დაპატარავებულია. რამდენიმე დღის წინ მამა ნაუმიმ ხათუნა დალოცა და ისრაელიდან ჩამოსვლის შემდეგ მასთან დაიბარა.&nbsp;</p>\n<p><strong>ზურა:</strong>&nbsp;- რომ ჩამოხვალ, აუცილებლად მოდი ჩემთან და პასუხი მითხარი, ექიმები რას გეტყვიანო. ყინწვისის მონასტრის საძმოში ხშირად ჩავდივართ. ბევრი კარგი ბერი მოღვაწეობს იქ და გვერდში გვიდგას ამ დაავადების დასამარცხებლად. მადლობა მათ... საგურამოს დედათა მონასტერშიც დავდივართ.&nbsp;</p>\n<p>განსაცდელი ყველა ადამიანის ცხოვრებაში მოდის. მზად უნდა დავხვდეთ და ღმერთთან ახლოს დავდგეთ. მნიშვნელოვანია ის, რომ რთულად არ მივიღოთ ეს მოვლენილი განსაცდელი. ის, რაც ხდება, იმისთვისაა, რომ უფალთან დავახლოვდეთ.&nbsp;</p>\n<p>ბოლო თვეებია დიდ თანაგრძნობას ვგრძნობ საზოგადოებისგან. მინდა ვისარგებლო შემთხვევით და ყველას დიდი მადლობ ვუთხრა ამ მხარდაჭერისთვის. ამდენი ადამიანის ლოცვას იმხელა ძალა აქვს, დარწმუნებული ვარ, ყველაფერი კარგად იქნება. მადლობა ყველას და მათ შორის თქვენ - ჟურნალისტებს, ვინც ჩვენს მიმართ კეთილგანწობილია და მხარს გვიჭერთ.</p>', '27', '', 'https://newsebi.ge/media/zura%20khatuna.jpg', '', '', 0, 'kargi-shedegebia--filtvshi-simsivne-zomashi-dzalian-dapataravebulia', 1581518977, '', 6820, '', ''),
(183, '', 'სასწრაფოდ: ერდოღანის მუქარა რუსეთს ყველას ჩამოვაგდებ', '<p><strong>სირიის იდლიბის პროვინციაში საბრძოლო მოქმედებები ბოლო დღეებში კიდევ უფრო ინტენსიური გახდა, ყოველდღიურად ათეულობით მებრძოლი იღუპება დაპირისპირებული მხარეებიდან, რასაც საჰაერო დაბომბვებით დაღუპული მშვიდობიანი მოსახლეობაც ემატება.</strong></p>\n<div>იდლიბის პროვინციაში შეტევით ოპერაციას სირიის არმია ახორციელებს, რომელსაც აქტიურ მხარდაჭერა უწევს რუსეთის ავიაცია, ასევე რუსული სპეცდანიშნულების რაზმები.</div>\n<p>&nbsp;</p>\n<div>პრეზიდენტ&nbsp;<strong>ბაშარ ასადს</strong>&nbsp;გაუჩნდა საუკეთესო შანსი აღადგინოს კონტროლო იდლიბის მთელ პროვინციაზე და იქიდან გაყაროს მეზობელი თურქეთის ინტერესების გამტარებელი თურქომანი მებრძოლები.</div>\n<p>&nbsp;</p>\n<div>მაგრამ ეს ძალზე რთული იქნება, რადგან ანკარამ სირიის იდლიბის\n<div id=\"inlineads\" class=\"article_ads\">&nbsp;</div>\nრაიონში 12 თებერვლის ღამით უკვე გადაისროლა მრავალრიცხოვანი ჯავშანტექნიკა და სირიის არმიას უკვე არამარტო \"კალაშნიკოვით\" შეიარაღებული პარტიზანები უპირისპირდებიან, არამედ თურქეთის არმიის \"ლეოპარდის\" ტიპის ტანკებიც.</div>\n<div>\n<div class=\"article-img-inn\"><br />\n<div class=\"fotoClas\">&nbsp;</div>\n</div>\n</div>\n<div>სირიის არმიის მთავარი უპირატესობა იმაში გახლდათ, რომ საჰაერო სივრცეს მთლიანად აკონტროლებდნენ და საჰაერო დარტყმებს აყენებდნენ პროთურქულ ძალებს, მათ შორის ჰმეიმიმის&nbsp;საჰაერო ბაზიდან აფრენილი&nbsp;\n<div id=\"inlineadstwo\" class=\"article_ads\">\n<div class=\"samenews_main_block\">\n<div class=\"samenews_main_block_in\">\n<div class=\"module_title\">ასევე დაგაინტერესებთ რუსული ბომბდამშენების და მოიერიშეების საშუალებით.&nbsp;\n<div>თურქეთის პრეზიდენტმა ერდოღანმა საქვეყნოდ დაიქადნა, რომ იდლიბის თურქულენოვანი მოსახლეობის საჰაერო დაბომბვებს არავის აპატიებს და ყველას ჩამოაგდებს, იქნება ეს სირიელი თუ რუსი პილოტი!</div>\n<br />\n<div><strong>ერდოღანი, რომ სიტყვებს ქარს არ ატანს, მალევე გამოჩნდა - ჯერ იყო და სირიის საბრძოლო შვეულმფრენს მი-35-ს მარცხენა ფრთა \"მოტეხეს\" საზენიტო ქვემეხიდან ნასროლი ჭურვით, თუმცა ამ \"მფრინავმა ნიანგმა\" მაინც მოახერხა აეროდრომზე მშვიდობიანად დაშვება&nbsp;</strong>(სხვათა შორის ეს შვეულმფრენი მანამდე რუსეთის სამხედრო ბაზის კუთვნილება გახლდათ, ვიდრე სირიელებს გადაულოცავდნენ).</div>\n<br />სირიის მეორე შვეულმფრენის მი-8მტ-ს ჩამოგდების ვიდეოკადრებმა კი მსოფლიოს ინტერნეტსივრცე დაიპყრო - მაღალ სიმაღლეზე მფრენ შვეულმფრენს რაკეტის მოხვედრის შემდეგ ცეცხლი გაუჩნდა და ის რამდენიმე წუთი ვარდებოდა და თან ჰაერში ნაწილებად იშლებოდა.<br />\n<div>იმის გამო, რომ შვეულმფრენი გადასატანი საზენიტო-სარაკეტო კომპლექსების, \"იგლასა\" თუ \"სტინგერის\" მოქმედების არეალზე უფრო მაღლა მიფრინავდა, ჩნდება ვერსია, რომ ის მიწიდან კი არ ჩამოაგდეს, არამედ რამდენიმე ათეული კმ-იდან თურქული ფ-16-ის მიერ გაშვებულმა \"ჰაერი-ჰაერი\" კლასის მართავადმა რაკეტამ იმსხვერპლა.</div>\n<div>\n<div class=\"article-img-inn\"><br />\n<div class=\"fotoClas\">ფოტო:&nbsp;თურქულმა გამნადგურებელმა სირიულ შვეულმფრენს რაკეტა მოარტყა</div>\n<div>fb</div>\n<div class=\"cls\">&nbsp;</div>\n</div>\n</div>\n<div><strong>ხუთი წლის წინ თურქეთმა უკვე ჩამოაგდო რუსული საფრონტო ბომბდამშენი სუ-24მ, ხოლო კატაპულტირებული და პარაშუტით დაშვებული პილოტი თურქომანმა მებრძოლებმა ჰაერშივე დახვრიტეს, რის გამოც მაშინ რუსეთ-თურქეთის ურთიერთობა უკიდურესად დაიძაბა.</strong></div>\n<br />\n<div>მას შემდგომ მოსკოვი და ანკარა თითქოს ერთმანეთს \"ჩაეხუტნენ\", ვაშინგტონის გულის გასახეთქად, მაგრამ სირიაში დღეს არსებული უკიდურესად დაძაბული სიტუაციის ფონზე, როდესაც არც ერდოღანი თმობს სირიის იდლიბში მაცხოვრებელ თურქომანებს და არც პუტინი აჩერებს იდლიბის იერიშზე გადასულ ასადს, დიდი ალბათობა არსებობს, რომ ფრონტის ხაზზე რუსულ-თურქული სამხედრო შეჯახებებიც მოხდეს..</div>\n</div>\n</div>\n</div>\n</div>\n</div>', '27', '', 'https://newsebi.ge/media/%E1%83%94%E1%83%A0%E1%83%93%E1%83%9D%E1%83%A6%E1%83%90%E1%83%9C%E1%83%98.jpg', '', '', 0, 'sastsrafod-erdoghanis-muqara-rusets-yvelas-chamovagdeb', 1581627035, '', 5006, '', ''),
(184, '', 'რას წერს ბიძინა ივანიშვილზე მისი კურსელი და გზავნილი ექს-პრემიერს კურსელებისგან', '<p><strong>მარინა ქურდაძე</strong>&nbsp;სოციალურ ქსელში ხშირად ტვირთავდა თანაკურსელებთან ერთად გადაღებულ სურათებს, სადაც თამაზ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მეჭიაურსაც</span>&nbsp;ვხედავდი ხოლმე. ბუნებრივია, თუ ისინი კურსელები იყვნენ, ბიძინა ივანიშვილიც მათი კურსელი იქნებოდა და ქალბატონ მარინას შევეხმიანე ინტერვიუზე. &nbsp;</p>\n<p>მარინა ქურდაძე საქართველოს ეროვნული აკადემიის აკადემიკოსი, ბიზნესის მეცნიერებათა აკადემიის აკადემიკოსი, ფაზისის ეროვნული აკადემიის აკადემიკოსი, საქართველოს ტექნიკური უნივერსიტეტის, ენერგეტიკისა და ტელეკომუნიკაციის ფაკულტეტის ტელეკომუნიკაციის დეპარტამენტის პროფესორი გახლავთ. მან &bdquo;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">პრაიმტაიმთან</span>&ldquo; ინტერვიუში სტუდენტობის წლები გაიხსენა.</p>\n<p>- ჩვენი კურსი - საინჟინრო ეკონომიკური ფაკულტეტი - &nbsp;რამდენიმე&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">სპეციალობისგან</span>&nbsp;შედგებოდა. მე ვსწავლობდი ეკონომიკური კიბერნეტიკის სპეციალობაზე, ჩვენთან &nbsp;იყო მშენებლობის ეკონომიკისა და ორგანიზაციის,&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მანქანათმშენებლობისა</span>&nbsp;და ორგანიზაციისა და ინფორმაციის მექანიზებული დამუშავების სპეციალობები. მესამე კურსზე ბავშვები გამოგვაკლდნენ, რადგან ძალიან რთულ საგნებს ვსწავლობდით და ბევრმა ვერ გაუძლო ამ დატვირთვას. სწორედ მაშინ შემოგვემატა რამდენიმე ახალი სტუდენტი. მათ შორის - ბიძინა ივანიშვილი, რომელიც მანამდე საღამოს ფაკულტეტზე სწავლობდა, რადგან თან მუშაობდა და თამაზ მეჭიაური, რომელიც ჯარიდან დაბრუნდა. დანარჩენებს შორის ისინი იმით გამოირჩეოდნენ, რომ ორივე ძალიან კარგი&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მოსწრების</span>&nbsp;სტუდენტი იყო და ლექტორებს&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მაგალითადაც</span>&nbsp;კი მოჰყავდათ ხოლმე, - ახლა მოვიდნენ და ყველას&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">გჯობიათო</span>.</p>\n<p>სწავლის პერიოდში ისე ახლოს ვიყავით, რომ ერთმანეთის ყველაფერი ვიცოდით, მხარში ვედექით და დღემდე ერთმანეთი არ დაგვიკარგავს, ოჯახის წევრებივით ვართ.</p>\n<p>სახელმწიფო უნივერსიტეტის დამთავრების შემდეგ ბიძინამ დისერტაცია რუსეთში დაიცვა და სულ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ტყუილადაა</span>&nbsp;ატეხილი აჟიოტაჟი, ვითომ ჩააწყო და იყიდაო. მეც მასე მაქვს დისერტაცია დაცული და ვიცი, რა ეტაპები უნდა გაიარო. ოთხ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">საფეხურიანი</span>&nbsp;დაცვა იყო, საკმაოდ რთული. 4 კათედრის დადებითი შეფასება უნდა მიგეღო და თითქმის შეუძლებელი იყო,&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ჩაგეწყო</span>. მით უმეტეს, მაშინ ბიძინას რა თქმა უნდა ამდენი ფული არ ჰქონდა და რომც ჰქონოდა, დამიჯერეთ, არც იკადრებდა მაგას. ჯერ ერთი, რომ ცოდნა აძლევდა იმის საშუალებას, რომ ჩაწყობის გარეშე დაეცვა დისერტაცია და მეორეც - მისი ხასიათიდან გამომდინარე, ზუსტად ვიცი, ამას არ გააკეთებდა. &nbsp;</p>\n<p>ყველას გასაჭირი გულთან მიჰქონდა და იყო ძალიან მიმნდობი. ბიჭები ყოველთვის ამბობდნენ, რომ კარგი ურთიერთობა ჰქონდათ და მოსკოვში რომ ჩადიოდნენ, ერთმანეთს ხვდებოდნენ კიდეც. მასზე ძვირი არავის არასოდეს დასცდენია.</p>\n<p>თვითონ როგორი ერთგულიც იყო საქმისადმი, ისეთი ეგონა ყველა ალბათ და იმიტომაც ისარგებლა ბევრმა.&nbsp; ახლა არ ვიცი, ისევ მიმნდობია თუ არა, მაგრამ თუ არ არის, ისევ მისი გარემოცვის ბრალი იქნება, ვინც მისი ნდობა ვერ გაამართლა. ხომ ხედავთ, 2012-ში ვინც გვერდით ედგა, დღეს ის ოპოზიციაშია. ვისაც ჩააცვა, სწორედ ისინი ცდილობენ, გახადონ. &nbsp;</p>\n<p>ჩვენ, კურსელებს ერთმანეთი არ დაგვიკარგავს, დღემდე გვიყვარს ერთმანეთი და ხშირად ვხვდებით კიდეც. ბუნებრივია, ის ჯგუფიც, სადაც ბიძინა სწავლობდა - მანქანათმშენებლობის ეკონომიკისა და ორგანიზაციის ჯგუფი. ერთ წელს ისევ შევიკრიბეთ და რა თქმა უნდა, ისევ დავუძახეთ ამ ჯგუფსაც. ბიძინასაც&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">შევუთვალეთ</span>&nbsp;თამაზ მეჭიაურის პირით, რომ მოწვეული იყო კურსელების შეკრებაზე.</p>\n<p>ჩვენს გასაოცრად, &bdquo;მანქანათმშენებლობის&ldquo; ხალხმა &nbsp;ისე გააკეთა, რომ ზუსტად იმავე დღეს, ცალკე გადაიხადა ბანკეტი, სულ სხვა რესტორანში და ბიძინა მათთან მივიდა.</p>\n<p>თამაზმა მითხრა, რადგან ასე დაემთხვა, ბიძინამ თქვა, რამდენიმე ადამიანი აქ მოვიდესო. მე უარი ვთქვი, რადგან ჩემს კურსელებს ვერ მივატოვებდი, თავს უხერხულ მდგომარეობაში ვერ ჩავიგდებდი, ისედაც იმათი&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მოუსვლელობით</span>&nbsp;ერთი მაგიდა ცარიელი დაგვრჩა და თქვენ ყველანი აქეთ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">წამოდით-მეთქი</span>, შევუთვალე. ნაწყენი კი დავრჩი, რომ მანამდე ასე&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ერთსულოვანდ</span>&nbsp;ერთად ვიყავით და მოულოდნელად&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">გამოგვეყვნენ</span>.</p>\n<p>მოგეხსენებათ, 2012 წლამდე ყველანი ტერორში ვიყავით, ჟანგბადი გადაკეტილი გვქონდა, ოჯახებით ვიყავით საშინელ დღეში. უკვე ჩაყლაპვას&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">გვიპირებდა</span>&nbsp;ის მთავრობა. ციხეში იყო მოსახლეობის 80 %. იმათი ოჯახის წევრები რა დღეში იქნებოდნენ, ხომ წარმოგიდგენიათ? ბიზნესი დატერორებული იყო, სამსახურები არ იშოვებოდა.</p>\n<p>როდესაც ბიძინამ პოლიტიკაში მოსვლა დააანონსა, ჩვენ, კურსელები შევიკრიბეთ და ვიკითხეთ, - რა ვქნათ?</p>\n<p>-&nbsp;რა ვქნათ და მხარში ამოვუდგეთო, - ერთხმად თქვა ყველამ. - ბიძინა საარჩევნო კამპანიას რომ დაიწყებს, ვაცნობოთ, რომ მასთან ვართო.</p>\n<p>თუმცა, სულ არ იყო საჭირო, მისთვის გვეცნობებინა. ეს უხერხული იქნებოდა. 165 ადამიანი ვიყავით კურსზე და ერთსაც კი არ წამოსცდენია უარი. ყველანი დავირაზმეთ, ჩავრთეთ საქმეში ოჯახის წევრები, თანამშრომლები, ახლობლები, მეზობლები, ნაცნობები და დავიწყეთ საარჩევნო კამპანიის ჩატარება ისე, რომ არც არავის დაუვალებია და არც არავის დაუგეგმავს. ჩვენი კურსელები მთელ საქართველოში, ყველა რეგიონში არიან მიმოფანტული და კახეთიდან სამეგრელოს ჩათვლით, ყველასთან მიგვიწვდებოდა ხმა. სამცხე ჯავახეთი, სვანეთი, იმერეთი. ქართლი - ყველა, ყველა ჩართული იყო. &nbsp;</p>\n<p>ვიცოდით, რომ მიუხედავად იმისა, რომ ბიძინა დაპირებებს სრულიად გულწრფელად იძლეოდა და თავადაც მთელი გულით სჯეროდა, რომ აასრულებდა, მაინც გაუჭირდებოდა სიტუაციის უცებ დალაგება იმ ქვეყანაში, რომელიც უფსკრულის პირას იყო. ამის გამო ჩვენ არავის არაფერს&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ვპირდებოდით</span>, უბრალოდ, ყველას ვეუბნებოდით, რომ წავიდოდა ის კაციჭამია მთავრობა და მოვიდოდა ჰუმანური და სახალხო მთავრობა და ამისთვის უნდა გვებრძოლა.</p>\n<p>გავიმარჯვეთ კიდეც. იმას არ ვიტყვი, რომ მთლიანად ჩვენი დამსახურება იყო არჩევნების მოგება, მაგრამ საკმაოდ დიდი წვლილი შევიტანეთ.</p>\n<p>გავიდა 4 წელი და მოვიდა ისევ არჩევნები. ხალხში ცოტა შეპარული იყო სკეპტიციზმი, ჩვენ კი ისევ იმ პოზიციაზე ვიყავით. ისევ გავნაწილდით რეგიონებში და ისევ ვიბრძოლეთ, რომ &nbsp;ჩვენი სტუდენტობის მეგობარს ამოვდგომოდით მხარში. არც ამჯერად დაუვალებია ვინმეს. ჩვენ ჩვენი გასაკეთებელი გავაკეთეთ და დავუბრუნდით ჩვენს ადგილებს, არც არაფერს ველოდით მისგან და არც გამორჩენაზე ვყოფილვართ.</p>\n<p>საპრეზიდენტო არჩევნებზეც მის გვერდით ვიყავით და სალომეს ვგულშემატკივრობდით. არა მხოლოდ სიტყვით, არამედ - საქმითაც. სხვათა შორის, მიუხედავად იმისა, რომ თამაზ მეჭიაური &bdquo;ოცნებაში&ldquo; აღარ იყო, არჩევნებზე მის გვერდით ვიყავით, საარჩევნო&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ოლქებიც</span>&nbsp;კი&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">გადავინაწილეთ</span>&nbsp;და&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ყურედღებით</span>&nbsp;ვიყავით, რომ ვინმეს რამე არ გაეყალბებინა.&nbsp;</p>\n<p>საპრეზიდენტო არჩევნების მეორე ტურის შემდეგ ბიძინამ სამადლობელი სიტყვა თქვა და ახსენა, - ჩემი მეგობრები დამიდგნენ გვერდითო. არ ვიცი, ვინ იგულისხმა, მაგრამ ვფიქრობ, რომ ჩვენი მხარდაჭერის შესახებ შეიტყო და ჩვენ გადაგვიხადა მადლობა.</p>\n<p>ის ადამიანი საქმეს სჭირდებოდა და იმიტომ დავუდექით გვერდით. მის კარზე არაფრის სათხოვნელად მივსულვართ და არ შეგვიწუხებია. ამას იმიტომ ვუსვამ ხაზს, რომ არავინ იფიქროს, რაიმე ანგარება გვამოძრავებდა.</p>\n<p>ახლა 2020 წლის არჩევნები მოდის. მის გარემოცვას უკვე ამოვსებული აქვს გარკვეული ნიშა და ჩვენ ნიშის ამოვსება აღარ გვჭირდება. ჩვენ ბავშვობის მეგობრები ვართ და ჩვენი ნიშა ისედაც გვაქვს. ისევ მხარში&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ამოვუდგებით</span>&nbsp;და ვიბრძოლებთ, მაგრამ თხოვნა გვაქვს, - არ გადაუხვიოს იმ გზას, რა გზაც 2012-ში აირჩია.</p>\n<p>ოჯახის წევრს რომ რაიმე შეეშალოს, გარეთ ხომ არ გააგდებ? გვერდით დაუდგები და მოაგვარებ იმ გაფუჭებულ საქმეს. ასე უნდა ვიყოთ ჩვენც და ასე უნდა იყოს ოპოზიციაც. კი არ უნდა იყვირონ და ებრძოლონ, მხარში უნდა ამოუდგნენ და ერთად აკეთონ ქვეყნისთვის სასიკეთო საქმე.</p>\n<p>2012-ში ვიბრძოლეთ, 2016-ში ვიბრძოლეთ და ახლაც ვიბრძოლებთ, ამ აზრზეა ყველა ჩვენი კურსელი, თუმცა, უკვე გაისმა კითხვა - ვიბრძოლებთ, მაგრამ მერე - რა? - რას ელოდებით? - ვკითხე მე. - ჩვენთვის პირადად არაფერს, ჩვენც იმას ველოდებით, რასაც მთელი ქვეყანა და თითოეული&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მოქალაქეო</span>.</p>\n<p>იმედი გვაქვს, რომ ჩვენი მცდელობა შედეგს ამჯერადაც გამოიღებს და არჩევნებს მოვიგებთ. იმის იმედიც გვაქვს, რომ შემდეგ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ოთხწლედში</span>&nbsp;უკეთ იქნება ყველაფერი და კიდევ შემდეგ არჩევნებზე ბრძოლა აღარ დაგვჭირდება.</p>', '22', '', 'https://newsebi.ge/media/%E1%83%91%E1%83%98%E1%83%AB%E1%83%9C%E1%83%90.jpg', '', '', 0, 'ras-tsers-bidzina-ivanishvilze-misi-kurseli-da-gzavnili-eqs-premiers-kurselebisgan', 1581804362, '', 9156, '', ''),
(185, '', 'სამი  შვილის და თავისი სიკვდილი ორი  წლის წინ იწინასწარმეტყველა” – ქვიშხეთის ავარიის დროს დაღუპულმა  მისი და სამი შვილის სიკვდილი იწინასწარმეტყველა და ტილოზე დახატა', '<p>ქვიშხეთის გზაზე ტრაგიკულად დაღუპული, ბაქარ ბანძელაძის ნამუშევრების გამოფენა გალერეა &bdquo;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ვარლაში</span>&ldquo; გაიმართა.</p>\n<p>ბაქარ ბანძელაძის დედის თქმით, გამოფენა მისი შვილის ოცნება იყო.</p>\n<p>&bdquo;ყოველთვის ხატავდა ისეთ ნახატებს, რომელსაც ძნელ ახსნა აქვს, როცა ვთხოვდით, რომ აეხსნა შინაარსი, გევუბნებოდა, რომ დრო მოვა და ავხსნიო. წლების წინ გამოფენაზე ვეუბნებოდი. მაგრამ სულ ამბობდა, რომ ჯერ ადრე იყო. მზად არ ვარ, დრო მოვა და აუცილებლად გავაკეთებო. რადგან ბაქარის დაბადების დღეა, მეგობრებმა გადაწყვიტეს სურვილი&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">აესრულებინათ</span>. შემდეგში მარიანა, ჩემი რძალი გამოჯანმრთელდება და ჩვენ კვლავ გავაკეთებთ გამოფენას, სადაც უკვე ის გიმასპინძლებთ,&ldquo;- აცხადებს ბაქარ ბანძელაძის დედა.&nbsp;</p>\n<p>გამოფენაზე წარმოდგენილ ერთ-ერთი ტილო, რომელიც ტრაგედიამდე 2 წლით ადრეა დახატული, ბაქარ ბანძელაძის ოჯახის ახლობელი ქვიშხეთთან დატრიალებულ ტრაგედიას უკავშირებს:&bdquo;ოთხი სისხლიანი ნიღაბი, ოთხი დაღუპული და ქალი, რომელიც თავდახრილი დგას და გლოვობს&ldquo;.</p>\n<p>გამოფენა დაღუპულის მეგობრების ინიციატივითა და ქალაქის მერიის მხარდაჭერით მოეწყო. სიუჯეტი გამოფენის შესახებ ტელეკომპანია &bdquo;რიონმა&ldquo; მოამზადა.</p>\n<p>ხა&shy;შუ&shy;რი&shy;დან ბორ&shy;ჯო&shy;მის&shy;კენ მი&shy;მა&shy;ვალ გზა&shy;ზე (ქვიშ&shy;ხეთ&shy;თან) ავ&shy;ტო&shy;საგ&shy;ზაო შემ&shy;თხვე&shy;ვა 26 იანვარს მოხდა, რასაც 4 ადამიანის სიცოცხლე ემსხვერლა. არ&shy;სე&shy;ბუ&shy;ლი ინ&shy;ფორ&shy;მა&shy;ცი&shy;ით, მძღოლ&shy;მა საჭე ვერ და&shy;ი&shy;მორ&shy;ჩი&shy;ლა და მდი&shy;ნა&shy;რე&shy;ში გა&shy;და&shy;ვარ&shy;და. ავ&shy;ტო&shy;მო&shy;ბილ&shy;ში ერთი ოჯა&shy;ხის 5 წევ&shy;რი იმ&shy;ყო&shy;ფე&shy;ბო&shy;და. ავარიისას დაიღუპა ბაქარ ბანძელაძე და მისი სამი მცირეწლოვანი შვილი, ხოლო მეუღლე,უმძიმესი დაზიანებებით საავადმყოფოში გადაიყვანეს.</p>\n<p><iframe src=\"//www.youtube.com/embed/C8lSJUSOXNM\" width=\"665\" height=\"449\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>', '27', '', 'https://newsebi.ge/media/cudia.jpg', '', '', 0, 'sami--shvilis-da-tavisi-sikvdili-ori--tslis-tsin-itsinastsarmetyvela--qvishkhetis-avariis-dros-daghupulma--misi-da-sami-shvilis-sikvdili-itsinastsarmetyvela-da-tiloze-dakhata', 1581873427, '', 5175, '', ''),
(186, '', 'დათო ქაცარავა ხურვალეთში ოკუპანტების პირისპირ - \"გაბედეთ და სცადეთ ახალი მავთულხლართის გავლება\"', '<p>დათო ქაცარავა ხურვალეთში, სათვალთვალო კოშკზე მდგარ ოკუპანტებს რუსულ ენაზე მიმართავს და ხვალ პატრულირების დაწყებაზე აფრთხილებს:<br />\"გაბედეთ და სცადეთ ახალი მავთულხლ<span class=\"text_exposed_show\">ართის გავლება, იმ მავთულხლართის ადგილას ჩვენ დავდგებით! ვიცი, რომ ახლა ჩემი გესმით და გადაეცით თქვენებს: არცერთ გოჯს არ დაგითმობთ!\".</span></p>\n<p><iframe style=\"border: none; overflow: hidden;\" src=\"https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2FLashaBerula%2Fvideos%2F2704811722877465%2F&amp;show_text=0&amp;width=560\" width=\"560\" height=\"315\" frameborder=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"></iframe></p>', '22', '', 'https://newsebi.ge/media/%E1%83%93%E1%83%90%E1%83%97%E1%83%9D%20%E1%83%A5%E1%83%90%E1%83%AA%E1%83%90%E1%83%A0%E1%83%90%E1%83%95%E1%83%90.jpg', '', '', 0, 'dato-qacarava-khurvaletshi-okupantebis-pirispir---gabedet-da-scadet-akhali-mavtulkhlartis-gavleba', 1581888536, '', 1837, '', ''),
(187, '', 'მაია ასათიანმა გამთენიისას საქართველო დატოვა - \"კეთილი მგზავრობა მისურვეთ, ძალიან, ძალიან შორს მივდივარ\"', '<div class=\"page_arttitle\">&bdquo;კეთილი მგზავრობა მისურვეთ, ძალიან, ძალიან შორს მივდივარ, მერე მოგიყვებით სად და როგორ. წარმატებული ორშაბათი ყველას. ჩემს ოცნებაში მივდივარ, 16 საათი უნდა ვიფრინო. მისურვეთ კეთილი მგზავრობა.<br /><br />რეალურად კი, ჩემი შვილის წლისთავია, ასეთ დროს მივდივარ ხოლმე ქვეყნიდან და საკუთარ თავთან მარტო ვრჩები&ldquo;, - ამ სიტყვებით დაგვემშვიდობა მაია ასათიანი და ინსტაგრამზე ვიდეო გამოაქვეყნა.<br /><br />ჟურნალისტი სამ ძაღლთან ერთად ცხოვრობს, &bdquo;ახლა ვერ წაგიყვანთ ბავშვებო&ldquo;, - ასე მიმართა იმ ცხოველებს მაიამ, რომლებიც დროებით დედას დაუტოვა.&nbsp;თუ სად წავიდა მაია ასათიანი, ამას&nbsp;\n<div id=\"inlineads\" class=\"article_ads\">&nbsp;</div>\nმარტივად მიხვდებით ისინი, ვისაც წაკითხული გაქვთ ელიზაბეტ ჯილბერტის ცნობილი ბესტსელერი &bdquo;ჭამე, ილოცე, შეიყვარე...&ldquo;, რადგან მოგვიანებით მაიამ სწორედ ამ წიგნის ფოტო გამოაქვეყნა და დაწერა, რომ იგივე გზას გაივლიდა, რომელსაც ფილმში მთავარი გმირი გადის.&nbsp;წიგნის სიუჟეტი, რომლის კინოვერსიაშიც მთავარი გმირის როლს ჯულია რობერტსი ასრულებს ასეთია:<br />მთავარი გმირი ელიზაბეტი მტკიცედ გადაწყვეტს, იპოვოს ის, რაც აქამდე ძალიან აკლდა. ამდენად, ის იწყებს ძიებას... რომში ის თავს ნებაზე მიუშვებს, ინდოეთში კი სულის განწმენდას ჰპოვებს... საბოლოოდ, კუნძულ ბალიზე მცხოვრები ექიმბაში ახალ გზას დაანახებს სიმშვიდისკენ და კვლავ გაუღვივებს სიყვარულის სურვილს.<br /><br /><br /><br />მაია ასათიანი დაგვპირდა, რომ ბალიზე მოგზაურობის შესახებ აუცილებლად მოგვიყვება ინსტაგრამის საშუალებით.</div>\n<div class=\"page_body\">&nbsp;</div>', '27', '', 'https://newsebi.ge/media/maia3_26c9a.jpg', '', '', 0, 'maia-asatianma-gamteniisas-saqartvelo-datova---ketili-mgzavroba-misurvet-dzalian-dzalian-shors-mivdivar', 1581964250, '', 4226, '', ''),
(188, '', 'ვინ არის 20 წლის გოგონა, რომელიც ქორწილში ცეკვის დროს გარდაიცვალა (იხ. ვიდეო)', '<p>20 წლის გოგონა თავის დაბადების დღეზე, მოსკოვში, აჭარულის ცეკვის დროს გარდაიცვალა. მომხდარის შესახებ ინფორმაციას სოციალურ ქსელში გარდაცვლილის ოჯახის ახლობელი ავრცელებს.</p>\n<p>&bdquo;ანა ენგიბარიანს საშინელმა ბედისწერამ მოსკოვში საკუთარ დაბადების დღეზე&nbsp; აჭარულის ცეკვისას მოუსწრო. ამ შემზარავმა და დაუჯერებელმა ფაქტმა შავებით შემოსა გარი ენგიბარიანის ლამაზი სამშვილიანი ოჯახი. წარმოშობით სამტრედიელი გოგონა ასე მძიმედ დაემშვიდობა მოსკოვს სადაც ბავშვობა გაატარა და ახლა მშობლიური სამტრედია ჩაიხუტებს მის ცხედარს..&ldquo;_ წერს ის.</p>\n<p>გარდაცვალების მიზეზი უცნობია, ახლობლების თქმით, გოგონა სიცოცხლეში არაფერს უჩიოდა. ანა ენგიბარიანი წარმოშობით სამტრედიელია. მისი ოჯახი საცხოვრებლად მოსკოვში, დაახლოებით, 15 წლის წინ გადავიდა. ენგიბარიანები მშობლიურ სამტრედიას ხშირად სტუმრობდნენ. გარდაცვლილ&nbsp;&nbsp; გოგონას საქართველოში ხვალ ჩამოასვენებენ. &nbsp;</p>\n<p><a href=\"http://gurianews.com/article/g-news-tv/acharulis-tsekvis-dros-gogo-gardaitsvala-video?fbclid=IwAR2jSMz71s4eegm7HgrPW9pZCwzImxudIdHHai9KjLKMWQS6q_zlJXiRAH8\">წყარო</a></p>\n<p><iframe src=\"//www.youtube.com/embed/seYp0YBxOQE\" width=\"425\" height=\"350\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>', '27', '', 'https://newsebi.ge/media/%E1%83%92%E1%83%9D%E1%83%92%E1%83%9D%20(1).jpg', '', '', 0, 'vin-aris-20-tslis-gogona-romelic-qortsilshi-cekvis-dros-gardaicvala-ikh-video', 1581975114, '', 4174, '', ''),
(189, '', 'რთულია ამის აღიარება, მაგრამ სომეხი მამაკაცები ქართველ მამაკაცებს ჯობიან', '<p>რუსეთში მოღვაწე ქართველი ტელეწამყვანი&nbsp;<strong>თინა კანდელაკი &bdquo;ფეისბუქის&ldquo;</strong>&nbsp;საკუთარ გვერდზე წერს, რომ სომეხი მამაკაცები ქართველებს სჯობიან:</p>\n<p>&nbsp;</p>\n<p><strong>&bdquo;რთულია ამის აღიარება, მაგრამ სომეხი მამაკაცები ქართველ მამაკაცებს ჯობიან. მიჭირს ამის აღიარება, მაგრამ ასეა&ldquo;,&nbsp;</strong>- წერს&nbsp;<strong>კანდელაკი.&nbsp;</strong></p>', '27', '', 'https://newsebi.ge/media/tina.jpg', '', '', 0, 'rtulia-amis-aghiareba-magram-somekhi-mamakacebi-qartvel-mamakacebs-jobian', 1582054581, '', 10622, '', ''),
(190, '', '“გთხოვ მაპატიე და შემინდე, ძალიან მჭირდები…” – ზურა ხაჩიძის სულისშემძვრელი წერილი', '<p><strong>მომღერლ ზურა ხაჩიძისა და ხათუნა ჟორდანიას ქორწინებიდან 14 წელი გავიდა. ზურა ჟურნალ &ldquo;სარკესთან&rdquo; მათი ურთიერთობის შესახებ საუბრობს და აღნოშნავს, რომ ხათუნას მის ცხოვრებაში განსაკუთრებული ადგილი უჭირავს.</strong><br /><br />14 წელი გავიდა ქორწინებიდან ისე 16 წელია ერთად ვართ. ძალიან კარგად მახსენდება ქორწილის დღე, მაშინ უფრო მეტი სიყვარელი გაგვაჩნდა ადამიანებს ერთამანეთის მიმართ. თბილი და მხიარული ქორწილი გამოგვივიდა. ბოლომდე გავერთეთ, თუ არ ჩავთლით, იმ ინციდენტს, როცა ზალიკო ბერგერის გამო კლინიკაში აღმოვჩნდით. ალბათ, გახსოვთ მან თაკო დოლაბერიძე ხელში აიყვანა, წაიქცა და ფეხი მოიტეხა.<br /><strong>&ndash; ამ 16 წლის განმავლობაში ალბათ იყო რთული პერიოდებიც თქვენს ოჯახში.</strong><br />&ndash; ურთულესი გზა გავიარეთ, ბევრი წინააღმდეგობა შეგხვდა. განსაკუთრებით რთული იყო პირველი ხუთი წელი. შეყვარებულ წყვილებს ვურჩევ, განსაკუთრებით მოუფრთხილდნენ ურთიერთობას პირველი 5 წელი. გვქონია ისეთი ეტაპები, როდესაც გვიჩხუბია გვიკამათია და დანგრევის პირამდეც მიგვიყვანია ჩვენი ურთიერთობა, მაგრამ ჯვრისწერის მადლმა, სიყვარულმა და პატივისცემამ ყველაფერი გადაგვალახინა.<br /><strong>&ndash; რა არის ხათუნაში ისეთი, რასაც დღემდე ყველაზე მეტად აფასებთ?</strong><br />&ndash; მე ხათუნას სახით არა მარტო მეუღლე მყავს გვერდით ის ჩემი ძმაკაციცაა, ჩემთვის ყველაზე მნიშვნელოვანი მისი აზრია და არ მრცხვენია ამის თქმის. კრიტიკასაც მისგან უფრო ვიღებ.<br /><strong>&ndash; რას ეტყოდით თქვენ საყვარელ ქალს დაუფარავად, მთელი ქვეყნის წინაშე?</strong><br />&ndash; პირველ რიგში, მინდა მაპატიოს და შემინდოს, თუ რამე მიწყენინებია მისთვის. პატიებას ვითხოვ, ამ 16 წლის მანძილზე თუ მასზე ხმა ამიწევია ან გული მიტკენია. დანარჩენი თვითონ იცის, როგორ მიყვარს და რამდენად დიდი ადგილი უჭირავს ჩემს ცხოვრებაში. ვიტყვი, რომ ძალიან მჭირდება და მინდა ძალიან დიდხანს ვიყოთ ერთად!</p>', '27', '', 'https://newsebi.ge/media/zura%20khatuna.jpg', '', '', 0, 'gtkhov-mapatie-da-sheminde-dzalian-mchirdebi--zura-khachidzis-sulisshemdzvreli-tserili', 1582127943, '', 13976, '', ''),
(191, '', 'ყველას აქვს იმდენი შემოსავალი რამდენიც ეს პროპორციულია მის სწავლა-განათლებასთან,ისწავლეთ და არც თქვენ იშიმშილებთ', '<p>საკუთარ ფეისბუქ გვერდზე ქართული ოცნების წევრი და ბიძინა ივანიშვილის ოჯახის მეგობარი გუგული მაღრაძე აცხადებს: \"ყველას აქვს იმდენი შემოსავალი რამდენიც ეს პროპორციულია მის სწავლა-განათლებასთან. ისწავლეთ პროფესია მშობლებო და არც თქვენ იშიმშილებთ და არც თქვენი შვილები\"</p>', '27', '', 'https://newsebi.ge/media/%E1%83%92%E1%83%A3%E1%83%92%E1%83%A3%E1%83%9A%E1%83%98.jpg', '', '', 0, 'yvelas-aqvs-imdeni-shemosavali-ramdenic-es-proporciulia-mis-stsavla-ganatlebastanistsavlet-da-arc-tqven-ishimshilebt', 1582151060, '', 2655, '', ''),
(192, '', 'ძალიან გაბრაზებული ვარ გიორგიზე რა ჩაიდინა გიორგი ყიფშიძემ', '<p class=\"dropcap\">ახლა ნერვები მეშლება გიორგიზე, სხვა ქალისგან ბავშვს ელოდება, ცოლად შეირთო უკვე, &ndash; ამის შესახებ განცხადებას მსახიობი ზურა ყიფშიძე აკეთებს.</p>\n<p class=\"dropcap\">- საოცარი ტიპია, ჭკვიანი, მოსიყვარულე, გაიზარდა, გაიწელა, იშვიათად ვხედავ. ახლა ნერვები მეშლება გიორგიზე...</p>\n<div><em><strong>&nbsp;</strong></em></div>\n<div><em><strong>- რატომ?</strong></em></div>\n<p class=\"dropcap\">- ახლა ალექსანდრე დედამისთან არის. გიორგი სხვა ქალისგან ბავშვს ელოდება, ცოლად შეირთო უკვე.</p>\n<div><em><strong>&nbsp;</strong></em></div>\n<div><em><strong>- 24 წლის მსახიობიაო, წავიკითხე.</strong></em></div>\n<p class=\"dropcap\"><strong>- არ არის მსახიობი. ენი ჰქვია, დღე-დ&shy;ღეზე ბავშვს ელოდებიან, ბიჭს. ენის, მგონი,&shy; ლონდონში ჰყავს ოჯახი, ქართველია. რამდენიმეჯერ შევხვდით. მათი გადაწყვეტილება ჩემი საქმე არ არის, ამიტომ ჩუმად ვარ. მე ასე არ შემიძლია - მანქანებს, ცოლებს, ძაღლებს უცბად ვერ ვიცვლი.<br /></strong></p>\n<div><em><strong>&nbsp;</strong></em></div>\n<div><em><strong>- გიორგიმ თუ გითხრათ თავისი გადაწყვ&shy;ეტილების შესახებ, სანამ იქორწინებდა?</strong></em></div>\n<div>- რომ გვითხრა, მერე რა... ნატალია დადებითად შეხვდა ამას. ის უფრო კარგად იცნობს ენის, ვიდრე მე. წელს ლენ&shy;უკ&shy;ამაც შექმნა ოჯახი და კარგი არჩევანი გააკეთა.</div>\n<div><em><strong>&nbsp;</strong></em></div>\n<p class=\"dropcap\"><em><strong>- ქვეყანაში მიმდინარე პროცესებს ადევნ&shy;ებთ თვალს?</strong></em></p>\n<div><strong>- ერთხელ ერთმა კორეს&shy;პონდენტმა&shy; მიკროფონი&shy; მომაბჯინა სახეზე და მკითხა,&shy; ბატონო ზურა, როდის დაიწყება წარღვნაო?&shy; დ</strong>აწყებული არ არის, თუ თქვენ გგონიათ, დილით დაიწყება და საღამოს დამთავრდება-მეთქი? გრიპიც წარღვნაა, ბომბიც. დედამიწა გაგიჟდა, ისეთ რამეებს ვაკეთებთ ადამიანები. რამაზ ჩხიკვაძის არ იყოს, ვეღარ&shy; ვიტან სიტყვებს \"პოლიტიკა\" და \"დემოკრატია\". დემოკრატიას ამოფარებული&shy; რამდენია და დემოკრატია, დემოკრატიაო, გაიძახიან...</div>\n<p class=\"dropcap\">&nbsp;</p>\n<div>ჩვენ ზედაპირულად ვიცით რაღაცები, ნეტავ სინამდვილეში როგორაა საქმე. მინდა ყველას დაუფასდეს შრომა, მშვიდი და სტაბილური ცხოვრება გვქონდეს. ადამიანები ადამიანებს ვგავდეთ, ღმერთის გვწამდეს.</div>\n<p>&bdquo;ენი ჰქვია, დღე-დღეზე ბავშვს ელოდებიან, ბიჭს. ენის, მგონი, ლონდონში ჰყავს ოჯახი, ქართველია. რამდენიმეჯერ შევხვდით. მათი გადაწყვეტილება ჩემი საქმე არ არის, ამიტომ ჩუმად ვარ. მე ასე არ შემიძლია &ndash; მანქანებს, ცოლებს, ძაღლებს უცბად ვერ ვიცვლი&rdquo;, &ndash; ამბობს ზურა ყიფშიძე &bdquo;კვირის პალიტრასთან&rdquo;.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%9B%E1%83%90%E1%83%9B%E1%83%90%20%E1%83%A8%E1%83%95%E1%83%98%E1%83%9A%E1%83%98.jpg', '', '', 0, 'dzalian-gabrazebuli-var-giorgize-ra-chaidina-giorgi-yifshidzem', 1582318276, '', 1920, '', '');
INSERT INTO `trainings` (`id`, `source`, `title`, `text`, `category`, `scraped_at`, `img`, `origin_date`, `tags`, `comments_number`, `slug`, `date`, `origin_url`, `views`, `keywords`, `description`) VALUES
(193, '', 'ხვალ ჩემი შვილის გარდაცვალების დღეა, ამ დღეს მივალ იმ ადგილზე და ოცნებას ავისრულებ...\" - რა ოცნება უნდა აისრულოს მაია ასათიანმა შვილის გარდაცვალების დღეს ', '<p>23 თებერვალს ჩემი შვილის გარდაცვალების დღეა, ამ დღეს მივალ იმ ადგილზე და ოცნებას ავისრულებ...\" - რა ოცნება უნდა აისრულოს მაია ასათიანმა შვილის გარდაცვალების დღეს&nbsp;17 თე&shy;ბერ&shy;ვალს მაია ასა&shy;თი&shy;ა&shy;ნი სა&shy;ქარ&shy;თვე&shy;ლო&shy;დან გა&shy;ემ&shy;გზავ&shy;რა. სამი წლის წინ, თე&shy;ბერ&shy;ვლის თვე&shy;ში ტე&shy;ლე&shy;წამ&shy;ყვა&shy;ნის 18 წლის ქა&shy;ლიშ&shy;ვი&shy;ლი გარ&shy;და&shy;იც&shy;ვა&shy;ლა და ყო&shy;ველ წე&shy;ლი&shy;წადს, ეს პე&shy;რი&shy;ო&shy;დი ასა&shy;თი&shy;ა&shy;ნის&shy;თვის გან&shy;სა&shy;კუთ&shy;რე&shy;ბით მძი&shy;მეა.<br /><br />ამ&shy;ჯე&shy;რად, ტე&shy;ლე&shy;წამ&shy;ყვან&shy;მა მარ&shy;ტო მოგ&shy;ზა&shy;უ&shy;რო&shy;ბა გა&shy;და&shy;წყვი&shy;ტა და კუნ&shy;ძულ ბა&shy;ლი&shy;ზე გა&shy;ემ&shy;გზავ&shy;რა: \"16 სა&shy;ა&shy;თი უნდა ვიფ&shy;რი&shy;ნო, ჩემი შვი&shy;ლის წლის&shy;თა&shy;ვია\" - ამ სი&shy;ტყვე&shy;ბით გა&shy;მო&shy;აქ&shy;ვეყ&shy;ნა ვი&shy;დეო \"ინ&shy;სტაგ&shy;რა&shy;მის\" პი&shy;რად გვერ&shy;დზე მაია ასა&shy;თი&shy;ან&shy;მა.<br /><br />რო&shy;გორც ის ამ&shy;ბობს, ამ მოგ&shy;ზა&shy;უ&shy;რო&shy;ბით ოც&shy;ნე&shy;ბა აის&shy;რუ&shy;ლა და მისი საყ&shy;ვა&shy;რე&shy;ლი წიგ&shy;ნის - ელი&shy;ზა&shy;ბეტ გილ&shy;ბერ&shy;ტის ბესტსე&shy;ლე&shy;რის \"ჭამე, ილო&shy;ცე, შე&shy;იყ&shy;ვა&shy;რეს\" მთა&shy;ვა&shy;რი გმი&shy;რის გზის გავ&shy;ლას აპი&shy;რებს...<br /><br />წიგ&shy;ნის სი&shy;უ&shy;ჟე&shy;ტი, რომ&shy;ლის კი&shy;ნო&shy;ვერ&shy;სი&shy;ა&shy;შიც მთა&shy;ვარ როლს ჯუ&shy;ლია რო&shy;ბერტსი ას&shy;რუ&shy;ლებს, ასე&shy;თია: მთა&shy;ვა&shy;რი გმი&shy;რი - ელი&shy;ზა&shy;ბე&shy;ტი მტკი&shy;ცედ გა&shy;და&shy;წყვეტს, იპო&shy;ვოს ის, რაც აქამ&shy;დე ძა&shy;ლი&shy;ან აკ&shy;ლდა. ამ&shy;დე&shy;ნად, ის იწყებს ძი&shy;ე&shy;ბას... რომ&shy;ში ის თავს ნე&shy;ბა&shy;ზე მი&shy;უშ&shy;ვებს, ინ&shy;დო&shy;ეთ&shy;ში კი სუ&shy;ლის გან&shy;წმენ&shy;დას ჰპო&shy;ვებს... სა&shy;ბო&shy;ლო&shy;ოდ, კი კუნ&shy;ძულ ბა&shy;ლი&shy;ზე მცხოვ&shy;რე&shy;ბი ექიმ&shy;ბა&shy;ში ახალ გზას და&shy;ა&shy;ნახ&shy;ვებს სიმ&shy;შვი&shy;დის&shy;კენ და კვლავ გა&shy;უღ&shy;ვი&shy;ვებს სიყ&shy;ვა&shy;რუ&shy;ლის სურ&shy;ვილს.<br /><br />კუნ&shy;ძულ ბა&shy;ლი&shy;ზე ჩა&shy;სულ&shy;მა მაია ასა&shy;თი&shy;ან&shy;მა გა&shy;და&shy;წყვი&shy;ტა გულ&shy;შე&shy;მატ&shy;კივ&shy;რე&shy;ბის&shy;თვის \"ინ&shy;სტაგ&shy;რამ&shy;ზე\" გუ&shy;ლახ&shy;დი&shy;ლად მო&shy;ე&shy;ყო&shy;ლა, თუ რა მი&shy;ზანს ისა&shy;ხავ&shy;და მისი მოგ&shy;ზა&shy;უ&shy;რო&shy;ბა და რა&shy;ტომ გა&shy;ემ&shy;გზავ&shy;რა მარ&shy;ტო:<br /><br />\"ძა&shy;ლი&shy;ან ბევ&shy;რი სით&shy;ბო და სიყ&shy;ვა&shy;რუ&shy;ლი მინ&shy;და გა&shy;მო&shy;გიგ&shy;ზავ&shy;ნოთ აქე&shy;დან. ვერ წარ&shy;მო&shy;იდ&shy;გენთ, რა რა&shy;ო&shy;დე&shy;ნო&shy;ბით ტკბი&shy;ლი, თბი&shy;ლი, სიყ&shy;ვა&shy;რუ&shy;ლით სავ&shy;სე წე&shy;რი&shy;ლე&shy;ბი მი&shy;ვი&shy;ღე... ას&shy;მა&shy;გად და ათას&shy;მა&shy;გად მინ&shy;და და&shy;გიბ&shy;რუნ&shy;დეთ. ძა&shy;ლი&shy;ან ბევრ ღი&shy;მილს გიგ&shy;ზავ&shy;ნით, მად&shy;ლო&shy;ბა! და&shy;გიბ&shy;რუნ&shy;დეთ თი&shy;თო&shy;ე&shy;ულ თქვენ&shy;განს ეს ბედ&shy;ნი&shy;ე&shy;რე&shy;ბით სავ&shy;სე ემო&shy;ცი&shy;ე&shy;ბი, რო&shy;მელ&shy;საც მიგ&shy;ზავ&shy;ნით.<br /><br />დღეს, სა&shy;ინ&shy;ტე&shy;რე&shy;სო სა&shy;უ&shy;ბა&shy;რი მქონ&shy;და ბა&shy;ლის რი&shy;გით მა&shy;ცხოვ&shy;რე&shy;ბელ&shy;თან. მიხ&shy;სნი&shy;და, რო&shy;დე&shy;საც მი&shy;ჭირს ადა&shy;მი&shy;ანს გა&shy;ვა&shy;გე&shy;ბი&shy;ნო რა მინ&shy;და, უბ&shy;რა&shy;ლოდ ვი&shy;ღი&shy;მი და ეს ყვე&shy;ლა&shy;ფერ&shy;ში მშვე&shy;ლი&shy;სო, რა მა&shy;გა&shy;რი რა&shy;ღაც არის, არა?!<br /><br />ბევ&shy;რი მე&shy;კი&shy;თხე&shy;ბით, რა&shy;ტომ ვარ მარ&shy;ტო წა&shy;მო&shy;სუ&shy;ლი. ერთ დღეს აღ&shy;მო&shy;ა&shy;ჩენ, რომ შენს თავ&shy;თან მარ&shy;ტო ხარ... მე ძა&shy;ლი&shy;ან მიყ&shy;ვარს სა&shy;კუ&shy;თა&shy;რი თა&shy;ვის შეც&shy;ნო&shy;ბა, მე&shy;კი&shy;თხე&shy;ბით მწყინ&shy;დე&shy;ბა თუ არა - არა, იმი&shy;ტომ რომ ბევრ სა&shy;ინ&shy;ტე&shy;რე&shy;სო რა&shy;ღა&shy;ცას აღ&shy;მო&shy;ვა&shy;ჩენ ხოლ&shy;მე. როცა სა&shy;კუ&shy;თარ თავ&shy;თან ყოფ&shy;ნას შე&shy;იყ&shy;ვა&shy;რებთ, აღ&shy;მო&shy;ა&shy;ჩენთ რომ სა&shy;ში&shy;ში არა&shy;ფე&shy;რი არ არის და მარ&shy;ტო&shy;ო&shy;ბის აღარ შე&shy;გე&shy;შინ&shy;დე&shy;ბათ.&nbsp;<a href=\"https://www.ambebi.ge/article/241256-23-tebervals-chemi-shvilis-gardacvalebis-dges-am/\" target=\"_blank\" rel=\"noopener external noreferrer\">განაგრძეთ კითხვა..</a>.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%9B%E1%83%90%E1%83%98%E1%83%90%20%E1%83%9C%E1%83%A3%E1%83%AA%E1%83%90.jpg', '', '', 0, 'khval-chemi-shvilis-gardacvalebis-dghea-am-dghes-mival-im-adgilze-da-ocnebas-avisruleb---ra-ocneba-unda-aisrulos-maia-asatianma-shvilis-gardacvalebis-dghes-', 1582391176, '', 5827, '', ''),
(195, '', 'ზურა ყიფშიზე ყველასთვის მოულოდნელ განცხადებას ავრცელებს', '<p><strong>&bdquo;ვაშაძემ - პირველად რასაც გავაკეთებ, შევიწყალებ სააკაშვილს და დანარჩენებსო. რა უნდა ელაპარაკო ახლა მაგას!.. საგიჟეთში მაინც დააწვინონ ეს კაცი, ავად არის აშკარად&ldquo;, -&nbsp;</strong>ამის შესახებ მსახიობმა&nbsp;<strong>ზურა ყიფშიძემ &bdquo;კვირის პალიტრასთან&ldquo;&nbsp;</strong>ინტერვიუში განაცხადა.<br />&nbsp;<br /><strong>&nbsp;</strong><br /><strong>&bdquo;ამას წინათ, დილაუთენია, მირეკავს ქალბატონი, პრეზიდენტობის კანდიდატმა გრიგოლ ვაშაძემ თქვა, თეატრები დოტაციაზე არ უნდა იყოს, თავი თვითონ შეინახონო. თუ ასე ამბობს, დეგენერატი ყოფილა-მეთქი. ამან კი არ დაწერა პირდაპირ? ვაშაძეს მეუღლე მაინც არ ჰყავდეს ხელოვანი, მან ხომ კარგად იცის, რაც ხდება თეატრში?</strong><br /><strong>ვაშაძემ - პირველად რასაც გავაკეთებ, შევიწყალებ სააკაშვილს და დანარჩენებსო. რა უნდა ელაპარაკო ახლა მაგას!.. საგიჟეთში მაინც დააწვინონ ეს კაცი, ავად არის აშკარად.</strong><br /><strong>&bdquo;ნაციონალური მოძრაობის&ldquo; გამარჯვების წარმოდგენაც არ მინდა, შეიძლება გული გამისკდეს. სხვა რომ არაფერი, სირცხვილია! სააკაშვილის რეჟიმის მობრუნება დაუშვებელია!&ldquo;</strong>- განაცხადა&nbsp;<strong>ზურა ყიფშიძემ.</strong></p>', '19', '', 'https://newsebi.ge/media/zurabi.jpg', '', '', 0, 'zura-yifshize-yvelastvis-moulodnel-ganckhadebas-avrcelebs', 1582492677, '', 3981, '', ''),
(197, '', 'აარჩიე სასურველი ბინა aparto.ge-ზე სწრაფად და კომფორტულად', '<p><span style=\"font-size: 12pt;\">თბილისში - ბინების დღიურად ქირაობა <a href=\"https://aparto.ge\">Aparto.ge</a> საკმაოდ მოთხოვნადი სერვისია,</span><br /><span style=\"font-size: 12pt;\"> ბინის ქირაობას შესაძლებელია მრავალმხრივი მიზნები ჰქონდეს, მაგალითად #წვეულებისთვის, #დაბადების დღეებისთვის #ოჯახებისთვის #განტვირთვისათვის და ა.შ ჩამოთვილიდან ყველა შემთხვევაში ბინის დღიურად ქირაობა ითვალება კომფრტულ და იაფ საშუალებად.</span></p>\n<p><img src=\"/media/ff.jpg\" alt=\"\" width=\"558\" height=\"372\" /></p>\n<p><span style=\"font-size: 12pt;\">Aparto.ge წარმოადგენს ვებ-პლატფორმას, რომელიც მსგავს მომსახურებას სთავაზობს მომხმარებლებს, თუ თქვენ გსურთ 1 ღამით იქირაოთ ბინა გარკვეული მიზნებისათვის, Aparto ზე მარტივად შეგიძლიათ მოიძინოთ თქვენთვის სასურველი მიზნისთვის გამოყოფილ კატეგორიაში აპარტამენტები, დაუკავშირდეთ ბინის მეპატრონეს და შეუთანხმდეთ დეტალებზე.</span><br /> <br /><span style=\"font-size: 12pt;\"> Aparto.ge ზე განცხადების განთავსება შეუძლია ნებისმიერ მსურველს, უფასოდ.</span><br /><span style=\"font-size: 12pt;\"> მათ ვინც ბინის დღიურად დაქირავებას აპირებს აღარ დასჭირდება უამრავი დრო და ენეგრია დახარჯოს ბინის ძიებნაში, ყველაფერი ერთ სივრცეშია მოწყობილი Aparto.ge ზე.</span></p>', '27', '', 'https://newsebi.ge/media/d.png', '', '', 0, 'aarchie-sasurveli-bina-apartoge-ze-stsrafad-da-komfortulad', 1582566294, '', 1076, '', ''),
(198, '', 'ლელა კაკულიას საგანგაშო წინასწარმეტყველება - დავინახე როგორ გაანადგურა  ვირუსმა მსოფლიო მას ვერ გადაურჩება ვერავინ', '<p>ქართველი წინასწარმეტყველი ლელა კაკულია საუბრობს კორონავირუსის საშიშროებასთან დაკავშირებით საქართველოში და მსოფლიოში.&ldquo;ადრე ვიწინასწარმეტყველე მზგავს ვირუსზე, მედიცინა უძლურია და პლანეტის ნახევარზე მეტს გაწყვიტავდა. ეს ვირუსი საქართველოსთვის საშიში ნამდვილად არ არის და ვერც იქნება. კიდევ არის ვირუსების მთელი &ldquo;სერიალები&rdquo; მომავალში, მაგრამ საქართვლოს თითქოს გვერდს უვლის ეს სასიკვდილო დარტყმები. ამ სიტუაციიდანაც გამოვძვრებით&rdquo;, &ndash; აცხადება ლელა კაკულია.<br />წინასწარმეტყველის განმარტებით, მისი წინასწარმეტყველება ყოველთვის სრულდება და არაფრის უნდა გვეშინოდეს.</p>', '20', '', 'https://newsebi.ge/media/lela.jpg', '', '', 0, 'lela-kakulias-sagangasho-tsinastsarmetyveleba---davinakhe-rogor-gaanadgura--virusma-msoflio-mas-ver-gadaurcheba-veravin', 1582630583, '', 8002, '', ''),
(199, '', 'რას წერენ რუსი გოგონები ქართველებზე ინტერნეტში  - \"იმიტომ ხართ ასეთი ბოროტები და დებილები, რომ პატარა პენისები გაქვთ\"', '<p>რუსეთის საგარეო საქმეთა სამინისტროს საზოგადოებასთან ურთიერთობის ხელმძღვანელი მარია ზახაროვა სოციალურ ქსელში გამოეხმაურა სერგეი ლავროვისთვის კითხვების დასმის მცდელობას, ქართველი ჟურნალისტების მიერ.</p>\n<p>ზახაროვამ ქართველი ჟურნალისტები მწვავედ გააკრიტიკა და საკუთარ \"ფეისბუქზე\" ფოტოებიც გამოაქვეყნა. ზახაროვა ირწმუნება, რომ ის მედიის წარმომადგენლებმა \"დაკაწრეს.\"</p>\n<p>რუსი ჩინოვნიკის წერილს ინტერნეტ-მომხმარებლების დიდი გამოხმაურება მოჰყვა. კომენტარების უმრავლესობა საქართველოს და ქართველების შურაცხმყოფელია.</p>\n<p>\"ქართველებს თუ ევროპაში შესვლა უნდათ, პირველ რიგში, ევროპული კულტურა ისწავლონ,\" \"ველური ხალხი,\" \"რა სურთ საქართველოს ქალებს? ლავროვი!\" \"რა სიველურეა, ჯუნგლებიდან გამოვარდნენ თუ მთიდან ჩამოვიდნენ,\" \"მათ ეს სისხლში აქვთ - ხმამაღლა საუბარი, ჩხუბი, მუჯლუგუნები... მოსკოვის ცენტრში სულ ქართველები არიან. ვეღარ გამიგია, რუსეთში ვცხოვრობ თუ საქართველოში,\" \"ქართველებს პატარა პენისები გაქვთ, ამიტომ ხართ ასეთი ბოროტები და დებილები,\" - წერენ რუსი ინტერნეტ-მომხმარებლები.</p>', '27', '', 'https://newsebi.ge/media/rusebi.jpg', '', '', 0, 'ras-tseren-rusi-gogonebi-qartvelebze-internetshi----imitom-khart-aseti-borotebi-da-debilebi-rom-patara-penisebi-gaqvt', 1582671514, '', 4886, '', ''),
(200, '', '\"რუსთავი 2-დან წამოსვლის შემდეგ ვტ..ურობდი\" „აჭარის ტელევიზიის“ ახალდანიშნული ახალი ამბების რედაქტორის პასუხი ჟურნალისტს ', '<p>&bdquo;აჭარის ტელევიზიის&ldquo; ახალდანიშნული ახალი ამბების რედაქტორმა, ნინო ხაჟომიამ, ჟურნალისტის შეკითხვას, რას საქმიანობდა გადაცემა &bdquo;60 წუთის&ldquo; დახურვის შემდეგ, ასე უპასუხა: &bdquo;ვ**ნაურობდით&ldquo;</p>\n<p><iframe style=\"border: none; overflow: hidden;\" src=\"https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2FAjaraTV%2Fvideos%2F2799544236829756%2F&amp;show_text=0&amp;width=476\" width=\"476\" height=\"476\" frameborder=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"></iframe></p>', '27', '', 'https://newsebi.ge/media/60%20%E1%83%AC%E1%83%A3%E1%83%97%E1%83%98.jpg', '', '', 0, 'rustavi-2-dan-tsamosvlis-shemdeg-vturobdi-acharis-televiziis-akhaldanishnuli-akhali-ambebis-redaqtoris-pasukhi-zhurnalists-', 1582734496, '', 1626, '', ''),
(201, '', 'სასწრაფოდ! თავდასხმა ზვიად კუპრავაზე ის სასტიკად ნაცემია', '<p><strong>ჟურნალისტი</strong>&nbsp;<strong>გიორგი კაპანაძე, სოციალურ ქსელში, ავრცელებს ნაცემი ზვიად კუპრავას ფოტოს და წერს:</strong></p>\n<p>&ldquo;ამ წუთას რეჟიმის ტიტუშკები დახვდნენ ზვიად კუპრავას სახლთან და ფიზიკურად გაუსწორდნენ. მანამდე ჩემთან იყო ოფისში ერთერთ სკანდალურ თემაზე, რომელიც შს მინისტრის მოადგილეს ეხება. ასევე, ხვალ იგეგმებოდა აქცია ივანიშვილის სახლთან, სადაც შუშის კოლბა საკარანტინე ადგილად, ხოლო უზურპატორი მთავარ კორონა ვირუსად უნდა გამოცხადებულიყო.<br />ივანიშვილო პირადად და პერსონალურად ხარ პასუხისმგებელი ამ ნაძირლობაზე. ნამდვილად არ უნდა შეგრჩეს და არც შეგრჩება.&rdquo;</p>', '22', '', 'https://newsebi.ge/media/zviad-kuprava-nacemi-720x650.jpg', '', '', 0, 'sastsrafod-tavdaskhma-zviad-kupravaze-is-sastikad-nacemia', 1582830459, '', 1658, '', ''),
(202, '', 'ესენი ის ახალდაქორწინებული წყვილია, რომელიც დღეს ავარიას ემსხვერპლა', '<p>ზუგდიდი-ანაკლიის გზაზე, სოფელ დარჩელის მონაკვეთზე მომხდარი შემზარავი ავარიის შედეგად გარდაიცვალა სამი ადგილობრივი მოსახლე, მათ შორის ცოლ-ქმარი, დათო სოსელია და ნანა ჯალაღონია და მათი მეზობელი მამუკა ტურავა. მეოთხე დაშავებული ახალგაზრდის კუზა ტორუას მდგომარეობა უკიდურესად მძიმეა.<br /><br />შინაგან საქმეთა სამინისტროს ცნობით, მომხდარზე გამოძიება276-ე მუხლის მერვე ნაწილით დაიწყო, რაც გულისხმობს ტრანსპორტის მოძრაობის უსაფრთხოების ან ექსპლუატაციის წესის დარღვევას, რამაც ორი ან ორზე მეტი პირის გარდაცვალება გამოიწვია.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%90%E1%83%95%E1%83%90%E1%83%A0%E1%83%98%E1%83%90.jpg', '', '', 0, 'eseni-is-akhaldaqortsinebuli-tsyvilia-romelic-dghes-avarias-emskhverpla', 1582902944, '', 3760, '', ''),
(203, '', 'თურქეთმა გაანადგურა რუსეთის ბუკისა და პანზერის ტიპის 23 ჯავშანტექნიკა და 5 ვერტმფრენი ', '<p>თურქეთის არმიამ გაანადგურა რუსეთის 23 ჯავშანტექნიკა და 5 ვერტმფრენი განაცხადა თურქეთის შეიარაღებული ძალების მინისტრმა ხულუსი აკაპმა, აცხადებს ანადოლუ.</p>\n<p>ეს იყო პასუხი სირიის თავდასხმაზე თურქეთის შეიარაღებულ ძალებზე, როდესაც 33 ჯარისკაცი დაიღუპა და 32 დაიჭრეა 27 თებერვალს იდლიბში.</p>', '19', '', 'https://newsebi.ge/media/ffff.jpg', '', '', 0, 'turqetma-gaanadgura-rusetis-bukisa-da-panzeris-tipis-23-javshanteqnika-da-5-vertmfreni-', 1582908276, '', 6787, '', ''),
(204, '', 'სასწრაფოდ! ამ წუთბში ხანძარია მთაწმინდაზე ანძასთან', '<p>მთაწმინდაზე, სატელევიზიო ანძასთან ხანძარია. რამ გამოიწვია ცეცხლის გაჩენა, ჯერჯერობით უცნობია.</p>\n<p>როგორც როგორც \"რუსთავი 2-ს\"&nbsp;საგანგებო სიტუაციების მართვის სამსახურში განუცხადეს,&nbsp; \"ეშმაკის ბორბლის\" ქვემოთ,&nbsp; ოთხი სახანძრო ჯგუფია მობილიზებული, თუმცა შესაძლოა,&nbsp; სახანძრო ბრიგადების დამატებაც გახდეს საჭირო.&nbsp;</p>', '27', '', 'https://newsebi.ge/media/%E1%83%9B%E1%83%97%E1%83%90%E1%83%AC%E1%83%9B%E1%83%98%E1%83%9C%E1%83%93%E1%83%90.jpg', '', '', 0, 'sastsrafod-am-tsutbshi-khandzaria-mtatsmindaze-andzastan', 1582907517, '', 1794, '', ''),
(205, '', '', '', '', '', '', '', '', 0, '', 1582907664, '', 602, '', ''),
(206, '', 'ერთადერთი და ჰყავდა… როგორ გაიმეტა ანგელოზივით გოგო?! – ჭოპორტში მომხდარი მკვლელობის ახალი დეტალები', '<p class=\"dropcap\">დუშეთში მომხდარი მკვლელობის შესახებ დამატებითი დეტალები ხდება ცნობილი, არსებული ინფორმაციით&nbsp;41 წლის ლაშა&nbsp;ქემბარაშვილი, რომელიც დედისა და დის განსაკუთრებული სისასტიკით მკვლელობაშია ბრალდებული პოლიციას თავად ჩაბარდა. რაც შეეხება საზარელი მკვლელობის მოტივს, ამაზე ჭოპორტში მცხოვრებლებს საუბარი უჭირთ.</p>\n<p>როგორც ადგილობრივები ჰყვებიან, რომ გასროლის ხმა 08:00 საათზე გაიგეს.&nbsp;ქემბარაშვილის&nbsp;დედა ადგილზე იყო გარდაცვლილი, ახალგაზრდა ქალს კი სასიცოცხლო ნიშნები აღენიშნებოდა, თუმცა ის კლინიკაში მიყვანისთანავე გარდაიცვალა. მეზობლების ინფორმაციით მამაკაცი ნასვამ მდგომარეობაში არ ყოფილა.</p>\n<p>&bdquo;41 წლის კაცმა, საკუთარი დედა და და სანადირო თოფით მოკლა. ლაშას ცოლი არ ჰყავს, მშრომელი ბიჭია. დედა ადგილზე გარდაიცვალა. ერთადერთი და ჰყავდა, როგორ გაიმეტა?! ანგელოზივით გოგო იყო&ldquo;, &ndash; ამბობს ოჯახის ახლობელი.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%A1%E1%83%A1%E1%83%A1.png', '', '', 0, 'ertaderti-da-hyavda-rogor-gaimeta-angelozivit-gogo--choportshi-momkhdari-mkvlelobis-akhali-detalebi', 1582919366, '', 1666, '', ''),
(207, '', 'არის თუ არა მზად ინფექციური საავადმყოფო  ინფექციური პაციენტების დასახვედრად?', '<h2><span class=\"example1\">&nbsp; &nbsp; ინფექციურ საავადმყოფოში, ბოქსირებულ განყოფილებაში, მოთავსებული პაციენტები და მათი ახლობლები უკმაყოფილებას გამოთქვამენ. მათი განცხადებით პალატებში ანტისანიტარიაა, სველი წერტილები დაუმუშავებელია, ექთნები პაციენტებს ერთი თერმომეტრით უზომავენ ტემპერატურას. ადამიანები, რომლებიც გადაყვანილები არიან კარანტინში, არც მათ აქვთ სახარბიელო პირობები.&nbsp;</span><span class=\"example1\"><br />&nbsp; &nbsp; მედიკოსები მოსახელეობას არწმუნებენ, რომ პანიკის საფუძველი არ არსებობს და მოუწოდებენ მათ, ხშირად იბანონ ხელები და მოერიდონ საზოგადოების თავშეყრის ადგილებს.<br /></span>&nbsp; &nbsp; შეგახსენებთ, ბოლო ინფორმაციით 39 ადამიანი რჩება ბოქსირებულ განყოფილებაში. მათგან კორონა ვირუსი მხოლოდ 2 ადამიანს დაუდასტურდა.&nbsp;</h2>', '22', '', 'https://newsebi.ge/media/ambulance.jpg', '', '', 0, 'aris-tu-ara-mzad-infeqciuri-saavadmyofo--infeqciuri-pacientebis-dasakhvedrad', 1582975100, '', 377, '', ''),
(209, '', 'საქართველოში კორონავირუსის მესამე შემთხვევა დადასტურდა.', '<h3>საქართველოში კორონავირუსის მესამე შემთხევა ოფიციალურად დადასტურდა. პაციენტი საქართველოს მოქალაქეა, რომელიც ირანში იმყოფებოდა. მას&nbsp; კონტაქტი აქვს პირველ დაავადებულ ადამიანთან, რომლის დიაგნოზი რამდენიმე დღის წინ ლაბორატორიულად დადასტურდა. ამ ეტაპზე სამივე პაციენტის მდგომარეობა დამაკმაყოფილებელია.&nbsp;</h3>', '22', '', 'https://newsebi.ge/media/%E1%83%A1%E1%83%90%E1%83%A1%E1%83%AC%E1%83%A0%E1%83%90%E1%83%A4%E1%83%9D.jpg', '', '', 0, 'saqartveloshi-koronavirusis-mesame-shemtkhveva-dadasturda', 1582974839, '', 464, '', ''),
(210, '', 'ინფექციურში კარანტინგამოვლილი გოგო უმძიმეს პირობებზე ყვება შოკისმომგვრელია ეს ყველაფერი', '<p>27 თებერვალს, ღამით მე და ჩემი ორი მეგობარი მოვხვდით ინფექციურ საავადმყოფოში.<br />იმდენად გაბრაზებული, გაოგნებული, შეშფოთებული (და კიდევ სხვა ბევრი დიპლიმატიური თუ არადიპლომატიური სიტყვა) ვართ, არც კი ვიცი საიდან დავიწყო.<br />მოდი, ქრონოლოგიურად მივყვები და შევეცდები მაქსიმალურად ლაკონიური ვიყო, რამდენადაც ეს შესაძლებელია.<br /><a class=\"profileLink\" title=\"Tako Kurtanidze\" href=\"https://www.facebook.com/kurtanidzetako?__tn__=%2CdK-R-R&amp;eid=ARAhnVCaOOWQLSGlGwUg18_LHRYrxEmO5tgsGl7HM74SU0unqbArWfI1HXeXXf4d59RqTAICtlwjL5wW&amp;fref=mentions\" data-hovercard=\"/ajax/hovercard/user.php?id=100001800619699&amp;extragetparams=%7B%22__tn__%22%3A%22%2CdK-R-R%22%2C%22eid%22%3A%22ARAhnVCaOOWQLSGlGwUg18_LHRYrxEmO5tgsGl7HM74SU0unqbArWfI1HXeXXf4d59RqTAICtlwjL5wW%22%2C%22fref%22%3A%22mentions%22%7D\" data-hovercard-prefer-more-content-show=\"1\">Tako</a>&nbsp;და თავისი მეუღლე,&nbsp;<a class=\"profileLink\" title=\"დავით ტუღუში\" href=\"https://www.facebook.com/datun8888?__tn__=%2CdK-R-R&amp;eid=ARDi5HJe_mHo_BxLUX11_mwrXlZErxIsOTvldl8r3v0RmsnIkbleOHzEk4aPNxiEdsajFiLuFb1H015I&amp;fref=mentions\" data-hovercard=\"/ajax/hovercard/user.php?id=100030664291841&amp;extragetparams=%7B%22__tn__%22%3A%22%2CdK-R-R%22%2C%22eid%22%3A%22ARDi5HJe_mHo_BxLUX11_mwrXlZErxIsOTvldl8r3v0RmsnIkbleOHzEk4aPNxiEdsajFiLuFb1H015I%22%2C%22fref%22%3A%22mentions%22%7D\" data-hovercard-prefer-more-content-show=\"1\">დავით</a>ი 24 თებერვალს ჩამოფრინდნენ მილანიდან. აეროპორტში შეუმოწმეს ყველას ტემპერატურა, ვინაიდან თვითმფრინავში ერთ-ერთი მგზავრი ცუდად გახდა. აღმოჩნდა, რომ დაახლოებით 15მდე ადამიანს ჰქონდა სიცხე, მათ შორის თაკოსაც. თუმცა, თაკოს პირველ რიგში ეხოსკოპია ესაჭიროებოდა, ვინაიდან იყო ფეხმძიმედ და გამოფრენამდე ერთი დღით ადრე დაეწყო სისხლდენა. შესაბამისად, სასწრაფოდ უნდა გადამოწმებულიყო, იყო თუ არა ნაყოფის შენარჩუნება შესაძლებელი.<br />საბოლოოდ ისე მოხდა, რომ ყველა მგზავრი, ყველა, გამოუშვეს.<br />სამწუხაროდ, თაკოს შეწყვეტილი ორსულობა დაუდგინეს, დაუნიშნეს მედიკამენტოზური აბორტი.<br />ჩვენც ჩავთვალეთ, რომ ტემპერატურა ამ პროცესების ფონზე ჰქონდა, წამოვედით სახლში და დავიწყეთ ექიმის დანიშნულების შესრულება.<br />სახლში ვიყავით მხოლოდ თაკო, დათო და მეც, რათა ამ პერიოდის განმავლობაში დავხმარებოდი ყველაფერში.<br />უკვე 27-ში შევამჩნიეთ, რომ თაკოს ტემპერატურა მოემატა. ამავდროულად, ტემპერატურა დაუფიქსირდა დათოსაც და მეც.<br />დავრეკეთ სასწრაფოში, ავუხსენით მდგომარეობა. საკმაოდ იპერატიულად მოვიდნენ და გადაგვიყვანეს ინფექციურში.<br />აი, აქ იწყება მთავარი.<br />კარში შესვლისთანავე გვესმის, რომ ადგილები არ არის, შემდეგ რამდენიმეწამიანი დაბნეულობა იყო, რა ვქნათო და უცებ, როგორც ჩანს რაღაც გაახსენდათ და წაგვიყვანეს \"პალატაში\".<br />ეს ოთახი, არც კი ვიცი უწინ რა იყო, თავისთავად ცხადია, რომ პალატა - არა.<br />სამი ადამიანი ვიყავით, იდგა ორი ლოგინი, მათ შორის, ერთი სრულიად ხე.<br />ოთახს არ ეკეტებოდა კარი. არც ეხურებოდა, ვინაიდან საკეტი იყო მთლიანად მოტეხილი და ასე ღია კარში, ყველა გავლა-გამოვლა, საუბარი დერეფანში გვესმოდა.<br />ვითომ პირად აბაზანაში, არ იყო არანაირი დუში, ანუ, აბაზანა კი იდგა, მაგრამ დუში არ იყო, ფიზიკურად. უნიტაზიც საშინელ მდგომარეობაში, ცივი წყალი ონკანში. აბაზანის უკან, კი იყო კარი, რომელსაც გარეთ გაყავდი.<br />ამ ზოგად მდგომარეობაზე უარესი, ჰიგიენური მდგომარეობა იყო. არამცთუ დეზინფექცია, დალაგებულიც კი არ იყო ოთახი. წინა პაციენტის ნაჭამი კონტეინერი და ჩანგალი დაგვხვდა, ასევე, ფანჯრის რაფა იყო ამოტეხილი და იქ ეყარა სიგარეტის ფერფლი და სხვა წვრილ-წვრილი ნაგავი. იქვე კი იდგა ლოგინი და ფანჯარა რომ გამოვაღეთ, ქარმა, თან ორპირმა (იმიტომ რომ კარი ხომ ღია გვქონდა) გადმოაყარა ეს ყველაფერი.<br />მთელი ღამე მაქსიმალურად ვიჯექი, დაწოლის სურვილი არანაირად არ მქონდა.<br />წარმოიდგინეთ, ჩვენს შესვლამდე, დეზინფექცია კი არა, ტილოც კი არავის გადაუსვამს არაფრისთვის. ნაგვის ურნაში ათასჯერ ვთხოვეთ, პარკი ჩაედოთ და ეგეც არ გააკეთეს.<br />არ დაგავიწყდეთ, ვცდილობ, მაქსიმალურად ლაკონურად ვისაუბრო.<br />ახლა რაც შეეხებათ ექიმებს:<br />აუცილებლად უნდა ვთქვა, რომ უმეტესობა იყო უსაყვარლესი, უკარგესი, უკეთილშობილესი ადამიანი, ძალიან ადამიანური მიდგომებით. უპირველასად ჩვენ სამივეს ძალიან დიდი მადლობა გვინდა გადავუხადოთ ექიმს, რომელიც დაგვხვდა მისვლისას, რეზო ერქვა და ახალგაზრდა იყო, სხვა არაფერი არ ვიცით, მათ შორის არც ის, როგორ გამოიყურება, სპეციალური ფორმების გამო. თუმცა, ზოგადად, მისი ჩვენს გარემოცვაში ყოფნა, ძალიან დამამშვიდებელი იყო, ყველანაირდ ზრუნავდა და ჩვენთან ერთად დარდობდა იმ გარემოზე, სადაც ყოფნა გვიწევდა. არ ვიცი, ნახავს თუ არა ამას, მაგრამ დიდი მადლობა აუცილებლად.<br />მისვლისთანავე აგვიღეს ანალიზები, სისხლი, გადაგვიღეს რენტგენი, უშუალოდ კორონაზე კი დილით მოვიდოდნენ და წაიღებდნენ ნაცხსს.<br />მოკლედ, როგორც ვთქვი, ექიმები, ექთნები იყვნენ უსაყვარლესები. თავადაც ძალიან დაღლილები და რთულ რეჟიმში მომუშავეები.<br />მაგრაააამ, აი ასეთ კარგ ხალხს, შეიძლება ძალიან მარტივად გაუფუჭოს სახელი ერთმა ისეთმა გამოხტომამ, როგორიც გამოხტა შუაღამისას (ჩვენს თვალში ვერ გაუფუჭებს).<br />მოკლედ, როგორც იცით თაკო სვამდა სპეციალურ მედიკამენტებს ნაყოფის გამოსადევნად. თავისთავად ცხადია, თავის გინელოლოგთან მუდმივი კომუნიკაცია ჰქონდა, გაიარა კონსულტაცია მობილურით, დაელია თუ არა საავადმყოფოშიც და მიიღო თანხმობა, ვინაიდან ამ პროცესების შეჩერება არ შეიძლებოდა, თუნდაც სეფსისის რისკის გამო.<br />ეს ინფორმაცია ჩვენ მივაწოდეთ იქ მყოფ ექიმებს.<br />უეცრად, \"პალატაში\" შემოდის ქალი, რომელიც კარგად ვერ მივხვდით ვინ იყო და იწყებს ხელების შლას და საყვედურებს. თაკოს ეუბნება, რატომ მოვიდა აქ?! ეუბნენა, რომ დარდობს, სისხლდენა თუ დაეწყება ჭარბირაოდენობით, ისინი ვერ შეუჩერებენ, რადგან სხვა პროფილი აქვთ და რომ უკვე აღარცერთი გინეკოლოგი არ მიიღებს აქ მოხვედრილობის გამო.<br />გაოგნებულები ვუყურებთ და ვერ ვხვდებით, რას გვსაყვედურობს, თაკო ძალიან გაბრაზდა და ჰკითხა, რა გინდოდათ, მილანიდან ჩამოსული ხალხი, რომელსაც სიცხე აგვიწია და ჩვენთან მყოფ პირსაც აუწია აქ არ მოვსულიყავით, იმიტომ რომ მუცელი მომეშალაო? და ვთქვათ მართლა ვირუსი მაქვს, ასე წავსულიყავი გინეკოლოგთან და სხვები დამეინფიცირებინაო?<br />საკმაოდ მწვავე კამათის შემდეგ ეს ქალი გავარდა გარეთ, ჩვენმა ექიმმა რეზომ კი ბოდიში მოგვიხადა, დაგვამშვიდა და თვითონაც გაკვირვებული წავიდა.<br />შემდეგ ჰქონდათ მცდელობები, გაეკეთებინათ რაღაც ნემსები, მგონი სისხლის შემაკავებლები, არადა, ადამიანს პირიქით, სისხლის წამოსასვლელი წამალი ჰქონდა დალეული... ამ დეტალებში შესვლა არ მინდა, მედიცინის საკითხია და მე კარგად ვერ ვერკვევი...<br />გამოვათენეთ ეს ღამე როგორღაც, დილით მოვიდნენ დაავადებათა კონტროლიდან, ასევე უკარგესი გოგოები, გაგვამხიარულეს და საღამოს გეცოდინებათ პასუხიო.<br />ის დღე ძალიან გაიწელა, ჩვენმა ექიმმაც, როგორც ჩანს, მორიგეობა დაასრულა.<br />მოსაღამოვდა, ინტერნეტში ვხედავთ განცხადებას, რომ არც ერთს კორონა არ დაუდასტურდა, გვიხარია, ვიცით რომ ჩვენზეცაა საუბრი, თუმცა ჩვენთან პირადად არავინ არ ჩანს.<br />ველოდებით, ველოდებით, ველოდებით, გავიდა ერთი ორი სამი საათი, არავინ არაა..<br />შემდეგ უცებ შემოდის ქალი, მანამდე ნანახი არ გვყავდა და გვეკითხება - მზად ხართ?!<br />მზად რისთვის? გაგვიკვირდა, არავის პასუხიც კი არ უთქვამს ჩვენთვის პირადად დაგვიდასტურდა თუ არა რამე..<br />უიო, არ გითხრესო? თამარი გადაგვყავს გინეკოლოგთან და თქვენ კარანტინშიო.<br />ახლა კარანტინის საკითხი:<br />რასაც ჩვენ ვუყურეთ, სულ რომ ჯანმრთელი იყო, შეიძლება იქ თვითონ დაგმართონ რამე. ფორმები აცვიათ, კი, მაგრამ ამ ფორმით ჯერ შედიან ვირუსიან პაციენტთან, შემდეგ არავირუსიანთან და ხდება ყველანაირი პირდაპირი კონტაქტი... გარდა ამისა, არის ანტისანიტარია. საავადმყოფოში იმის რომ გეშინია, არაფერს შევეხო, არ დავბინძურდეო, იქ რაზეა საუბარი საერთოდ?<br />ჩვენ არ ვიცოდით სხვაგან რა დაგვხვდებოდა, ამიტომ, მოვითხივეთ შინაიზოლაცია.<br />შეგვეძლო, ჩვენ სამნი მხოლოდ და მარტო ვყოფილიყავით სახლში, არც არავინ მოვიდოდა, არც ჩვენ გავიდოდით.<br />დაგვთანხმდნენ, ოღონდ თაკო მაინც უნდა წაეყვანათ გინეკოლოგთან ევექსში.<br />ჩვენ, მე და დათო ვდგევართ და ველოდებით რომ სახლში წაგვიყვანენ, მაგრამ არა, თქვენ თვითონ უნდა წახვიდეთო...<br />მეთქი ბატონოოო??? ცოტა ხნის წინ კარანტინში მიგყავდით, შინაიზოლაციაზე დაგვთანხმდით და ახლა გინდათ, რომ ჩვენ სახლში წავიდეთ ტრანსპორტით?? ეს რა კარანტინი და რა იზოლაციაა ქუჩაში თუ ვიარე?!<br />რა ვქნათო, ჩვენ ვერ გადაგიყვანთო...<br />რაღა უნდა გვექნა, გავიკეთეთ ნიღბები და წავედით ტაქსით...<br />თაკო მიიყვანეს კლინიკაში, სადაც ერთ ღამეში საკმაოდ დიდი თანხა მოსთხოვეს, უარი თქვა დარჩენაზე, აიღო ანალიზები, დარწმუნდნენ რომ საშიშროება არ არის და გამოუშვეს.<br />ვწევართ ახლა სახლში, როგორც იქნა მოვედით აზრზე იმ საშინელი დღე-ღამის შემდეგ, რომელიც ისე გვეჩვენება, რომ საუკუნე იყო. მთელი სხეული გვტკივა, დანგრეული ვართ, გეგონება ვინმემ გვაწამა...<br />ისე, წამება არა, მაგრამ ძალიან საცოდაობა კი იყო, თაკო და დათო ერთ ლოგინზე იწვნენ და დათოს ფეხები სკამზე ედო პარალელურად, აბა, ისე ვერ ეტეოდნენ და...<br />კომიკურია თუ ტრაგიკული ვეღარ გაიგებ.<br />ასე რომ, თავმომწონედ საუბარი იმაზე, რომ მზად ვართ, ტყუილია, არ ვართ მზად.<br />ელემენტარული მენეჯმენტის საკითხები ეშლებათ.<br />ვისაც კარანტინში უნდა და ფიქრობს და ხუმრობს, დავისვენებო, ნუ გინდათ, ვერ დაისვენებთ.<br />ეს ყვეკაფერი ხალხმა უნდა იცოდეს, ყველას და ყველანაირ კითხვას ვუპასუხებთ რაც გაჩნდება.<br />რაც შეეხება პანიკას, დიახ, პანიკაში არ უნდა იყოთ, უბრალოდ, ფრთხილად იყავით.</p>\n<p><iframe style=\"border: none; overflow: hidden;\" src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fmariam.gaprindashvili.3%2Fposts%2F2606075942836473&amp;width=500\" width=\"500\" height=\"700\" frameborder=\"0\" scrolling=\"no\"></iframe></p>\n<p><iframe style=\"border: none; overflow: hidden;\" src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fmariam.gaprindashvili.3%2Fposts%2F2605453769565357&amp;width=500\" width=\"500\" height=\"325\" frameborder=\"0\" scrolling=\"no\"></iframe></p>', '22', '', 'https://newsebi.ge/media/%E1%83%9B%E1%83%90%E1%83%A0%E1%83%98%E1%83%90%E1%83%9B%E1%83%98.jpg', '', '', 0, 'infeqciurshi-karantingamovlili-gogo-umdzimes-pirobebze-yveba-shokismomgvrelia-es-yvelaferi', 1583004069, '', 3501, '', ''),
(211, '', 'სასწავლო პროცესი 2 მარტის ნაცვლად ...', '<h3>&nbsp; &nbsp;ახალი კორონავირუსის შესაძლო გავრცელების პრევენციასთან დაკავშირებით, ივანე ჯავახიშვილის სახელობის თბილისის სახელმწიფო უნივერსიტეტში სასწავლო პროცესი 2 მარტის ნაცვლად 16 მარტს განახლდება. ასევე სწავლის დაწყება 16 მარტამდე გადაიდო თბილისის სახელმწიფო სამედიცინო უნივერსიტეტშიც.&nbsp;</h3>\n<h3>&nbsp; &nbsp;სკოლებსა და ბაღებში არდადეგები 9 მარტის ნაცვლად 2 მარტს დაიწყება და 16 მარტამდე გაგრძელდება.<br />&nbsp; &nbsp;განათლების, მეცნიერების, კულტურისა და სპორტის მინისტრმა, მიხეილ ჩხენკელმა, სკოლებს სადეზინფექციო სამუშაოების ჩატარების რეკომენდაციით&nbsp;მიმართა.</h3>', '22', '', 'https://newsebi.ge/media/unnamed.jpg', '', '', 0, 'sastsavlo-procesi-2-martis-nacvlad-', 1583005215, '', 363, '', ''),
