(213, '', 'ყაჩაღობა ოზურგეთში - 80 წლის ქალი და 82 წლის მამაკაცი ...', '<h3>&nbsp; &nbsp;ოზურგეთის სოფელ ნაღობილევში, დღეს დილით, ყაჩაღებმა 82 მამაკაცი და 80 წლის ქალი აწამეს და სახლიდან 2500 ლარი&nbsp; წაიღეს. მამაკაცს ნეკნები აქვს გატეხილი. რაც შეეხება ქალს, მას ჭრილობა სახის არეში მიაყენეს.&nbsp; ორივე მათგანი კლინიკაში გადაიყვანეს, სადაც შესაბამისი მკურნალობა უტარდებათ.</h3>\n<h3>&nbsp; &nbsp;გამოძიება სისხლის სამათლის კოდექსის 179 -ე მუხლით მიმდინარეობს. პოლიციას დამნაშავე ამ დროისთვის არ დაუკავებია.</h3>', '24', '', 'https://newsebi.ge/media/unnamed%20(1).jpg', '', '', 0, 'yachaghoba-ozurgetshi---80-tslis-qali-da-82-tslis-mamakaci-', 1583060171, '', 350, '', ''),
(214, '', 'უბედური შემთხვევა დედოფლისწყაროში ...', '<h3>&nbsp; &nbsp;დედოფლისწყაროში, მდინარეში, ორი კაცი დაიხრჩო. სამძებრო სამუშაოების შემდეგ მდინარე იორში 2 ადამიანის ცხელარი იპოვნეს. ინფორმაციას ადასტურებს საგანგებო სიტუაციების მართვის სამსახური. \'\'112 ში შემოვიდა ზარი სათევზაოდ წასული 2 ადამიანის შესახებ, რომლებიც მდინარეში გაუჩინარდნენ\'\'. ადგილზე მყოფებმა მდინარეში ჩავარდნილ ადამიანებს ვერ მიაგნეს და დახმარება გამოიძახეს.<br />&nbsp; &nbsp;გამოძიება სისხლის სამართლის კოდექსის 115 -ე მუსხლით მიმდინარეობს.<br /><br /></h3>', '22', '', 'https://newsebi.ge/media/unnamed%20(2).jpg', '', '', 0, 'ubeduri-shemtkhveva-dedoflistsyaroshi-', 1583066987, '', 356, '', ''),
(215, '', 'შემზარავი ტრაგედია ვინ არიან ბიჭები, რომლებიც  თევზაობისას ნავი გადაუბრუნდათ და წყალში დაიხრჩო ', '<p>გარდაცვლილების ახლობლები ამბობენ, რომ სავარაუდოდ ახალგაზრდებს თევზაობისას ნავი გადაუბრუნდათ, რის გამოც ერთერთი ბიჭი იხრჩობოდა, მეორემ კი მისი დახმარება სცადა, შედეგად, ორივე მათგანი წყალში გაუჩინარდა და სამაშველო სამსახურის გამოძახება გახდა საჭირო.<br /><br />ორივე გარდაცვლილი დედოფლისწყაროს მკვიდრია. ერთერთი სოფელ სამრეკლოს მკვიდრი 18 წლის თემურ უძილაურია, რომელსაც 5 მარტს 19 წელი შეუსრულდებოდა. მეორე კი ქალაქ დედოფლისწყაროს მკვიდრი 25 წლის დავით გიგოლაშვილია, რომელიც ვაშლოვანის ნაკრძალში რეინჯერად მუშაობდა. დაოჯახებული არც ის იყო.</p>', '27', '', 'https://newsebi.ge/media/%E1%83%91%E1%83%98%E1%83%AD%E1%83%94%E1%83%91%E1%83%98.jpg', '', '', 0, 'shemzaravi-tragedia-vin-arian-bichebi-romlebic--tevzaobisas-navi-gadaubrundat-da-tsyalshi-daikhrcho-', 1583090032, '', 3037, '', ''),
(216, '', 'ავარიას ფოთში ერთი ადამიანი ემსხვერპლა ...', '<h3>&nbsp; &nbsp;ერთი ადამიანი დაიღუპა ავარიის შედეგად ფოთში, კოკაიას ხეივნის მე-7 კილომეტრზე, მსუბუქი ავტომობილი სატვირთოს დაეჯახა. მსუბუქი ავტომობილის მძღოლი, 30 წლამდე მამაკაცი, ადგილზე გარდაიცვალა. გამოძიება სისხლის სამართლის კოდექსის 276 -ე მუხლის მე-6 ნაწილით მიმდინარეობს.</h3>', '22', '', 'https://newsebi.ge/media/unnamed%20(3).jpg', '', '', 0, 'avarias-fotshi-erti-adamiani-emskhverpla-', 1583137979, '', 409, '', ''),
(217, '', 'ქართველი მოჭიდავის მამა ტრიბუნაზე გარდაიცვალა ...', '<h3>29 თებერვალს რამდენიმე წარმატებული ასპარეზობის შემდეგ ლუკა მარიამიძე, თავისუფალის სტილით ჭიდაობაში, ნახევარ ფინალში გავიდა, რა&nbsp; დროსაც სამწუხარო ფაქტი მოხდა. ლუკას მამა, რომელიც შვილს ქომაგობდა, შეხვედრის დროს,ტრიბუნაზე, გულის შეტევით გარდაიცვალა. ლუკა ფინალში გავიდა. მიუხედავად მისი დიდი ტრაგედიისა მან ფინალურ ბრძოლაში მონაწილეობა მიიღო და საქართველოს ჩემპიონიც გახდა.&nbsp;</h3>', '21', '', 'https://newsebi.ge/media/3fb94773d162cf1aacfd656a8495efec.jpg', '', '', 0, 'qartveli-mochidavis-mama-tribunaze-gardaicvala-', 1583139014, '', 508, '', ''),
(218, '', 'მადრიდის რეალი - ბარსელონა 2-0', '<h3>&nbsp; &nbsp;დაძაბული და სანახაობრივი გამოდგა სანტიაგო ბერნაბეუზე გამართული \'\'ელ კლასიკო\'\'. ზინედინ ზიდანის შეგირდებმა მეტოქე 2 - 0 დაამარცხეს და სატურნირო ცხრილში პირველ ადგილზე გადავიდნენ. მადრიდის რეალმა მეორე ტაიმი მაღალ დონეზე ჩაატარა.&nbsp; 71 წუთზე მადრიდის რეალის შემტევმა, ვინიციუსმა, გაიტანა და მასპინძლები დააწინაურა, ხოლო მატჩში საბოლოო წერტილი მარიანომ დასვა, მან შემოსვლიდან ერთ წუთში გაიტანა და საბოლოო ანგარიში დააფიქსირა.<br />&nbsp; &nbsp;შეხვედრას რეალის ყოფილი ვარსკვლავი, კრისტიანო რონალდოც, დაესრო.&nbsp;</h3>', '21', '', 'https://newsebi.ge/media/c_3908172_1583100176.jpg', '', '', 0, 'madridis-reali---barselona-2-0', 1583140618, '', 412, '', ''),
(219, '', 'რუსეთში კორონავირუსის 6 შემთხვევა დადასტურდა  ...', '<p>რუსეთში კორონავირუსის 6 შემთხვევა დადასტურდა. ადგილობრივი მედიის ცნობით ვირუსული ინფექცია იტალიიდან დაბრუნებულ, რუსეთის მოქალაქეებს, დაუდასტურდა. ვირუსი მსუბუქ ფორმებში მიმდინარეობს და ამ&nbsp; დროისთვის მათი ჯანმრთელობის მდგომარეობა დამაკმაყოფილებელია.&nbsp;</p>\n<p>კორონა ვირუსის გავრცელების არეალი ყოველდღიურად იზრდება, დღეის მონაცემებით&nbsp;ინფიცირებულია 89 ათასზე მეტი, 45 ათასზე მეტი პაციენტი კი გამოჯანმრთელდა.</p>', '22', '', 'https://newsebi.ge/media/COVID-19%20(1).png', '', '', 0, 'rusetshi-koronavirusis-6-shemtkhveva-dadasturda--', 1583170135, '', 379, '', ''),
(220, '', '', '', '', '', '', '', '', 0, '', 1583699168, '', 525, '', ''),
(221, '', 'საქართველოში კორონავირუსით დაავადებულთა რიცხვი 15- მდე გაიზარდა...', '<p>&nbsp; &nbsp;საქართველოში კორონავირუსის მე-15 შემთხვევა დადასტურდა, ორივე დაავადებული იტალიასთან კავშირშია. მათი ჯანმთელობის მდგომარეობა დამაკმაყოფილებელია. ინფიცირებულებს, როგორც დაავადებულთა უმეტესობას მსუბუქი სიმპტომები აღენიშნებათ, თუმცა შედარებით დამძიმდა 2 პაციენტის მდგომარეობა. დაავადებულთა შორის არის დაავადებათა კონტროლის ცენტრის დირექტორის, ამირან გამყრელიძის, შვილი, რომელსაც შეხება ჰქონდა დაიმფიცირებულ ადამიანთან. \'\'ინფექციამ არ იცის ვინ ვისი შვილია\" -ამირან გამყრელიძე.<br />&nbsp; საქართველოში კორონავირუსის ზრდას ელიან. დაფიქსირდა 15 შემთხვევა, კარანტინშია 141 ადამიანი, ხოლო 51- ს აკვირდებიან.&nbsp;<br />&nbsp; მსოფლიოში კორონავირუსით დამიმფიცირებულთა რიცხვი 105 ათასს აცდა, 3594 კი იმსხვერპლა.<br />&nbsp; ადამიანებს სწამთ, რომ კორონავირუსი დათბობასთან ერთად გაქრება. თუმცა სმეციალისტები ამ ფაქტს ვერ ადასტურებენ, რადგან ვირუსი ახალია და ბოლომდე შესწავლილი არ არის.&nbsp;<br />&nbsp; მაქსიმალურად მოერიდეთ თავშეყრის ადგილებს, დაიცავით სისუფთავის ნორმები. თუ გაქვთ სიმპტომები, როგორიცაა: ტემპერატურა, ხველა , სისუსტე, სუნთქვის გაძნელება და სხვა ვირუსისთვის დამახასიათებელი სიმპტომები, დაუყონებლივ მიმართეთ ექიმს.&nbsp;</p>', '27', '', 'https://newsebi.ge/media/mqdefault.jpg', '', '', 0, 'saqartveloshi-koronavirusit-daavadebulta-rickhvi-15--mde-gaizarda', 1583744687, '', 517, '', ''),
(222, '', 'ცნობილი ინფექციონისტის ეს FB-პოსტი 1 მილიონზე მეტმა ადამიანმა გააზიარა', '<p>კანადელმა&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ინფექციონისტმა</span>&nbsp;სოციალურ ქსელში&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">კორონავირუსის</span>&nbsp;შესახებ პოსტი გამოაქვეყნა და საზოგადოებას მოუწოდა ვირუსის არ შეეშინდეთ.&nbsp;<a href=\"https://www.mirror.co.uk/lifestyle/health/coronavirus-doesnt-scare-infectious-disease-21658432?fbclid=IwAR2eqoZmvYHZbbB8ijvM87b2s_M0WHUJUKNm5-Xkfj3jza8I62VRPULkkGo\" target=\"_blank\" rel=\"noopener\">ამის შესახებ ინფორმაციას &bdquo;Mirror&ldquo; ავრცელებს.</a></p>\n<p><span class=\"nanospell-typo\" data-cke-bogus=\"true\">კორონავირუსის</span>&nbsp;ეპიდემიამ გლობალური პანიკის შექმნა გამოიწვია. ადამიანებმა სასწრაფოდ სუპერმარკეტებს მიაშურეს იმისთვის, რომ ყველა საჭირო პროდუქტი - ტუალეტის ქაღალდიდან დაწყებული სადეზინფექციო საშუალებებით დამთავრებული, რაც შეიძლება სწრაფად მოემარაგებინათ. ვირუსის გამო ბევრი მნიშვნელოვანი ღონისძიება გაუქმდა ან დროებით გადაიდო.</p>\n<p>მაგრამ, რეალურად რამდენად უნდა გვეშინოდეს ავადმყოფობის?</p>\n<p>მიუხედავად იმისა, რომ COVID-19 ბოლო პერიოდში საგრძნობლად გავრცელდა და ბევრი ადამიანის სიცოცხლე შეიწირა, კანადელი ინფექციონისტი, აბდუ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">შარკავი</span>&nbsp;საზოგადოებას მოუწოდებს პანიკის ნაცვლად, ფაქტებს დაუჯერონ.</p>\n<p>Facebook პოსტში კანადელი ინფექციონისტი განმარტავს, თუ რატომ არ ეშინია მას&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">კორონავირუსის</span>.</p>\n<p>&bdquo;პრაიმტაიმი&ldquo; პოსტის თარგმანს უცვლელად გთავაზობთ.</p>\n<p>&bdquo;20 წელზე მეტია, რაც ექიმი და ინფექციური დაავადებების სპეციალისტი ვარ. ამ დროის განმავლობაში უამრავი ავადმყოფი მინახავს. მე ვმუშაობდი ქალაქის შიდა საავადმყოფოებში, აფრიკის ყველაზე ღარიბ და მიყრუებულ ადგილებში.&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">აივ-შიდსი</span>, ჰეპატიტი, ტუბერკულოზი, მწვავე რესპირატორული სინდრომი ( SARS), წითელა, ჰერპესი, კრუნჩხვითი ხველება, დიფტერია - ეს იმ დაავადებათა მცირე ჩამონათვალია, რომლებსაც ამ წლების განმავლობაში შევხვედრივარ. მწვავე რესპირატორული სინდრომის გარდა, ძალიან ცოტა დაავადებას თუ შევუშინებივარ ან თავი&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მოწყვლადად</span>&nbsp;უგრძნობინებია.</p>\n<p>მე არ მეშინია Covid-19-ის. მე უფრო მეტად მაწუხებს ახალი ე.წ. ინფექციური აგენტის გავრცელება, რომელმაც მსოფლიო მოიცვა და რომელიც ფეხის მოკიდებას სხვადასხვა ნიადაგში ცდილობს. მაწუხებს მოხუცებულთა მდგომარეობა, რომელთა ჯანმრთელობაც შედარებით სუსტია და რომლებიც ამ პირობებში ყველაზე მეტად იტანჯებიან, მაგრამ მე არ მეშინია Covid-19-ის.</p>\n<p>ყველაზე მეტად იმ შიშის მეშინია, რომელიც მასობრივად გავრცელდა და საზოგადოება მოიცვა. იმ შიშის, რომელიც პანიკაში გადაიზარდა. მეშინია იმის, რომ N95 სამედიცინო ნიღბებს საავადმყოფოებიდან და გადაუდებელი დახმარების კლინიკებიდან იპარავენ. იმ ადგილებიდან, სადაც მათი არსებობა ყველაზე მნიშვნელოვანი და საჭიროა. ამის მაგივრად კი, სამედიცინო ნიღბებით სავსეა აეროპორტები, სავაჭრო ცენტრები, კაფეები, რაც საზოგადოებაში შიშს კიდევ უფრო აძლიერებს და ადამიანებიც ერთმანეთს ეჭვის თვალით&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">უწყებენ</span>&nbsp;ყურებას.</p>\n<p>მეშინია, რომ ჩვენი საავადმყოფოები გადაიტვირთება ისეთი ადამიანებით, რომლებიც ფიქრობენ: &bdquo; ვიცი, რომ არაფერი მჭირს, მაგრამ მაინც უნდა&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">გავესინჯო</span>, არავინ არ იცის რა შეიძლება მოხდეს&ldquo;. ადამიანები, რომლებსაც გულის უკმარისობა, პნევმონია აქვთ იდგებიან გრძელ რიგებში იმისთვის, რომ ექიმებმა შეამოწმონ.</p>\n<p>მე მეშინია, რომ ფრენებზე დაწესებული შეზღუდვები იმდენად შორს წავა, რომ ამის გამო ძალიან ბევრი ქორწილი გაუქმდება, უნივერსიტეტის გამოსაშვები საღამოები გადაიდება და ოჯახები ვეღარ გაერთიანდებიან.</p>\n<p>მე მეშინია, რომ ეს ეპიდემიური შიშები შეზღუდავს ვაჭრობას, დიდ ზიანს მიაყენებს სხვადასხვა სექტორში&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">თანამშრომლობებს</span>, დაარტყამს ბიზნესს და საბოლოო კულმინაციას გლობალურ ვარდნაში პოვებს.</p>\n<p>მაგრამ ყველაზე მეტად მაინც იმის მეშინია რას ვეუბნებით შვილებს მაშინ, როდესაც საფრთხის წინაშე დგებიან. იმის მაგივრად, რომ რაციონალურად და გონივრულად დაველაპარაკოთ, ვეუბნებით, რომ უნდა&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">დაპანიკდნენ</span>, ეშინოდეთ..</p>\n<p>ვირუსმა შეიძლება შემოაღწიოს ქალაქში, ჰოსპიტალში, მეგობრის სახლში, სამეზობლოში და&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">შენამდეც</span>&nbsp;კი მოვიდეს. ელოდე ამას და ნუ გაგიკვირდება. მაგრამ ფაქტი ისაა, რომ ვირუსი იმდენად დიდ ზარალს არ&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მოგვაყენებს</span>, როგორც ჩვენივე ქცევები იზამენ ამას. &bdquo;საკუთარი თავისთვის იბრძოლე და ყველაზე მაღლა დააყენე&ldquo; დამოკიდებულება კი, შესაძლოა, მართლაც დამღუპველი აღმოჩნდეს.</p>\n<p>ყველას გევედრებით, ჩაანაცვლეთ პანიკა და შიში მოთმინებითა და განათლებით. ჩვენ გვაქვს შესაძლებლობა ვისწავლოთ მეტი ჰიგიენისა და იმ წესების შესახებ, რომლითაც დაავადების გავრცელების შეზღუდვას შევძლებთ. მოდით, ამ გამოწვევას ერთად, სხვების მიმართ გამოვლენილი თანაგრძნობითა და მოთმინებით შევხვდეთ. ვეძებოთ ფაქტები, სიმართლე და არ ავყვეთ სპეკულაციას.</p>\n<p>ფაქტები და არა შიში. დაიბანეთ ხელები.&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">გაიხსენით</span>&nbsp;გულები.</p>\n<p>ჩვენი შვილები ამისთვის მადლობას გვეტყვიან&ldquo;,- წერს კანადელი ინფექციონისტი სოციალურ ქსელში.</p>\n<p>კანადელი&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ინფექციონისტის</span>&nbsp;ამ პოსტს მილიონზე მეტი გაზიარება და 470&nbsp;000 მოწონება აქვს.</p>\n<p>ადამიანები მას მადლობას უხდიან.</p>\n<p>&bdquo;შესანიშნავად გიწერია აბდუ, ასე განაგრძე ინფორმაციის გავრცელება&ldquo;,- წერს ერთ-ერთი მომხმარებელი.</p>\n<div class=\"embed\"><iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fabdu.sharkawy%2Fposts%2F2809958409125474&amp;width=500\" width=\"500\" height=\"293\" frameborder=\"0\" scrolling=\"no\"></iframe></div>', '22', '', 'https://newsebi.ge/media/abdu.jpg', '', '', 0, 'cnobili-infeqcionistis-es--posti-1-milionze-metma-adamianma-gaaziara', 1583784892, '', 1777, '', ''),
(223, '', 'კორონავირუსუს 8 ახალი შემთხვევა საქართველოში ...', '<p>&nbsp; &nbsp;საქართველოში კორონავირუსით ინფიცირებულთა რიცხვი 23-მდე გაიზარდა. ინფორმაცია ამის შესახებ საქართველოში კორონავირუსის გავრცელების პრევენციის მიზნით შექმნილ ვებგვერდზე გამოქვეყნდა.<br />&nbsp; &nbsp;ამ დრომდე ქვეყანაში კორონავირუსის 15 შემთხვევა იყო დარეგისტრირებული, ამჟამად კი ინფიცირებულთა რაოდენობა 23-მდე გაიზარდა.</p>\n<p>კარანტინის რეჟიმში ამ დროისთვის 126 ადამიანი იმყოფება, სტაციონარში მეთვალყურეობის ქვეშ კი 46 პაციენტი რჩება.<br />&nbsp; &nbsp;ჯანმოს დირექტორმა ტედროს ადჰანომ გებრეიესუსიმ განაცხადა, რომ ახალი კორონავირუსის პანდემიის საფრთხე რეალური გახდა.</p>', '27', '', 'https://newsebi.ge/media/ce0e9af7-269e-4818-b588-a38d09c4e635_640.jpg', '', '', 0, 'koronavirusus-8-akhali-shemtkhveva-saqartveloshi-', 1583866680, '', 1036, '', ''),
(224, '', 'აზერბაიჯანში, კორონავირუსით, ქალი გარდაიცვალა..', '<p>აზერბაიჯანში კორონავირუსით გარდაცვალების პირველი შემთხვევა დაფიქსირდა.</p>\n<p>ამის შესახებ ინფორმაციას აზერბაიჯანის ოპერატიული შტაბი ავრცელებს.</p>\n<p>გავრცელებული ინფორმაციით, გარდაიცვალა აზერბაიჯანის მოქალაქე, ქალბატონი, რომელიც ირანიდან დაბრუნდა, სადაც ქრონიკულ დაავადებებზე მკურნალობდა.</p>\n<p>კორონავირუსით ინფიცირების შემდეგ მას ქრონიკული დაავადებები გაუმწვავდა. ექიმებმა ვერ შეძლეს მისი გადარჩენა.</p>\n<p>გარდაცვლილი ქალბატონის ოჯახის წევრები და სხვა პირები, ვისთანაც კონტაქტი ჰქონდა, კარანტინში გადაიყვანეს.</p>\n<p>ჯანდაცვის მსოფლიო ორგანიზაციამ კორონავირუსთან დაკავშირებით პანდემია 2020 წლის 11 მარტს გამოცხადდა.</p>', '22', '', 'https://newsebi.ge/media/COVID-19%20(1).png', '', '', 0, 'azerbaijanshi-koronavirusit-qali-gardaicvala', 1584032982, '', 518, '', ''),
(225, '', 'იტალიაში საქართველოს 2 მოქალაქე გარდაიცვალა ...', '<p>იტალიაში ქართველი დედა-შვილი გაზის გაჟონვის შედეგად გარდაიცვალა.&nbsp;</p>\n<p>იტალიური მედიის&nbsp;ინფორმაციით, გარდაცვლილები 41 წლის ქალი და მისი 16 წლის შვილი არიან. შემთხვევა ქალაქ ბარიში მოხდა.</p>\n<p>გარდაცვლილები სახლში ოჯახის ახლობელმა აღმოაჩინა და პოლიციაში დარეკა. ექიმები კორონავირუსით გარდაცვალებას გამორიცხავენ. მიმდინარეობს გამოძიება.&nbsp;</p>\n<p>&nbsp;</p>', '22', '', 'https://newsebi.ge/media/polizia.jpg', '', '', 0, 'italiashi-saqartvelos-2-moqalaqe-gardaicvala-', 1584114748, '', 1665, '', ''),
(226, '', 'იტალიაში გარდაცვლილთა რიცხვმა 1250-ს გადააჭარბა', '<div class=\"overflow-hidden text-ellipsis padding-left-quarter avenir-bold\">იტალია</div>\n<div class=\"overflow-hidden text-ellipsis padding-left-quarter avenir-bold\">&nbsp;</div>\n<div class=\"overflow-hidden text-ellipsis padding-left-quarter avenir-bold\">დადასტურებული:<strong><span class=\"esriNumericValue\">15,113</span></strong></div>\n<div class=\"overflow-hidden text-ellipsis padding-left-quarter avenir-bold\">&nbsp;</div>\n<div class=\"overflow-hidden text-ellipsis padding-left-quarter avenir-bold\"><strong><span class=\"esriNumericValue\">გარდაცვლილია: 1266</span></strong></div>\n<div class=\"overflow-hidden text-ellipsis padding-left-quarter avenir-bold\">&nbsp;</div>\n<div class=\"overflow-hidden text-ellipsis padding-left-quarter avenir-bold\">&nbsp;</div>\n<div class=\"overflow-hidden text-ellipsis padding-left-quarter avenir-bold\">Italy</div>\n<div id=\"ember1230\" class=\"feature-description ember-view\">Confirmed:&nbsp;<span style=\"color: #dc143c;\"><strong><span class=\"esriNumericValue\">15,113</span></strong></span><br />Deaths:&nbsp;<strong><span class=\"esriNumericValue\">1,266</span></strong><br />Recovered:&nbsp;<strong><span style=\"color: #32cd32;\"><span class=\"esriNumericValue\">1,045</span>&nbsp;<br /></span></strong>Active:&nbsp;<span style=\"color: #ff8c00;\"><strong><span class=\"esriNumericValue\">13,052</span></strong></span></div>\n<div class=\"feature-description ember-view\">&nbsp;</div>\n<div class=\"feature-description ember-view\">&nbsp;</div>\n<div class=\"feature-description ember-view\">სტატისტიკა</div>\n<div class=\"feature-description ember-view\"><span style=\"color: #ff8c00;\"><strong><span class=\"esriNumericValue\">იხილეთ ლინკი:&nbsp;</span></strong></span><span style=\"color: #ff8c00;\"><strong><span class=\"esriNumericValue\"><a href=\"https://gisanddata.maps.arcgis.com/apps/opsdashboard/index.html#/bda7594740fd40299423467b48e9ecf6\">https://gisanddata.maps.arcgis.com/apps/opsdashboard/index.html#/bda7594740fd40299423467b48e9ecf6</a></span></strong></span></div>\n<div class=\"feature-description ember-view\">&nbsp;</div>\n<div class=\"feature-description ember-view\">&nbsp;</div>\n<div class=\"feature-description ember-view\">&nbsp;</div>', '27', '', 'https://newsebi.com/media/corona.png', '', '', 0, 'italiashi-gardacvlilta-rickhvma-1250-s-gadaacharba', 1584129819, '', 471, '', ''),
(227, '', 'ერთი ადამიანის სიცოცხლე  ემსხვერპლა ...', '<p>ურეკში მომხდარი ავტოსაგზაო შემთხვევის შედეგად ერთი ადამიანი გარდაიცვალა, ორი მძიმედ დაშავდა.</p>\n<p>თვითმხილველების ინფორმაციით, \"ტოიოტას\" მარკის ავტომობილი ჯერ მიკროავტობუსს, შემდეგ კი ორივე ინერციით \"მერსედესის\" მარკის ავტომობილს შეეჯახნენ.</p>\n<p>არსებული ინფორმაციით, ავტომობილში ბავშვებიც იმყოფებოდნენ. დაშავებულები ფოთის ჰოსპიტალში გადაიყვანეს.</p>\n<p>ექიმების ინფორმაციით, მათი ჯანმრთელობის მდგომარეობა დამაკმაყოფილებელია. მომხდარზე&nbsp;გამოძიება სისხლის სამართლის კოდექსის 276-ე მუხლის მე-6 პუნქტით დაიწყო.</p>', '22', '', 'https://newsebi.ge/media/%E1%83%9E%E1%83%9D%E1%83%9A%E1%83%98%E1%83%AA%E1%83%98%E1%83%90-%E1%83%A8%E1%83%A1%E1%83%A1-%E1%83%9E%E1%83%90%E1%83%A2%E1%83%A0%E1%83%A3%E1%83%9A%E1%83%98.jpg', '', '', 0, 'erti-adamianis-sicockhle--emskhverpla-', 1584377479, '', 1053, '', ''),
(228, '', 'კორონავირუსით იმფიცირებულთა რიცხვი 38 მდე გაიზარდა. ვრცლად >>>', '<p>&nbsp; კორონავირუსით დაინფიცირებულთა რაოდენობა 38-მდე გაიზარდა, ამის შესახებ ინფორმაცია stopcov.ge-ზე გამოქვეყნდა.</p>\n<p>საქართველოში კორონავირუსის 4 ახალი შემთხვევა დაფიქსირდა. მთავრობის მიერ შექმნილ ვებგვერდზე stopcov.ge&nbsp;&nbsp;განთავსებული ინფორმაციის მიხედვით, ინფიცირებულთა რაოდენობა ამ დროისთვის 38-ს შეადგენს.</p>\n<p>&nbsp; ინფექციური ცენტრის სამედიცინო დირექტორის მარინა ეზუგბაიას თქმით,&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">კორონავირუსის</span>&nbsp;4 ახალი შემთხვევიდან 2 პაციენტი ინფექციურ საავადმყოფოშია მოთავსებული და ისინი ძველი შემთხვევის კონტაქტებს წარმოადგენენ. აღნიშნული განცხადება მარინა&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ეზუგბაიამ</span>&nbsp;დღეს ინფექციურ საავადმყოფოსთან გააკეთა.</p>\n<p>\"მათთან შეინიშნება ტემპერატურის მატება დაბალი ციფრებით, მინიმალურად გამოხატული კლინიკაა,\" - განაცხადა&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">ეზუგბაიამ</span>.</p>\n<p>&nbsp; ინფექციური ცენტრის სამედიცინო დირექტორის განცხადებით,&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">კორონავირუსით</span>&nbsp;ბავშვების დაავადების მაჩვენებელი სხვა ქვეყნებთან შედარებით საქართველოში მაღალ პროცენტად ითვლება, თუმცა მისივე განმარტებით, ინფექციის მქონე არასრულწლოვანთა მდგომარეობა სტაბილურია.</p>\n<p>&nbsp; კარანტინის რეჟიმში ქვეყნის მასშტაბით 1130 ადამიანი იმყოფება, სტაციონარებში მეთვალყურეობის ქვეშ კი 81 ადამიანი რჩება.&nbsp;</p>', '22', '', 'https://newsebi.ge/media/COVID-19%20(1).png', '', '', 0, 'koronavirusit-imficirebulta-rickhvi-38-mde-gaizarda-vrclad-', 1584519315, '', 1127, '', ''),
(229, '', '2013 წელი, ლელა კაკულიას წინასწარმეტყველება კორონავირუსზე (ვიდეო) ...', '<p><video controls=\"controls\" width=\"300\" height=\"150\">\n<source src=\"/media/20200322_192200_001.mp4\" type=\"video/mp4\" /></video></p>', '22', '', 'https://newsebi.ge/media/news_53844-681x397.jpg', '', '', 0, '2013-tseli-lela-kakulias-tsinastsarmetyveleba-koronavirusze-video-', 1584895239, '', 2084, '', ''),
(230, '', 'COVID 19-ით საქართველოში გარდაცვალების პირველი შემთხვევა დაფიქსირდა ...', '<p>საქართველოში&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">კორონავირუსით</span>&nbsp;პაციენტი გარდაიცვალა. გარდაცვლილი 78 წლის ქალია. ის მკურნალობას საუნივერსიტეტო კლინიკაში გადიოდა.</p>\n<p>პაციენტის ისტორია&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">მარნეული-ბოლნისის</span>&nbsp;<span class=\"nanospell-typo\" data-cke-bogus=\"true\">კლასტერს</span>&nbsp;უკავშირდება.</p>\n<p>საუნივერსიტეტო&nbsp;კლინიკის ხელმძღვანელის&nbsp;ლევან რატიანის თქმით, ქალი გულის უკმარისობა და სუნთქვის გაძნელება აღენიშნებოდა. ის კლინიკაში 31 მარტს მოათავსეს.</p>', '22', '', 'https://newsebi.ge/media/COVID-19%20(1).png', '', '', 0, '-19-it-saqartveloshi-gardacvalebis-pirveli-shemtkhveva-dafiqsirda-', 1585994745, '', 631, '', ''),
(231, '', 'საქართველოში COVID 19-ით მესამე ადამიანი გარდაიცვალა ... ', '<p>კორონავირუსით საქართველოში მესამე ადამიანი გარდაიცვალა. გარდაცვლილი 86 წლის ქალია, რომელიც ყველაზე მძიმე პაციენტი იყო. მას ქონდა თანხლები მძიმე დაავადებები : მძიმე ორმხრივი პლევმონია, მას პრაქტიკულად არქონდა დარჩენილი ჯანმრთელი ფილტვის ქსოვილი, ქონდა მძიმე სეფსისი და კიდევ სხვა გართულებები. განაცხადა თენგიზ ცერცვაძემ.</p>', '22', '', 'https://newsebi.ge/media/mqdefault.jpg', '', '', 0, 'saqartveloshi--19-it-mesame-adamiani-gardaicvala--', 1586272318, '', 512, '', ''),
(235, '', 'ზესტაფონში კორონავირუსის შემთხვევა ???', '<p>დაუდასტურებელი იმფორმაციით, ზესტაფონში კორონა ვისრუსის ერთი შემთხვევა დაფიქსირდა. დაავადებული სატვირტო ავტომობილის მძღოლია, რომელიც ზესტაფონის ერთ ერთ სამედიცინო ცენტრში იმყოფებოდა. ასევე დაუდასტურებელი ინფორმაციით, მას აქტიური შეხება ქონდა ზესტაფონის ბაზართან. სხვა დეტალებ უცნობია.&nbsp;</p>', '22', '', 'https://newsebi.ge/media/much-than-37.jpg', '', '', 0, 'zestafonshi-koronavirusis-shemtkhveva-', 1589959543, '', 2312, '', ''),
(237, '', 'რა შეზღუდვები დარჩება საგანგებო მგომარეობის გაუქმების შემდეგ. ვრცლად ...', '<p>საქართველოს პრემიერ მინისტრის, გიორგი გახარიას, განცხადებით საჭიროა ეფექტურად და ფრთხილად დავუბრუნდეთ ნომალურ ცხოვრებას, ამიტომ მთავრობამ მიიღო გადაწყვეტილება გაუქმდეს კომენდანტის საათი და საგანგებო მგომარეობა. თუმცა, შეზღუდვები, როგორიცაა:&nbsp; პირბადის ტარება დახურულ სივცეში და სოციალური დისტანცია, საკმადოდ დიდხანს გაგძელდება.&nbsp;</p>', '22', '', 'https://newsebi.ge/media/0779b6c80d233dbdd3c0d1b1e9b60f4a.jpg', '', '', 0, 'ra-shezghudvebi-darcheba-sagangebo-mgomareobis-gauqmebis-shemdeg-vrclad-', 1590047294, '', 787, '', '');
INSERT INTO `trainings` (`id`, `source`, `title`, `text`, `category`, `scraped_at`, `img`, `origin_date`, `tags`, `comments_number`, `slug`, `date`, `origin_url`, `views`, `keywords`, `description`) VALUES
(238, '', 'კორონა პანდემია და შიმშილი. საგანგაშო სტატისტიკა', '<p>ყოველწლიურად მსოფლიოსი შიმშილით 9 მილიონამდე ადამიანი იღუპება. ეს გაცილებით მეტია ვიდრე ტუბერკულიოზის , მალარიისა და შიდსის დაღუპულთა რაოდენობა ერთად. 2020 წლის მონაცემები ,ასევე, საგანგაშო და სამწუხაროა. წელს მსოფლიოსი შიმშილით 3,4 მილონზე მეტი ადამიანი გარდაიცვალა. კორონა ვირუსით ინფიციერებულები 5 მილიონს აჭარბებს, ხოლო გარდაცვლილა 329,925 ადამიანი.<br />საქართველოში, სადაც ისედაც ძვირი პროდუქტების, გაზრდილი გადასახადების და გაზრდილი პროცენტების გამო უამრავი ადამიანი შიმშილობს, მგომარეობა პანდემიის პირობებში კიდევ უფრო დამძიმდა. ხალხის დიდმა ნაწილმა სამსახური დაკარგა. ეკონომიკა პრაქტიკულად გაჩერდა, მოშიმშილე ადამიანებს კიდევ ბევრი ადამიანი დაემატა.&nbsp;<br />&nbsp; ამგვარად, შიმშილით 2020 წელს 10 ჯერ მეტი ადამიანი დაიღუპა ვიდე კოვიდ 19 ით.&nbsp;</p>', '25', '', 'https://newsebi.ge/media/12Sharma-mediumSquareAt3X.jpg', '', '', 0, 'korona-pandemia-da-shimshili-sagangasho-statistika', 1590052457, '', 562, '', ''),
(240, '', 'ირაკლი კობახიძემ გიგა ბოკერია \'\'ნომერ პირველ გოიმად\'\' მოიხსენია...', '<p>&bdquo;ძალიან მარტივად არის ყველაფერი. გოიმურად გამოიყურებიან, გოიმურად იქცევიან, შესაბამისად, მეტი არაფერია გოიმობა და ამ&nbsp;<span class=\"nanospell-typo\">გოიმობის</span>&nbsp;გამო ისინი მიიღებენ პასუხს საზოგადოებისგან. გოიმობა, მგონი, ყველამ კარგად იცის, რას ნიშნავს და ამას განმარტება არ სჭირდება. მგონი, საქართველოში არ არის ადამიანი, ვინც არ იცის, რა არის გოიმობა და ასევე საზოგადოებამ იცის, რას ნიშნავს გოიმური ქცევა, გოიმური საუბარი. ეს ყველაფერი ვნახეთ &bdquo;ლეიბორისტული პარტიის&ldquo; ოფისში რამდენიმე დღის წინ. პოლარიზებას უწყობს ხელს ერთადერთი რამ &ndash; კრიმინალები პოლიტიკაში. ბუნებრივია, ეს ეპოქა საქართველოში ერთხელ და სამუდამოდ უნდა დასრულდეს, როდესაც რჩებიან კრიმინალები პოლიტიკაში და ჩვენ ყველაფერს გავაკეთებთ ამისთვის. გიგა ბოკერია არის ნომერ პირველი გოიმი ამ გოიმების სპექტრში&ldquo; - განაცხადა ირაკლი კობახიძემ&nbsp;</p>', '19', '', 'https://newsebi.ge/media/BeFunky-Collage-4.jpg', '', '', 0, 'irakli-kobakhidzem-giga-bokeria-nomer-pirvel-goimad-moikhsenia', 1590063677, '', 604, '', ''),
(243, '', 'დღეიდან სტომატოლოგიურმა კლინიკებმა მუშაობა განაახლეს. წესები რომელიც უნდა დავიცვათ ..', '<p>დღეისათვის, სამედიცინო საქმიანობის რეგულირების სააგენტომ, 164 კლინიკას საქმიანობის განხორციელების უფლება მიცა. პაციენტებს კლინიკაში გაზრდილი ფასები და მთელიცი რიგი მოთხოვნები ხვდება. კერძოდ, ყველა ადამიანმა: , აუცილებლად, უნდა გაიაროს თერმო სკრინინგი,&nbsp;უნდა გაიკეთონ ნიღბები, დამცავი სათვალე და ბახილები.<br />&nbsp; სტომატოლოგიური კლინიკების დიდმა ნაწილმა მომსახურეობა გააძვირა და მიზეზად მათთვის დაწესებული ახალი რეგულაციები დაასახელა:&nbsp;ბარიერები, თერმოსკრინინგის აპარატი, ნიღბები და სხვა ინვენტარი, რომელთა შეძენა მათ კოვიდ 19 ის პრევენციის მიზნით მოუხდათ.&nbsp;</p>', '22', '', 'https://newsebi.ge/media/pr2.jpg', '', '', 0, 'dgheidan-stomatologiurma-klinikebma-mushaoba-ganaakhles-tsesebi-romelic-unda-davicvat-', 1590132701, '', 842, '', ''),
(244, '', 'ავტომობილით 3 ზე მეტი ადამიანის მგზავრობა იხსნება !? ვრცლად ...', '<p>&nbsp;3 კაცის გადაყვანის შეზღუდვა მხოლოდ ტაქსებზე გავრცელდება, - ამის შესახებ პრემიერ-მინისტრმა საკოორდინაციო საბჭოს სხდომაზე განაცხადა.<br />&nbsp;&bdquo;შეზღუდვები გრძელდება საჰაერო და სახმელეთო მიმოსვლაზე. რესტორნები ადგილზე მომსახურებით ვერ იმუშავებენ. სავაჭრო ცენტრები, კერძოდ კი მოლები, დახურული რჩება. სპორტულ-გამაჯანსაღებელი აქტივობები დახურული რჩება&ldquo;, - განაცხადა გიორგი გახარიამ&nbsp;</p>', '22', '', 'https://newsebi.ge/media/6u8o7ne8.jpg', '', '', 0, 'avtomobilit-3-ze-meti-adamianis-mgzavroba-ikhsneba--vrclad-', 1590134092, '', 1034, '', ''),
(247, '', 'ამერიკელი პოლიციელები დამნშავეებს არ ინდობენ. ვიდეო... 18+', '<p>ამერიკაში ძალიან გახშირდა თავდასხმები პლიციელებზე, რამაც მათი ნაწილი სიცოცხლის მოსპობა გამოიწვია. აღნისნული პრობლემის პრევენცია ასე ხდება...<br /><video controls=\"controls\" width=\"528\" height=\"264\">\n<source src=\"/media/10000000_912303702536556_659096081990784654_n.mp4\" type=\"video/mp4\" /></video></p>\n<p>&nbsp;</p>', '24', '', 'https://newsebi.ge/media/TIMESSQUARE-3-articleLarge.jpg', '', '', 0, 'amerikeli-policielebi-damnshaveebs-ar-indoben-video-18', 1590148368, '', 1029, '', ''),
(248, '', 'საქართველომ კორონა ვირუსის სტატისტიკა გააყალბა?', '<p>&nbsp; &nbsp;სომხეთის ჯანდაცვის მინისტრი საქართველოს სტატისტიკას ეჭვქვეშ აყენებ და ამბობს , რომ საქართველოში ბევრად მეტი ინფფიცირებული ვიდრე ამას მთავრობა ამბობს.&nbsp;<br />ამ განცხადებას, საქართველოს დაავადებათა კონტროლის ეროვნული ცენტრის ხელმძღვანელმა,ამირან გამყრელიძემ, უპასუხა.<br />&nbsp;&nbsp;\"ჯერ დასადასტურებელია, ნამდვილად იყო თუ არა ასეთი განცხადება, იმიტომ, რომ მე ვიცნობ პირადად ბატონ არსენ ტოროსიანს და ცოტა მიკვირს მისგან თუ ეს განცხადება ამ რაკურსით გაკეთდა. მოგეხსენებათ, ჩვენ ძალიან ახლო ერები ვართ, მეზობლები, დიდი ხნის ისტორია გვაქვს და ცოტა მეუცხოვა მისგან ამ ტიპის არადიპლომატიური&nbsp;განცხადება, იმიტომ რომ თუ ასეთი შემთხვევები იყო, რომ აქედან ჩასულ მძღოლს თუ კიდევ სხვას, დაუდგინდა ინფექცია, ანუ საქართველოს მოქალაქეებს, მაშინ ჩვენც და სომხეთიც ვართ ჯანდაცვის მსოფლიო ორგანიზაციის ჯანმრთელობის საერთაშორისო წესების კონვენციის ხელმომწერები,\"</p>', '20', '', 'https://newsebi.ge/media/a58d2e069a278a887902762de5f45ade.png', '', '', 0, 'saqartvelom-korona-virusis-statistika-gaayalba', 1590217646, '', 1611, '', ''),
