(252, '', 'ნიკოლოზ ბასილაშვილი პოლიციამ დააკავა. მას ყოფილ ცოლზე ძალადობა ბრალდება. ვიდეო... ', '<p><video controls=\"controls\" width=\"512\" height=\"256\">\n<source src=\"/media/10000000_2648071015515571_4491991903021301472_n.mp4\" type=\"video/mp4\" /></video></p>\n<p><strong>წყარო : მთავარი არხი</strong>&nbsp;</p>', '20', '', 'https://newsebi.ge/media/42086248_1072013662974419_5385720630760964096_o-1537278552-1024x603.jpg', '', '', 0, 'nikoloz-basilashvili-policiam-daakava-mas-yofil-colze-dzaladoba-braldeba-video-', 1590310774, '', 526, '', ''),
