(254, '', 'როდის მოიხსნება საზოგადოებრ ტრანპორტზე შეზღუდვა? ვრცლად...', '<p>მთავრობა საზოგადოებრივ ტრანსპორტთან დაკავშირებითაც ეპიდემიოლოგების რეკომენდაციას ელოდება და ვითარების ანალიზის საფუძველზე მიიღებენ ტრანსპორტის მოძრაობის აღდგენის გადაწყვეტილებას, რითაც დადგენილებაში ცვლილებები განხორციელდება. მთავრობაში აცხადებენ, რომ შეზღუდვები ეპიდსიტუაციიდან გამომდინარე, ნებისმიერ დროს შეიძლება მოიხსნას. მმართველვა გუნდმა გარკვეული შეზღუდვები ქვეყანაში დატოვა, რაც ძალაშია 15 ივლისამდე.</p>\n<p>&nbsp;</p>', '22', '', 'https://newsebi.ge/media/1.png', '', '', 0, 'rodis-moikhsneba-sazogadoebr-tranportze-shezghudva-vrclad', 1590353546, '', 837, '', ''),
(255, '', 'ვინ არის ნიკოლოზ ბასილაშვილის ყოფილი მეუღლე, რომელიც მას ძალადობაში ადანაშაულებს? ', '<p><strong>&nbsp;ნიკოლოზ ბასილაშვილი 2013 წელს, 21 წლის ასაკში, მოდელ ნეკა დოროყაშვილზე დაქორწინდა.&nbsp; 2015 წელს&nbsp;ვაჟი შეეძინათ.<br /><br /><img src=\"/media/67630032_2864747986885158_8525888331739824128_o.jpg\" alt=\"\" width=\"324\" height=\"552\" /><br /><br /></strong></p>\n<p><strong>მათ ერთმანეთი სამგობრო წრეში გაიცნეს. ერთმანეთი შეუყვარდათ, რაც ქორწილით დაგვირგვინდა.<br /><br /><img src=\"/media/10806448_989097801116862_5921615078470708435_n.jpg\" alt=\"\" width=\"359\" height=\"359\" /><br /><br />ნიკოლოზ ბასილაშვილს მან ბრალი ძალადობაში დასდო. ჩოგბურთელი ბრალს არ აღიარებს და სამართლიან განაჩენს ელოდება.&nbsp;<br />\'\' რაც შეეხება, 22 მაისს, განვითარებულ მოვლენებს, ვიმედოვნებ ყველა დეტალი გაირკვევა, ახლა უკვე სასამართლოში და დადგება სამართლიანი განაჩენი, მანამდე კი, არ მსურს ვისაუბრო ჩემს პირად სივრცეზე. არ ვაპირებ საჯარო დისკუსიაში შევიდე ჩემს ყოფილ მეუღლესთან და ვამტკიცო ის, რაც ნამდვილად არ ყოფილა\'\'.<br />&nbsp;<img src=\"/media/11745416_1130994363593871_7380068615653977839_n.jpg\" alt=\"\" width=\"432\" height=\"429\" /></strong></p>', '20', '', 'https://newsebi.ge/media/67736264_2867165963310027_5147537721803145216_o.jpg', '', '', 0, 'vin-aris-nikoloz-basilashvilis-yofili-meughle-romelic-mas-dzaladobashi-adanashaulebs-', 1590385848, '', 668, '', ''),
(256, '', 'სომხეთის ჯანდაცვის მინისტრმა საქართველოზე განცხადება გააკეთა!!!', '<p>სომხეთის ჯანდაცვის მინისტრმა საქართველო ინფიცირებულების რიცხვის გაყალბებასი დაადანაშაულა, რასაც მკაცრი კრიტიკა მოყვა საართველოდან. თენგის ცერცვაძის განცხადებით ტოროსიანს ბოდიში აქვს მოსახდელი აღნიშნული განცხადების გამო. ბოდიშმა არ დააყოვნა. მისმა პრეს-სპიკერმა ალინა ნიკოგოსიანმა მინისტრის პოზიცია საჯაროდ გაავრცელა. \'\'<strong>ვწუხვართ ჯანდაცვის მინსიტრის მხრიდან გაკეთებულ კომენტარზე, რომელმაც გაუგებრობა &nbsp;და პოლიტიკური სპეკულაცია გამოიწვია.\'\'</strong></p>', '20', '', 'https://newsebi.ge/media/76f5e8fd196b4acf90f854d4fe81dc21.jpg', '', '', 0, 'somkhetis-jandacvis-ministrma-saqartveloze-ganckhadeba-gaaketa', 1590430813, '', 643, '', ''),
(257, '', 'თეა წულუკიანმა, ნაციონალურ მოძრაობაზე, სკანდალური განცხადება გააკეთა...', '<p>&bdquo;ეს გადაცემა არ ეყოფა იმის ანალიზს, თუ რა გააკეთეს მათ, რითაც თავს იწონებენ.ხშირადაა საუბარი პატრულზე, იუსტიციის სახლებზე. ეს ყველაფერი იყო ზედაპირული წამოწყებები და ამას არანაირი სერიოზულობის კვალი არ ჰქონდა. მათ არ გაუტარებიათ არც ერთი ძირეული საკანონმდებლო რეფორმა. ისინი ნიჩბით ყრიდნენ ბავშვებს ციხეში. როდესაც ხელისუფლება არ ზრუნავს ბავშვზე და მას იმეტებს ციხისთვის, რა თქმა უნდა, არ უნდა გაგვიკვირდეს, რომ ეს ხელისუფლება საკნის ფანჯარაში კალაშნიკოვს შეყოფს და პატიმრებს ამოხოცავს. ამაზე რამდენიმე კვირის წინ სტრასბურგის სასამართლომ დარღვევის გადაწყვეტილებაც დაადგინა&ldquo;. განაცხადა თეა წულუკიანმა.&nbsp;</p>', '20', '', 'https://newsebi.ge/media/4jg42mfvo7082xv.jpg', '', '', 0, 'tea-tsulukianma-nacionalur-modzraobaze-skandaluri-ganckhadeba-gaaketa', 1590525574, '', 3569, '', ''),
(258, '', 'გიორგი გახარია ოპოზიციას აკრიტიკებს: \'\' გახსენით წიგნი, რაღაცა წაიკითხეთ“', '<div class=\"news-text\">\n<p>&bdquo;25 მილიონით ხარჯები გაიზარდა იმიტომ, რომ სასწრაფო დახმარების მთლიანი სტრუქტურა მერიიდან გადავიდა ჯანდაცვის სამინისტროში. ბიუროკრატიულ ხარჯებზე როცა ვსაუბრობთ, ეს დროშა რომ გიჭირავთ და აქნევთ, IMF-ის მონაცემებით, საქართველო ბიუროკრატიული ხარჯებით, მშპ-სთან შედარებით, არის მეორე ადგილზე. პირველ ადგილზე არის სინგაპური, მეორეზე &ndash; საქართველო. გახსენით წიგნი, რაღაცა წაიკითხეთ&ldquo;. განაცხადა გიორგი გახარიამ.</p>\n</div>\n<div class=\"social-block\">\n<div class=\"fb-like fb_iframe_widget\" data-href=\"http://imedinews.ge/ge/politika/144875/giorgi-gakharia-opozitsias-drosha-rom-gichiravt-da-aqnevt-gakhsenit-tsigni-ragatsa-tsaikitkhet\" data-layout=\"button_count\" data-action=\"like\">&nbsp;</div>\n<div class=\"fb-share-button fb_iframe_widget\" data-href=\"http://imedinews.ge/ge/politika/144875/giorgi-gakharia-opozitsias-drosha-rom-gichiravt-da-aqnevt-gakhsenit-tsigni-ragatsa-tsaikitkhet\" data-layout=\"button\">\n<div class=\"news-text\">\n<p>&nbsp;</p>\n</div>\n<div class=\"social-block\">&nbsp;</div>\n</div>\n</div>', '19', '', 'https://newsebi.ge/media/6u8o7ne8.jpg', '', '', 0, 'giorgi-gakharia-opozicias-akritikebs--gakhsenit-tsigni-raghaca-tsaikitkhet', 1590608682, '', 771, '', ''),
(259, '', 'ბიძინა ივანიშვილმა 2012 წელს დეგრადირებური, მოძალადე მთავრობა ჩამოშორა ქვეყანას. ირაკლი კობახიძე ', '<p>&bdquo;2011 წლიდან ბიძინა ივანიშვილი ოპოზიციის თავდასხმის მთავარი ობიექტია. ამის პირველი მიზეზია, რომ მან შეძლო ის, რაც წლების მანძილზე ვერ ხერხდებოდა და ქვეყნის ცხოვრებაში დემოკრატიული გარდატეხა შეიტანა. მან ქვეყანას აბსოლუტურად დეგრადირებული პოლიტიკური ძალა ჩამოაშორა, რომელიც მთლიანად ძალადობასა და აგრესიაზეა დაფუძნებული. სწორედ ეს ვერ აპატიეს დღემდე ბიძინა ივანიშვილს&ldquo; განაცხადა კობახიძემ.</p>', '19', '', 'https://newsebi.ge/media/2225666118327632500970188730240151322179260o.jpg', '', '', 0, 'bidzina-ivanishvilma-2012-tsels-degradireburi-modzalade-mtavroba-chamoshora-qveyanas-irakli-kobakhidze-', 1590694286, '', 721, '', ''),
(260, '', 'ოზურგეთის ერთ ერთ სოფელში 6 წლის ბავშვის ცხედარი იპოვნეს. ', '<p>ოზურგეთის სოფელ გურიანთაში ექვსი წლის ბიჭი, სახლიდან დაახლოებით ერთ კილომეტრში, გარდაცვლილი იპოვეს. არსებული იუნფორმაციის თანახმად მცირეწლოვანი დაგუბბულ წყალში დაიხრჩო.&nbsp;<br />შინაგან საქმეთა სამინისტროს ინფორმაციით, მომხდარზე გამოძიება სისხლის სამართლის კოდექსის 115-ე მუხლით მიმდინარეობს, რაც თვითმკვლელობამდე მიყვანას გულისხმობს.</p>', '22', '', 'https://newsebi.ge/media/unnamed%20(1).jpg', '', '', 0, 'ozurgetis-ert-ert-sofelshi-6-tslis-bavshvis-ckhedari-ipovnes-', 1590866685, '', 636, '', ''),
(261, '', 'როგორ გაჩნდა კორონა ვირუსი? ახალი ვერსია ...იხილეთ დღეის მდგომარეობა საქართველოში', '<p>&bdquo;თავიდან ვფიქრობდით, რომ ვირუსი ზღვის პროდუქტების ბაზრობაზე გაჩნდა, მაგრამ ანალიზებით ეს არ დადასტურდა. სამაგიეროდ, ჩვენ აღმოვაჩინეთ ვირუსის კვალი ჩამდინარე წყლის ნიმუშებში. შესაბამისად, არ არის გამორიცხული, რომ ვირუსი უხანის ბაზრობაზე გამოჩენამდეც არსებობდა&ldquo; - განაცხადა, ჩინეთის დაავადებათა კონტროლისა და პროფილაქტიკის ცენტრის დირექტორმა, გაო ფუმ.<br />&nbsp;შეგახსენებთ, დღეს კორონავირუსით კიდევ 26 ადამინანი დაიმფიცირდა, აქედან 18 ბოლნისის კლასტერს მიეკუტვნება, 4 საკარანტინო ზონიდან არის, ხოლო ოთხი საბურთალოს კორპუსიდან. ამირან გამყრელიძის განცხადებით ჩვეულ რიტმში დაბრუნებას მოჰყვება დადასტურებული შემთხვევების მატება, თუმცა ეს საშიში არ რის და პანიკის საფუძველიც არ ასებობს.</p>', '22', '', 'https://newsebi.ge/media/0779b6c80d233dbdd3c0d1b1e9b60f4a.jpg', '', '', 0, 'rogor-gachnda-korona-virusi-akhali-versia-ikhilet-dgheis-mdgomareoba-saqartveloshi', 1590954473, '', 1002, '', ''),
(262, '', 'საზარელი შემთხვევა სოფელ ვერხვიანში ...', '<p>საგარეჯოს სოფელ ვერხვიანში&nbsp;უბედური შემთხვევა მოხდა. 70 წლამდე ქალი ანთებულ თონეში ჩავარდა და გარდაიცვლა.&nbsp;</p>\n<p>ადგილობრივების თქმით ფაქტი ახლობლბმა გვიან გაიგეს და დახმარება ვერ გაუწიეს, რის&nbsp;გამოც ქალი დამწვრობის შედეგად ადგილზე გარდაიცვალა. &nbsp;</p>\n<p>შემთხვევის ადგილზე ექსპერტ- კრიმინალისტები მუშაობდნენ.&nbsp;საქმეზე დაწყებულია გამოძიება.</p>', '22', '', 'https://newsebi.ge/media/%E1%83%9E%E1%83%9D%E1%83%9A%E1%83%98%E1%83%AA%E1%83%98%E1%83%90-%E1%83%A8%E1%83%A1%E1%83%A1-%E1%83%9E%E1%83%90%E1%83%A2%E1%83%A0%E1%83%A3%E1%83%9A%E1%83%98.jpg', '', '', 0, 'sazareli-shemtkhveva-sofel-verkhvianshi-', 1597071002, '', 811, '', ''),
(263, '', 'შეცდომა საკრანტინო სივრცეში, რომელმაც შეიძლება პრობლემები გამოიწვიოს...', '<p>გუდაურის საკარანტინო სივრცეში ანალიზების არევის გამო ნინოწმინდის მუნიციპალიტეტის სოფელ&nbsp;<span class=\"nanospell-typo\">ყაურმაში</span>&nbsp;<span class=\"nanospell-typo\">კორონავირუსით</span>&nbsp;ინფიცირებული კაცი მოხვდა. ის რუსეთიდან 20 დღის წინ ჩამოვიდა და კარანტინის გავლის შემდეგ სოფელში 31 მაისს დაბრუნდა. სპეციალისტებმა შეცდომა 2 დღის შემდეგ აღმოაჩინეს და 44 წლის კაცი კლინიკაში გადაიყვანეს.</p>\n<p>ინფორმაცია&nbsp;ნინოწმინდის მერმა, ანა&nbsp;<span class=\"nanospell-typo\">მოსოიანმა</span>&nbsp;დაადასტურა. მისი თქმით, ახლა კაცი გორშია&nbsp;<span class=\"nanospell-typo\">გამოკვლებეზე</span>. მან სახლში 2 დღე გაატარა, რის გამოც მისი ოჯახის წევრები თვითიზოლაციაში იმყოფებიან.</p>', '20', '', 'https://newsebi.ge/media/o_2411039_1024.jpg', '', '', 0, 'shecdoma-sakrantino-sivrceshi-romelmac-sheidzleba-problemebi-gamoitsvios', 1597071055, '', 661, '', ''),
(264, '', 'საქართველოში კორონავირუსით კიდევ ერთი პაციენტი გარდაიცვალა ...', '<p>კორონავირუსით საქართველოში მეცამეტე ადამიანი გარდაიცვალა, რომელიც მკურნალობას თბილისის რესპუბლიკურ საავადმყოფოში გადიოდა. ინფორმაცია რესპუბლიკური საავადმყოფოს ხელმძღვანელმა ლევან გოფოძემ დაუდასტურა. მისი თქმით, გარდაცვლილი მამაკაცია, ის კრიტიკულად მძიმე პაციენტი იყო. სხვა დეტალები ჯერჯერობით უცნობია.&nbsp;</p>', '22', '', 'https://newsebi.ge/media/COVID-19%20(1).png', '', '', 0, 'saqartveloshi-koronavirusit-kidev-erti-pacienti-gardaicvala-', 1597070950, '', 601, '', ''),
(265, '', 'ლიბანში უძლიერესი ბომბი აფეთქდა', '<p>ლიბანში&nbsp; აფეთქდა უძლიერესი ბომბი, რომელმაც ქალაქი მაშტაბურად დააზიანა.</p>\n<p>10 კაცი გარდაიცვალა</p>\n<p>2500 დაიჭრა</p>\n<p>დაზარალებულთა რიცხვი გაიზრდება</p>\n<p>ბომბმა სრულიად გაანადგურა პორტი</p>\n<p>&nbsp;</p>\n<p><iframe src=\"//www.youtube.com/embed/yfHNZAV0euA\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p>&nbsp;</p>\n<p><img src=\"/media/news/download.jpg\" alt=\"\" width=\"292\" height=\"173\" />&nbsp;</p>\n<p><img src=\"/media/news/5f2984e92618b973d34e5172.jpg\" alt=\"\" width=\"747\" height=\"374\" /></p>\n<p>&nbsp;</p>', '22', '', 'https://newsebi.ge/media/news/Untitled.png', '', '', 0, 'libanshi-udzlieresi-bombi-afetqda', 1596573796, '', 146, '', ''),
(266, '', 'COVID ვირუსით ინფიცირებულთა რიცხვი 23.09.2020 თარიღის მდგომარეობით ', '<p>&nbsp;</p>\n<ul>\n<li class=\"statistic-square\">კორონავირუსის დადასტურებული შემთხვევა -&nbsp;<span class=\"quantity-numver\">4140</span></li>\n<li class=\"statistic-circleGreen\">მათ შორის გამოჯანმრთელებული -&nbsp;<span class=\"quantity-numver\">1643</span></li>\n<li class=\"statistic-circleRed\">მათ შორის გარდაცვლილი -&nbsp;<span class=\"quantity-numver\">24</span></li>\n<li class=\"statistic-square\">კარანტინის რეჟიმში -&nbsp;<span class=\"quantity-numver\">5390</span></li>\n<li class=\"statistic-square\">სტაციონარში მეთვალყურეობის ქვეშ -&nbsp;<span class=\"quantity-numver\">836</span></li>\n<li class=\"statistic-square\">კოვიდ სასტუმროში მყოფი პირები -&nbsp;<span class=\"quantity-numver\">640</span></li>\n<li class=\"statistic-square\">*უცხოეთიდან სამკურნალოდ გადმოყვანილი საქართველოს მოქალაქეები -&nbsp;<span class=\"quantity-numver\">41</span></li>\n</ul>\n<p style=\"padding-left: 30px;\">&nbsp;</p>\n<p style=\"padding-left: 30px;\">&nbsp;</p>\n<p><span class=\"quantity-numver\">წყარო იხილეთ ბმულზე:</span></p>\n<p><span style=\"color: #0000ff;\"><a style=\"color: #0000ff;\" href=\"https://stopcov.ge/ka/\">https://stopcov.ge/ka/</a></span></p>', '27', '', 'https://newsebi.ge/media/news/Screenshot%20(6).png', '', '', 0, 'covid-virusit-inficirebulta-rickhvi-23092020-tarighis-mdgomareobit', 1600854310, '', 143, 'COVID, ვირუსით, ინფიცირებულთა, რიცხვი, 23.09.2020, თარიღის, მდგომარეობით,ეპიდემია,პანდემია,ვირუსი,ბოლო,მონაცემები,ინფორმაცია ', 'COVID ვირუსით ინფიცირებულთა რიცხვი 23.09.2020 თარიღის მდგომარეობით '),
